INSERT INTO `wced_entry` VALUES (17733, "taak", "950", "<entry page=""950"" id=""17733""><form id=""taxak"" lang=""ceb"">táak</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b6(1)]</itype><trans> <tr>step on</tr>, <tr>tread</tr>. </trans>
<eg><i lang=""ceb"">Ngánung gitaákan man nímu ang ákung sabud?</i><trans> Why did you step on my seedbed? </trans></eg>
