<eg><i lang=""ceb"">Nakatáak (nakataak) na kug Amirika,</i><trans> Now, I have set foot in America. </trans></eg>
<eg><i lang=""ceb"">Taákun ku bisag impirnu pagpangítà nímu,</i><trans> I’ll go to hell and back in my search for you.
