INSERT INTO `wced_entry` VALUES (17734, "taal", "950", "<entry page=""950"" id=""17734""><form id=""taal"" lang=""ceb"">taal</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>genuine</tr>, <tr>pure</tr>. </trans>
<eg><i lang=""ceb"">Sáyaw nga taal Pilipínu,</i><trans> Native Filipino dance. </trans></eg>
<eg><i lang=""ceb"">Taal nà siyang Árab,</i><trans> He is a full-blooded Arab. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>mellow</tr> and <tr>well-aged</tr>. </trans>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> said of root crops that have been left to mature in the ground. </trans>
<eg><i lang=""ceb"">Kamúting taal,</i><trans> Mature sweet potatoes. </trans></eg>
<eg><i lang=""ceb"">b</i><trans> said of wine or vinegar. </trans></eg>
<eg><i lang=""ceb"">Súkà nga taal,</i><trans> Fully-aged vinegar. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B3(1); a2]</itype><trans> become well-aged.
</trans>
</sense></hom></entry>");
