INSERT INTO `wced_entry` VALUES (17735, "taan", "950", "<entry page=""950"" id=""17735""><form id=""taan"" lang=""ceb"">taan</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AN; c]</itype><trans> set a trap of any sort. </trans>
<eg><i lang=""ceb"">Itaan ang búbu, lit-ag,</i><trans> Set the fish trap, the noose. </trans></eg>
</sense></hom>
<entry><form id=""taantaxan"" lang=""ceb"">taantáan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> method of fishing with a hook and line in shallow waters where the fisherman looks in the water with a <ix>silip</ix> or goggles at the same time as he holds his line and maneuvers his boat. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> fish in this way.
</trans>
</sense></hom></entry></entry>");
