INSERT INTO `wced_entry` VALUES (17737, "taas", "950", "<entry page=""950"" id=""17737""><form id=""taas"" lang=""ceb"">taas</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>long</tr>, <tr>tall</tr>, <tr>high</tr>. </trans>
<eg><i lang=""ceb""><abbr expan=""taas"" type=""lemma"">—</abbr> ug ilung</i><trans> not see s.t. right in front of one’s nose. </trans></eg>
<eg><i lang=""ceb"">Taas kag ilung kay wà ka kakità sa lápis sa ímung atubángan,</i><trans> You’re blind because you didn’t see the pencil right in front of your nose. </trans></eg>
</sense></hom>
<entry><form id=""taas_ug_tinuntu"" lang=""ceb""><abbr expan=""taas"" type=""lemma"">—</abbr> ug tinuntu</form>
<hom>
<sense n=""0""><trans> <tr>extremely naughty</tr>. </trans>
</sense></hom></entry>
<entry><form id=""taas_ug_lupad"" lang=""ceb""><abbr expan=""taas"" type=""lemma"">—</abbr> ug lupad</form>
<hom>
<sense n=""0""><trans> <ix>see</ix> <xr lang=""ceb"" target=""#lupad""><sc>lupad</sc></xr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B3(1); b6]</itype><trans> grow, appear long, tall. </trans>
<eg><i lang=""ceb"">Mutaas ka kun maghayhil,</i><trans> You’ll appear tall if you wear heels. </trans></eg>
<eg><i lang=""ceb"">Wà makataas ang káhuy kay giawngan,</i><trans> The tree didn’t grow tall because it was stifled by other trees. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b]</itype><trans> add more length, height. </trans>
<eg><i lang=""ceb"">Tas-i ang lamísa,</i><trans> Make the table higher (longer). </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[a]</itype><trans> do s.t. in a long way. </trans>
<eg><i lang=""ceb"">Ayaw tas-a ímung ampù,</i><trans> Don’t make your prayers long. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[B23(1)4; b6]</itype><trans> rise in temperature, pressure, and other quantities. </trans>
<eg><i lang=""ceb"">Nagkataas ang íyang hilánat,</i><trans> His fever is getting higher and higher. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> fifth bottle (slang). </trans>
</sense></hom></entry>
<entry><form id=""taxas"" lang=""ceb""><abbr expan=""táas"" type=""lemma"">(←)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B3(1); a1]</itype><trans> be <tr>stretched</tr> long, <tr>tall</tr>. </trans>
<eg><i lang=""ceb"">Mitáas íyang líug ug pinangítà nákù,</i><trans> She <tr>craned</tr> her neck looking for me. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#i-""><sc>i-</sc></xr>. </trans>
</sense></hom></entry>
<entry><form id=""pataas"" lang=""ceb""><abbr expan=""pataas"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c]</itype><trans> <tr>raise</tr>. </trans>
<eg><i lang=""ceb"">Magpataas sa kamut ang dúnay pangutána,</i><trans> Anyone who has a question should raise his hand. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b(1)]</itype><trans> <tr>lengthen</tr>, increase the length. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>upward</tr>. </trans>
<eg><i lang=""ceb"">Isíbug ang kwadru pataas,</i><trans> Move the picture upwards. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>length-</tr>*wise, </trans>
</sense></hom></entry>
<entry><form id=""tagas"" lang=""ceb""><abbr expan=""tagas"" type=""lemma"">-g-</abbr></form>
<hom>
<sense n=""0""><trans> <tr>high</tr>, <tr>tall</tr>, <tr>long</tr> (plural). </trans>
</sense></hom></entry>
<entry><form id=""gitas-un"" lang=""ceb"">gitas-un</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>height</tr>, <tr>length</tr>. </trans>
</sense></hom></entry>
<entry><form id=""hataas"" lang=""ceb""><abbr expan=""hataas"" type=""lemma"">ha-</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> very <tr>long</tr>, <tr>high</tr>. </trans>
<eg><i lang=""ceb"">Hataas nga panahun,</i><trans> A very long time. </trans></eg>
</sense></hom></entry>
<entry><form id=""itaas_itaxas"" lang=""ceb""><abbr expan=""itaas"" type=""lemma"">i-</abbr>, <abbr expan=""itáas"" type=""lemma"">i-(←)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>upstairs</tr>. </trans>
</sense></hom></entry>
<entry><form id=""katas-an"" lang=""ceb"">katas-an</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>uplands</tr>. </trans>
</sense></hom></entry>
<entry><form id=""kahitas-an"" lang=""ceb"">kahitas-an</form>
<hom>
<sense n=""1""><number>1</number><trans> <tr>sky</tr>, <tr>heavens</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>God</tr>. </trans>
<eg><i lang=""ceb"">Ihangad sa kahitas-an ang ímung suliran,</i><trans> Look to God for the solution to your problems. </trans></eg>
</sense></hom></entry>
<entry><form id=""mapahitas-un_mahatas-un_mahitas-un"" lang=""ceb"">mapahitas-un, mahatas-un, mahitas-un</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>haughty</tr>. </trans>
<eg><i lang=""ceb"">Mapahitas-un ang mga dátù,</i><trans> The rich people are haughty. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B16]</itype><trans> become haughty. </trans>
</sense></hom></entry>
<entry><form id=""kamapahitas-un_kahatas-un"" lang=""ceb"">kamapahitas-un, kahatas-un</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>haughtiness</tr>.
</trans>
</sense></hom></entry></entry>");
