<sense n=""0""> <itype>[A; c]</itype><trans> cover s.t. or s.o. by heaping or dumping s.t. onto it. </trans>
<eg><i lang=""ceb"">Daghan kaáyung trabáhu ang gitab-ak ni bus sa sikritarya,</i><trans> The boss <tr>heaped</tr> a pile of work on the secretary.
