INSERT INTO `wced_entry` VALUES (17750, "tabal-ak", "951", "<entry page=""951"" id=""17750""><form id=""tabal-ak"" lang=""ceb"">tabal-ak</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> a k.o. large woven <tr>sack</tr>, usually made of buri leaves, commonly used for holding brown sugar or salt. </trans>
<eg><i lang=""ceb"">Usa ka tabal-ak kámay,</i><trans> A buri bag full of brown sugar. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> for a woman to be fat and shapeless like a <ix>tabal-ak</ix>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a2]</itype><trans> make this k.o. container. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[c1]</itype><trans> do by the <ix>tabal-ak</ix>. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[B1256]</itype><trans> get to look like a <ix>tabal-ak</ix>. </trans>
<eg><i lang=""ceb"">Lawásan pa nà run, apan manghinapū̂ ka túig karun matabal-ak na pud nà,</i><trans> She may have a good body, but give her ten years and she will look like a sack. </trans></eg>
</sense></hom>
<entry><form id=""tinabal-ak"" lang=""ceb""><abbr expan=""tinabal-ak"" type=""lemma"">-in-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> put in the <ix>tabal-ak</ix>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#tabal-ak""><sc>tabal-ak</sc></xr>, <i lang=""ceb"">v2.</i>
</trans>
</sense></hom></entry></entry>");
