INSERT INTO `wced_entry` VALUES (17751, "taban", "951", "<entry page=""951"" id=""17751""><form id=""taxban"" lang=""ceb"">tában</form>
<hom>
<sense n=""0""><trans> (from <ix>talában</ix>) </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AC; a12]</itype><trans> <tr>elope</tr>. </trans>
<eg><i lang=""ceb"">Nagtában ang duha ug wà na lang pakasal,</i><trans> The two eloped and did not get married formally. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> = <xr lang=""ceb"" target=""#talaxban""><sc>talában</sc></xr>. </trans>
</sense></hom>
<entry><form id=""pataxban"" lang=""ceb""><abbr expan=""patában"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> give, put s.t. miscellaneous along with the thing of primary interest. </trans>
<eg><i lang=""ceb"">Magpatában siyag kwarta matag sulat níya,</i><trans> He <tr>encloses</tr> money each time he writes. </trans></eg>
<eg><i lang=""ceb"">Gipatabánan ug midiyas ang gipalit kung sapátus,</i><trans> A pair of socks went together with the shoes I bought. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> do s.t. additional, do s.t. but not without making unwanted remarks. </trans>
<eg><i lang=""ceb"">Muhátag lagi, apan patabánan ug sirmun,</i><trans> Sure, she’ll give you some but not without reading you a lecture. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. <tr>enclosed</tr> or put along with.
</trans>
</sense></hom></entry></entry>");
