INSERT INTO `wced_entry` VALUES (17758, "tabas", "951", "<entry page=""951"" id=""17758""><form id=""taxbas"" lang=""ceb"">tábas</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a1]</itype><trans> cut lengthwise or through s.t. flat. </trans>
<eg><i lang=""ceb"">Gitábas ang trúsu nga himúung tabla,</i><trans> The log was cut into boards. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> go over a surface as if cutting it. </trans>
<eg><i lang=""ceb"">Ang gamayng sakayan nitábas sa mabalud nga lawud,</i><trans> The small boat plowed through the stormy seas. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A]</itype><trans> make a dress. </trans>
</sense></hom>
<entry><form id=""taxbas_sa_nawung"" lang=""ceb""><abbr expan=""tábas"" type=""lemma"">—</abbr> sa nawung</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> shape of the face. </trans>
