INSERT INTO `wced_entry` VALUES (17763, "tabi", "952", "<entry page=""952"" id=""17763""><form id=""tabiq"" lang=""ceb"">tabì</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AN; c6]</itype><trans> <tr>gossip</tr>, spread secrets. </trans>
