INSERT INTO `wced_entry` VALUES (17764, "tabi2", "952", "<entry page=""952"" id=""17764""><form id=""taxbiq2"" lang=""ceb"">tábì<sub>2</sub></form>
<hom>
<sense n=""1""><number>1</number><trans> <ix>particle of courtesy used to ask permission to leave for a second, ask a question, pass in front of s.o.:</ix> <tr>excuse me</tr>. </trans>
<eg><i lang=""ceb"">Tábì, kinsay ímung ngálan?</i><trans> Excuse me, what’s your name? </trans></eg>
<eg><i lang=""ceb"">Tábì úsà, byáan tikawg kadiyut,</i><trans> Excuse me, I have to leave you a second. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> particle telling s.o. to get out of the way rather brusquely. </trans>
<eg><i lang=""ceb"">Tábì diha u sikáran tika,</i><trans> Get out of the way or I’ll kick you. </trans></eg>
</sense></hom>
<entry><form id=""taxbiq_iskixna"" lang=""ceb""><abbr expan=""tábì"" type=""lemma"">—</abbr> iskína</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> name of news column and radio program that exposes anomalies. </trans>
</sense>
<sense n=""2""><number>2</number><trans> child that has a young sibling (and <corr sic=""this"">thus</corr> is shunted off to the corner). </trans>
</sense>
<sense n=""3""><number>3</number><trans> woman beyond her prime (and not yet married). </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B1256; a12]</itype><trans> be aired in this program or column. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[B35]</itype><trans> wind up a spinster. </trans>
</sense></hom></entry>
<entry><form id=""panaxbiq"" lang=""ceb""><abbr expan=""panábì"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; b6]</itype><trans> say excuse me.
</trans>
</sense></hom></entry></entry>");
