INSERT INTO `wced_entry` VALUES (17784, "tabla1", "952", "<entry page=""952"" id=""17784""><form id=""tabla"" lang=""ceb"">tabla<sub>1</sub></form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>draw</tr>, <tr>tie</tr>. </trans>
<eg><i lang=""ceb"">Tabla ang risulta sa iliksiyun,</i><trans> The election ended in a draw. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> having experienced an equal amount of s.t., usually unpleasant. </trans>
<eg><i lang=""ceb"">Tabla ta. Púlus hilatusan,</i><trans> <pb n=""953""/>We both came out the same. We both got a whipping. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> just like, just as if. </trans>
<eg><i lang=""ceb"">Ang ímung pagluib nákù tabla ra sa ímu akung gipatay,</i><trans> When you betrayed me it was just as though you had killed me. </trans></eg>
<eg><i lang=""ceb"">Tabla ka ug búang ánang ímung taas nga buhuk,</i><trans> You are like a madman with your long hair. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A13; a12]</itype><trans> declare a game a draw, end in a draw. </trans>
<eg><i lang=""ceb"">Tabláhun ta na lang ni kay ngitngit na,</i><trans> Let’s call the game a draw because it’s getting dark. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A12]</itype><trans> play s.o. to a draw. </trans>
<eg><i lang=""ceb"">Maáyu nag makatabla kag kampiyun,</i><trans> It would be good enough if you could play a champion to a draw. </trans></eg>
</sense></hom>
<entry><form id=""panabla"" lang=""ceb""><abbr expan=""panabla"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; c6]</itype><trans> give one’s life to get revenge. </trans>
<eg><i lang=""ceb"">Kay nadisgrasya na ku manabla na lang ku níya,</i><trans> Because he has violated me, I’ll give my life to kill him.
</trans></eg>
</sense></hom></entry></entry>");
