INSERT INTO `wced_entry` VALUES (17785, "tabla2", "953", "<entry page=""953"" id=""17785""><form id=""tabla2"" lang=""ceb"">tabla<sub>2</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>board</tr>, a piece of sawed lumber, made of lumber. </trans>
<eg><i lang=""ceb"">Muskitírung tabla,</i><trans> <tr>coffin</tr> (lit. mosquito net of wood). </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> pieces of cloth cut ready for sewing. </trans>
<eg><i lang=""ceb"">Upat ka tabla ang karsúnis,</i><trans> Trousers are sewn from four pieces of cloth cut according to the measurements. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a12]</itype><trans> saw into boards. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[a12]</itype><trans> cut cloth for sewing. </trans>
</sense></hom>
<entry><form id=""tinabla"" lang=""ceb""><abbr expan=""tinabla"" type=""lemma"">-in-</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> gore, a style of skirt. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c1]</itype><trans> wear, make into a gore style skirt.
