INSERT INTO `wced_entry` VALUES (17791, "tablug", "953", "<entry page=""953"" id=""17791""><form id=""tablug"" lang=""ceb"">tablug</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AB; c]</itype><trans> <tr>swing</tr>, make a swinging motion. </trans>
<eg><i lang=""ceb"">Mutablug ang kawáyan kun hangínun,</i><trans> The bamboo poles swing to and fro when the wind blows them. </trans></eg>
<eg><i lang=""ceb"">Siyay nagtablug sa dúyan nákù sa gamay pa ku,</i><trans> She rocked my cradle when I was young. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c]</itype><trans> throw s.t. out with a swinging motion. </trans>
<eg><i lang=""ceb"">Gitablug níla sa barku ang mga patay,</i><trans> They threw the dead men overboard. </trans></eg>
<eg><i lang=""ceb"">Tablúgan ta unyà ka ug inínit,</i><trans> I’ll throw hot water on you, if you don’t watch out. </trans></eg>
</sense></hom>
<entry><form id=""tablung"" lang=""ceb""><abbr expan=""tablung"" type=""lemma"">(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> rope or cloth that holds up a hammock. </trans>
</sense></hom></entry>
<entry><form id=""tablugtablug"" lang=""ceb"">tablugtablug</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A]</itype><trans> <tr>dangle</tr> as a result of almost being cut off. </trans>
<eg><i lang=""ceb"">Nagtablugtablug ang íyang tudlù nga hápit maputul,</i><trans> His finger that was almost cut is dangling.
</trans></eg>
</sense></hom></entry></entry>");
