INSERT INTO `wced_entry` VALUES (17794, "tabu", "953", "<entry page=""953"" id=""17794""><form id=""taxbuq"" lang=""ceb"">tábù</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; ac]</itype><trans> <tr>meet</tr> s.o. </trans>
<eg><i lang=""ceb"">Tabúun nátù siya sa piyir,</i><trans> We’ll meet him at the pier. </trans></eg>
<eg><i lang=""ceb"">Pirmi lang kasábà ímung itábù inig-abut nákù,</i><trans> You always meet me with nagging when I come home. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[C; c3]</itype><trans> meet each other on the way. </trans>
<eg><i lang=""ceb"">Ambut ása siya. Gikatábù man tu nákù,</i><trans> I don’t know where he’s going. We met on the way. </trans></eg>
</sense>
<sense n=""1b""><number>1b</number> <itype>[AC; a2]</itype><trans> assemble, meet, cause people to do so. </trans>
<eg><i lang=""ceb"">Ang mayur mauy mitábù sa mga draybir,</i><trans> The mayor assembled the drivers. </trans></eg>
<eg><i lang=""ceb"">Magtábù ta sa simbahan,</i><trans> We will assemble in church. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[C3; c1]</itype><trans> for two ends to meet, make them meet. </trans>
<eg><i lang=""ceb"">Tabúa (itábù) ang masig ka tumuy arun glúhan,</i><trans> Make both ends meet so they can be glued. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A13]</itype><trans> converge at a place for market. </trans>
<eg><i lang=""ceb"">Magtábù dinhi malúnis,</i><trans> They hold market here on Mondays. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> periodical converging to hold market. </trans>
</sense></hom>
<entry><form id=""panaxbuq"" lang=""ceb""><abbr expan=""panábù"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; b6]</itype><trans> <tr>go shopping</tr>, esp. at a periodical market. </trans>
<eg><i lang=""ceb"">Manábù ku sa Mantalúngun,</i><trans> I’ll attend the market day in Mantalongon. </trans></eg>
</sense></hom></entry>
<entry><form id=""hitabuq"" lang=""ceb""><abbr expan=""hitabù"" type=""lemma"">hi-(→)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B1256]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>happen</tr>, <tr>take place</tr>. </trans>
<eg><i lang=""ceb"">Nahitabù nga nagkasákay mi,</i><trans> It so happened that we rode on the same vehicle. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> for s.t. bad to happen. </trans>
<eg><i lang=""ceb"">Ug magpadáyun kag paíbug nákù mahitabù ra man ta,</i><trans> If you keep on flirting with me s.t. will happen between us. </trans></eg>
<eg><i lang=""ceb"">Dúna tingaliy nahitabù sa báy kay gikulbaan man ku,</i><trans> S.t. bad must have happened at home because I feel uneasy. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>incident</tr>, <tr>happening</tr>. </trans>
<eg><i lang=""ceb"">Gisaysay níya ang hitabù,</i><trans> He told about the incident. </trans></eg>
</sense></hom></entry>
<entry><form id=""hatabuq_hinabuq_hanabuq"" lang=""ceb""><abbr expan=""hatabù"" type=""lemma"">ha-</abbr>/<abbr expan=""hinabù"" type=""lemma"">hiN-</abbr>/<abbr expan=""hanabù"" type=""lemma"">haN-(→)</abbr></form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#hitabuq""><sc>hitabù</sc></xr> (but not as frequent). </trans>
</sense></hom></entry>
<entry><form id=""hinaxbuq"" lang=""ceb""><abbr expan=""hinábù"" type=""lemma"">hiN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[C3; c3]</itype><trans> <tr>meet</tr> s.o. by chance. </trans>
<eg><i lang=""ceb"">Na, kay naglikay ku, nagkahinábù na hinúun mi,</i><trans> I was trying to avoid him, but instead we ran into each other. </trans></eg>
</sense></hom></entry>
<entry><form id=""tabuqtaxbuq"" lang=""ceb"">tabùtábù</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> small <tr>market</tr>. </trans>
</sense></hom></entry>
<entry><form id=""tabuan"" lang=""ceb"">tabuan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> place where periodic markets are held. </trans>
</sense></hom></entry>
<entry><form id=""tinabuxan"" lang=""ceb""><abbr expan=""tinabúan"" type=""lemma"">-in-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>gift</tr> given by s.o. who arrives from a trip.
</trans>
</sense></hom></entry></entry>");
