INSERT INTO `wced_entry` VALUES (17796, "tabudyus", "953", "<entry page=""953"" id=""17796""><form id=""tabudyus"" lang=""ceb"">tabudyus</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>cylindrical</tr>. </trans>
<eg><i lang=""ceb"">Tabudyus ang panghaw sa barku,</i><trans> The ship’s chimney is cylindrical. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> the fry of the <ix>gisaw</ix>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> sweet made of starch from the trunk of buri palm mixed with grated coconut meat, sugar, and <pb n=""954""/>water, wrapped in banana leaves and rolled to cylinders the size of a child’s arm, about <measure reg=""18 cm"">7″</measure> long, and roasted. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c1]</itype><trans> roll into a cylinder, tube. </trans>
<eg><i lang=""ceb"">Nagtabudyus siyag sín nga himúung túbu sa túbig,</i><trans> He rolled a galvanized sheet into a cylinder to make a water pipe. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> prepare <ix>tabudyus</ix>.
</trans>
</sense></hom></entry>");
