INSERT INTO `wced_entry` VALUES (17799, "tabug2", "954", "<entry page=""954"" id=""17799""><form id=""taxbug2"" lang=""ceb"">tábug<sub>2</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AP; b6]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> do s.t. in excess, way beyond reasonable bounds. </trans>
<eg><i lang=""ceb"">Nagtábug (nagpatábug) ka man lag prisyu sa ímung baligyà!</i><trans> You are pricing your merchandise ridiculously high! </trans></eg>
<eg><i lang=""ceb"">Nakapatábug kug sulti tungud sa ákung kalágut,</i><trans> I said a lot of things I should not have because of my anger. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> do s.t. without forethought. </trans>
<eg><i lang=""ceb"">Nagpatábug lag tíru, lagmit makaigù,</i><trans> The way he is just shooting so carelessly, he might just hit s.o. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> do s.t. hurriedly and carelessly. </trans>
<eg><i lang=""ceb"">Dì ku makapatábug ug lútù sa sud-an,</i><trans> I can’t cook the food hurriedly and poorly.
</trans></eg>
</sense></hom></entry>");
