INSERT INTO `wced_entry` VALUES (17804, "tabuk", "954", "<entry page=""954"" id=""17804""><form id=""tabuk"" lang=""ceb"">tabuk</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; ac]</itype><trans> <tr>cross over</tr>, bring s.t. across to the opposite side. </trans>
<eg><i lang=""ceb"">Mutabuk na ta sa karsáda,</i><trans> Let’s cross the street. </trans></eg>
<eg><i lang=""ceb"">Kuyaw tabukun ning subáa kay sulug,</i><trans> This river is dangerous to cross because the current is strong. </trans></eg>
<eg><i lang=""ceb"">Itabuk ning asin sa píkas pū̂,</i><trans> Bring the salt across to the other island. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A2; a]</itype><trans> emigrate to another island. </trans>
<eg><i lang=""ceb"">Mitabuk siya sa Mindanaw pamásin nga muasinsu,</i><trans> He migrated to Mindanao in the hope that he would be successful there. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2; b6]</itype><trans> move from one group or affiliation to a rival one. </trans>
<eg><i lang=""ceb"">Ang Libiral nga diputádu mitabuk ngadtu sa Nasyunalista,</i><trans> The Liberal congressman crossed over to the Nacionalista Party. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> area on the other side, across the street. </trans>
<eg><i lang=""ceb"">Túa siya manarabáhu sa tabuk,</i><trans> He works on the other island (other bank). </trans></eg>
</sense></hom>
<entry><form id=""tabukanan"" lang=""ceb""><abbr expan=""tabukanan"" type=""lemma"">-anan(←)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>ferryboat</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> small, make-shift bridge. </trans>
</sense></hom></entry>
<entry><form id=""tabukaxnun"" lang=""ceb""><abbr expan=""tabukánun"" type=""lemma"">-anun(←)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> people from across the street, the other island. </trans>
</sense></hom></entry>
<entry><form id=""talabukun"" lang=""ceb""><abbr expan=""talabukun"" type=""lemma"">-l-un</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> to be reached by crossing a body of water.
</trans>
</sense></hom></entry></entry>");
