INSERT INTO `wced_entry` VALUES (17807, "tabun1", "954", "<entry page=""954"" id=""17807""><form id=""taxbun"" lang=""ceb"">tábun<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>cover</tr> s.t. to protect or conceal it. </trans>
<eg><i lang=""ceb"">Tabúni ang kan-un arun dílì langawun,</i><trans> Cover the food so it won’t get flies on it. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>cover up</tr> for s.o.’s mistakes. </trans>
<eg><i lang=""ceb"">Nagdasà siya kay mutábun ang ginikánan sa íyang binúang,</i><trans> He is abusive because his parents cover up for his foolishness. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>drown out</tr> a sound. </trans>
<eg><i lang=""ceb"">Hápit tabúni ang íyang tíngug sa makusug nga áwit,</i><trans> Her voice was almost drowned out by the loud song. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos></hom>
<entry><form id=""taxbun_sa_laxyag"" lang=""ceb""><abbr expan=""tábun"" type=""lemma"">—</abbr> sa láyag</form>
<hom>
<sense n=""0""><trans> <tr>Passion Sunday</tr>, the second Sunday before Easter when it was the custom to cover the tabernacle and statue with a piece of purple cloth. </trans>
</sense></hom></entry>
