<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>cover</tr>. </trans>
<eg><i lang=""ceb"">Hápit walay tabun ang íyang dughan,</i><trans> Her breast was almost uncovered. </trans></eg>
</sense></hom></entry>
<entry><form id=""tabuntaxbun"" lang=""ceb"">tabuntábun</form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#taxbun""><sc>tábun</sc></xr>, <i lang=""ceb"">v2.</i> </trans>
</sense></hom></entry>
