INSERT INTO `wced_entry` VALUES (17837, "tag-1", "955", "<entry page=""955"" id=""17837""><form id=""tag-"" lang=""ceb"">tag-<sub>1</sub></form>
<hom>
<sense n=""0""><trans> affix forming nouns which refer to the agent of a particular action or to the particular person concerned. </trans>
<eg><i lang=""ceb"">Si Risal ang tagsúlat (tagsulat) sa Núli Mi Tanghiri,</i><trans> Rizal was the author of Noli Me Tangere. </trans></eg>
<eg><i lang=""ceb"">Ang tagsalà,</i><trans> The one who committed the sin. </trans></eg>
<eg><i lang=""ceb"">Tagbalay (tagbálay),</i><trans> Owner of the house.
</trans></eg>
</sense></hom></entry>");
