INSERT INTO `wced_entry` VALUES (17838, "tag-2", "955", "<entry page=""955"" id=""17838""><form id=""tag-2"" lang=""ceb"">tag-<sub>2</sub></form>
<hom>
<sense n=""1""><number>1</number><trans> prefix added to numbers and numerals to form numerals which mean [so-and-so] many apiece. </trans>
<eg><i lang=""ceb"">Tag singku ang pan disal,</i><trans> Rolls cost five cents each. </trans></eg>
<eg><i lang=""ceb"">Tagsa ka sáku, tagurha ka sáku ang palitun káda palit níya,</i><trans> He buys a sack, two sacks at a time. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <ix>added to other parts of speech:</ix> [such-and-such] <tr>each time</tr>. </trans>
<eg><i lang=""ceb"">Tagdugay siyang mupaúlì,</i><trans> He comes home late each time. </trans></eg>
<eg><i lang=""ceb"">Taglagyù siyag byáhi,</i><trans> He travels long distances each time.
</trans></eg>
</sense></hom></entry>");
