<eg><i lang=""ceb"">Tagakustum,</i><trans> People in the <tr>Customs</tr>. </trans></eg>
<eg><i lang=""ceb"">Tagakíim,</i><trans> One of the members of the <asc>K.M.</asc>’s (<ix>Kabatáang Makabáyan</ix>, Patriotic Youth).
