INSERT INTO `wced_entry` VALUES (17846, "tagad", "956", "<entry page=""956"" id=""17846""><form id=""tagad"" lang=""ceb"">tagad</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a1]</itype><trans> <tr>give attention to</tr>, <tr>mind</tr>. </trans>
<eg><i lang=""ceb"">Wà na siya magtagad sa íyang pangláwas,</i><trans> She stopped paying attention to her health. </trans></eg>
<eg><i lang=""ceb"">Wà ku makatagad nímu dáyun,</i><trans> I wasn’t able to <tr>attend to</tr> you at once. </trans></eg>
<eg><i lang=""ceb"">Walà ni Li tagda ang ákung pakilúuy,</i><trans> Lee did not heed my pleading. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A; c]</itype><trans> <tr>pay attention to</tr> s.o. showing warmth, concern. </trans>
<eg><i lang=""ceb"">Mutagad lang siya kun unáhan,</i><trans> He is friendly to others only when they speak to him first. </trans></eg>
<eg><i lang=""ceb"">Nagtagad pa giyud kag andam dà,</i><trans> You shouldn’t have bothered fixing anything to eat. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a2]</itype><trans> <tr>wait for</tr>. </trans>
<eg><i lang=""ceb"">Ása ta magtagad ug sakyanan?</i><trans> Where shall we wait for the bus? </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> action of <tr>caring</tr>. </trans>
<eg><i lang=""ceb"">Wà siyay tagad sa íyang pagkáun,</i><trans> He is not particular about his food. </trans></eg>
</sense></hom>
<entry><form id=""taxgad"" lang=""ceb""><abbr expan=""tágad"" type=""lemma"">(←)</abbr></form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#tagad""><sc>tagad</sc></xr>, <i lang=""ceb"">v2.</i> </trans>
</sense></hom></entry>
<entry><form id=""tagdanay_tinagdanay"" lang=""ceb"">tagdanay, tinagdanay</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[C2]</itype><trans> be on friendly terms with each other. </trans>
</sense></hom></entry>
<entry><form id=""tinagad"" lang=""ceb""><abbr expan=""tinagad"" type=""lemma"">-in-</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>looked up to</tr>, <tr>respected</tr>, considered important. </trans>
<eg><i lang=""ceb"">Usa siya sa mga tinagad nga táwu sa lungsud,</i><trans> He is one of the respected people in the town. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13N]</itype><trans> treat s.o. as worthy of attention. </trans>
<eg><i lang=""ceb"">Magtinagad (maninagad) ka man niánang bastus,</i><trans> Why do you mind those rowdy fellows? </trans></eg>
</sense></hom></entry>
<entry><form id=""tagadanan_tagaranan"" lang=""ceb""><abbr expan=""tagadanan"" type=""lemma"">-anan</abbr>, tagaranan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>waiting place</tr>. </trans>
</sense></hom></entry>
<entry><form id=""tinagdan"" lang=""ceb"">tinagdan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> manner of attending to s.t. </trans>
<eg><i lang=""ceb"">Lahì ang íyang tinagdan (pagtagad) kanákù karun sa kaniadtu,</i><trans> She treats me differently from the way she used to. </trans></eg>
</sense></hom></entry>
<entry><form id=""matinagdaxnun"" lang=""ceb"">matinagdánun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>attentive</tr>. </trans>
</sense></hom></entry>
<entry><form id=""pagtagad"" lang=""ceb""><abbr expan=""pagtagad"" type=""lemma"">pag-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>attention</tr>. </trans>
<eg><i lang=""ceb"">Ang íyang líhuk nakadani sa ákung pagtagad,</i><trans> The way she acted caught my attention. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> = <xr lang=""ceb"" target=""#tinagdan""><sc>tinagdan</sc></xr>.
</trans>
</sense></hom></entry></entry>");
