INSERT INTO `wced_entry` VALUES (17847, "tagadtad", "956", "<entry page=""956"" id=""17847""><form id=""tagadtad"" lang=""ceb"">tagadtad</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> for the meat of fleshy fruits and tubers to have hardened parts. </trans>
<eg><i lang=""ceb"">Tagadtad kaáyu ang kamúti nga guwang,</i><trans> Matured sweet potatoes have hardened portions. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B2]</itype><trans> get to have hardened portions. </trans>
<eg><i lang=""ceb"">Sakit ang nakatagadtad (nakapatagadtad) sa ságing,</i><trans> A blight caused the bananas to develop hardened lumps.
</trans></eg>
</sense></hom></entry>");
