INSERT INTO `wced_entry` VALUES (17849, "tagak", "956", "<entry page=""956"" id=""17849""><form id=""taxgak"" lang=""ceb"">tágak</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A1; ac]</itype><trans> cause s.t. to fall straight down. </trans>
<eg><i lang=""ceb"">Matágak ang mga dáhun,</i><trans> The leaves will fall. </trans></eg>
<eg><i lang=""ceb"">Tagákun ku nang langgam sa usa ka tíru,</i><trans> I’ll knock that bird down in one shot. </trans></eg>
<eg><i lang=""ceb"">Namatay siya kay hitagakan sa lubi,</i><trans> He died because a coconut fell on his head. </trans></eg>
<eg><i lang=""ceb"">Itágak nang sapátus kay naglisud ka pagsaka,</i><trans> Kick off your shoes because you’re having trouble climbing. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a12]</itype><trans> <tr>fail</tr> in school. </trans>
<eg><i lang=""ceb"">Tagáka siya kay absiníru,</i><trans> Fail him because he’s always absent. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A2; c1]</itype><trans> for coconuts to yield. </trans>
<eg><i lang=""ceb"">Kanang kalubihána mutágak ug usa ka líbu,</i><trans> That coconut plantation yields one thousand nuts. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[B1267; b8]</itype><trans> suffer a <tr>miscarriage</tr>. </trans>
<eg><i lang=""ceb"">Natagákag makaduha,</i><trans> She has had two miscarriages. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[a3]</itype><trans> for the curtain to fall signifying the end of a presentation (metaphorical). </trans>
<eg><i lang=""ceb"">Ug dinhi natágak ang tabil sa átung sugilánun,</i><trans> And so, here our story ends. </trans></eg>
</sense>
<sense n=""6""><number>6</number> <form id=""taxgak_ang_kwarta"" lang=""ceb""><abbr expan=""tágak"" type=""lemma"">—</abbr> ang kwarta</form><trans> <itype>[a3]</itype> spend money. </trans>
<eg><i lang=""ceb"">Natágak ang kwarta sa way hinungdan,</i><trans> The money was just wasted. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>yield</tr> of coconuts. </trans>
</sense></hom>
<entry><form id=""tagak2"" lang=""ceb""><abbr expan=""tagak"" type=""lemma"">(→)</abbr><sub>2</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> fallen leaves of fruits. </trans>
</sense>
<sense n=""2""><number>2</number><trans> fallen pieces, pieces which fell or spilled out of a container. </trans>
<eg><i lang=""ceb"">Tagak sa kupras, mais,</i><trans> Extra pieces of copra, corn grain. </trans></eg>
</sense></hom></entry>
<entry><form id=""tagaktagak"" lang=""ceb"">tagaktagak</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B6; c16]</itype><trans> drop down in spurts or drips. </trans>
<eg><i lang=""ceb"">Nagtagaktagak ang tái sa bátang nagkalíbang,</i><trans> The child with the diarrhea kept having his BM’s in spurts. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A13; b6]</itype><trans> drop things around, <tr>mess</tr>. </trans>
<eg><i lang=""ceb"">Mauy musilhig sa sawug ang nagtagaktagak ug kan-un,</i><trans> Whoever throws rice all over the floor is going to have to pick it up. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B145; c1]</itype><trans> fail to do s.t. in unison. </trans>
<eg><i lang=""ceb"">Dungána pagrisayit. Ayaw tagaktagaka (itagaktagak),</i><trans> Recite it together in unison, not raggedly. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> not in unison. </trans>
</sense></hom></entry>
<entry><form id=""tinaxgak"" lang=""ceb""><abbr expan=""tinágak"" type=""lemma"">-in-(→)</abbr></form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#tagaktagak""><sc>tagaktagak</sc></xr>, <i lang=""ceb"">3.</i>
</trans>
</sense></hom></entry></entry>");
