INSERT INTO `wced_entry` VALUES (17850, "tagaktak1", "956", "<entry page=""956"" id=""17850""><form id=""tagaktak"" lang=""ceb"">tagaktak<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>clacking</tr> or <tr>banging</tr> sound, but not resounding, e.g. that of slapping s.t. with wood. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; c6]</itype><trans> make such a sound. </trans>
<eg><i lang=""ceb"">Mitagaktak ang sín pagbundak sa ulan,</i><trans> The metal roof made a banging noise when the rain came down hard. </trans></eg>
<eg><i lang=""ceb"">Ayawg itagaktak ang bakyà sa simintu,</i><trans> Don’t bang your wooden slippers on the concrete.
</trans></eg>
</sense></hom></entry>");
