INSERT INTO `wced_entry` VALUES (17852, "tagal", "956", "<entry page=""956"" id=""17852""><form id=""tagal"" lang=""ceb"">tagal</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> stipulated length or <tr>period</tr> of time to do s.t. </trans>
<eg><i lang=""ceb"">Ang tagal sa pagbáyad sa útang tulu ka búlan,</i><trans> The stipulated period for paying the debt is three months. </trans></eg>
<eg><i lang=""ceb"">Ugmà ang íyang tagal nga mubálik,</i><trans> He set tomorrow as the day he’ll be back. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> stipulate a period of time within which or at which s.t. is to be done. </trans>
<eg><i lang=""ceb"">Gitagalan ang masakitun ug lima ka adlaw,</i><trans> The patient was given five days to live. </trans></eg>
<eg><i lang=""ceb"">Daghang burúka ang gikatagal niánang adláwa,</i><trans> Many cases had been set for that day.
</trans></eg>
</sense></hom></entry>");
