INSERT INTO `wced_entry` VALUES (17859, "tag-an", "957", "<entry page=""957"" id=""17859""><form id=""tag-an"" lang=""ceb"">tag-an</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a2b2]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>guess</tr>. </trans>
<eg><i lang=""ceb"">Akuy tag-an sa sulud sa bangà,</i><trans> I’ll guess what’s inside the jar. </trans></eg>
<eg><i lang=""ceb"">Hitag-anan nákung ikaw tung nagmaskara,</i><trans> I guessed right that you were the one wearing a mask. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>foretell</tr>. </trans>
<eg><i lang=""ceb"">Tag-ánun níya ang ímung kapaláran,</i><trans> He will tell your fortune. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>guess</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> fortune told. </trans>
</sense></hom>
<entry><form id=""tag-antag-an"" lang=""ceb"">tag-antag-an</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> any k.o. guessing game. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>guesswork</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[C]</itype><trans> play a guessing game. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a12]</itype><trans> <tr>conjecture</tr>, <tr>guess</tr>. </trans>
<eg><i lang=""ceb"">Wà ku makasigúru sa íyang panuígun. Átù lang tag-antag-ánun,</i><trans> I can’t be sure of her age. Let’s just guess it. </trans></eg>
</sense></hom></entry>
<entry><form id=""hinag-an"" lang=""ceb""><abbr expan=""hinag-an"" type=""lemma"">hiN-</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> good guesser. </trans>
</sense></hom></entry>
<entry><form id=""mananag-an"" lang=""ceb""><abbr expan=""mananag-an"" type=""lemma"">maN-r-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>fortune-teller</tr>.
</trans>
</sense></hom></entry></entry>");
