INSERT INTO `wced_entry` VALUES (17860, "tagana", "957", "<entry page=""957"" id=""17860""><form id=""tagaxna"" lang=""ceb"">tagána</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A1; c]</itype><trans> set s.t. aside for future use, prepare s.t. beforehand for s.t. </trans>
<eg><i lang=""ceb"">Nagtagána kug aslúnun pára sa pista,</i><trans> I reserved a pig to be roasted for the fiesta. </trans></eg>
<eg><i lang=""ceb"">Itagána ku ang kwarta sa inyung pagtuun,</i><trans> I am setting this money aside for your studies. </trans></eg>
<eg><i lang=""ceb"">Ulì na kay gitagan-an kag latus ni Tátay,</i><trans> Come home because Father is preparing a whipping for you. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>prepared</tr>. </trans>
<eg><i lang=""ceb"">Andam ug tagána na síya sa iksámin,</i><trans> He is ready and prepared for the examination. </trans></eg>
</sense></hom>
<entry><form id=""tagana"" lang=""ceb""><abbr expan=""tagana"" type=""lemma"">(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. prepared for s.o. esp. for a special occasion. </trans>
<eg><i lang=""ceb"">Dakung bábuy ang ákung tagana sa pista,</i><trans> I prepared a huge pig for the fiesta. </trans></eg>
</sense></hom></entry>
<entry><form id=""panagaxna"" lang=""ceb""><abbr expan=""panagána"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; b3c]</itype><trans> do s.t. as a precaution just in case. </trans>
<eg><i lang=""ceb"">Pagdág pistúla. Maáyu nang managána,</i><trans> Bring a gun. It’s a good precaution. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2S3; b3]</itype><trans> <tr>hesitate</tr> to do s.t., have reservations about doing s.t. </trans>
<eg><i lang=""ceb"">Nagpanagana kung mamisíta níya kay istrikta,</i><trans> I hesitate to visit her because she’s a difficult person. </trans></eg>
</sense></hom></entry>
<entry><form id=""mapanagan-un"" lang=""ceb"">mapanagan-un</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> characterized with cautious hesitation.
</trans>
</sense></hom></entry></entry>");
