INSERT INTO `wced_entry` VALUES (17866, "tagaw", "957", "<entry page=""957"" id=""17866""><form id=""tagaw"" lang=""ceb"">tagaw</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; ac]</itype><trans> <tr>wander</tr>, <tr>roam</tr>. </trans>
<eg><i lang=""ceb"">Nakatagaw na siya sa íyang mga saup,</i><trans> He has already made the rounds of his tenants. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B; c6]</itype><trans> <tr>deviate from</tr>, <tr>go separately</tr>. </trans>
<eg><i lang=""ceb"">Sa pag-ikskursiyun námù mitagaw silang duha,</i><trans> During our excursion the two of them got separated from us. </trans></eg>
<eg><i lang=""ceb"">Mangulitáwu gánì nà siya, itagaw ang sulti,</i><trans> If he begins talking about love, change the subject. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B]</itype><trans> be <tr>boorish</tr>, <tr>ignorant</tr> in one’s ways. </trans>
<eg><i lang=""ceb"">Makatagaw man diay ning subra ra sa paghigpit,</i><trans> I found out that being too strict with a child makes him develop into a shy, socially poor sort. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A; b3c]</itype><trans> <tr>talk</tr>, <tr>speak</tr> out loudly. </trans>
<eg><i lang=""ceb"">Mitagaw siya sa mikrupunu,</i><trans> He spoke loud over the microphone. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> ignorant and boorish. </trans>
<eg><i lang=""ceb"">Giinum sa tagaw nga dakù ang patis, ábi níyag kukakúla,</i><trans> The oaf drank the soy sauce thinking it was coca-cola. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>vagabond</tr>, <tr>wanderer</tr>. </trans>
<eg><i lang=""ceb"">Dì ku mamánag tagaw,</i><trans> I won’t marry a vagabond. </trans></eg>
</sense></hom>
<entry><form id=""taxgaw"" lang=""ceb""><abbr expan=""tágaw"" type=""lemma"">(←)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B; a]</itype><trans> be in confusion. </trans>
<eg><i lang=""ceb"">Mutágaw (matágaw) ang panagsulti ug muintra na siya,</i><trans> If he takes part, the conversation will get utterly confused. </trans></eg>
<eg><i lang=""ceb"">Tagáwun ku ang ílang panimuyù,</i><trans> I’ll cause confusion in their home. </trans></eg>
</sense></hom></entry>
<entry><form id=""latagaw"" lang=""ceb""><abbr expan=""latagaw"" type=""lemma"">la-</abbr></form>
<hom>
<sense n=""0""><trans> <ix>see</ix> <xr lang=""ceb"" target=""#latagaw""><sc>latagaw</sc></xr>.
</trans>
</sense></hom></entry></entry>");
