INSERT INTO `wced_entry` VALUES (17867, "tagawtaw", "957", "<entry page=""957"" id=""17867""><form id=""tagawtaw"" lang=""ceb"">tagawtaw</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A1; c6]</itype><trans> talk nonsense to oneself. </trans>
<eg><i lang=""ceb"">Kabuangun nà siya kay síging magtagawtaw,</i><trans> He is going crazy because he keeps talking nonsense to himself. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A]</itype><trans> <tr>nag</tr> and <tr>scold</tr> in a long rambling way. </trans>
<eg><i lang=""ceb"">Nagtagawtaw ang asáwa kay nahubug siya,</i><trans> His wife kept nagging him because he was drunk. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>nonsense</tr> one speaks. </trans>
</sense>
<sense n=""2""><number>2</number><trans> uninterrupted nagging talk. </trans>
</sense></hom>
<entry><form id=""tagawtawan"" lang=""ceb""><abbr expan=""tagawtawan"" type=""lemma"">-an(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>nagger</tr>.
