INSERT INTO `wced_entry` VALUES (17868, "tagay", "957", "<entry page=""957"" id=""17868""><form id=""taxgay"" lang=""ceb"">tágay</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c]</itype><trans> <tr>pour</tr> alcoholic drinks into a drinking vessel. </trans>
<eg><i lang=""ceb"">Ikay tágay kay ímu ning silibrasiyun,</i><trans> You pour the drinks because it’s your celebration. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[C2; c3]</itype><trans> <tr>drink together</tr>. </trans>
<eg><i lang=""ceb"">Makigtágay aku níya,</i><trans> I will drink together with him. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> indulge in sensual pleasure together. </trans>
<eg><i lang=""ceb"">Nagtágay sila sa kinawatkawat <pb n=""958""/>nga kalípay,</i><trans> They shared stolen moments of joy. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[b6]</itype><trans> be <corr sic=""proferred"">proffered</corr> s.t. </trans>
<eg><i lang=""ceb"">Gitagáyan siyag madaníhun nga pahíyum,</i><trans> He was <corr sic=""proferred"">proffered</corr> a winsome smile. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> drink poured. </trans>
</sense>
<sense n=""2""><number>2</number><trans> drinking party. </trans>
</sense></hom>
<entry><form id=""tagayan"" lang=""ceb""><abbr expan=""tagayan"" type=""lemma"">-an(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> vessel one drinks liquor from.
