INSERT INTO `wced_entry` VALUES (17874, "tagbaw", "958", "<entry page=""958"" id=""17874""><form id=""tagbaw"" lang=""ceb"">tagbaw</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AP1B16; a12]</itype><trans> </trans>
