INSERT INTO `wced_entry` VALUES (17877, "tagbu", "958", "<entry page=""958"" id=""17877""><form id=""tagbuq"" lang=""ceb"">tagbù</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>work bee</tr> on a community project. </trans>
<eg><i lang=""ceb"">Tagbù sa pagpúu sa ilagà,</i><trans> A work bee to exterminate mice. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> = <xr lang=""ceb"" target=""#suxgat""><sc>súgat</sc></xr>, <i lang=""ceb"">n</i>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b6]</itype><trans> hold a work bee. </trans>
</sense>
<sense n=""2""><number>2</number><trans> = <xr lang=""ceb"" target=""#taxbuq""><sc>tábù</sc></xr>, <i lang=""ceb"">v1, 2.</i> </trans>
</sense></hom>
<entry><form id=""hinagbuq"" lang=""ceb""><abbr expan=""hinagbù"" type=""lemma"">hiN-</abbr></form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#hinabuq""><sc>hinabù</sc></xr>. <ix>see</ix> <xr lang=""ceb"" target=""#taxbuq""><sc>tábù</sc></xr>. </trans>
</sense></hom></entry>
<entry><form id=""tagbuqtagbuq"" lang=""ceb"">tagbùtagbù</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A12C2; c1]</itype><trans> <tr>meet</tr> in a clandestine manner. </trans>
<eg><i lang=""ceb"">Dì na sila makatagbùtagbù kay nasakpan na ang ílang rilasiyun sa bána,</i><trans> They can no longer continue with their trysting because the woman’s husband found out about it. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[C3]</itype><trans> keep passing by one another. </trans>
<eg><i lang=""ceb"">Magtagbùtagbù lang ang nagkalainláing mga sakyanan sa kadalánan,</i><trans> All different vehicles keep passing each other on the streets. </trans></eg>
</sense></hom></entry>
<entry><form id=""tagbuanan"" lang=""ceb""><abbr expan=""tagbuanan"" type=""lemma"">-anan</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> trysting place. </trans>
</sense></hom></entry>
<entry><form id=""tinagbuan"" lang=""ceb""><abbr expan=""tinagbuan"" type=""lemma"">-in-an</abbr></form>
<hom>
<sense n=""0""><trans> s.t. s.o. brings when arriving from a trip.
</trans>
</sense></hom></entry></entry>");
