INSERT INTO `wced_entry` VALUES (17878, "tagduk", "958", "<entry page=""958"" id=""17878""><form id=""tagduk"" lang=""ceb"">tagduk</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A46; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> for s.t. pointed to pierce and stick into s.t. </trans>
<eg><i lang=""ceb"">Gitagduk níya sa punúan sa káhuy ang bára,</i><trans> He stuck the iron bar into the trunk of the tree. </trans></eg>
<eg><i lang=""ceb"">Tagdúki ang yútà ug kahiktan sa báka,</i><trans> Plant a stake into the ground to tie the cow to. </trans></eg>
</sense>
