<eg><i lang=""ceb"">Siyay mitagduk sa pabúrut,</i><trans> He punctured the balloon. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>puncture</tr>, prick. </trans>
<eg><i lang=""ceb"">Pilía ang síng walay mga tagduk,</i><trans> Choose iron sheets that have no punctures.
</trans></eg>
</sense></hom></entry>");
