INSERT INTO `wced_entry` VALUES (17886, "tagik", "958", "<entry page=""958"" id=""17886""><form id=""taxgik"" lang=""ceb"">tágik</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; ac1]</itype><trans> tie things together carefully in construction. </trans>
<eg><i lang=""ceb"">Nagtágik siya sa mga nípà didtu sa katsaw,</i><trans> He was tying the nipa strips to the rafters. </trans></eg>
<eg><i lang=""ceb"">Gitágik níya ang duha ka bulus kawáyan,</i><trans> He tied two bamboo poles together. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> create s.t. literary or musical.</trans>
<eg><i lang=""ceb""> Maáyu siyang mutágik ug sugilánun nga kulbà hínam,</i><trans> He is good in composing suspenseful stories. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[a12]</itype><trans> organize or arrange words or ideas. </trans>
<eg><i lang=""ceb"">Tagíka (itágik) únà pag-áyu ang ímung mga púlung nga igsusulti,</i><trans> Compose what you are going to say carefully. </trans></eg>
</sense></hom>
<entry><form id=""tagik"" lang=""ceb""><abbr expan=""tagik"" type=""lemma"">(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. used to tie things together. </trans>
</sense></hom></entry>
<entry><form id=""tinaxbik"" lang=""ceb""><abbr expan=""tinábik"" type=""lemma"">-in-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. constructed by tying. </trans>
</sense></hom></entry>
<entry><form id=""magtatagik"" lang=""ceb""><abbr expan=""magtatagik"" type=""lemma"">mag-r-(→)</abbr></form>
