INSERT INTO `wced_entry` VALUES (17897, "tagimtim1", "959", "<entry page=""959"" id=""17897""><form id=""tagimtim"" lang=""ceb"">tagimtim<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> discoloration of teeth or surface roughness on metals, concrete, stone, due to exposure to the elements. </trans>
</sense>
<sense n=""2""><number>2</number><trans> very tiny seashells found attached to stones or the bottoms of logs that have lain in the sand for a long time. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[b4]</itype><trans> be discolored and dirtied by the elements. </trans>
<eg><i lang=""ceb"">Munyumintu nga gitagimtiman na,</i><trans> A monument that has been discolored by the elements. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[a4b4]</itype><trans> stay long s.w. (as if long enough to develop <ix>tagimtim</ix>). </trans>
<eg><i lang=""ceb"">Gitagimtim (gitagimtiman) na lang ang lubut ug paninda, apan wà giyud muirug,</i><trans> He has been in business for a long time, but he has never prospered.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (17897, "tagimtim", "tagimtim", "s", "nv");
