INSERT INTO `wced_entry` VALUES (17915, "tagpas", "959", "<entry page=""959"" id=""17915""><form id=""tagpas"" lang=""ceb"">tagpas</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; a2]</itype><trans> <tr>permeate</tr>, penetrate through material. </trans>
<eg><i lang=""ceb"">Mitagpas ang ulan sa tulda,</i><trans> The rain permeated through the tent. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[b1]</itype><trans> be splotched with menstrual blood from menstruation. </trans>
<eg><i lang=""ceb"">Wà mutindug ang babáyi kay gitagpasan diay,</i><trans> The woman didn’t want to get up because her menstrual blood had seeped through her skirt.
</trans></eg>
</sense></hom></entry>");
