<sense n=""1""><number>1</number> <itype>[A1; c1P]</itype><trans> slice s.t. thinly. </trans>
<eg><i lang=""ceb"">Tagpísun (itagpis) nákug hiwà ang kasahusun nga karni,</i><trans> I’ll slice the meat thin to make it into jerked meat. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B12; b6]</itype><trans> be skinny <pb n=""960""/>and slim. </trans>
