INSERT INTO `wced_entry` VALUES (17918, "tagpud", "960", "<entry page=""960"" id=""17918""><form id=""tagpud"" lang=""ceb"">tagpud</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> crisp, brittle and easily breaking into small pieces like glass or like dry and mealy sweet potatoes. </trans>
<eg><i lang=""ceb"">Ang tagpud nga kamúti kun lútù, uga ug unud nga húmuk mapulpug,</i><trans> A powdery sweet potato is dry when it is cooked and has meat that crumbles readily. </trans></eg>
<eg><i lang=""ceb"">Ang biskwit nga bag-ung lútù tagpud,</i><trans> Newly baked biscuits are crisp. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B; a]</itype><trans> become crisp or brittle. </trans>
<eg><i lang=""ceb"">Nagtagpud ang íyang ngípun,</i><trans> His teeth are crumbling.
</trans></eg>
</sense></hom></entry>");
