INSERT INTO `wced_entry` VALUES (17923, "tagsuk", "960", "<entry page=""960"" id=""17923""><form id=""tagsuk"" lang=""ceb"">tagsuk</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AB16; ac]</itype><trans> pack elongated things tightly in an upright position using every bit of space. </trans>
<eg><i lang=""ceb"">Nagtagsuk ang mga táwu sa trak dikarga,</i><trans> People were jampacked into the truck. </trans></eg>
<eg><i lang=""ceb"">Tagsukun níya ang butilya sa sáku,</i><trans> He will pack the bottles tightly into the sack. </trans></eg>
<eg><i lang=""ceb"">Itagsuk ang putput sa alat,</i><trans> Pack the sticks tightly in an upright position into the basket. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c]</itype><trans> <tr>pierce</tr>, plant into but not through. </trans>
<eg><i lang=""ceb"">Kinsay nagtagsuk ning sundang sa báni?</i><trans> Who stuck the bolo into the banana trunk?
</trans></eg>
</sense></hom></entry>");
