INSERT INTO `wced_entry` VALUES (17928, "tagud1", "960", "<entry page=""960"" id=""17928""><form id=""taxgud"" lang=""ceb"">tágud<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c]</itype><trans> plant in a seedbed, esp. rice, but also other plants. </trans>
<eg><i lang=""ceb"">Magtágud na ta pára pangulílang,</i><trans> Let’s plant the seedbed now for the second crop. </trans></eg>
<eg><i lang=""ceb"">Itágud sa kahun ang kamátis,</i><trans> Plant the tomatoes in the box. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[B2456]</itype><trans> for a rice field to have a certain capacity. </trans>
<eg><i lang=""ceb"">Mutágud ning basáka ug usa ka bákid,</i><trans> This rice field is big enough to have one cavan planted on it. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c]</itype><trans> drop in several numbers. </trans>
<eg><i lang=""ceb"">Nagtágud siyag lima ka pasul,</i><trans> He dropped four hooks and lines. </trans></eg>
<eg><i lang=""ceb"">Gitágud ang mga bumba sa syudad,</i><trans> The bombs were dropped on the city. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B125]</itype><trans> be covered with wounds, sores. </trans>
<eg><i lang=""ceb"">Natágud sa núka ang makililímus,</i><trans> The beggar is covered with sores. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> rice seedlings. </trans>
</sense></hom>
<entry><form id=""taguran"" lang=""ceb"">taguran</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>seedbed</tr>.†
</trans>
</sense></hom></entry></entry>");
