INSERT INTO `wced_entry` VALUES (17929, "tagud2", "960", "<entry page=""960"" id=""17929""><form id=""taxgud2"" lang=""ceb"">tágud<sub>2</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a]</itype><trans> cut or slice into small, but not fine, pieces. </trans>
<eg><i lang=""ceb"">Gitágud ang kamúti nga giságul sa kan-un,</i><trans> The potatoes that were boiled with the rice were sliced into small pieces. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AB125; a]</itype><trans> tear into pieces. </trans>
<eg><i lang=""ceb"">Bátà ang mitágud sa piryudiku,</i><trans> It was the child <pb n=""961""/>who tore the newspaper into pieces. </trans></eg>
<eg><i lang=""ceb"">Nagkatagud ang tualya,</i><trans> The towel is being reduced to tatters. </trans></eg>
</sense></hom>
<entry><form id=""tagudtagud"" lang=""ceb"">tagudtagud</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>cut</tr> s.t. small into many pieces. </trans>
</sense>
<sense n=""2""><number>2</number><trans> cut s.t. with short, fast chopping strokes. </trans>
<eg><i lang=""ceb"">Tagudtagurun ta ka rung tikasána ka!</i><trans> I will chop you to bits, you cheat, you!
</trans></eg>
</sense></hom></entry></entry>");
