INSERT INTO `wced_entry` VALUES (17930, "tagudtud", "961", "<entry page=""961"" id=""17930""><form id=""tagudtud"" lang=""ceb"">tagudtud</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> having the quality of being <tr>rubbery</tr> when bitten by the teeth but yielding when subjected to increased pressure. </trans>
<eg><i lang=""ceb"">Ang unud sa budyung tagudtud apan lamì,</i><trans> The meat of the conch shell is rubbery but delicious. </trans></eg>
<eg><i lang=""ceb"">Tagudtud kan-un ang hilawhílaw nga linung-ag,</i><trans> Inadequately cooked rice is not soft enough. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B; b6]</itype><trans> be rubbery in consistency.
</trans>
</sense></hom></entry>");
