INSERT INTO `wced_entry` VALUES (17931, "taguk", "961", "<entry page=""961"" id=""17931""><form id=""taguk"" lang=""ceb"">taguk</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>sticky</tr> sap of plants and fruits. </trans>
</sense>
<sense n=""2""><number>2</number><trans> sticky, thin, membranous substance that sticks on the body of a newly-delivered child. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b8]</itype><trans> give off sap. </trans>
<eg><i lang=""ceb"">Mutaguk ang kapáyas ug tigbásun,</i><trans> The papaya will give off sap if it is cut. </trans></eg>
<eg><i lang=""ceb"">Hingtagukan ang ákung sinínà,</i><trans> My shirt got smeared with sap. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A2; b6(1)]</itype><trans> for s.t. to be sticky with sap. </trans>
<eg><i lang=""ceb"">Dì na nà makataguk kay uga na,</i><trans> That sap won’t stick because it is dry. </trans></eg>
</sense>
<sense n=""1b""><number>1b</number> <itype>[B]</itype><trans> for sap to get sticky. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A; ab2]</itype><trans> catch s.t. with a sticky substance, esp. the sap of a plant. </trans>
<eg><i lang=""ceb"">Tagukun ku nang langgáma,</i><trans> I’ll catch that bird with sticky sap. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[b(1)]</itype><trans> remove, gather the sticky sap. </trans>
<eg><i lang=""ceb"">Ákung tagukan ning púsù úsà utánun,</i><trans> I’ll remove the sap from this banana blossom before I cook it. </trans></eg>
</sense></hom>
<entry><form id=""kataxguk"" lang=""ceb""><abbr expan=""katáguk"" type=""lemma"">ka-(←)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> have sticky substance all over it. </trans>
<eg><i lang=""ceb"">Nagkatáguk ang bátà nga bag-ung natáwu,</i><trans> The newborn baby had sticky substance all over it. </trans></eg>
</sense></hom></entry>
<entry><form id=""taguxkun"" lang=""ceb""><abbr expan=""tagúkun"" type=""lemma"">-un</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> a child having thin sticky substance on him at birth. </trans>
</sense>
<sense n=""2""><number>2</number><trans> producing plenty of sticky sap. </trans>
<eg><i lang=""ceb"">Tagukun kaáyung gumáha,</i><trans> Rubber tree producing lots of latex. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> having lots of sticky sap on it.
</trans>
</sense></hom></entry></entry>");
