INSERT INTO `wced_entry` VALUES (17934, "tagulhus", "961", "<entry page=""961"" id=""17934""><form id=""tagulhus"" lang=""ceb"">tagulhus</form>
<hom>
<sense n=""0""><trans> (from <ix>ulhus</ix>) </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A1; c1]</itype><trans> do s.t., come out <tr>in turns</tr> or <tr>alternately</tr>. </trans>
<eg><i lang=""ceb"">Nagtagulhus ang háguk sa duha ka táwu,</i><trans> The two men were snoring alternately with each other. </trans></eg>
<eg><i lang=""ceb"">Itagulhus (tagulhusun) sila pagpabantay sa masakitun,</i><trans> They will be assigned to watch the sick man in turns.
</trans></eg>
</sense></hom></entry>");
