INSERT INTO `wced_entry` VALUES (17935, "tagulilung", "961", "<entry page=""961"" id=""17935""><form id=""tagulixlung"" lang=""ceb"">tagulílung</form>
<hom>
<sense n=""0""><trans> (from <ix>tágù</ix> and <ix>lílung</ix>) </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> k.o. <tr>charm</tr> which enables a person to appear and disappear at will, said to be the egg of a k.o. bird (the <ix>tuktur</ix>) which flies only after dusk when he can be heard but not seen. The egg is also invisible but obtainable through magical procedures. </trans>
</sense>
<sense n=""2""><number>2</number><trans> person who possesses this charm. </trans>
</sense>
<sense n=""2a""><number>2a</number><trans> one who disappears as suddenly as he appeared. </trans>
<eg><i lang=""ceb"">Mabáwu man tag pangítà nímu. Mu ra man kag tagulílung,</i><trans> I’ve been going crazy looking for you. You are harder to find than a <ix>tagulílung</ix>. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> name also given to the <ix>tuktur</ix> bird.
</trans>
</sense></hom></entry>");
