INSERT INTO `wced_entry` VALUES (17936, "tagultul1", "961", "<entry page=""961"" id=""17936""><form id=""tagultul"" lang=""ceb"">tagultul<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> a signalling device made of a nodule of bamboo having the nodes covering both ends and a slit on the side. </trans>
</sense>
<sense n=""2""><number>2</number><trans> thonking sound. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a2]</itype><trans> beat this <tr>bamboo resounder</tr> or produce a similar sound. </trans>
<eg><i lang=""ceb"">Mutagultul siya arun pagtawag sa mga silíngan,</i><trans> He sounds the bamboo resounder to call the neighbors.</trans></eg>
<eg><i lang=""ceb""> Mutagultul ang likiun nga kawáyan kun dukdúkun sa káhuy,</i><trans> A cracked bamboo tube will make the sound of thonk-thonk if you beat it with a stick.
