INSERT INTO `wced_entry` VALUES (17943, "taguntun1", "962", "<entry page=""962"" id=""17943""><form id=""taguntun"" lang=""ceb"">taguntun<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> half the value of a domestic animal. </trans>
<eg><i lang=""ceb"">Bayinti písus mauy taguntun sa ákung bábuy nga íyang gibatunan,</i><trans> He took care of my pig for which I gave him half the value, twenty pesos<corr>.</corr> </trans></eg>
<eg><i lang=""ceb"">Baktin mauy ákung taguntun sa katungà sa litsun níya,</i><trans> I exchanged a piglet for one-half of his roast pig. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c1]</itype><trans> give one-half the value of a domestic animal. </trans>
<eg><i lang=""ceb"">Ákù na ning bábuy kay nakataguntun na ku,</i><trans> I’ve given for half the value of this pig for raising it, so it is all mine now.
