INSERT INTO `wced_entry` VALUES (17948, "tagustus", "962", "<entry page=""962"" id=""17948""><form id=""tagustus"" lang=""ceb"">tagustus</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AB; c1]</itype><trans> for rope to <tr>unwind</tr>, get undone. </trans>
<eg><i lang=""ceb"">Usba pagbúbud ang písì kay nagtagustus na,</i><trans> Wind the rope again because it is <tr>unreeling</tr>. </trans></eg>
<eg><i lang=""ceb"">Itagustus (tagustúsa) ang mga lánut nga gibugkus,</i><trans> Undo the abaca fibers that had been tied in place. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AP; c1P]</itype><trans> pay out a line slowly. </trans>
<eg><i lang=""ceb"">Ikay tagustus (patagustus) sa láyag inigkusug sa hángin,</i><trans> Lower the sails slowly when the wind begins to blow hard. </trans></eg>
<eg><i lang=""ceb"">Tagustúsi ang tabánug. Taas bítaw ang lambu,</i><trans> Give the kite more line. Anyway it has a long line.
</trans></eg>
</sense></hom></entry>");
