INSERT INTO `wced_entry` VALUES (17955, "taha", "962", "<entry page=""962"" id=""17955""><form id=""tahaq"" lang=""ceb"">tahà</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B1256; b3(1)]</itype><trans> feel shyness or inhibition in the presence of s.o. who commands distant respect. </trans>
<eg><i lang=""ceb"">Matahà siyang mudúul ug dagkung táwu,</i><trans> He is afraid to approach big shots. </trans></eg>
<eg><i lang=""ceb"">Paríhu ra nátù nang ímung gikatahaan,</i><trans> You feel shy in his presence, but he is just like us. </trans></eg>
