<eg><i lang=""ceb"">Íyang gitahan ang náwung níya arun hagkan,</i><trans> She put her face forward to be kissed. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>offer</tr>, <tr>render up</tr>, <tr>offer up</tr> in trust. </trans>
<eg><i lang=""ceb"">Itahan ku kining kinabúhì sa kahitas-an,</i><trans> I’ll <tr>entrust</tr> my life to the Almighty. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> offer without reservation. </trans>
<eg><i lang=""ceb"">Itahan sa kaáway ang pagpasaylu,</i><trans> Offer forgiveness to the enemy. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> for bets to be placed or handed over usually before the start of the game. </trans>
<eg><i lang=""ceb"">Itahan nang ímung pusta arun sugdan ang dúlà,</i><trans> Place your bets so that the game may start. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[A; c]</itype><trans> offer a <tr>bond</tr>, <tr>security</tr>. </trans>
<eg><i lang=""ceb"">Itahan ku ang ákung yútà sa salapì nga hulaman ku nímu,</i><trans> I will put up my land as security for the money that I will borrow from you. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>bond</tr>, <tr>guarantee</tr>. </trans>
<eg><i lang=""ceb"">Ímu na kining singsing silbing tahan sa ákung pagmahal nímu,</i><trans> Take this ring as a guarantee of my love for you<corr>.</corr>
</trans></eg>
</sense></hom></entry>");
