INSERT INTO `wced_entry` VALUES (17959, "tahas", "962", "<entry page=""962"" id=""17959""><form id=""taxhas"" lang=""ceb"">táhas</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> task or duty one must fulfill prior to acquiring possession of supernatural powers. </trans>
<eg><i lang=""ceb"">Dúnay táhas únà makahuput ug urasiyun,</i><trans> You must perform a task before you may acquire a magic formula. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>mission</tr> one is bound by vow or otherwise to accomplish. </trans>
<eg><i lang=""ceb"">Matag táwu adúnay táhas sa kalibútan,</i><trans> Each man has a mission on this earth. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A1; c5]</itype><trans> make a vow to accomplish s.t. </trans>
<eg><i lang=""ceb"">Tahásun ku ang pagtúman sa íyang túgun,</i><trans> I will make it my mission to fulfill her commands. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[c]</itype><trans> assign as a mission. </trans>
<eg><i lang=""ceb"">Akuy gitahásan pagpatay nímu,</i><trans> I was entrusted with a mission to kill you. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A12]</itype><trans> able to be in some place alone without fear. </trans>
<eg><i lang=""ceb"">Makatáhas ka bag mintiryu?</i><trans> Do you dare go to the cemetery alone?
</trans></eg>
</sense></hom></entry>");
