INSERT INTO `wced_entry` VALUES (17965, "tahud", "963", "<entry page=""963"" id=""17965""><form id=""tahud"" lang=""ceb"">tahud</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>spur</tr> of fowls and birds. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[b4]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> get one’s spurs. </trans>
<eg><i lang=""ceb"">Walà pa tadhi ang sunuy,</i><trans> The rooster hasn’t gotten his spurs yet. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> become <tr>experienced</tr>. </trans>
</sense></hom>
<entry><form id=""tadhan"" lang=""ceb"">tadhan</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>experienced</tr> and <tr>authoritative</tr> in one’s line of work. </trans>
<eg><i lang=""ceb"">Tadhan siyang kusiníru,</i><trans> He is an experienced cook. </trans></eg>
</sense></hom></entry>
<entry><form id=""tahudtahud"" lang=""ceb"">tahudtahud</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> growths on the body, usually near the joints, which look like the spurs of the rooster. </trans>
</sense>
<sense n=""2""><number>2</number><trans> small boils on small children’s heads.
</trans>
</sense></hom></entry></entry>");
