INSERT INTO `wced_entry` VALUES (17966, "tahud", "963", "<entry page=""963"" id=""17966""><form id=""taxhud"" lang=""ceb"">táhud</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A23; a12]</itype><trans> <tr>obey</tr>. </trans>
<eg><i lang=""ceb"">Tahúra úsà ang ákung gipabúhat úsà magdúwà,</i><trans> Do what I tell you to before you play. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a12]</itype><trans> <tr>respect</tr>. </trans>
<eg><i lang=""ceb"">Tahúra ang ímung ginikánan,</i><trans> Respect your parents. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[A3; c6]</itype><trans> use an address of respect to an elder. </trans>
<eg><i lang=""ceb"">Nagtáhud siya nákug Tiyù,</i><trans> He <tr>addresses</tr> me as Uncle. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>respect</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> address of respect. </trans>
<eg><i lang=""ceb"">Púpuy ang ámung táhud níya,</i><trans> We addressed him as Grandpa. </trans></eg>
</sense></hom>
<entry><form id=""patahud"" lang=""ceb""><abbr expan=""patahud"" type=""lemma"">pa-(→)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A]</itype><trans> be <tr>arrogant</tr>, demanding of more respect than one has the right to. </trans>
<eg><i lang=""ceb"">À, mu pay muhangyù mau pay mupatáhud!</i><trans> Hm, here you go acting as if you want me to kiss your feet when you are asking me for a favor! </trans></eg>
</sense></hom></entry>
<entry><form id=""tahuray"" lang=""ceb"">tahuray</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> respect each other. </trans>
<eg><i lang=""ceb"">Ángay magtahuray ang managsúun,</i><trans> Brothers must respect each other. </trans></eg>
</sense></hom></entry>
<entry><form id=""katahuxran_pangatahuxran"" lang=""ceb"">katahúran, pangatahúran</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> words of greeting. </trans>
<eg><i lang=""ceb"">Nangáyù mig pangatahúran (katahúran) apan way mitubag nga tagbalay,</i><trans> We called out <tr>greetings</tr> but no one in the house answered. </trans></eg>
</sense></hom></entry>
<entry><form id=""pangatahuxran"" lang=""ceb"">pangatahúran</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2]</itype><trans> say words of respect or greetings. </trans>
<eg><i lang=""ceb"">Nangatahúran sila paglabay sa párì,</i><trans> When the priest passed by they <tr>greeted</tr> him. </trans></eg>
</sense></hom></entry>
<entry><form id=""matinahuxrun"" lang=""ceb"">matinahúrun</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>respectful</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <ix>short for</ix> </trans>
</sense></hom></entry>
<entry><form id=""kanixmu_matinahuxrun"" lang=""ceb"">kanímu matinahúrun</form>
<hom>
<sense n=""0""><trans> <ix>in the complimentary closing of a letter:</ix> ‘<tr>Respectfully yours</tr>’. </trans>
</sense></hom></entry>
<entry><form id=""talahuxrun"" lang=""ceb"">talahúrun</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> term of address to a person of distinction. </trans>
<eg><i lang=""ceb"">Duha sila ka táwu, talahúrun,</i><trans> There were two of them, <tr>sire</tr>.
</trans></eg>
</sense></hom></entry></entry>");
