<eg><i lang=""ceb"">Akuy nagtàhung ug kawit dihà sa palwa,</i><trans> I was the one that hung a toddy container over the palm frond. </trans></eg>
<eg><i lang=""ceb"">Gitàhúngan níya ang kingki,</i><trans> He put a shade over the kerosene lamp. </trans></eg>
