INSERT INTO `wced_entry` VALUES (17976, "taka", "964", "<entry page=""964"" id=""17976""><form id=""taka"" lang=""ceb"">taka</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; b4]</itype><trans> get tired of doing s.t. and thus cease. </trans>
<eg><i lang=""ceb"">Mitaka na siya, wà na maghilak,</i><trans> He got sick of crying so he stopped. </trans></eg>
<eg><i lang=""ceb"">Gitak-an kug hinuwat nímu, maung mipaúlì lang ku,</i><trans> I got tired waiting for you so I just went home. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[c5]</itype><trans> not like to do s.t. </trans>
<eg><i lang=""ceb"">Kun dì mu ikataka palíhug buháta kini,</i><trans> If you don’t <tr>mind</tr>, please do this for me. </trans></eg>
</sense></hom>
<entry><form id=""kataka"" lang=""ceb""><abbr expan=""kataka"" type=""lemma"">ka-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> feeling of <tr>boredom</tr> or of being <tr>fed up</tr>. </trans>
</sense></hom></entry>
<entry><form id=""mataka"" lang=""ceb""><abbr expan=""mataka"" type=""lemma"">ma-</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>boring</tr>, <tr>tiresome</tr>, </trans>
</sense></hom></entry>
<entry><form id=""tak-axnun_matak-axnun_matalak-un"" lang=""ceb"">tak-ánun, matak-ánun, matalak-un</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> easily bored, tending to lose interest.
</trans>
</sense></hom></entry></entry>");
