INSERT INTO `wced_entry` VALUES (17978, "takaba, takaba", "964", "<entry page=""964"" id=""17978""><form id=""takaba_takabaq"" lang=""ceb"">takaba, takabà</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> wrap a piece of cloth or the like around the body, esp. the torso. </trans>
<eg><i lang=""ceb"">Human kag kalígù magtakaba kag tualya kay musihag ang sinínà,</i><trans> After you swim, you should put a towel around you because you can see through your dress. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> use as a shield or cover for any part of the body. </trans>
<eg><i lang=""ceb"">Nagtakaba siyag papil tungud sa ínit,</i><trans> She put a piece of paper over her head to protect her from the heat of the sun. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; c1]</itype><trans> carry s.t. on the back or shoulders by tying it. </trans>
</sense>
<sense n=""3a""><number>3a</number><trans> carry s.o. on the back or shoulders not tied. </trans>
<eg><i lang=""ceb"">Gitakaba ni Mulit ang íyang manghud,</i><trans> Mulit carried his little brother <tr>pick-a-back</tr>. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A; aP]</itype><trans> for animals to <tr>mate</tr>. </trans>
</sense>
<sense n=""4a""><number>4a</number><trans> have <tr>intercourse</tr> (derogatory). </trans>
<eg><i lang=""ceb"">Mitakaba ka uruy ánang mubug lupad,</i><trans> You went to bed with that pig of a woman. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> wrap-around cloth. </trans>
</sense>
<sense n=""2""><number>2</number><trans> s.t. to cover one’s head or shoulders.
</trans>
</sense></hom></entry>");
