INSERT INTO `wced_entry` VALUES (17979, "takad", "964", "<entry page=""964"" id=""17979""><form id=""takad"" lang=""ceb"">takad</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b(1)]</itype><trans> step on a line or specific area. </trans>
<eg><i lang=""ceb"">Dì ka mutakad sa bágis kay páwul ka,</i><trans> If you step on the line, you are foul. </trans></eg>
<eg><i lang=""ceb"">Kining batúha ímung takaran (takdan) arun makaabut ka sa búnga,</i><trans> Step on this stone so that you can reach the fruit. </trans></eg>
</sense></hom>
<entry><form id=""takdanan"" lang=""ceb"">takdanan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> in games, the line on which one steps at the start or any phase of the game.
</trans>
</sense></hom></entry></entry>");
