INSERT INTO `wced_entry` VALUES (17980, "takal1", "964", "<entry page=""964"" id=""17980""><form id=""taxkal"" lang=""ceb"">tákal<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>volume</tr>, <tr>contents</tr>. </trans>
<eg><i lang=""ceb"">Ang garapun dakug tákal kay sa básu,</i><trans> A jar holds more than a glass. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a]</itype><trans> <tr>measure</tr> out in a certain volume. </trans>
<eg><i lang=""ceb"">Gitákal níla sa bukag ang kamúti,</i><trans> They measured the sweet potatoes by baskets. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AB; c]</itype><trans> for a measure to become full, cause it to do so. </trans>
<eg><i lang=""ceb"">Lainláing butang ang nagtákal sa íyang pitáka,</i><trans> Her bag was <tr>filled</tr> with all different things. </trans></eg>
<eg><i lang=""ceb"">Nagkatakal ang baldi sa hinayhínayng túlù sa túbig,</i><trans> The pail is slowly <tr>filling up</tr> with water dripping into it. </trans></eg>
</sense></hom>
<entry><form id=""patakal"" lang=""ceb""><abbr expan=""patakal"" type=""lemma"">-an(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> a measuring box, basket, or can of any convenient size.
</trans>
</sense></hom></entry></entry>");
