INSERT INTO `wced_entry` VALUES (17981, "takal2", "964", "<entry page=""964"" id=""17981""><form id=""taxkal2"" lang=""ceb"">tákal<sub>2</sub></form>
<hom role=""v""><pos>v</pos>
