INSERT INTO `wced_entry` VALUES (17983, "takam, takam", "964", "<entry page=""964"" id=""17983""><form id=""takam_taxkam"" lang=""ceb"">takam, tákam</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> ravenous. </trans>
<eg><i lang=""ceb"">Ang táwung takam mukáun bísan unsa,</i><trans> A ravenous person will eat anything. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B]</itype><trans> be <tr>hungry</tr>, ravenous. </trans>
<eg><i lang=""ceb"">Kinsay dílì mutakam (matakam) nga tulu ka adlaw wà miy káun gawas sa prútas,</i><trans> Who wouldn’t become ravenous when for three days we did not have anything to eat except fruits. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c1]</itype><trans> take a large bite, <tr>chew</tr>. </trans>
<eg><i lang=""ceb"">May nagtakam sa kík kay gamay na lang ang nahibilin,</i><trans> S.o. took a big bite from the cake because only a small portion of it is left. </trans></eg>
<eg><i lang=""ceb"">Itakam (takama) ug maáyu ang <pb n=""965""/>kan-un únà tunla,</i><trans> Chew the food well before you swallow it. </trans></eg>
</sense></hom>
<entry><form id=""takamtakam"" lang=""ceb"">takamtakam</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A13; c16]</itype><trans> <tr>smack the lips</tr>. </trans>
<eg><i lang=""ceb"">Nagtakamtakam ang bátà kay miángay sa lamì sa gátas,</i><trans> The child is smacking his lips because he likes the milk. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A13]</itype><trans> await eagerly. </trans>
<eg><i lang=""ceb"">Nagtakamtakam na ku sa lamì sa mga sud-an,</i><trans> I am eagerly <tr>anticipating</tr> the delicious food.
</trans></eg>
</sense></hom></entry></entry>");
