INSERT INTO `wced_entry` VALUES (17984, "takandal", "965", "<entry page=""965"" id=""17984""><form id=""takandal"" lang=""ceb"">takandal</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A3P]</itype><trans> for vehicles to run with a jouncing, bouncing motion. </trans>
<eg><i lang=""ceb"">Mutakandal na pud ang trák kun mulabang sa kabatuan,</i><trans> The truck will bounce again when it crosses the stony area. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B46; c1]</itype><trans> make a <tr>clacking</tr>, banging sound. </trans>
<eg><i lang=""ceb"">Mitakandal ang bakyà sa simintádung dálan,</i><trans> The wooden slippers went clickety clack over the cemented walk. </trans></eg>
<eg><i lang=""ceb"">Ang táru nga way sulud mitakandal kay ákung hipatiran,</i><trans> The empty can <tr>rattled</tr> when I kicked it.
</trans></eg>
</sense></hom></entry>");
