INSERT INTO `wced_entry` VALUES (17987, "takas", "965", "<entry page=""965"" id=""17987""><form id=""taxkas"" lang=""ceb"">tákas</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2S; ac]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>go up</tr> an incline. </trans>
<eg><i lang=""ceb"">Takásun pa nátù ang pitu ka bungtud úsà muabut sa píkas baybay,</i><trans> We still have to <tr>ascend</tr> seven hills before we get to the other side of the island. </trans></eg>
<eg><i lang=""ceb"">Kining bakilíra dílì katakásan ug gamayng awtu,</i><trans> A small car cannot negotiate this slope. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> go <tr>ashore</tr>. </trans>
<eg><i lang=""ceb"">Ang pawíkan mutákas arun mangitlug,</i><trans> The sea turtles <tr>go ashore</tr> to lay their eggs. </trans></eg>
<eg><i lang=""ceb"">Dì ta makatákas kay balud kaáyu,</i><trans> We can’t go ashore because the sea is very rough. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[A; b6]</itype><trans> land from a sea attack. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[A2; b(1)]</itype><trans> escape from prison. </trans>
<eg><i lang=""ceb"">Tulu na ka prisuhan ang ílang gitakásan,</i><trans> They have already escaped from three prisons.
</trans></eg>
</sense></hom></entry>");
