INSERT INTO `wced_entry` VALUES (17988, "takba", "965", "<entry page=""965"" id=""17988""><form id=""takba"" lang=""ceb"">takba</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b]</itype><trans> lean forward on s.t. or s.o. and cling to it. </trans>
<eg><i lang=""ceb"">Mitakba siya sa bukubuku sa íyang bána nga nagkaun,</i><trans> She <tr>leaned on</tr> her husband’s back while he was eating. </trans></eg>
<eg><i lang=""ceb"">Maáyu kay nakatakba siyag bátang pagkalúnud sa barku,</i><trans> Luckily he was able to cling to a log for support when the boat sunk. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a12]</itype><trans> carry a child closely in one’s arms with the child facing one. </trans>
<eg><i lang=""ceb"">Takbáha ang bátà kun butdan sa tiyan,</i><trans> Carry the child with his stomach pressed against you if he has gas in the stomach. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[AC; b(1)]</itype><trans> <tr>mount</tr> for copulation, as if for copulation. </trans>
<eg><i lang=""ceb"">Mitakba na ang butù apan dì gustu ang bayi,</i><trans> The male mounted, but the female did not like it. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number><trans> for humans to <tr>have intercourse</tr> (coarse). </trans>
</sense>
<sense n=""4""><number>4</number> <itype>[A; b]</itype><trans> wrap a part of the body with s.t. </trans>
<eg><i lang=""ceb"">Gitakbahan níyag dyákit ang bukubuku sa dalága,</i><trans> He covered the girl’s back with a jacket.
</trans></eg>
</sense></hom></entry>");
