INSERT INTO `wced_entry` VALUES (17989, "takbas", "965", "<entry page=""965"" id=""17989""><form id=""takbas"" lang=""ceb"">takbas</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> swing a bolo or a similar bladed instrument. </trans>
<eg><i lang=""ceb"">Mitakbas siyag bálus apan lúya na siya,</i><trans> He swung a bolo to retaliate but he was already too weak. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> sever with a swing of the bolo. </trans>
<eg><i lang=""ceb"">Si Simyun ang mitakbas sa gamayng punúan sa ságing,</i><trans> Simeon cut down the small banana trunk in one stroke.
</trans></eg>
</sense></hom></entry>");
