INSERT INTO `wced_entry` VALUES (17991, "takda", "965", "<entry page=""965"" id=""17991""><form id=""takdaq"" lang=""ceb"">takdà</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c]</itype><trans> <tr>schedule</tr>, set a date. </trans>
<eg><i lang=""ceb"">Átung itakdà ang sunud nátung tígum,</i><trans> We will set the date for our next meeting. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c]</itype><trans> <tr>sign</tr>, put a <tr>mark</tr> on. </trans>
<eg><i lang=""ceb"">Siyay mitakdà (nagtakdà) sa sulat,</i><trans> He signed the letter. </trans></eg>
<eg><i lang=""ceb"">Takdái ug íkis ang punúan sa lubi,</i><trans> Mark the trunks of the coconut trees with an X. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>signature</tr>, <tr>mark</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>reminder</tr>; s.t. that is used as a reminder. </trans>
<eg><i lang=""ceb"">Ang anínu sa pusti mauy ákung takdà sa úras,</i><trans> The shadow of the post is my reminder of the time. </trans></eg>
</sense></hom>
<entry><form id=""takdaan"" lang=""ceb""><abbr expan=""takdaan"" type=""lemma"">-an(→)</abbr></form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#takdaq""><sc>takdà</sc></xr>, <i lang=""ceb"">n</i>.
</trans>
</sense></hom></entry></entry>");
