INSERT INTO `wced_entry` VALUES (17992, "takdang", "965", "<entry page=""965"" id=""17992""><form id=""takdang"" lang=""ceb"">takdang</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; ab2]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> hack or lodge a blade laterally into s.t. </trans>
<eg><i lang=""ceb"">Ang amul wà makatakdang sa punúan sa káhuy,</i><trans> The dull bolo did not cut the trunk of the tree. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> make <tr>notches</tr>, <tr>nick</tr>. </trans>
<eg><i lang=""ceb"">Ang bátà mauy mitakdang sa tiil sa silya,</i><trans> The child made notches on the legs of the chair. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; b]</itype><trans> strike the forehead with s.t. heavy. </trans>
<eg><i lang=""ceb"">Akuy mutakdang ug puthaw sa ímung agtang,</i><trans> I’ll strike your forehead with an iron rod.
</trans></eg>
</sense></hom></entry>");
