INSERT INTO `wced_entry` VALUES (17993, "takdu", "965", "<entry page=""965"" id=""17993""><form id=""takduq"" lang=""ceb"">takdù</form>
<hom>
<sense n=""0""><trans> <tr>exactly</tr>, no more and no less. </trans>
<eg><i lang=""ceb"">Takdù karung diyis anyus ang átung kaminyúun,</i><trans> We have been married for exactly ten years today. </trans></eg>
<eg><i lang=""ceb"">Takdù sa gikasabútan,</i><trans> In exact accordance with their agreement. </trans></eg>
<eg><i lang=""ceb"">Takdù giyud sa nahitabù ang íyang tahù,</i><trans> His report turned out to be exactly in agreement with what had happened. </trans></eg>
</sense></hom>
<entry><form id=""takduq_ang_buxwan"" lang=""ceb""><abbr expan=""takdù"" type=""lemma"">—</abbr> ang búwan</form>
<hom>
<sense n=""0""><trans> for the moon to be full. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AB256C3; c1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> for things that are joined to fit exactly at their point of junction, make s.t. fit. </trans>
<eg><i lang=""ceb"">Walà mutakdù ang takub sa kaban,</i><trans> The cover of the trunk doesn’t fit squarely. </trans></eg>
<eg><i lang=""ceb"">Takdúa (itakdù) ang duha ka iskína arun tíkup,</i><trans> Have the corners meet and fit to make it tight. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>coincide</tr>, be in agreement with each other; <pb n=""966""/>make things be in agreement. </trans>
<eg><i lang=""ceb"">Ang íyang kamatáyun ug ang ímung damgu nagkatakdù lang,</i><trans> His death and your dream were just a <tr>coincidence</tr>. </trans></eg>
<eg><i lang=""ceb"">Itakdù ang ímung bakak sa akúa arun katuúhan,</i><trans> Make your lie be in <tr>accordance</tr> with mine so they will be plausible. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> be <tr>appropriate</tr>. </trans>
<eg><i lang=""ceb"">Kinahanglang mutakdù ang ímung isul-ub sa ukasiyun,</i><trans> Your attire must <tr>fit</tr> the occasion. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number> <itype>[C3]</itype><trans> be on compatible terms with each other. </trans>
<eg><i lang=""ceb"">Nagkatakdù ang duha ka buringug,</i><trans> The two fools <tr>hit it off</tr> nicely. </trans></eg>
</sense></hom></entry>
<entry><form id=""tinakduan"" lang=""ceb""><abbr expan=""tinakduan"" type=""lemma"">-in-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> point of junction, place s.t. meets.
