INSERT INTO `wced_entry` VALUES (17996, "takgus", "966", "<entry page=""966"" id=""17996""><form id=""takgus"" lang=""ceb"">takgus</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; ac]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>fasten</tr> s.t. to s.t. with a knotted cord. </trans>
<eg><i lang=""ceb"">Palíhug rag takgus sa ríbun sa ákung buhuk,</i><trans> Please tie my hair up for me with a ribbon. </trans></eg>
<eg><i lang=""ceb"">Takgúsun na silang duha sa talikálà sa kaminyúun,</i><trans> They are going to be <tr>bound</tr> together in wedlock. </trans></eg>
<eg><i lang=""ceb"">Ang salug nga kawáyan takgúsan ug uway ngadtu sa busaug,</i><trans> The bamboo flooring is <tr>tied</tr> to the joists with rattan. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> tie into a loop that easily gets undone. </trans>
<eg><i lang=""ceb"">Takgúsa ang listǔn sa ákung sapátus,</i><trans> Tie my shoelace. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> tie s.t. around s.t. </trans>
<eg><i lang=""ceb"">Nagtakgus siyag sundang sa háwak,</i><trans> He strapped a bolo around his waist. </trans></eg>
<eg><i lang=""ceb"">Itakgus ang tarì sa tiil sa hiniktan,</i><trans> Tie the gaff around the cock’s leg. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. that is fastened to s.t. else by entwining or the like. </trans>
</sense></hom>
<entry><form id=""tinakgusan"" lang=""ceb""><abbr expan=""tinakgusan"" type=""lemma"">-in-an(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> the knotted part of s.t. tied. </trans>
<eg><i lang=""ceb"">Tan-áwa nga dílì mailhan ang tinakgusan,</i><trans> See to it that the knotted part does not show.
</trans></eg>
</sense></hom></entry></entry>");
