</sense>
<sense n=""1""><number>1</number><trans> <tr>tilt</tr>, <tr>turn over</tr> on the side. </trans>
<eg><i lang=""ceb"">Nilísù siya kay mutakílid siya paghigdà,</i><trans> He turned over to lie on his side. </trans></eg>
<eg><i lang=""ceb"">Ang agúkuy magtakilid nga maglakaw,</i><trans> The fiddler crab walks <tr>sideways</tr>. </trans></eg>
<eg><i lang=""ceb"">Ayaw itakílid (takilíra, takilda), mayabu,</i><trans> Don’t tilt it. It might spill. </trans></eg>
