<eg><i lang=""ceb"">Mitakílid ang barku sa tuu,</i><trans> The ship veered off to the right. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A23]</itype><trans> get money from one’s pocket (lit. lean over to stick the hands in the pocket). </trans>
<eg><i lang=""ceb"">Mutakílid siya dáyun ug pangayúag kwarta,</i><trans> He immediately reaches in his pocket if anyone asks him for money.
