<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6]</itype><trans> make a clicking, clacking noise with the tongue. </trans>
<eg><i lang=""ceb"">Taklái siya kay mau nay ámung sinyas,</i><trans> Clack your tongue at him because that’s our signal. </trans></eg>
