INSERT INTO `wced_entry` VALUES (18015, "takli", "967", "<entry page=""967"" id=""18015""><form id=""takliq"" lang=""ceb"">taklì</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B2]</itype><trans> draw one’s attention away from where it should be focused. </trans>
<eg><i lang=""ceb"">Ang nakataklì (nakapataklì) sa íyang intiris sa panulat mau ang súgal,</i><trans> Gambling drew away his interest from writing. </trans></eg>
<eg><i lang=""ceb"">Nataklì ang atinsiyun ni Míla ngadtu sa íyang katúpad,</i><trans> Mila’s attention was drawn away from me towards her seatmate. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[c]</itype><trans> transfer temporary ownership of land from one mortgage-holder to another. </trans>
<eg><i lang=""ceb"">Ang pinirindang yútà gitaklì pagprinda diri kanákù,</i><trans> The mortgaged lot was transferred to me.
</trans></eg>
</sense></hom></entry>");
