INSERT INTO `wced_entry` VALUES (18016, "takliad", "967", "<entry page=""967"" id=""18016""><form id=""taklixad"" lang=""ceb"">taklíad</form>
<hom>
<sense n=""0""><trans> (from <ix>liad</ix>) </trans>
</sense></hom>
