<eg><i lang=""ceb"">Bantáyi nga dì mataklíad ang bátà,</i><trans> Watch out that the baby doesn’t throw himself backwards. </trans></eg>
<eg><i lang=""ceb"">Ákung itaklíad (takliárun) ug maáyu ang ákung láwas sa sáyawng limburak,</i><trans> I bend way back when I dance the limbo rock.
