INSERT INTO `wced_entry` VALUES (18034, "taktak", "968", "<entry page=""968"" id=""18034""><form id=""taktak"" lang=""ceb"">taktak</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AB26; ac]</itype><trans> for small things or s.t. fastened or stuck to s.t. to detach and drop; cause to drop. </trans>
<eg><i lang=""ceb"">Kinsay nagtaktak ug ágiw sa sawug?</i><trans> Who knocked cigarette ashes on the floor? </trans></eg>
<eg><i lang=""ceb"">Nataktak ang íyang pilukpíluk sa sawug,</i><trans> Her false eyelashes fell to the floor. </trans></eg>
<eg><i lang=""ceb"">Taktáka ang mga tambis,</i><trans> Knock the fruits off the tree. </trans></eg>
<eg><i lang=""ceb"">Wà kataktákig balhíbu,</i><trans> It was unharmed. (Lit. Not a feather was knocked off of it.) </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[b4(1)]</itype><trans> have a <tr>miscarriage</tr>. </trans>
<eg><i lang=""ceb"">Nataktakan siya sa dihang nadakin-as,</i><trans> She had a miscarriage after she slipped and fell. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; c]</itype><trans> cast a fishing net. </trans>
<eg><i lang=""ceb"">Itaktak ang púkut kay dúnay duut,</i><trans> Cast the net because there’s a school of fish. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A; c1]</itype><trans> drop from a list. </trans>
<eg><i lang=""ceb"">Taktáka (itaktak) sa listahan ang mining bitiránu,</i><trans> Drop the fake veterans from the list. </trans></eg>
</sense>
<sense n=""4a""><number>4a</number><trans> <tr>fire</tr> from a position. </trans>
<eg><i lang=""ceb"">Mutaktak nà siyag impliyádung tapulan,</i><trans> He fires lazy employees. </trans></eg>
</sense>
<sense n=""4b""><number>4b</number><trans> drop a charge. </trans>
<eg><i lang=""ceb"">Ang sumbung gitaktak sa huwis,</i><trans> The accusation was dropped by the judge. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> s.t. which has been detached and dropped. </trans>
</sense>
<sense n=""2""><number>2</number><trans> action of casting a fishing net. </trans>
</sense></hom>
<entry><form id=""taktakan"" lang=""ceb""><abbr expan=""taktakan"" type=""lemma"">-an(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> designated place where the fishing net is emptied of catch. </trans>
</sense></hom></entry>
<entry><form id=""taktakun"" lang=""ceb""><abbr expan=""taktakun"" type=""lemma"">-un(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> for coconuts to be mature enough for harvesting. </trans>
<eg><i lang=""ceb"">Hustu na sak-un nang mga lubíha kay taktakun na,</i><trans> Now is the time to gather the coconuts because they are mature.†
</trans></eg>
</sense></hom></entry></entry>");
