INSERT INTO `wced_entry` VALUES (18045, "takud", "968", "<entry page=""968"" id=""18045""><form id=""takud"" lang=""ceb"">takud</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AC; ac]</itype><trans> <tr>attach</tr> s.t. to s.t. else, put it right next to s.t. so that it touches. </trans>
<eg><i lang=""ceb"">Nagtákud ang duha ka daplin sa lamísa,</i><trans> The two edges of the table <tr>are</tr> touching each other. </trans></eg>
<eg><i lang=""ceb"">Takúra ang duha ka daplin sa panaptung himúung hábul,</i><trans> Attach the two pieces of cloth at the ends to make them into a blanket. </trans></eg>
<eg><i lang=""ceb"">Itakud ang kwadru sa bungbung,</i><trans> Attach the picture to the wall. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b6]</itype><trans> <tr>harness</tr> an animal, <tr>hitch</tr> it for work. </trans>
<eg><i lang=""ceb"">Ayaw takdi nang bakáha ug balsa kay gamay pa nà,</i><trans> Don’t harness the cow to a sled because it is still too small. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A2; b4(1)]</itype><trans> <tr>infect</tr> with disease. </trans>
<eg><i lang=""ceb"">Makatakud nang hanggà,</i><trans> Chicken pox is <tr>contagious</tr>. </trans></eg>
<eg><i lang=""ceb"">Hitakdan kag mudúul sa tibíhun,</i><trans> You’ll get infected if you go near a tubercular person. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number> <itype>[C3]</itype><trans> contaminate each other. </trans>
<eg><i lang=""ceb"">Nag-úsa lang mug unlan magtákud giyud nang inyung mga kútu,</i><trans> You’re both lying on the same pillow, so you’ll get each other’s lice. </trans></eg>
</sense>
<sense n=""3b""><number>3b</number> <itype>[A12]</itype><trans> arouse or <tr>spread</tr> to s.o. else as if a contagious disease. </trans>
<eg><i lang=""ceb"">Nahimuut siyang namínaw sa makatakud nga katáwa ni Rúsi,</i><trans> He was amused listening to Rosie’s contagious laughter. </trans></eg>
</sense>
<sense n=""3c""><number>3c</number> <itype>[A12; b4(1)]</itype><trans> influence so as to become like one. </trans>
<eg><i lang=""ceb"">Natakdan ku sa kahinúun níya,</i><trans> I was influenced by his diligence in study. </trans></eg>
</sense></hom>
<entry><form id=""patakud"" lang=""ceb""><abbr expan=""patakud"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13; b4]</itype><trans> pass a supernatural attribute on to another person upon death. </trans>
<eg><i lang=""ceb"">Úngù na siya kay gipatakdan sa tigúlang úngù,</i><trans> He is a vampire now because the old man passed his supernatural power on to him. </trans></eg>
</sense></hom></entry>
<entry><form id=""takdanan"" lang=""ceb"">takdanan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> an animal trained to take the harness. </trans>
</sense></hom></entry>
<entry><form id=""mananaxkud_matakdaxnun"" lang=""ceb""><abbr expan=""mananákud"" type=""lemma"">maN-r-(←)</abbr>, matakdánun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>contagious</tr>, tending to spread from person to person.
</trans>
</sense></hom></entry></entry>");
