INSERT INTO `wced_entry` VALUES (18068, "takyab", "969", "<entry page=""969"" id=""18068""><form id=""takyab"" lang=""ceb"">takyab</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> cast a small fishing net into the sea, usually in the shallows. </trans>
<eg><i lang=""ceb"">Dakung duut sa isdà ang íyang gitakyában sa láya,</i><trans> He cast the net on a big school of fish. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> throw s.t. on and over s.t. as if casting a small net or throw s.t. with a similar motion. </trans>
<eg><i lang=""ceb"">Ákung gitakyában ug hábul ang káma,</i><trans> I spread a blanket over the bed. </trans></eg>
<eg><i lang=""ceb"">Ákù ta kang takyában sa tahup ug anhà ka lingkud dihà,</i><trans> The chaff will fall off on you as I winnow it, if you sit there. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> flap s.t. to shake s.t. off it. </trans>
<eg><i lang=""ceb"">Gitakyab níya ang sinínà kay abugun kaáyu,</i><trans> She flapped her dress because it was so dusty.
</trans></eg>
</sense></hom></entry>");
