INSERT INTO `wced_entry` VALUES (18069, "takyan", "969", "<entry page=""969"" id=""18069""><form id=""takyan"" lang=""ceb"">takyan</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> toy which is similar to a shuttlecock in badminton and kicked with the instep of the foot. </trans>
</sense>
<sense n=""2""><number>2</number><trans> game played with this shuttlecock which involves kicking it with the instep of the foot. A server is chosen by kicking the <ix>takyan</ix> a required number of times without missing. The one who misses is the server. The other player (or team) has to kick the <ix>takyan</ix> when it is served. If the server catches it, he serves the next player, and so forth, until all the players have been served, at which point the game starts again. <pb n=""970""/>If he fails to catch it he must serve the same player again. If he is able to return the <ix>takyan</ix> kicking it, the person whom he returned it to must take his place. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b6]</itype><trans> play <ix>takyan</ix>. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A2; a12]</itype><trans> kick as one would a <ix>takyan</ix>.
</trans>
</sense></hom></entry>");
