INSERT INTO `wced_entry` VALUES (18092, "talampad", "970", "<entry page=""970"" id=""18092""><form id=""talampad"" lang=""ceb"">talampad</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A13; a1]</itype><trans> place things in a row across s.t. </trans>
<eg><i lang=""ceb"">Magtalampad tag butilya sa paril kay magpunta blangku ta,</i><trans> Let us arrange bottles in a row because we will have target practice. </trans></eg>
<eg><i lang=""ceb"">Italampad ning mga batu sa yanang arun náay átung katumban,</i><trans> Arrange these rocks in a row across the mud puddle so we have s.t. to step on. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; ac]</itype><trans> <tr>compare</tr>. </trans>
<eg><i lang=""ceb"">Tampárun nátù sila ug kinsay kinagwapahan,</i><trans> Let us compare them and see who is the prettiest. </trans></eg>
<eg><i lang=""ceb"">Ayawg itampad ang ákung pinintal sa kang Amursúlu,</i><trans> Don’t compare my paintings with those of Amorsolo. </trans></eg>
</sense></hom>
<entry><form id=""tamparay"" lang=""ceb"">tamparay</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[C; c3]</itype><trans> compare with each other. </trans>
<eg><i lang=""ceb"">Makigtamparay siya sa ákung núts,</i><trans> He wanted to compare notes with me.
</trans></eg>
</sense></hom></entry></entry>");
