INSERT INTO `wced_entry` VALUES (18099, "talatala", "971", "<entry page=""971"" id=""18099""><form id=""talatala"" lang=""ceb"">talatala</form>
<hom>
<sense n=""0""><trans> (not without <ix>l</ix>) </trans>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>foolish</tr>, slightly crazy. </trans>
<eg><i lang=""ceb"">Talatala, ngánung giusíkan nímu,</i><trans> <tr>Stupid</tr>! Why are you wasting it? </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> k.o. small <tr>frog</tr> about <measure reg=""5.1 cm"">2″</measure>, of marshy areas, often seen in trees. </trans>
</sense>
<sense n=""2""><number>2</number><trans> one who is constantly chattering about unimportant things sounding like the <ix>talatala</ix> frog. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B126]</itype><trans> become <tr>crazy</tr>. </trans>
<eg><i lang=""ceb"">Natalatala siya human bulagi,</i><trans> He became crazy when his girl left him.
