INSERT INTO `wced_entry` VALUES (18102, "talay", "971", "<entry page=""971"" id=""18102""><form id=""talay"" lang=""ceb"">talay</form>
<hom>
<sense n=""0""><trans> (not without <ix>l</ix>) </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> put or sit next to. </trans>
<eg><i lang=""ceb"">Kinsa man tu nga nagtalay nímu?</i><trans> Who was that who sat beside you? </trans></eg>
<eg><i lang=""ceb"">Italay ni sa baril,</i><trans> Put this beside the drum. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> a loaf of bread made of easily separable sections baked together in a row in one mold. </trans>
</sense>
<sense n=""2""><number>2</number><trans> one <tr>beside</tr> s.o. else. </trans>
<eg><i lang=""ceb"">Kinsa man tung ímung talay sa sini?</i><trans> Who was it you were sitting next to in the movies? </trans></eg>
</sense></hom>
<entry><form id=""taxlay"" lang=""ceb""><abbr expan=""tálay"" type=""lemma"">(←)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[C; a]</itype><trans> sit, set next to each other. </trans>
<eg><i lang=""ceb"">Nagtálay mi ug lingkud sa bátang,</i><trans> We sat beside each other on the log. </trans></eg>
<eg><i lang=""ceb"">Taláyun ta ning duha ka lamísa,</i><trans> Let’s put these two tables next to each other. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; ac]</itype><trans> fall, put in line. </trans>
<eg><i lang=""ceb"">Nagtálay ang mamalítay ug arsii,</i><trans> Buyers of <asc>RCA</asc> rice are forming a line. </trans></eg>
<eg><i lang=""ceb"">Gwápa siya kun itálay sa mga maksut,</i><trans> She’s pretty if you put her next to the ugly ones. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>line</tr>, <tr>row</tr> of people or things. </trans>
</sense></hom></entry>
<entry><form id=""hitalay"" lang=""ceb""><abbr expan=""hitalay"" type=""lemma"">hi-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B1256]</itype><trans> belong to a distinct group. </trans>
<eg><i lang=""ceb"">Nahitálay siya sa hataas nga katilingban,</i><trans> She belongs to the upper class.
