INSERT INTO `wced_entry` VALUES (18158, "taliunduk", "973", "<entry page=""973"" id=""18158""><form id=""taliunduk"" lang=""ceb"">taliunduk</form>
<hom>
<sense n=""0""><trans> (from <ix>unduk</ix>) </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B3(1); c1]</itype><trans> be <tr>heaped</tr> up. </trans>
<eg><i lang=""ceb"">Nagtaliunduk ang labhanan,</i><trans> The soiled clothes are <tr>piled</tr> up high. </trans></eg>
<eg><i lang=""ceb"">Ayawg italiunduk (taliundúka) ang kan-un sa ímung kutsára,</i><trans> Don’t put so much food on your spoon at one time. </trans></eg>
<eg><i lang=""ceb"">Akuy nataliundukan sa tanang búhat sa balay,</i><trans> All the housework was heaped on me. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>heap</tr> of s.t.
</trans>
</sense></hom></entry>");
