INSERT INTO `wced_entry` VALUES (18160, "taliwan", "973", "<entry page=""973"" id=""18160""><form id=""talixwan"" lang=""ceb"">talíwan</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[a3]</itype><trans> for work to be disposed of or finished. </trans>
<eg><i lang=""ceb"">Ayaw ug súgud ug láin ug dì pa matalíwan kanang ímu rung gitrabáhu,</i><trans> Don’t start anything else as long as you haven’t finished what you started there. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A23]</itype><trans> for feelings to vanish (literary). </trans>
<eg><i lang=""ceb"">Mitalíwan kanákù ang kalípay pagtalikud nímu,</i><trans> When you left, all the joys of life departed with you. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B2346]</itype><trans> for a person to <tr>pass away</tr>. </trans>
<eg><i lang=""ceb"">Mitalíwan na ang ákung mga ginikánan,</i><trans> My parents have passed away. </trans></eg>
</sense></hom>
<entry><form id=""tumatalixwan"" lang=""ceb""><abbr expan=""tumatalíwan"" type=""lemma"">-um-r-</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> about to disappear or vanish. </trans>
<eg><i lang=""ceb"">Tumatalíwan <pb n=""974""/>nga kaháyag sa kahapúnun,</i><trans> A <tr>fading</tr> afternoon sunlight.
</trans></eg>
</sense></hom></entry></entry>");
