INSERT INTO `wced_entry` VALUES (18167, "taltal", "974", "<entry page=""974"" id=""18167""><form id=""taltal"" lang=""ceb"">taltal</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a]</itype><trans> knock off s.t. that is attached or set. </trans>
<eg><i lang=""ceb"">Taltáli ang ligid sa karitun sa yapak nga nakakápal niánà,</i><trans> Scrape off the mud from the wheels of your pushcart. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c]</itype><trans> deduct from one’s wages to pay for a debt. </trans>
<eg><i lang=""ceb"">Taltálig diyis ang íyang swildu arun siya kabayad,</i><trans> Deduct ten pesos from his salary so that he can pay his debt. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[c]</itype><trans> divide land, property informally among prospective heirs without legal papers. </trans>
<eg><i lang=""ceb"">Ang tibuuk datag tampi sa subà mauy báhin nga gitaltal álang kanákù,</i><trans> All the level land along the riverbank was my share of the inheritance.
</trans></eg>
</sense></hom></entry>");
