INSERT INTO `wced_entry` VALUES (18194, "tama", "975", "<entry page=""975"" id=""18194""><form id=""tamaq"" lang=""ceb"">tamà</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>imprint</tr> or <tr>mark</tr> left on. </trans>
<eg><i lang=""ceb"">Kining uwáta ang tamà sa ímung pagkatampásan,</i><trans> This scar is a mark of your cruelty. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> identifying <tr>sign</tr> or mark. </trans>
</sense>
<sense n=""3""><number>3</number><trans> = <xr lang=""ceb"" target=""#tamlaq""><sc>tamlà</sc></xr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6(1)]</itype><trans> leave a mark on. </trans>
<eg><i lang=""ceb"">Mitamà ang latigu níya sa ákung láwas,</i><trans> His whip left a mark on my body. </trans></eg>
</sense></hom>
<entry><form id=""taxmaq"" lang=""ceb""><abbr expan=""támà"" type=""lemma"">(←)</abbr><sub>1</sub></form>
<hom>
<sense n=""1""><number>1</number><trans> put an identifying mark on. </trans>
<eg><i lang=""ceb"">Akuy mitámà sa ámung kargamintu,</i><trans> I <tr>marked</tr> our cargoes. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> = <xr lang=""ceb"" target=""#tamlaq""><sc>tamlà</sc></xr>, <i lang=""ceb"">v</i>. </trans>
</sense></hom></entry>
<entry><form id=""tamaan"" lang=""ceb""><abbr expan=""tamaan"" type=""lemma"">-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>marker</tr> or identifying sign.
