INSERT INTO `wced_entry` VALUES (18195, "tama2", "975", "<entry page=""975"" id=""18195""><form id=""taxmaq2"" lang=""ceb"">támà<sub>2</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A23; c1]</itype><trans> for s.t. to hit squarely on s.t. </trans>
<eg><i lang=""ceb"">Mitámà ang suntuk sa apapángig sa buksiyadur,</i><trans> The fist hit the boxer squarely on the jaw. </trans></eg>
<eg><i lang=""ceb"">Tamáa (itámà) pagdukduk ang martilyu sa lansang,</i><trans> Hit the nail squarely on the head. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A23C3; c1]</itype><trans> be just exactly on time. </trans>
<eg><i lang=""ceb"">Mitámà ang pyista sa ámung lungsud sa ákung adlaw,</i><trans> The fiesta of our town fell exactly on my birthday. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[c1]</itype><trans> make s.t. <tr>fit</tr>. </trans>
<eg><i lang=""ceb"">Tamáa (itámà) pag-áyu ang sinínà sa ákung sukud arun dì ku magyàyà,</i><trans> Fit my dress according to my measurements so that it won’t hang loosely on me. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[c1]</itype><trans> stop doing s.t. bad. </trans>
<eg><i lang=""ceb"">Tamáa (itámà) na nang ímung pagpamabáyi,</i><trans> Put a stop to your romantic exploits. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> squarely hit, <tr>on time</tr>, <tr>fitting</tr> perfectly. </trans>
</sense></hom>
<entry><form id=""taxmaq_na"" lang=""ceb""><abbr expan=""támà"" type=""lemma"">—</abbr> na</form>
<hom>
<sense n=""0""><trans> <tr>that’s enough</tr>. </trans>
<eg><i lang=""ceb"">Támà na ánang ímung binúang,</i><trans> That’s enough of your foolishness.
</trans></eg>
</sense></hom></entry></entry>");
