INSERT INTO `wced_entry` VALUES (18200, "tam-ak1", "976", "<entry page=""976"" id=""18200""><form id=""tam-ak"" lang=""ceb"">tam-ak<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>dump</tr>, throw a large quantity of s.t. in a heap s.w. </trans>
<eg><i lang=""ceb"">Dì ka makatam-ak ug sagbut sa agiánan,</i><trans> You can’t dump the rubbish in the street. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> fill up a hole in the ground. </trans>
<eg><i lang=""ceb"">Íyang gitam-ákan ang atábay ug mga sagbut,</i><trans> He filled the well with trash. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> heap work, blame, abuse on s.o. </trans>
<eg><i lang=""ceb"">Akuy natam-akan sa tanang kasábà,</i><trans> All the abuse was heaped on me.
</trans></eg>
</sense></hom></entry>");
