INSERT INTO `wced_entry` VALUES (18201, "tam-ak2", "976", "<entry page=""976"" id=""18201""><form id=""tam-ak2"" lang=""ceb"">tam-ak<sub>2</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; b5]</itype><trans> <tr>wind up</tr> s.w. one would not expect to be. </trans>
<eg><i lang=""ceb"">Ngánung mitam-ak ka ning dapíta?</i><trans> How come you wound up in this place? </trans></eg>
<eg><i lang=""ceb"">Sa panahun sa kampanya gitam-ak (gitam-ákan) níla ang kinahilitang baryu,</i><trans> During the campaign they penetrated to the remotest villages. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A12; b8]</itype><trans> <tr>come across</tr> by chance. </trans>
<eg><i lang=""ceb"">Nakatam-ak siyag bahandì pagkálut níyag lubung,</i><trans> He <tr>discovered</tr> a treasure while digging a grave. </trans></eg>
<eg><i lang=""ceb"">Hitam-akan námù ang duut sa isdà,</i><trans> We came across a school of fish.
</trans></eg>
</sense></hom></entry>");
