INSERT INTO `wced_entry` VALUES (18208, "*tamas", "976", "<entry page=""976"" id=""18208""><form id=""xxtaxmas"" lang=""ceb"">*támas</form>
<entry><form id=""panamastaxmas"" lang=""ceb"">panamastámas</form>
