INSERT INTO `wced_entry` VALUES (18214, "tambag", "976", "<entry page=""976"" id=""18214""><form id=""tambag"" lang=""ceb"">tambag</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> <tr>advise</tr>. </trans>
<eg><i lang=""ceb"">Mitambag ang duktur nga mupahúlay siya,</i><trans> The doctor advised him to rest. </trans></eg>
