INSERT INTO `wced_entry` VALUES (18221, "tambalulu, tambaluslus", "977", "<entry page=""977"" id=""18221""><form id=""tambaluqluq_tambaluslus"" lang=""ceb"">tambalùlù, tambaluslus</form>
