<sense n=""0""> <itype>[A1C; b(1)]</itype><trans> work together sharing the labor, share in expenses. </trans>
<eg><i lang=""ceb"">Dílì siya mutambayáyung sa buluhatun sa balay,</i><trans> He does not <tr>help out</tr> with household chores. </trans></eg>
<eg><i lang=""ceb"">Nagtambayáyung mi sa ábang,</i><trans> We each pay a share of the rent. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> one whom one works together with to accomplish s.t. </trans>
</sense></hom>
