INSERT INTO `wced_entry` VALUES (18242, "tambug", "977", "<entry page=""977"" id=""18242""><form id=""tambug"" lang=""ceb"">tambug</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> throw s.t. heavy or bulky into s.t. deep. </trans>
<eg><i lang=""ceb"">Silay mitambug sa gipatay sa <pb n=""978""/>dágat,</i><trans> They threw the murder victim into the sea. </trans></eg>
<eg><i lang=""ceb"">Maáyu itambug sa pangpang ning gubaung kutsi,</i><trans> Better throw this rickety car over the cliff. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> give animals feed or fodder. </trans>
<eg><i lang=""ceb"">Tambúgi lang ug pakpak ang kábaw,</i><trans> Just give corn husks to the carabao. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> drop a coin into a piggy bank. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[B12; b8]</itype><trans> <tr>fall</tr>. </trans>
<eg><i lang=""ceb"">Ubang búnga matambug ug mahinug,</i><trans> Some fruits fall when ripe. </trans></eg>
<eg><i lang=""ceb"">Natambug ang bátà sa hagdanan,</i><trans> The child fell down the stairs.
</trans></eg>
</sense></hom></entry>");
