INSERT INTO `wced_entry` VALUES (18243, "tambuk1", "978", "<entry page=""978"" id=""18243""><form id=""tambuk"" lang=""ceb"">tambuk<sub>1</sub></form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>fat</tr>. </trans>
<eg><i lang=""ceb"">Bábuyng tambuk,</i><trans> A fat pig. </trans></eg>
<eg><i lang=""ceb"">Paridyǔs kay tambuk ka ra,</i><trans> Go on a diet because you’re too fat. </trans></eg>
<eg><i lang=""ceb"">Tambuk pay dyís, miswa,</i><trans> Thinner than a dime, a <corr sic=""noddle"">noodle</corr>. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> fertile soil. </trans>
<eg><i lang=""ceb"">Tambuk ang yútang daplin sa subà,</i><trans> The soil near the riverbank is fertile. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> growing vigorously, lush. </trans>
<eg><i lang=""ceb"">Tambuk ang tanum inabunúhan,</i><trans> Fertilized plants are vigorous. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[BN; b3(1)]</itype><trans> get fat. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[B; b3(1)]</itype><trans> become fertile, vigorous in growth. </trans>
<eg><i lang=""ceb"">Makahayblad ang pagsingárig káug tambuk,</i><trans> You can get high blood pressure from eating fat all the time. </trans></eg>
</sense></hom>
<entry><form id=""tambuk_nga_nagdaxg_luib"" lang=""ceb""><abbr expan=""tambuk"" type=""lemma"">—</abbr> nga nagdág luib</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> fat but sickly person. </trans>
</sense></hom></entry>
<entry><form id=""tambuk_ug_ang_sulti_manulti"" lang=""ceb""><abbr expan=""tambuk"" type=""lemma"">—</abbr> ug, ang sulti, manulti</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> exaggerating, bragging. </trans>
<eg><i lang=""ceb"">Dílì katuúhan nang tawhána kay tambuk nà ug sulti,</i><trans> You can’t believe him because he is a braggart. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A12; a12]</itype><trans> <tr>brag</tr> or <tr>exaggerate</tr>.
</trans>
</sense></hom></entry></entry>");
