<sense n=""1""><number>1</number><trans> <tr>shield</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> s.t. used as defense. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13; c6]</itype><trans> use a shield. </trans>
<eg><i lang=""ceb"">Naigù siya kay wà magtaming,</i><trans> He was hit because he didn’t use a shield.
</trans></eg>
</sense></hom></entry>");
