INSERT INTO `wced_entry` VALUES (18274, "tamislat", "979", "<entry page=""979"" id=""18274""><form id=""tamislat"" lang=""ceb"">tamislat</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <corr><number>1</number> </corr>k.o. brachiopod found burrowing in the sand, used in soup. </trans>
