INSERT INTO `wced_entry` VALUES (18276, "tampa, tampa1", "979", "<entry page=""979"" id=""18276""><form id=""tampa_tampaq"" lang=""ceb"">tampa, tampà<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a1]</itype><trans> put a ladle into s.t. that is boiling over to settle it. </trans>
<eg><i lang=""ceb"">Way nitampà sa linúgaw pagbúkal,</i><trans> Nobody came to take care of the porridge when it boiled over.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (18276, "tampa", "tampa", "s", "v");
