INSERT INTO `wced_entry` VALUES (18277, "tampa2", "979", "<entry page=""979"" id=""18277""><form id=""tampaq2"" lang=""ceb"">tampà<sub>2</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c]</itype><trans> cover or patch an opening with a flat sheet. </trans>
<eg><i lang=""ceb"">Tampái lang ug kartun ang lungag,</i><trans> Just cover the hole with a piece of cardboard. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A3P; c1]</itype><trans> lay s.t. flat over another flat surface. </trans>
<eg><i lang=""ceb"">Ang lubut sa aparadur wà mutampà sa salug,</i><trans> The bottom part of the cabinet did not lay flat on the floor. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; a1]</itype><trans> flatten or strike with the palm of the hand. </trans>
<eg><i lang=""ceb"">Tampáun ta ang íyang dughan kun nagginhawa pa ba,</i><trans> Let us press the palm of our hands to his breast to see if he is still breathing.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (18277, "tampà", "tampa", "s", "v");
INSERT INTO `wced_entry` VALUES (18278, "tampa3", "979", "<entry page=""979"" id=""18278""><form id=""tampaq3"" lang=""ceb"">tampà<sub>3</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>bride price</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
