INSERT INTO `wced_entry` VALUES (18280, "tampak", "979", "<entry page=""979"" id=""18280""><form id=""tampak"" lang=""ceb"">tampak</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> square, straight on the path or focus of. </trans>
<eg><i lang=""ceb"">Nahúlug ang butung tampak sa íyang úlu,</i><trans> The coconut fell smack on his head. </trans></eg>
<eg><i lang=""ceb"">Tampak sa habágat ang baybáyun sa Talísay,</i><trans> The southwest wind blows squarely across the beach at Talisay.
</trans></eg>
</sense></hom></entry>");
