INSERT INTO `wced_entry` VALUES (18281, "tampal", "979", "<entry page=""979"" id=""18281""><form id=""tampal"" lang=""ceb"">tampal</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b]</itype><trans> overlay a patch on clothing at places of great wear to add strength. </trans>
<eg><i lang=""ceb"">Gitampálan nákù ang samput sa purul,</i><trans> I put a patch on the seat of the short pants.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (18281, "tampal", "tampal", "m", "v");
INSERT INTO `wced_entry` VALUES (18282, "tampalas", "979", "<entry page=""979"" id=""18282""><form id=""tampaxlas"" lang=""ceb"">tampálas</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AN; b(1)]</itype><trans> maltreat severely. </trans>
<eg><i lang=""ceb"">Mutampálas (manampálas) sa asáwa ang bánang palahúbug,</i><trans> A drunkard husband maltreats his wife. </trans></eg>
</sense></hom>
<entry><form id=""tampalasan"" lang=""ceb""><abbr expan=""tampalasan"" type=""lemma"">-an</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> s.o. who maltreats. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>foul-mouthed</tr>, obscene in speech. </trans>
<eg><i lang=""ceb"">Tampásan siyang manulti báhig babáyi,</i><trans> He speaks obscenely about women. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B12; b6]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> become severely abusive toward s.o. </trans>
<eg><i lang=""ceb"">Nagkatampásan ang way uwaw nga inaína,</i><trans> The shameless stepmother is getting more and more abusive. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> become foul-mouthed.
</trans>
</sense></hom></entry></entry>");
