INSERT INTO `wced_entry` VALUES (18283, "tampaling", "979", "<entry page=""979"" id=""18283""><form id=""tampaling"" lang=""ceb"">tampaling</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; ab2]</itype><trans> slap the face. </trans>
<eg><i lang=""ceb"">Walà kay katungud mutampaling nákù,</i><trans> You had no right to slap me in the face. </trans></eg>
<eg><i lang=""ceb"">Kaáyu giyud níyang tampalingun,</i><trans> How nice it would be to slap her in the face. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>slap in the face</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> insult like a slap in the face.
</trans>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (18283, "tampaling", "tampaling", "m", "vn");
INSERT INTO `wced_translation` (entryid, translation) VALUES (18283, "slap in the face");
