INSERT INTO `wced_entry` VALUES (18285, "tamparus", "979", "<entry page=""979"" id=""18285""><form id=""tamparus"" lang=""ceb"">tamparus</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A12; c1]</itype><trans> do s.t. hurriedly and carelessly. </trans>
<eg><i lang=""ceb"">Ug tamparusun (itamparus) ninyu pagtáud ang bungbung mangatangtang lang nà dáyun,</i><trans> If you put the wall up hurriedly and carelessly, it will get loose right away. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; ab2]</itype><trans> slap the face hard. </trans>
<eg><i lang=""ceb"">Tamparusun ta kag magtubagtubag ka,</i><trans> I’ll slap you in the face if you talk back. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> hard slap in the face. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>insult</tr>. </trans>
<eg><i lang=""ceb"">Tamparus álang kanátù ang íyang pagbalíbad,</i><trans> His refusal is a slap on the face.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (18285, "tamparus", "tamparus", "m", "vn");
INSERT INTO `wced_translation` (entryid, translation) VALUES (18285, "insult");
INSERT INTO `wced_entry` VALUES (18286, "tampi", "979", "<entry page=""979"" id=""18286""><form id=""tampi"" lang=""ceb"">tampi</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> bank of a body of water. </trans>
</sense>
<sense n=""2""><number>2</number><trans> edge of a surface. </trans>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>nearby</tr>, close by. </trans>
<eg><i lang=""ceb"">Ang kumbintu <pb n=""980""/>tampi sa simbahan,</i><trans> The convent is near the church. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> close to the edge. </trans>
<eg><i lang=""ceb"">Tampi ra kaáyung pagbutang mu sa básu sa lamísa. Mahū́g,</i><trans> You put the glass much too close to the edge of the table. It’s going to fall.
</trans></eg>
</sense></hom></entry>");
