INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (18287, "tampì", "tampi", "s", "");
INSERT INTO `wced_entry` VALUES (18288, "tampi2", "980", "<entry page=""980"" id=""18288""><form id=""tampiq2"" lang=""ceb"">tampì<sub>2</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c1]</itype><trans> tuck a piece of cloth into another to hold it in place, e.g. a shirt that sticks out or s.t. wrapped around the waist. </trans>
<eg><i lang=""ceb"">Tampía (itampì) ang karsúnis kay luag ang hawakan,</i><trans> Fold your trousers and tuck in the folds because they are loose at the waist.
</trans></eg>
</sense></hom></entry>");
