INSERT INTO `wced_entry` VALUES (18289, "tampihak", "980", "<entry page=""980"" id=""18289""><form id=""tampihak"" lang=""ceb"">tampihak</form>
<hom>
<sense n=""0""><trans> (from <ix>pihak</ix>) </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>temple</tr> of the head. </trans>
</sense>
<sense n=""2""><number>2</number><trans> severe headache on one side of the head. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[a4b4]</itype><trans> get a headache of this sort.
</trans>
</sense></hom></entry>");
