INSERT INTO `wced_translation` (entryid, translation) VALUES (18289, "temple");
INSERT INTO `wced_entry` VALUES (18290, "tampil", "980", "<entry page=""980"" id=""18290""><form id=""tampil"" lang=""ceb"">tampil</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> milled or pounded rice. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> cook rice. </trans>
<eg><i lang=""ceb"">Nakatampil ka nag ipaniudtu?</i><trans> Have you cooked rice for lunch? </trans></eg>
<eg><i lang=""ceb"">Dì nátù tampílun ang paniudtu kay dì paígù ang usa ka litru,</i><trans> Let’s not have rice for lunch because a liter isn’t enough.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (18290, "tampil", "tampil", "m", "nv");
INSERT INTO `wced_entry` VALUES (18291, "tamping", "980", "<entry page=""980"" id=""18291""><form id=""tamping"" lang=""ceb"">tamping</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> flat cake made of fine corn flour (<ix>tiktik</ix>) or buri flour (<ix>unaw</ix>) mixed with coconut milk and sugar. It is either fried in coconut oil or wrapped in banana leaves and put over live embers. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> make this sort of cake.
</trans>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (18291, "tamping", "tamping", "m", "nv");
INSERT INTO `wced_entry` VALUES (18292, "tampipi", "980", "<entry page=""980"" id=""18292""><form id=""tampixpiq"" lang=""ceb"">tampípì</form>
