</trans>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (18292, "tampípì", "tampipi", "m", "nv");
INSERT INTO `wced_entry` VALUES (18293, "tampiri", "980", "<entry page=""980"" id=""18293""><form id=""tampiri"" lang=""ceb"">tampiri</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B; c1]</itype><trans> <tr>lean</tr>, <tr>tilt</tr>. </trans>
<eg><i lang=""ceb"">Mitampiri (natampiri) ang lubi sa paghángin ug kusug,</i><trans> The coconut tree tilted during the strong wind. </trans></eg>
<eg><i lang=""ceb"">Kun magtanum kag kamúting káhuy, tampiriha (itampiri) ang láwas sa yútà,</i><trans> When you plant cassava, plant the stem into the ground at an angle.
</trans></eg>
</sense></hom></entry>");
