INSERT INTO `wced_translation` (entryid, translation) VALUES (18293, "lean");
INSERT INTO `wced_translation` (entryid, translation) VALUES (18293, "tilt");
INSERT INTO `wced_entry` VALUES (18294, "tampu", "980", "<entry page=""980"" id=""18294""><form id=""tampu"" lang=""ceb"">tampu</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AB3C; ac]</itype><trans> join in a group, <tr>put together</tr>. </trans>
<eg><i lang=""ceb"">Kinsay nagtampu íning bulingun sa inutaw?</i><trans> Who put this dirty laundry together with the ironed things? </trans></eg>
<eg><i lang=""ceb"">Tampúha lang ang tanan arun usa ray sudlanan,</i><trans> Put them all together so there will be just one container. </trans></eg>
<eg><i lang=""ceb"">Itampu nang bakláa sa mga babáyi,</i><trans> Put that sissy together with the girls. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c]</itype><trans> give a contribution. </trans>
<eg><i lang=""ceb"">Magtampu (magtampuhay) ta pára sa parti,</i><trans> Let’s contribute for the party. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; c]</itype><trans> contribute to a publication. </trans>
<eg><i lang=""ceb"">Sugilánun ákung itampu sa sunud gulà,</i><trans> I’ll contribute a short story for the next issue. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number> <itype>[A; c]</itype><trans> send in an entry to a contest. </trans>
<eg><i lang=""ceb"">Gitampu námù ang basíyung káha sa sigarilyu,</i><trans> We sent the empty cigarette packs as entries to the contest. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>contribution</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> entry in a contest. </trans>
</sense></hom>
<entry><form id=""tampuhan"" lang=""ceb"">tampuhan</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> contribute to s.t. regularly. </trans>
<eg><i lang=""ceb"">Magtampuhan siya sa Bisayà,</i><trans> He contributes regularly to Bisaya. </trans></eg>
</sense></hom></entry>
<entry><form id=""tampuhay"" lang=""ceb"">tampuhay</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#tampu""><sc>tampu</sc></xr>.<pb n=""980""/>
</trans>
</sense></hom></entry>
<entry><form id=""matampuxhun"" lang=""ceb"">matampúhun</form>
<hom>
<sense n=""0"">
<eg><i lang=""ceb"">a</i><trans> <tr>generous</tr> in contributing.
</trans></eg>
