INSERT INTO `wced_entry` VALUES (18296, "tampuk2", "980", "<entry page=""980"" id=""18296""><form id=""tampuk2"" lang=""ceb"">tampuk<sub>2</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c1]</itype><trans> gather and <tr>dump</tr> into s.t. </trans>
<eg><i lang=""ceb"">Ang mutsatsa mauy nagtampuk sa mga bulingun sa planggána,</i><trans> The maid put the dirty laundry into the basin. </trans></eg>
<eg><i lang=""ceb"">Tampúkun (itampuk) ku ang mga basíyung láta sa dakung kahun,</i><trans> I will dump the empty cans into the big box.
</trans></eg>
</sense></hom></entry>");
