INSERT INTO `wced_entry` VALUES (18297, "tampulung", "980", "<entry page=""980"" id=""18297""><form id=""tampulung"" lang=""ceb"">tampulung</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B56]</itype><trans> <tr>loom</tr>, <tr>stand out</tr> large. </trans>
<eg><i lang=""ceb"">Dúnay dakung batu nga nagtampulung daplin sa likuánan sa dálan,</i><trans> There is a huge rock looming at the side of the road at the bend. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b6c1]</itype><trans> pile or heap stones. </trans>
<eg><i lang=""ceb"">Magtampulung siyag mga batu líbut sa ílang balay,</i><trans> He will pile stones around their house as a wall. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> large rock or pile of stones that stands prominently in the middle of the sea, protruding or immersed under shallow water. </trans>
</sense>
<sense n=""2""><number>2</number><trans> a dike of piled stones in the sea, constructed to trap fish behind it when the tide goes out.
</trans>
</sense></hom></entry>");
