INSERT INTO `wced_entry` VALUES (18308, "tamud", "981", "<entry page=""981"" id=""18308""><form id=""tamud"" lang=""ceb"">tamud</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a12]</itype><trans> <tr>obey</tr>; perform s.t. in obedience. </trans>
<eg><i lang=""ceb"">Ang Kristiyánus magtamud giyud sa súgù sa Diyus,</i><trans> A Christian must obey the law of God. </trans></eg>
<eg><i lang=""ceb"">Tamdun ku ang tanan mung pagmandù,</i><trans> I will obey all your orders. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> abide by one’s word, fulfill one’s promises. </trans>
<eg><i lang=""ceb"">Kinahanglang magtamud ka sa átung gikasabútan,</i><trans> You should abide by our agreement. </trans></eg>
</sense>
<sense n=""1b""><number>1b</number> <itype>[A3; a12]</itype><trans> give <tr>respect</tr> to s.t. by heeding it. </trans>
<eg><i lang=""ceb"">Ángay ka nga magtamud sa pahimangnù sa ímung mga ginikánan,</i><trans> You must respect the advice of your parents. </trans></eg>
</sense>
<sense n=""1c""><number>1c</number> <itype>[A; a12]</itype><trans> observe a custom, feast day. </trans>
<eg><i lang=""ceb"">Uban nga mga táwu dílì magtamud sa adlaw nga iglilíhi,</i><trans> Some people do not observe holidays of obligation. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A13; a12]</itype><trans> <tr>respect</tr>. </trans>
<eg><i lang=""ceb"">Magtinarung ta arun tamdun sa átung isigkatáwu,</i><trans> We must deport ourselves in an honest fashion if we are to be respected by our fellowmen. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; a12]</itype><trans> gaze at s.t. with attention or intent. </trans>
<eg><i lang=""ceb"">Ug magkupya ka, tamda sígi ang pahina,</i><trans> When you copy, keep looking at the page. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A; b(1)]</itype><trans> guide oneself by s.t. </trans>
<eg><i lang=""ceb"">Sa mísa karun dílì na kinahanglang mutamud ug misal,</i><trans> Nowadays, it is not necessary to read the missal during the mass. </trans></eg>
<eg><i lang=""ceb"">Nagtamud siya sa margáti sistim,</i><trans> He is following the margate system of planting. </trans></eg>
<eg><i lang=""ceb"">Tamdi ang libru inigtubag nímu,</i><trans> Refer to the book when you recite. </trans></eg>
</sense>
<sense n=""4a""><number>4a</number> <itype>[A13; b(1)]</itype><trans> <tr>copy</tr>, <tr>trace</tr> off from. </trans>
<eg><i lang=""ceb"">Ayaw ug tamdi ang libru kay mulamà ang ági,</i><trans> Don’t trace on top of the book because it will leave a mark. </trans></eg>
</sense>
<sense n=""4b""><number>4b</number> <itype>[b(1)]</itype><trans> mark s.t. for easy reference. </trans>
<eg><i lang=""ceb"">Sayun ra nga bulúngun ang dápit sa sugilánun kay ákung gitamdan ang pahina,</i><trans> It is easy to locate the part of the story because I marked the page. </trans></eg>
</sense>
<sense n=""4c""><number>4c</number> <itype>[b(1)]</itype><trans> <tr>remember</tr>, make a <tr>note</tr> of. </trans>
<eg><i lang=""ceb"">Tamdi ni, Wà pa giyud aku masayup niíning mga butánga,</i><trans> Take note of this: I have never made a mistake in these matters. </trans></eg>
</sense></hom>
<entry><form id=""tinamud"" lang=""ceb""><abbr expan=""tinamud"" type=""lemma"">-in-</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>respectable</tr> person. </trans>
<eg><i lang=""ceb"">Tinamud nga mga dinápit,</i><trans> <tr>Respected</tr> guests. </trans></eg>
</sense></hom></entry>
<entry><form id=""talamdan_tamdanan"" lang=""ceb"">talamdan, tamdanan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> basic <corr sic=""buide"">guide</corr>, rules, and regulations to follow. </trans>
<eg><i lang=""ceb"">Mau niy talamdan ug maggansilyu ka ug bidsprid,</i><trans> This is the instruction sheet to crochet a bedspread by. </trans></eg>
</sense></hom></entry>
<entry><form id=""talamdun"" lang=""ceb"">talamdun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> worthy of being respected, revered. </trans>
</sense></hom></entry>
<entry><form id=""matinamdaxnun"" lang=""ceb"">matinamdánun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> characterized with faithful and regular observance of customs. </trans>
<eg><i lang=""ceb"">Rilihiyúsa siya ug matinamdánun sa mga pista sa simbahan,</i><trans> She is religious and keeps good observance of church holidays.
</trans></eg>
</sense></hom></entry></entry>");
