INSERT INTO `wced_entry` VALUES (18315, "tan", "981", "<entry page=""981"" id=""18315""><form id=""tan"" lang=""ceb"">tan</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> short for <ix>kapitan</ix>. </trans>
</sense>
