INSERT INTO `wced_entry` VALUES (18318, "tanan", "981", "<entry page=""981"" id=""18318""><form id=""tanan"" lang=""ceb"">tanan</form>
<hom>
<sense n=""0""><trans> (from <ix>ngatanan</ix>) </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>all</tr>, <tr>everyone</tr>. </trans>
<eg><i lang=""ceb"">Tanan tsukuláti ang kík,</i><trans> The cake is all chocolate. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>in all</tr>. </trans>
<eg><i lang=""ceb"">Dúsi tanan ang ákung anak,</i><trans> I have twelve children in all. </trans></eg>
<eg><i lang=""ceb"">Ginadápit ang tanan sa prugráma,</i><trans> Everybody is invited to the program. </trans></eg>
</sense></hom>
<entry><form id=""sa_tanan"" lang=""ceb"">sa <abbr expan=""tanan"" type=""lemma"">—</abbr></form>
<hom>
<sense n=""0""><trans> most, greatest in degree, magnitude (but less than <ix>sa ngatanan</ix>). </trans>
<eg><i lang=""ceb"">Maldítu siya sa tanan,</i><trans> He’s the naughtiest of the naughty. </trans></eg>
<eg><i lang=""ceb"">Tabian sa tanang tabian,</i><trans> The most talkative of all talkative ones.
</trans></eg>
</sense></hom></entry></entry>");
