INSERT INTO `wced_entry` VALUES (18321, "tanda2", "982", "<entry page=""982"" id=""18321""><form id=""tandaq2"" lang=""ceb"">tandà<sub>2</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>sign</tr> or <tr>mark</tr> which indicates s.t. </trans>
<eg><i lang=""ceb"">Ang búlak nga íyang gihátag mauy tandà nga siya nagmahal,</i><trans> The flower that he gave is a sign that he cares. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b6(1)]</itype><trans> <tr>mark</tr>, put a mark on, esp. for identification. </trans>
<eg><i lang=""ceb"">Si Pápa ang nagtandà sa mga lubi nga amúa,</i><trans> Father marked the coconut trees that were ours. </trans></eg>
<eg><i lang=""ceb"">Tandái ang átung mga dalhunun,</i><trans> Put identifying marks on our baggage. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A12]</itype><trans> <tr>remember</tr>, <tr>recollect</tr>. </trans>
<eg><i lang=""ceb"">Wà ku makatandà nga nag-áway mi,</i><trans> I don’t remember a time that we quarrelled. </trans></eg>
</sense></hom>
<entry><form id=""talandaan"" lang=""ceb""><abbr expan=""talandaan"" type=""lemma"">-l-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>indicator</tr>. </trans>
<eg><i lang=""ceb"">Ang rilu mauy talandaan sa úras,</i><trans> A watch is an indicator of time.
</trans></eg>
</sense></hom></entry></entry>");
