INSERT INTO `wced_entry` VALUES (18322, "tandang", "982", "<entry page=""982"" id=""18322""><form id=""tandang"" lang=""ceb"">tandang</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b26(1)]</itype><trans> for the sun or moon to shine. </trans>
<eg><i lang=""ceb"">Bísan dì pa mutandang ang adlaw, túa na siya sa uma,</i><trans> The sun hadn’t shone yet but he was already in the field. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A]</itype><trans> for light to hit or shine upon. </trans>
<eg><i lang=""ceb"">Pulis ang nagtandang sa ímung nawung,</i><trans> It was a policeman who beamed a light in your face.
</trans></eg>
</sense></hom></entry>");
