INSERT INTO `wced_entry` VALUES (18328, "tandug", "982", "<entry page=""982"" id=""18328""><form id=""tandug"" lang=""ceb"">tandug</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A13; a1b2]</itype><trans> touch s.t. lightly to disturb it. </trans>
<eg><i lang=""ceb"">Dinhà giyuy nagtandug sa rúsas kay nabálì ang sanga,</i><trans> S.o. must have <tr>brushed against</tr> the rosebush because a branch is broken. </trans></eg>
<eg><i lang=""ceb"">Ayaw siya tandúga kay natúlug na,</i><trans> Don’t <tr>touch</tr> her because she is asleep. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> touch a wound. </trans>
<eg><i lang=""ceb"">Ayaw ug apil sa dúlà kay hitandugan (hingtandugan) nyà ang ímung samad,</i><trans> Don’t take part in the game because s.o. might strike your wound. </trans></eg>
</sense>
<sense n=""1b""><number>1b</number> <itype>[a3]</itype><trans> produce an effect, <tr>affect</tr>. </trans>
<eg><i lang=""ceb"">Bísan ug kusugkusug tung hangína, ang barku walà matandug,</i><trans> The wind was quite strong, but it did not affect the boat. </trans></eg>
</sense>
<sense n=""1c""><number>1c</number> <itype>[A; a2]</itype><trans> for fish to bite a line. </trans>
<eg><i lang=""ceb"">Gitandugan siya, apan wà makúhà,</i><trans> A fish bit his line, but he didn’t catch it. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A12; a12]</itype><trans> touch s.t. in the process of using it. </trans>
<eg><i lang=""ceb"">Wà gánì siya makatandug sa íyang pagkáun,</i><trans> He hasn’t even touched his food. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; a12]</itype><trans> do s.t. to interfere with one’s thoughts, decisions, plans. </trans>
<eg><i lang=""ceb"">Ang disisiyun sa kuymi dílì matandug,</i><trans> The umpire’s decision is final. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number> <itype>[A3P; a3]</itype><trans> move s.o. to have sympathetic feelings or pity. </trans>
<eg><i lang=""ceb"">Way kasingkásing nga dílì matandug adtung mga pulúnga,</i><trans> No heart could fail to be touched by those words. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A13; a12]</itype><trans> <tr>touch on</tr> past events. </trans>
<eg><i lang=""ceb"">Dílì tà ángay nga magtandug sa inyung miáging kabangían,</i><trans> You ought not to touch on what <pb n=""983""/>you quarrelled about long ago. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[AP; a2b8]</itype><trans> cause a <tr>relapse</tr> of an illness or injury. </trans>
<eg><i lang=""ceb"">Natandug ang piang,</i><trans> His broken bone broke again. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> pull on the line when fish bite. </trans>
</sense></hom>
<entry><form id=""talandugun"" lang=""ceb""><abbr expan=""talandugun"" type=""lemma"">-l-un(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>critical</tr>, <tr>grave</tr> in health or condition. </trans>
<eg><i lang=""ceb"">Ang masakitun náa sa talandugun nga kahimtang,</i><trans> The patient is in a grave condition. </trans></eg>
<eg><i lang=""ceb"">Tandugun ang kahimtang sa Mídul Ist,</i><trans> The situation in the Middle East is critical. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> prone to sickness. </trans>
<eg><i lang=""ceb"">Tandugun siya. Hilantan lang, magkumbulsiyun dáyun,</i><trans> He is prone to sickness. Even if he has just a slight fever, it turns to convulsions. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>touchy</tr>, <tr>temperamental</tr>. </trans>
<eg><i lang=""ceb"">Paabúta nga maáyu siya kay tandugun nang íyang kinaíya,</i><trans> Wait until he is in a better mood because he is a bit temperamental right now. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> subject to question, reconsideration. </trans>
<eg><i lang=""ceb"">Hukum nga talandugun,</i><trans> A decision open to question. </trans></eg>
</sense></hom></entry>
<entry><form id=""pagtandug"" lang=""ceb""><abbr expan=""pagtandug"" type=""lemma"">pag-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>test</tr>, <tr>trial</tr>. </trans>
<eg><i lang=""ceb"">Kadtung hitabúa mga pagtandug lámang sa usa ka táwu nga gikasináhan,</i><trans> That event is just a trial for you because you are the object of envy. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> strike, act of taking the bait. </trans>
<eg><i lang=""ceb"">Sa ikaduhang pagtandug napaktan sa bàbà ang isdà sa tagà,</i><trans> On the second strike, the fish was hooked in the mouth.
</trans></eg>
</sense></hom></entry></entry>");
