INSERT INTO `wced_entry` VALUES (18334, "tangag, tangag", "983", "<entry page=""983"" id=""18334""><form id=""tangag_taxngag"" lang=""ceb"">tangag, tángag</form>
<hom role=""v""><pos>v</pos>
