INSERT INTO `wced_entry` VALUES (18345, "tangdi", "983", "<entry page=""983"" id=""18345""><form id=""tangdiq"" lang=""ceb"">tangdì</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AC2; ac]</itype><trans> <tr>compare</tr> which is greater in degree, quality or size. </trans>
<eg><i lang=""ceb"">Way makatandì (makagtandì) sa íyang kaanyag,</i><trans> Nothing can compare with her beauty. </trans></eg>
<eg><i lang=""ceb"">Makigtandì ka nákù sa katas-un?</i><trans> You want to compare <pb n=""984""/>your height with mine? </trans></eg>
<eg><i lang=""ceb"">Tandía ang duruha kun háin ang mas putì,</i><trans> Compare the two to see which one is lighter in complexion. </trans></eg>
<eg><i lang=""ceb"">Way sarang ikatandì (ikagtandì) kang Risal,</i><trans> There is no one who can be compared with Rizal. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A12C; c1]</itype><trans> match fighting cocks for a cockfight. </trans>
<eg><i lang=""ceb"">Natandian ang íyang ugis ug buyugun,</i><trans> His white-feathered cock was paired with a honey-colored one. </trans></eg>
</sense></hom>
<entry><form id=""tangdiay"" lang=""ceb""><abbr expan=""tangdiay"" type=""lemma"">-ay</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[C; c3]</itype><trans> compare with each other.
</trans>
</sense></hom></entry></entry>");
