<eg><i lang=""ceb"">Tandúan gánì ka nákù, byái mi,</i><trans> When I nod at you, leave us alone. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2; a2]</itype><trans> <tr>consent</tr> to, <tr>accept</tr>. </trans>
<eg><i lang=""ceb"">Tandúa nang íyang paghálad,</i><trans> Accept his proposal. </trans></eg>
</sense></hom>
