INSERT INTO `wced_entry` VALUES (18348, "tanggab", "984", "<entry page=""984"" id=""18348""><form id=""tanggab"" lang=""ceb"">tanggab</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A3P; a1]</itype><trans> cut s.t. down clean, usually with one stroke. </trans>
<eg><i lang=""ceb"">Nananggab ang mag-uúma sa kasagingang gialkuhíris,</i><trans> The farmer is cutting down the bananas that are infected with a mosaic disease. </trans></eg>
