INSERT INTO `wced_entry` VALUES (18355, "tanggung", "984", "<entry page=""984"" id=""18355""><form id=""tanggung"" lang=""ceb"">tanggung</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c1]</itype><trans> <tr>incarcerate</tr>. </trans>
<eg><i lang=""ceb"">Itanggung ang kriminal arun pagpanalípud sa susyidad,</i><trans> Criminals are <tr>jailed</tr> to protect society. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b1]</itype><trans> raise an animal for slaughter on a special occasion. </trans>
<eg><i lang=""ceb"">Magtanggung kug bábuy pára sa sunud pista,</i><trans> I’ll raise a pig for next fiesta. </trans></eg>
<eg><i lang=""ceb"">Tanggúngi nang baktin pára sa inyung kasal,</i><trans> Raise that piglet for your wedding. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B126; b8]</itype><trans> be stranded, maneuvered into a place with no exit. </trans>
<eg><i lang=""ceb"">Sulug mauy nakatanggung (nakapatanggung) námù sa isla,</i><trans> The strong current caused us to get stranded on the island. </trans></eg>
<eg><i lang=""ceb"">Ang batalyun natanggung sa kimba,</i><trans> The battalion was trapped in the gully. </trans></eg>
</sense></hom>
<entry><form id=""tanggungan"" lang=""ceb""><abbr expan=""tanggungan"" type=""lemma"">-an(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> place one keeps an animal he is raising.
</trans>
</sense></hom></entry></entry>");
