INSERT INTO `wced_entry` VALUES (18366, "tangka", "984", "<entry page=""984"" id=""18366""><form id=""tangkaq"" lang=""ceb"">tangkà</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b6]</itype><trans> set to do s.t. </trans>
<eg><i lang=""ceb"">Mutangkà kug alas syíti sa buntag sa ákung trabáhu,</i><trans> I set to work at seven o’clock in the morning. </trans></eg>
<eg><i lang=""ceb"">Gitangkaan níla ang usa ka litsun ug nahurut,</i><trans> They set to eating a roast pig, and they finished it off. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[AN; b]</itype><trans> go s.w. to do work, usually the <ix>aláyun</ix>. </trans>
<eg><i lang=""ceb"">Tangkái intáwun kug usa ka adlawng dáru,</i><trans> Please come to my place to plow for one day. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A]</itype><trans> reach an entrance, vicinity of a place. </trans>
</sense>
<sense n=""2a""><number>2a</number> <itype>[C23]</itype><trans> agree to meet to do s.t. </trans>
<eg><i lang=""ceb"">Nagtangkà silang mangalígù sa Sabadu,</i><trans> They agreed to meet to go swimming on Saturday. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; c]</itype><trans> <tr>place on</tr>, <tr>set upon</tr>. </trans>
<eg><i lang=""ceb"">Nakatulug siyang nagtangkà sa bangkíyu,</i><trans> He fell asleep sitting on the toilet. </trans></eg>
<eg><i lang=""ceb"">Tangkái únà ang sug-ang sa kaldíru únà dagkuti,</i><trans> Place the pot on the stove first before you light it. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> one’s turn to do work in communal rotational work (<ix>aláyun</ix>). </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>feast</tr>, <tr>banquet</tr>. </trans>
<eg><i lang=""ceb"">Makabuhung nga tangkà ang gidúlut níla,</i><trans> They served a sumptuous banquet. <pb n=""985""/></trans></eg>
</sense></hom>
<entry><form id=""hitangkaq_hatangkaq"" lang=""ceb""><abbr expan=""hitangkà"" type=""lemma"">hi-</abbr>/<abbr expan=""hatangkà"" type=""lemma"">ha-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B1256; b2]</itype><trans> <tr>happen on</tr> s.t., come to a place by chance. </trans>
<eg><i lang=""ceb"">Hitangkaan níya ang kawatan nga nangabli sa húnus,</i><trans> He <tr>came upon</tr> the burglar opening the drawers. </trans></eg>
</sense></hom></entry>
<entry><form id=""patangkaq"" lang=""ceb""><abbr expan=""patangkà"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; ab]</itype><trans> have s.o. come to work. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> one’s turn to have people come to work in communal rotational work. </trans>
</sense></hom></entry>
<entry><form id=""panangkaq"" lang=""ceb""><abbr expan=""panangkà"" type=""lemma"">paN-</abbr></form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#tangkaq""><sc>tangkà</sc></xr>, <i lang=""ceb"">v1a, n1.</i>
</trans>
</sense></hom></entry></entry>");
