INSERT INTO `wced_entry` VALUES (18370, "tangkas", "985", "<entry page=""985"" id=""18370""><form id=""tangkas"" lang=""ceb"">tangkas</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> rip open the seam, rip off hinges, and the like. </trans>
<eg><i lang=""ceb"">Nagtangkas siya sa sinínang guut,</i><trans> She’s ripping open the seams of her tight dress. </trans></eg>
<eg><i lang=""ceb"">Natangkas ang pultahan nga gilúgus pag-abli,</i><trans> The door was ripped off its hinges when s.o. forced it open. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[B1256]</itype><trans> <tr>burst at the seams</tr>. </trans>
<eg><i lang=""ceb"">Natangkas ang sáku ug naúsik ang pasì,</i><trans> The sack burst at the seam and the grain spilled out. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>unfasten</tr>, <tr>unhook</tr>. </trans>
<eg><i lang=""ceb"">Gitangkásan níya ang kábaw sa yúgu,</i><trans> He took the yoke off the water buffalo.
</trans></eg>
</sense></hom></entry>");
