INSERT INTO `wced_entry` VALUES (18374, "tangkil", "985", "<entry page=""985"" id=""18374""><form id=""tangkil"" lang=""ceb"">tangkil</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> attach to s.t. so that it dangles. </trans>
<eg><i lang=""ceb"">Tangkíli ug gamayng krus ang kwintas,</i><trans> Attach a small crucifix on the necklace. </trans></eg>
<eg><i lang=""ceb"">Gitangkílan ang patayng irù ug batu ug gitambug sa dágat,</i><trans> They attached a rock to the dead dog and tossed it into the sea. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> carry s.t. attached to the body. </trans>
<eg><i lang=""ceb"">Itangkil sa ímung háwak ang pistúla,</i><trans> Carry the pistol around your waist. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> carry a baby while one is doing s.t. </trans>
<eg><i lang=""ceb"">Bísag magmadyung, túa nagtangkil ug bátà,</i><trans> She carries her baby even while she plays mahjong. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number><trans> for a man to drag along a woman wherever he goes. </trans>
<eg><i lang=""ceb"">Dì nà siya mutangkil sa íyang asáwa kay ábi dì man gwápa,</i><trans> He doesn’t bring his wife along with him because she’s not beautiful.
</trans></eg>
</sense></hom></entry>");
