INSERT INTO `wced_entry` VALUES (18375, "tangkiyu", "985", "<entry page=""985"" id=""18375""><form id=""tangkiyu"" lang=""ceb"">tangkiyu</form>
<hom>
<sense n=""0""><trans> <tr>thank you</tr>. </trans>
<eg><i lang=""ceb"">Tangkiyu kaáyu sa gása, ha?</i><trans> Thank you very much for the gift. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; a2]</itype><trans> say thank you. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A23; a2]</itype><trans> just say thanks without giving money. </trans>
<eg><i lang=""ceb"">Dimálas giyud kun tangkiyúhun lang ang átung panaygun,</i><trans> We are out of luck if all we get is a thank you for our caroling.
</trans></eg>
