<sense n=""0""> <itype>[AB16; a1]</itype><trans> be <tr>loosened</tr> from its socket or <tr>detached</tr> from its place, cause s.t. to be so. </trans>
<eg><i lang=""ceb"">Kinsay nagtangsù sa tiil sa silya?</i><trans> Who loosened the legs of the chair? </trans></eg>
<eg><i lang=""ceb"">Natangsù ang kab-ing sa kibídu,</i><trans> One side of the eyeglass frame came off. </trans></eg>
<eg><i lang=""ceb"">Tangsúa úsà ang ngípun únà ibta,</i><trans> <tr>Loosen</tr> the tooth first before you pull it. </trans></eg>
</sense></hom>
<entry><form id=""tangsuqtangsuq"" lang=""ceb"">tangsùtangsù</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B16]</itype><trans> be wobbly after being loosened at its base. </trans>
<eg><i lang=""ceb"">Nagtangsùtangsù ang pasamánu,</i><trans> The handrail is wobbly.
</trans></eg>
</sense></hom></entry></entry>");
