<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AB123; a]</itype><trans> <tr>take off</tr>, <tr>remove</tr> s.t. fastened or tied. </trans>
<eg><i lang=""ceb"">Tabángi kug tangtang sa yúgu sa kábaw,</i><trans> Help me take off the carabao’s yoke. </trans></eg>
<eg><i lang=""ceb"">Nakatangtang ang bábuy sa íyang gihigtan,</i><trans> The pig worked himself loose from the place it was tied. </trans></eg>
