INSERT INTO `wced_entry` VALUES (18392, "tangu", "986", "<entry page=""986"" id=""18392""><form id=""tangu"" lang=""ceb"">tangu</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>canine tooth</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>fang</tr> of animals. </trans>
<eg><i lang=""ceb"">Maáyung anting-anting ang tangu sa buáya,</i><trans> A crocodile’s tooth is a powerful charm. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>cog</tr> of gears. </trans>
</sense></hom>
<entry><form id=""tangu_sa_baxliw_lintiq"" lang=""ceb""><abbr expan=""tangu"" type=""lemma"">—</abbr> sa báliw, lintì</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> in folk belief, the tooth of a thunderbolt that gets lodged in places where it strikes. It possesses a magical power. </trans>
</sense></hom></entry>
<entry><form id=""tang-an"" lang=""ceb"">tang-an</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> highly <tr>unscrupulous</tr>. </trans>
<eg><i lang=""ceb"">Pahiphip giyud kanang mga tang-an sa sitihul,</i><trans> Those unscrupulous people in City Hall have to be bribed. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> tops in one’s field due to experience. </trans>
<eg><i lang=""ceb"">Tang-an siyang magsusúlat sa Binisayà,</i><trans> He is one of the top Visayan writers. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>rich</tr>, <tr>wealthy</tr>. </trans>
<eg><i lang=""ceb"">Nagparti ang mga tang-an sa Maníla Hutil,</i><trans> The oligarchs are having a party at the Manila Hotel.
</trans></eg>
</sense></hom></entry></entry>");
