<sense n=""0""> <itype>[B23(1); b4]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> for liquids to stop flowing. </trans>
<eg><i lang=""ceb"">Mutang-un ang dugù kun baátan siyag turniki,</i><trans> The bleeding will stop if we tie a tourniquet around it. </trans></eg>
</sense>
