<eg><i lang=""ceb"">Mitang-un ang kasukù,</i><trans> His anger <tr>subsided</tr>. </trans></eg>
<eg><i lang=""ceb"">Wà pa giyud makatang-un ang kasábà sa gawas,</i><trans> The noise outside has not stopped. </trans></eg>
<eg><i lang=""ceb"">Kining tambála makatang-un (makapatang-un) sa sakit sa ngípun,</i><trans> This medicine can stop a toothache.
