INSERT INTO `wced_entry` VALUES (18401, "taniag", "986", "<entry page=""986"" id=""18401""><form id=""taniag"" lang=""ceb"">taniag</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> for the day to be bright after being cloudy. </trans>
</sense>
<sense n=""2""><number>2</number><trans> for glass to be shiny and clear. </trans>
</sense>
<sense n=""3""><number>3</number><trans> <tr>clear</tr>, <tr>vivid</tr> in outline. </trans>
<eg><i lang=""ceb"">Taniag kaáyu ang litra kun maggámit kag antiyúhus,</i><trans> The letters become very clear when you use spectacles. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B]</itype><trans> for a gloomy day to <tr>brighten</tr>. </trans>
<eg><i lang=""ceb"">Mutaniag gánì run, pangarmirul giyud,</i><trans> As soon as the sun shines, starch the clothes. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B; c16]</itype><trans> for the face to brighten. </trans>
<eg><i lang=""ceb"">Unsa kahang balitáa nakataniag (nakapataniag) sa íyang nawung?</i><trans> What news could have brightened her face? </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[APB; c1]</itype><trans> for glass to be, become transparent and clear; cause it to become so. </trans>
<eg><i lang=""ceb"">Túbig lang ang magtaniag (magpataniag) ánang lapúkung bildu,</i><trans> Only water will make that muddy pane of glass transparent and clear. </trans></eg>
<eg><i lang=""ceb"">Mutaniag ang básu kun hugásan ug tayid,</i><trans> The glass will become transparent and clear if you wash it with detergent. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A; c1]</itype><trans> <tr>foretell</tr> the past, present, and future. </trans>
<eg><i lang=""ceb"">Taniagun (itaniag) ku ang ímung kaugmáun pinaági sa pagtan-aw sa ímung pálad,</i><trans> I will foretell your future by looking at the palm of your hand. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[A; c1]</itype><trans> peer, peep through s.t. at s.t. else. </trans>
<eg><i lang=""ceb"">Mitaniag <pb n=""987""/>siya sa lungag sa yawihánan,</i><trans> He peeped through the keyhole. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. to peer into to foretell the future.
</trans>
</sense></hom></entry>");
