INSERT INTO `wced_entry` VALUES (18414, "tantu2", "987", "<entry page=""987"" id=""18414""><form id=""tantu2"" lang=""ceb"">tantu<sub>2</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>interest</tr> on money loaned. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2N; b6(1)]</itype><trans> borrow money with interest. </trans>
<eg><i lang=""ceb"">Ug way kwarta, panantu lang,</i><trans> If you’re out of money, borrow. </trans></eg>
<eg><i lang=""ceb"">Tantúhan námù ímung kwarta, dílì libri,</i><trans> We will borrow your money with interest, not for nothing. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[cP]</itype><trans> charge interest. </trans>
<eg><i lang=""ceb"">Pilay ímung itantu (ipatantu)?</i><trans> How much interest do you charge? </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[A; b6]</itype><trans> give, pay interest. </trans>
<eg><i lang=""ceb"">Mutantu kug kinsi pursintu ug pahulam ka nákù,</i><trans> I will pay fifteen percent if you lend me money. </trans></eg>
<eg><i lang=""ceb"">Nagtantu kus singsing nga ákung giprinda,</i><trans> I am paying off the interest on the ring I pawned. </trans></eg>
</sense></hom>
<entry><form id=""patantu"" lang=""ceb""><abbr expan=""patantu"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; bc]</itype><trans> lend money for interest. </trans>
<eg><i lang=""ceb"">Nagpatantu siyag kwarta,</i><trans> He lends money for interest. </trans></eg>
</sense></hom></entry>
<entry><form id=""mananantu"" lang=""ceb""><abbr expan=""mananantu"" type=""lemma"">maN-r-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> one who lends for interest or borrows on interest.
</trans>
</sense></hom></entry></entry>");
