INSERT INTO `wced_entry` VALUES (18415, "tanud1", "987", "<entry page=""987"" id=""18415""><form id=""tanud"" lang=""ceb"">tanud<sub>1</sub></form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>tame</tr>. </trans>
<eg><i lang=""ceb"">Tanud ang íyang langgam maung binuhían,</i><trans> His pet bird is tame so it is not caged. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> for things which are normally elusive to approach, be submissive. </trans>
<eg><i lang=""ceb"">Tanud nímu ang kapaláran,</i><trans> Good fortune does not elude you. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
