INSERT INTO `wced_entry` VALUES (18419, "tan-ug", "987", "<entry page=""987"" id=""18419""><form id=""tan-ug"" lang=""ceb"">tan-ug</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b1]</itype><trans> store mature fruits in such a way as to hasten ripening. </trans>
<eg><i lang=""ceb"">Tan-úgi nang ságing sa sáku,</i><trans> Store the bananas in the sack to ripen. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b5]</itype><trans> keep unused, dormant. </trans>
<eg><i lang=""ceb"">Dúgay natan-ug ang yútà,</i><trans> The land was left unused for a long time. </trans></eg>
<eg><i lang=""ceb"">Ayaw tan-úgi ang ímung puhúnan,</i><trans> Don’t keep your capital unused. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[A; c]</itype><trans> keep coconut juice for a time to ferment it before cooking into oil. </trans>
<eg><i lang=""ceb"">Itan-ug ug mga usa ka adlaw úsà lanáha,</i><trans> Keep and ferment it for about a day before cooking it into oil. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> harbor s.t. in secret. </trans>
<eg><i lang=""ceb"">Dúgay na siyang nagtan-ug ug gugma,</i><trans> He has been harboring a secret love for a long time. </trans></eg>
</sense></hom>
<entry><form id=""tinan-ug"" lang=""ceb""><abbr expan=""tinan-ug"" type=""lemma"">-in-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> raw oil which floats to the surface after the coconut juice has fermented. </trans>
</sense></hom></entry>
<entry><form id=""tinan-uxgan"" lang=""ceb""><abbr expan=""tinan-úgan"" type=""lemma"">-in-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> fruits kept for ripening. </trans>
</sense>
<sense n=""2""><number>2</number><trans> things kept in secret. </trans>
<eg><i lang=""ceb"">Sa ílang áway, nabutyag ang mga tinan-úgan sa kadaghánan,</i><trans> In their quarrel they exposed their secrets to the public. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> = <xr lang=""ceb"" target=""#tinan-ug""><sc><abbr expan=""tinan-ug"" type=""lemma"">-in-</abbr></sc></xr>.
</trans>
</sense></hom></entry></entry>");
