INSERT INTO `wced_entry` VALUES (18423, "tanus", "988", "<entry page=""988"" id=""18423""><form id=""taxnus"" lang=""ceb"">tánus</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[APB; c1]</itype><trans> <tr>straighten</tr>; be, become <tr>straight</tr>. </trans>
<eg><i lang=""ceb"">Siyay mitánus (mipatánus) sa sangang báwug,</i><trans> He straightened the bent branch. </trans></eg>
<eg><i lang=""ceb"">Nagtánus lang nang ímung bukubuku,</i><trans> Your back is certainly straight. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a12]</itype><trans> <tr>discipline</tr>, impose disciplinary measures. </trans>
<eg><i lang=""ceb"">Ang amahan ray makatánus ánang batáa,</i><trans> Only the father can discipline that child. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[B1256]</itype><trans> be <tr>chastened</tr>. </trans>
<eg><i lang=""ceb"">Natánus ang maldítung bátà human malatiguhi,</i><trans> The mischievous child was chastened after he got his whipping. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#tanus""><sc>tanus</sc></xr>. </trans>
</sense></hom>
<entry><form id=""tanus"" lang=""ceb""><abbr expan=""tanus"" type=""lemma"">(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>straight</tr>, not curved or bent. </trans>
<eg><i lang=""ceb"">Tanus nga karsáda,</i><trans> Straight road. </trans></eg>
<eg><i lang=""ceb"">Tanus nga bára,</i><trans> Straight bar.
</trans></eg>
</sense></hom></entry></entry>");
