INSERT INTO `wced_entry` VALUES (18424, "tan-us", "988", "<entry page=""988"" id=""18424""><form id=""tan-us"" lang=""ceb"">tan-us</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> a yellowish swelling in the skin caused by an infection of a wound or sore. </trans>
<eg><i lang=""ceb"">Gitusdikan níyag dágum ang íyang tan-us,</i><trans> He pricked the yellow swelling next to the scratch on his skin with a needle. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B3(1)46; b4]</itype><trans> develop a yellow-colored infection under the skin next to a wound. </trans>
<eg><i lang=""ceb"">Gitan-usan ang íyang núka,</i><trans> His skin ulcers developed yellow swellings on the sides.
</trans></eg>
</sense></hom></entry>");
