INSERT INTO `wced_entry` VALUES (18425, "tanyag", "988", "<entry page=""988"" id=""18425""><form id=""tanyag"" lang=""ceb"">tanyag</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>offer</tr> s.t. for s.o.’s consideration. </trans>
<eg><i lang=""ceb"">Mitanyag siyang ihatud ku,</i><trans> He offered to escort me. </trans></eg>
<eg><i lang=""ceb"">Gitanyagan aku níyag trabáhu,</i><trans> He offered me a job. </trans></eg>
<eg><i lang=""ceb"">Pilay gitanyag sa balay?</i><trans> How much did they offer for the house? </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> offer an opportunity, entertainment. </trans>
<eg><i lang=""ceb"">Kining dúlà itanyag álang sa inyung kalingáwan,</i><trans> This play is offered for your enjoyment. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>offer</tr>.
