INSERT INTO `wced_entry` VALUES (18426, "tap", "988", "<entry page=""988"" id=""18426""><form id=""taxp"" lang=""ceb"">táp</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; a2]</itype><trans> be the tops in an exam. </trans>
<eg><i lang=""ceb"">Siya ang mitáp sa bár,</i><trans> He <tr>topped</tr> the bar exam. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a1]</itype><trans> buy all of s.t. </trans>
<eg><i lang=""ceb"">Akuy mutáp sa ímung mangga,</i><trans> I’ll buy all of those mangoes. </trans></eg>
<eg><i lang=""ceb"">Ákung baratúhun kun tápun nímug palit,</i><trans> I’ll give them cheap if you buy all of them. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[A; a12]</itype><trans> take on all of s.o.’s bet. </trans>
<eg><i lang=""ceb"">Tápun ku bísag pilay inyung pusta,</i><trans> I will take you on no matter how much you bet. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> one who is tops in an exam.
</trans>
</sense></hom></entry>");
