INSERT INTO `wced_entry` VALUES (18427, "tapa", "988", "<entry page=""988"" id=""18427""><form id=""tapa"" lang=""ceb"">tapa</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a2]</itype><trans> smoke fish. </trans>
<eg><i lang=""ceb"">Makatapa kug isdà ug náay ginabas ipaasu,</i><trans> I can smoke fish if there is some sawdust to smoke it with. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A; c6]</itype><trans> broil fish not close to the embers. </trans>
<eg><i lang=""ceb"">Bagul itapa sa isdà,</i><trans> Use coconut shells for broiling the fish. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b(1)]</itype><trans> kiln-dry copra. </trans>
<eg><i lang=""ceb"">Magtapa mi sa kupras kay way ínit,</i><trans> We’ll kiln-dry the copra because there is no sun. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>smoked fish</tr>. </trans>
