INSERT INTO `wced_entry` VALUES (18429, "tapad, tapad", "988", "<entry page=""988"" id=""18429""><form id=""tapad_taxpad"" lang=""ceb"">tapad, tápad</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A3SC; ac]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> stay, put beside s.t. </trans>
<eg><i lang=""ceb"">Nakatapad kug gwápa sa dyíp,</i><trans> I sat beside a pretty girl in the jeep. </trans></eg>
<eg><i lang=""ceb"">Ayaw sila tapára,</i><trans> Don’t put them next to each other. </trans></eg>
<eg><i lang=""ceb"">Itapad nang diksiyunári kun magbásag librung lisud,</i><trans> Put the dictionary beside you when you read a difficult book. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> stay next to s.o. to keep him company. </trans>
<eg><i lang=""ceb"">Bisan dì ka mukáun, tapari ku diri,</i><trans> Even if you don’t eat anything, sit here to keep me company. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> s.o. sitting beside s.o. else. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>next</tr>. </trans>
<eg><i lang=""ceb"">Ang ámung báy tápad (tapad) sa íla,</i><trans> Our house is next to theirs. </trans></eg>
</sense></hom>
<entry><form id=""taxpad"" lang=""ceb""><abbr expan=""tápad"" type=""lemma"">(←)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[C; ac]</itype><trans> compare so as to match. </trans>
<eg><i lang=""ceb"">Gwápa ka kun tapáran ug maksut (maksut ang itápad nímu),</i><trans> You are pretty if you are compared with an ugly person (if an ugly person is put next to you). </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2; ab2]</itype><trans> match a cock with another for a cockfight. </trans>
<eg><i lang=""ceb"">Way mutápad sa ákung manuk nga maáyu mulabuk,</i><trans> No one will match his cock with mine because it is good in fighting. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>comparison</tr>. </trans>
<eg><i lang=""ceb"">Dì siya maiwit sa tápad,</i><trans> He does not lose out in comparison. </trans></eg>
</sense></hom></entry>
<entry><form id=""taparan"" lang=""ceb"">taparan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> place where cocks are usually matched for a cockfight. </trans>
</sense></hom></entry>
<entry><form id=""kataxpad"" lang=""ceb""><abbr expan=""katápad"" type=""lemma"">ka-(←)</abbr></form>
<hom>
<sense n=""0""><trans> <tr>seatmate</tr>. </trans>
<eg><i lang=""ceb"">Siyay ákung katápad sa klási,</i><trans> He is my seatmate in class.
</trans></eg>
</sense></hom></entry></entry>");
