INSERT INTO `wced_entry` VALUES (18430, "tapak", "988", "<entry page=""988"" id=""18430""><form id=""taxpak"" lang=""ceb"">tápak</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b]</itype><trans> <tr>patch</tr>. </trans>
<eg><i lang=""ceb"">Tapáki ring gisì sa kurtína,</i><trans> Patch the tear here in the curtain. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A12; c6]</itype><trans> cover one’s debts. </trans>
<eg><i lang=""ceb"">Karung swildúha ígù rang ikatápak sa mga bayranan,</i><trans> This salary is just enough to pay for the bills. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; c]</itype><trans> <tr>cover up for</tr> undertime. </trans>
<eg><i lang=""ceb"">Magtápak ku sa ákung naabsinan,</i><trans> I’ll <tr>make up for</tr> the time I lost when I was absent. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number><trans> cover over a bad feeling. </trans>
<eg><i lang=""ceb"">Ang pag-inum-ínum ray íyang itápak sa íyang mga kaguul,</i><trans> He drowns his sorrows in alcohol. </trans></eg>
</sense></hom>
<entry><form id=""tapak"" lang=""ceb""><abbr expan=""tapak"" type=""lemma"">(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>patch</tr> on s.t. torn. </trans>
</sense></hom></entry>
<entry><form id=""tinapakan"" lang=""ceb""><abbr expan=""tinapakan"" type=""lemma"">-in-an(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. patched. </trans>
</sense></hom></entry>
<entry><form id=""tapakun"" lang=""ceb""><abbr expan=""tapakun"" type=""lemma"">-un(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> having patches.
</trans>
</sense></hom></entry></entry>");
