<sense n=""1""><number>1</number><trans> <tr>shallow</tr>, not well-based. </trans>
<eg><i lang=""ceb"">Taphaw ra kaáyu kanang katarungána,</i><trans> That reasoning is too shallow. </trans></eg>
<eg><i lang=""ceb"">Gidakup siya bísan taphaw lang ang katáhap,</i><trans> He was arrested on very shallow suspicion. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>insincere</tr>, <tr>superficial</tr>. </trans>
<eg><i lang=""ceb"">Taphaw ang pahíyum nga pinugus,</i><trans> A forced smile is artificial. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>silly</tr>. </trans>
<eg><i lang=""ceb"">Dì ba taphaw nang babayhána, mukatáwa lag kalit nga walay hinungdan?</i><trans> Isn’t she silly the way she laughs suddenly without reason?
