INSERT INTO `wced_entry` VALUES (18449, "tapi1", "989", "<entry page=""989"" id=""18449""><form id=""tapi"" lang=""ceb"">tapi<sub>1</sub></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>crooked</tr>, <tr>slanted</tr>, not well-rounded, <tr>off the mark</tr>. </trans>
<eg><i lang=""ceb"">Tapi ning pagkasulat kay way linya ang papil,</i><trans> The lines are not straight because the paper has no lines. </trans></eg>
<eg><i lang=""ceb"">Tapi siyag úlu,</i><trans> His head is not well-rounded. </trans></eg>
<eg><i lang=""ceb"">Tapi man, wà mabuls-ay,</i><trans> It’s off the mark, not a bull’s-eye. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AB; c1]</itype><trans> come out crooked, off the mark; cause s.t. to do so. </trans>
<eg><i lang=""ceb"">Mutapi (matapi) ang úlu sa bátà ug pirmi takildun,</i><trans> A child gets an irregularly-shaped head if he is put down on his side. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a1]</itype><trans> fend off <pb n=""990""/>a blow with a sideward motion of the arm or club. </trans>
<eg><i lang=""ceb"">Tapihun nímu ang duslak kay mau nay labing piligrúsu,</i><trans> You must fend off the forward thrust because that is the most dangerous. </trans></eg>
</sense></hom>
<entry><form id=""tapitaxpi"" lang=""ceb"">tapitápi</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c1]</itype><trans> do s.t. <tr>unevenly</tr>, <tr>zigzaggedly</tr>. </trans>
<eg><i lang=""ceb"">Nagtapitápig lakaw ang hubug,</i><trans> The drunk walked in a zigzag way.
</trans></eg>
</sense></hom></entry></entry>");
