INSERT INTO `wced_entry` VALUES (18469, "taptap", "990", "<entry page=""990"" id=""18469""><form id=""taptap"" lang=""ceb"">taptap</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b]</itype><trans> <tr>cover</tr> s.t. by laying s.t. over it, putting s.t. flat on top of it. </trans>
<eg><i lang=""ceb"">Usa ka táwuy mitaptap nákù arun dì ku makadumdum sa agiánan,</i><trans> A person blindfolded me so I wouldn’t know the way. </trans></eg>
<eg><i lang=""ceb"">Nagtaptap ug panyù ang mga tulisan,</i><trans> The robbers covered their faces with handkerchiefs. </trans></eg>
<eg><i lang=""ceb"">Taptápig puwa ang tabánug,</i><trans> Cover the kite with red paper. </trans></eg>
<eg><i lang=""ceb"">Ang lángit gitaptápan sa mabagang dag-um,</i><trans> The sky is covered with thick clouds. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. lain over as a covering.
</trans>
</sense></hom></entry>");
