INSERT INTO `wced_entry` VALUES (18471, "tapu", "991", "<entry page=""991"" id=""18471""><form id=""taxpuq"" lang=""ceb"">tápù</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; ac6]</itype><trans> put all together. </trans>
<eg><i lang=""ceb"">Kinsay nagtápù íning tanan sa sáku?</i><trans> Who put them all in the sack? </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2C3; c16]</itype><trans> for one end of s.t. tied around the body to meet the other. </trans>
<eg><i lang=""ceb"">Nagtápù ang higut apan dì mabalighut,</i><trans> The two ends of the bond meet but you can’t tie them. </trans></eg>
<eg><i lang=""ceb"">Matápù nímu ang duha nímu ka kamut sa íyang páa,</i><trans> You can encircle her legs with your two hands. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> join, connect. </trans>
<eg><i lang=""ceb"">Gitápù ang ílang kamut,</i><trans> They joined hands. </trans></eg>
</sense></hom>
<entry><form id=""hitapuq_hatapuq"" lang=""ceb""><abbr expan=""hitapù"" type=""lemma"">hi-</abbr>/<abbr expan=""hatapù"" type=""lemma"">ha-(→)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B1256]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> be put together with the rest by chance. </trans>
<eg><i lang=""ceb"">Ngánung nahitapù ning ákung butang sa imúha?</i><trans> Why are my things mixed with yours? </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> happen to join, live with a group. </trans>
<eg><i lang=""ceb"">Maáyung nahitapù ku sa inyung grúpu,</i><trans> It’s a good thing that I joined your group.
</trans></eg>
</sense></hom></entry></entry>");
