INSERT INTO `wced_entry` VALUES (18472, "tapuk", "991", "<entry page=""991"" id=""18472""><form id=""tapuk"" lang=""ceb"">tapuk</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> for fibrous materials to be <tr>weak</tr>, <tr>easily torn</tr>. </trans>
