INSERT INTO `wced_entry` VALUES (18473, "tapuk1", "991", "<entry page=""991"" id=""18473""><form id=""taxpuk"" lang=""ceb"">tápuk<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AC3; a2]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> make a pile of s.t. scattered. </trans>
<eg><i lang=""ceb"">Nagkatápuk ang mga pangánud,</i><trans> The clouds gathered. </trans></eg>
<eg><i lang=""ceb"">Tapúka ang mga dáhun,</i><trans> Pile the leaves up. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>gather</tr> people, <tr>be gathered</tr>. </trans>
<eg><i lang=""ceb"">Nagkatápuk uruy ang mga búang,</i><trans> A bunch of fools have gotten together in one place. </trans></eg>
<eg><i lang=""ceb"">Tapúka ang mga saup kay ákung pakigsultíhan,</i><trans> Get the tenants together so I can have a talk with them. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> pile of things. </trans>
</sense>
<sense n=""2""><number>2</number><trans> crowd gathered. </trans>
</sense></hom>
<entry><form id=""tapuktaxpuk"" lang=""ceb"">tapuktápuk</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A1; b6]</itype><trans> form cliques within a larger group. </trans>
<eg><i lang=""ceb"">Kinahanglang úsa tanan, way magtapuktápuk,</i><trans> All must be in one group, no forming of cliques. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> clique. </trans>
</sense>
<sense n=""2""><number>2</number><trans> social gatherings, parties. </trans>
<eg><i lang=""ceb"">Sa mga tapuktápuk náa giyud ang susyalayit,</i><trans> The socialites are sure to be present at gatherings. </trans></eg>
</sense></hom></entry>
<entry><form id=""tapuktapuk"" lang=""ceb"">tapuktapuk</form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#pundukpunduk""><sc>pundukpunduk</sc></xr>. <ix>see</ix> <xr lang=""ceb"" target=""#punduk""><sc>punduk</sc></xr>.
</trans>
</sense></hom></entry></entry>");
