INSERT INTO `wced_entry` VALUES (18478, "tapun1", "991", "<entry page=""991"" id=""18478""><form id=""tapun"" lang=""ceb"">tapun<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>move</tr> to another house or place. </trans>
<eg><i lang=""ceb"">Kung mag-áway ang magtiáyun ang asáwa adtu dáyun mutapun sa íyang ugángan,</i><trans> If the couple quarrels, the wife immediately goes to stay with her mother-in-law. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> move, bring to a nearby location separated by some k.o. barrier. </trans>
<eg><i lang=""ceb"">Mitapun ang langgam sa láing sanga,</i><trans> The bird moved to another branch. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>cross</tr> to the opposing party. </trans>
<eg><i lang=""ceb"">Daghang mutapun sa partídung daúgan,</i><trans> Many people will <tr>cross over</tr> to the winning party. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>area across</tr> s.t. </trans>
<eg><i lang=""ceb"">Kining kaingína muluwak sa tapun íning búd,</i><trans> This clearing stretches over to the opposite slope of this hill.
