INSERT INTO `wced_entry` VALUES (18487, "taput", "992", "<entry page=""992"" id=""18487""><form id=""taput"" lang=""ceb"">taput</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AC3; b]</itype><trans> <tr>stick</tr>, be firmly attached to s.t. </trans>
<eg><i lang=""ceb"">Mitaput giyud ang buling sa sinínà,</i><trans> The dirt sure stuck to the clothes. </trans></eg>
<eg><i lang=""ceb"">Nagtáput ang láwas sa sayamis tuwins,</i><trans> The bodies of the Siamese twins are stuck to each other. </trans></eg>
<eg><i lang=""ceb"">Gitaptan ug sisi ang gapnud,</i><trans> Small oysters were attached to the driftwood. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2; b]</itype><trans> for a disease to <tr>infect</tr> s.o. </trans>
<eg><i lang=""ceb"">Dì makataput ang sakit sa himsug nga láwas,</i><trans> Disease cannot infect a healthy body. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A2; b6]</itype><trans> remain very <tr>close</tr> and <tr>loyal</tr> to s.o. </trans>
<eg><i lang=""ceb"">Mutaput siya nímu kun ímu siyang makúhà,</i><trans> She will stick to you once you have had her. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[b4]</itype><trans> be somewhat affected by an unpleasant feeling. </trans>
<eg><i lang=""ceb"">Gitaptan siyag kalísang,</i><trans> Fear came over him. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>tight-fitting</tr> clothes. </trans>
<eg><i lang=""ceb"">Taput kaáyu sa láwas ang sinínà ni Marilin,</i><trans> Marilyn has a very tight-fitting dress on. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> sticking to the spot as if stuck. </trans>
<eg><i lang=""ceb"">Kasing taput,</i><trans> A top that whirls without wobbling. </trans></eg>
</sense></hom>
<entry><form id=""taput_laxwas"" lang=""ceb""><abbr expan=""taput"" type=""lemma"">—</abbr> láwas</form>
<hom>
<sense n=""0""><trans> <ix>see</ix> <xr lang=""ceb"" target=""#laxwas""><sc>láwas</sc></xr>. </trans>
</sense></hom></entry>
<entry><form id=""taput_sa_pamilya"" lang=""ceb""><abbr expan=""taput"" type=""lemma"">—</abbr> sa pamilya</form>
<hom>
<sense n=""0""><trans> one who has become a member of a family through marriage.</trans>
<eg><i lang=""ceb""> Wà kay lábut sa panunud kay taput lang kas mga Ríyis,</i><trans> You do not get an inheritance because you are related to the Reyeses only by marriage. </trans></eg>
</sense></hom></entry>
<entry><form id=""pataput"" lang=""ceb""><abbr expan=""pataput"" type=""lemma"">pa-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> thin tissue paper used to make lanterns or kites. </trans>
</sense></hom></entry>
<entry><form id=""taptanan"" lang=""ceb"">taptanan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> joist in a roof to which the galvanized iron sheets are attached.
</trans>
</sense></hom></entry></entry>");
