INSERT INTO `wced_entry` VALUES (18488, "tapuy", "992", "<entry page=""992"" id=""18488""><form id=""tapuy"" lang=""ceb"">tapuy</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> finger the strings or the keys of a musical instrument and the like. </trans>
<eg><i lang=""ceb"">Bungul ang tíngug sa sista kay luag kang mutapuy,</i><trans> The guitar sounds dull because you’re not holding tight enough to the chords. </trans></eg>
<eg><i lang=""ceb"">Gitapuy níya ang íyang mga tudlù sa tikla,</i><trans> He let his fingers move over the keyboard. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>fingering</tr> of chords. </trans>
</sense></hom>
<entry><form id=""tapyanan"" lang=""ceb"">tapyanan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>finger board</tr> or a <tr>fret</tr> of a stringed instrument.
</trans>
</sense></hom></entry></entry>");
