INSERT INTO `wced_entry` VALUES (18489, "tapwak", "992", "<entry page=""992"" id=""18489""><form id=""tapwak"" lang=""ceb"">tapwak</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A3P; c]</itype><trans> <tr>drag</tr>, <tr>push</tr> s.o. to danger or sin. </trans>
<eg><i lang=""ceb"">Ikaw ang nagtapwak níya sa kadaútan,</i><trans> You drove her to danger. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b(1)]</itype><trans> <tr>dive</tr>, <tr>dash</tr> forcefully towards. </trans>
<eg><i lang=""ceb"">Kinsa tung mitapwak sa ákung likud,</i><trans> Who was that who jumped on my back? </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[a3b8]</itype><trans> meet the eyes. </trans>
<eg><i lang=""ceb"">Mauy natapwak (natapwakan) sa ákung panan-aw ang babáying naghúbù,</i><trans> A stark naked woman met my eyes. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A; c]</itype><trans> <tr>splash</tr> onto. </trans>
<eg><i lang=""ceb"">Usa ka dakung balud ang mitapwak sa íyang náwung,</i><trans> A big wave splashed his face. </trans></eg>
<eg><i lang=""ceb"">Hitapwakan ug íhì ang nangharána,</i><trans> The serenaders got splashed with a potful of urine.
</trans></eg>
</sense></hom></entry>");
