INSERT INTO `wced_entry` VALUES (18490, "tapya", "992", "<entry page=""992"" id=""18490""><form id=""tapya"" lang=""ceb"">tapya</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c1]</itype><trans> for waves to dash against the shore. </trans>
<eg><i lang=""ceb"">Tapyáhun (itapya) nang gapnud sa baybáyun,</i><trans> The waves will dash that driftwood against the shore. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a12]</itype><trans> <tr>fend off</tr> blows with the palm or with an instrument. </trans>
<eg><i lang=""ceb"">Tapyáha íyang duslak sa ímung bangkaw,</i><trans> Fend off his thrust with your spear. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> dashing of waves. </trans>
</sense></hom>
<entry><form id=""tapyahan"" lang=""ceb"">tapyahan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> seashore where the waves break.
</trans>
</sense></hom></entry></entry>");
