INSERT INTO `wced_entry` VALUES (18491, "tapyas", "992", "<entry page=""992"" id=""18491""><form id=""tapyas"" lang=""ceb"">tapyas</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; b]</itype><trans> <tr>graze</tr>, rub against slightly. </trans>
<eg><i lang=""ceb"">Gitapyasan sa panà ang íyang áping,</i><trans> His cheek was grazed by the arrow. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a1]</itype><trans> <tr>deflect</tr>, hit with a swinging arm. </trans>
<eg><i lang=""ceb"">Makatapyas ka íning dunggába?</i><trans> Could you parry this thrust? </trans></eg>
<eg><i lang=""ceb"">Tapyasa ang mga lamuk,</i><trans> Drive the mosquitoes away by swinging your arms. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; a]</itype><trans> wipe s.t. off s.t. by sliding the palm of the hand over it. </trans>
<eg><i lang=""ceb"">Tapyása ang mga sagbut sa lamísa,</i><trans> Sweep the scraps off the table.
</trans></eg>
</sense></hom></entry>");
