INSERT INTO `wced_entry` VALUES (18492, "tara", "992", "<entry page=""992"" id=""18492""><form id=""taraq"" lang=""ceb"">tarà</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; cP]</itype><trans> put s.t. where it is easy to get at, can easily be hit. </trans>
<eg><i lang=""ceb"">Mitarà siya sa íyang nawung sa táwu nga nag-ingung musagpà,</i><trans> She put her face forward when the man threatened to slap her so he could hit her squarely if he dared. </trans></eg>
<eg><i lang=""ceb"">Kinsay nagtarà ug usa ka plátung mani sa mga bátà?</i><trans> Who put a plate of peanuts in front of the children where they could get at them? </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c]</itype><trans> <tr>point at</tr>, <tr>train upon</tr>. </trans>
<eg><i lang=""ceb"">Wà pa gánì siya makatarà, mibutu na ang pusil,</i><trans> The gun went off even before he could take his aim. </trans></eg>
<eg><i lang=""ceb"">Itarà ang ímung nawung sa adlaw,</i><trans> <tr>Face</tr> directly to the sun. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> in fighting, exposing the body and not parrying or ducking. </trans>
<eg><i lang=""ceb"">Tarà muáway manúka, dì mulihay,</i><trans> That rooster exposes itself when it fights and fails to parry. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> for a woman to be motionless, sexually unresponsive. </trans>
<eg><i lang=""ceb"">Tarà babayhána, dì mubálus kun dyangdyángun,</i><trans> An unresponsive woman. She does not react to sexual play. </trans></eg>
</sense></hom>
<entry><form id=""pataraq"" lang=""ceb""><abbr expan=""patarà"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c6]</itype><trans> fail to move and thus expose oneself instead of defending oneself or hiding. </trans>
<eg><i lang=""ceb"">Ayawg patarà sa pinusílay,</i><trans> Don’t expose yourself to the line of fire.
</trans></eg>
</sense></hom></entry></entry>");
