INSERT INTO `wced_entry` VALUES (18497, "taraktarak1", "992", "<entry page=""992"" id=""18497""><form id=""taraktarak"" lang=""ceb"">taraktarak<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A1; b6]</itype><trans> put several blade marks on s.t. </trans>
<eg><i lang=""ceb"">Ákung gitaraktarakan ang punúan <pb n=""993""/>sa nangkà arun muági ang taguk,</i><trans> I put blade marks in the trunk of the jackfruit so the sap would flow.
