<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A1]</itype><trans> make noisy footfalls. </trans>
<eg><i lang=""ceb"">Gisabáan ang mga burdir sa sílung kay may nagtaraktarak sa táas,</i><trans> The boarders on the ground floor were disturbed by the person walking noisily upstairs.
</trans></eg>
</sense></hom></entry>");
