INSERT INTO `wced_entry` VALUES (18499, "taral", "993", "<entry page=""993"" id=""18499""><form id=""taxral"" lang=""ceb"">táral</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a2]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> force s.t. to come along by dragging. </trans>
<eg><i lang=""ceb"">Gitáral nákug bábuy ngadtu sa ihawan,</i><trans> I dragged the pig to the slaughterhouse. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> coax s.o. into coming along. </trans>
<eg><i lang=""ceb"">Ayaw pagkúyug ug dúnay mutáral pagpangharána,</i><trans> Don’t go if s.o. coaxes you into going serenading. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> bring before the court for trial. </trans>
