INSERT INTO `wced_entry` VALUES (18520, "taru", "994", "<entry page=""994"" id=""18520""><form id=""taxru"" lang=""ceb"">táru</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> large cubical tin can made to contain kerosene and hold <measure reg=""18.93 liters"">five gallons</measure>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B256]</itype><trans> get to be one <ix>táru</ix> full. </trans>
<eg><i lang=""ceb"">Wà ra mutáru ang nainum námung tubà,</i><trans> We didn’t even consume five gallons of palm toddy.
</trans></eg>
</sense></hom></entry>");
