INSERT INTO `wced_entry` VALUES (18521, "tarug", "994", "<entry page=""994"" id=""18521""><form id=""tarug"" lang=""ceb"">tarug</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a12]</itype><trans> budge a little. </trans>
<eg><i lang=""ceb"">Ígù lang natarug ang kutsing ákung gitúlud,</i><trans> The car I was pushing just barely budged. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B12; a1]</itype><trans> for s.t. implanted to become loose. </trans>
<eg><i lang=""ceb"">Manghíngù na ang bátà kay nagkatarug na íyang ngípun,</i><trans> The child will soon lose his teeth now that they are getting loose. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B126]</itype><trans> for feelings to be moved, softened. </trans>
<eg><i lang=""ceb"">Bisan lúhà dì makatarug (makapatarug) sa íyang balatían,</i><trans> Even tears cannot move his feelings. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> s.t. planted that is loose. </trans>
<eg><i lang=""ceb"">Húmuk na ibtun ang lansang kay tarug na,</i><trans> It’s easy to pull the nail out now because it’s loose. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> a loose tooth. </trans>
<eg><i lang=""ceb"">Ipaibut na ímung tarug,</i><trans> Have your loose tooth pulled.
</trans></eg>
</sense></hom></entry>");
