INSERT INTO `wced_entry` VALUES (18524, "tarugu", "994", "<entry page=""994"" id=""18524""><form id=""taruxgu"" lang=""ceb"">tarúgu</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> a <tr>peg</tr> or <tr>rod</tr> to hold s.t. in place or provide <tr>support</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>penis</tr> (slang). </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
