INSERT INTO `wced_entry` VALUES (18525, "taruk", "994", "<entry page=""994"" id=""18525""><form id=""taxruk"" lang=""ceb"">táruk</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> plant a post or s.t. large. </trans>
<eg><i lang=""ceb"">Lawma kun magtáruk kag pusti,</i><trans> When you plant a post make it deep. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>erect</tr> a structure. </trans>
<eg><i lang=""ceb"">Magtáruk tag bunggalu inigkaminyù nátù,</i><trans> We’ll <tr>construct</tr> a bungalow when we get married. </trans></eg>
</sense></hom>
<entry><form id=""taruktaruk"" lang=""ceb"">taruktaruk</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AP]</itype><trans> sit or stand motionless, not saying a word. </trans>
<eg><i lang=""ceb"">Ang táwung hilumun nagtaruktaruk (nagpataruktaruk) lag lingkud,</i><trans> The quiet man was sitting without saying a word.
</trans></eg>
</sense></hom></entry></entry>");
