INSERT INTO `wced_entry` VALUES (18527, "tarungan", "995", "<entry page=""995"" id=""18527""><form id=""taruxngan"" lang=""ceb"">tarúngan</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>crested</tr>, having a circular growth of flesh or feathers on the crown or head. </trans>
<eg><i lang=""ceb"">Ang tarúngan nga manuk dúnay balhíbu nga mag-ulbu sa úlu,</i><trans> A crested chicken has a puff of feathers forming a circle on the top of its head.
</trans></eg>
</sense></hom></entry>");
