INSERT INTO `wced_entry` VALUES (18528, "tarurut", "995", "<entry page=""995"" id=""18528""><form id=""taruxrut"" lang=""ceb"">tarúrut</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> paper, leaf rolled into a <tr>cone</tr>. </trans>
<eg><i lang=""ceb"">Usa ka tarúrut mani,</i><trans> Peanuts in a piece of paper rolled into a cone. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> k.o. <tr>squid</tr> characterized by its long tapering tail. </trans>
</sense>
<sense n=""3""><number>3</number><trans> any musical instrument or noisemaker blown with the mouth. </trans>
</sense>
<sense n=""3a""><number>3a</number><trans> <tr>drumbeater</tr>, <tr>publicity man</tr>. </trans>
<eg><i lang=""ceb"">Gisangyaw dáyun sa mga tarúrut sa mayur nga siya ang nakapasimintu sa dálan Kulun,</i><trans> The mayor’s publicity men immediately broadcast that he was responsible for cementing Colon St. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> <tr>cuckold</tr>. </trans>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> short and stout. </trans>
<eg><i lang=""ceb"">Tarúrut tan-áwun ang mubù nga mutambuk,</i><trans> A short person looks like a cone when he grows stout. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a2]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> roll s.t. into a cone. </trans>
<eg><i lang=""ceb"">Nagtarúrut si Tátay arun ipúli sa íyang nawálang hunsuy,</i><trans> Father rolled a leaf into a cone to smoke with when he lost his pipe. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> play a <tr>wind instrument</tr>. </trans>
</sense>
<sense n=""3""><number>3</number><trans> for a wife to make a fool of her husband by taking up with other men. </trans>
<eg><i lang=""ceb"">Gitarúrut siya sa íyang asáwa,</i><trans> His wife made him a cuckold.
</trans></eg>
</sense></hom></entry>");
