INSERT INTO `wced_entry` VALUES (18529, "taruti", "995", "<entry page=""995"" id=""18529""><form id=""taruxti"" lang=""ceb"">tarúti</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>trot</tr>, a gait of a horse in which the legs are lifted in alternating diagonal pairs. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a2]</itype><trans> <tr>trot</tr>. </trans>
<eg><i lang=""ceb"">Maáyu mutarúti ning kabayúa, dì kaáyu lihuk,</i><trans> This horse trots well. It does not bounce so much.
</trans></eg>
</sense></hom></entry>");
