INSERT INTO `wced_entry` VALUES (18535, "tasal", "995", "<entry page=""995"" id=""18535""><form id=""tasal"" lang=""ceb"">tasal</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> set a date or time to do s.t., or for s.t. to happen. </trans>
<eg><i lang=""ceb"">Dì ku mutasal anus-a ku mubálik,</i><trans> I won’t set a date as to when I’m coming back. </trans></eg>
<eg><i lang=""ceb"">Gitasalan ang masakitun sa kansir ug usa ka búlan,</i><trans> The cancer patient was given a month to live. </trans></eg>
<eg><i lang=""ceb"">Lúnis ang gitasal nga adlaw sa kasal,</i><trans> Monday was the day set for the wedding. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> date fixed for s.t. expected. </trans>
</sense></hom>
<entry><form id=""tasaxdu"" lang=""ceb"">tasádu</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> a fixed date, term. </trans>
<eg><i lang=""ceb"">Way tasádu kun anus-a ang ílang kasal,</i><trans> There’s no date fixed for their wedding. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b(1)]</itype><trans> give a date, term or period. </trans>
<eg><i lang=""ceb"">Mutasádu kag úras kun anus-a ku ikaw hapita,</i><trans> You have to set a fixed time as to when I shall pick you up.
</trans></eg>
</sense></hom></entry></entry>");
