INSERT INTO `wced_entry` VALUES (18540, "taslup", "995", "<entry page=""995"" id=""18540""><form id=""taslup"" lang=""ceb"">taslup</form>
<hom>
<sense n=""0""><trans> (from <ix>salup</ix>) </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c]</itype><trans> <tr>penetrate</tr>, <tr>sink into</tr>. </trans>
<eg><i lang=""ceb"">Mitaslup ang tinggà sa túbig,</i><trans> The sinker sunk into the water. </trans></eg>
<eg><i lang=""ceb"">Walà makataslup sa íyang buktun ang dágum sa indiksiyun,</i><trans> The hypodermic needle didn’t penetrate into his arm. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2; b(1)]</itype><trans> penetrate deep into s.t.; impart s.t. into the thing penetrated. </trans>
<eg><i lang=""ceb"">Mitaslup na ang kaparat sa isdà,</i><trans> The saltiness has penetrated deep into the flesh of the fish. </trans></eg>
<eg><i lang=""ceb"">Nakataslup na ang kahumut sa panákut sa kasahusun,</i><trans> The taste of the spices has penetrated deep into the jerked meat. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A2]</itype><trans> for the sun to disappear behind s.t., set.
</trans>
</sense></hom></entry>");
