INSERT INTO `wced_entry` VALUES (18547, "tata2", "996", "<entry page=""996"" id=""18547""><form id=""taqtaq2"" lang=""ceb"">tàtà<sub>2</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> empty a container of its contents by turning it upside down and banging it downwards. </trans>
<eg><i lang=""ceb"">Nagtàtà ku sa mga síli áring butilya,</i><trans> I’m pushing the chili peppers out of this bottle. </trans></eg>
<eg><i lang=""ceb"">Itàtà (tàtáa) ang mga sulud sa sáku,</i><trans> Shake out the contents of the sack. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> pour, take out catch from a fish net or fish trap. </trans>
</sense>
<sense n=""3""><number>3</number><trans> empty coconut-palm toddy in a container. </trans>
</sense>
<sense n=""3a""><number>3a</number><trans> sell coconut-palm toddy to a permanent customer. </trans>
<eg><i lang=""ceb"">Mutàtà kug tubà nímu káda buntag,</i><trans> I’ll sell you fresh coconut-palm toddy every morning. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A; b]</itype><trans> <tr>lap</tr> at a liquid. </trans>
<eg><i lang=""ceb"">Irù ang mitàtà sa litsis bátà,</i><trans> The dog lapped the baby’s milk. </trans></eg>
</sense></hom>
<entry><form id=""taqtaxan"" lang=""ceb""><abbr expan=""tàtáan"" type=""lemma"">-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> a shed where catch from different bancas are put together for division into shares. </trans>
</sense>
<sense n=""2""><number>2</number><trans> place where palm toddy is kept. </trans>
</sense>
<sense n=""3""><number>3</number><trans> person who sells palm toddy on a regular basis.
</trans>
</sense></hom></entry></entry>");
