INSERT INTO `wced_entry` VALUES (18550, "tataw", "996", "<entry page=""996"" id=""18550""><form id=""taxtaw"" lang=""ceb"">tátaw</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> clearly visible, not covered. </trans>
<eg><i lang=""ceb"">Tátaw sa bintánà ang ílang rinubuhay,</i><trans> You could see them necking clearly through the window. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>obvious</tr>. </trans>
<eg><i lang=""ceb"">Tátaw kaáyu siyang nag-inartista,</i><trans> She’s obviously faking. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B12; b6]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> be clearly seen. </trans>
<eg><i lang=""ceb"">Matátaw nímu ang dágat ibabaw sa búkid,</i><trans> You can clearly see the sea from the top of the hill. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> be <tr>obvious</tr>. </trans>
<eg><i lang=""ceb"">Minuri kay matátaw kaáyung gustu ka níya,</i><trans> Slow down. It’s obvious that you like him.
</trans></eg>
</sense></hom></entry>");
