INSERT INTO `wced_entry` VALUES (18554, "tatsa", "996", "<entry page=""996"" id=""18554""><form id=""tatsa"" lang=""ceb"">tatsa</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A12; b4(1)]</itype><trans> <tr>mark</tr> or <tr>blemish</tr> on an otherwise smooth surface. </trans>
<eg><i lang=""ceb"">Wà giyud makatatsa ang buksidur sa íyang kuntra,</i><trans> The boxer was not able to make a single mark on his opponent. </trans></eg>
<eg><i lang=""ceb"">Natatsahan ang íyang puting barung,</i><trans> His white barong has a <tr>spot</tr> on it. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2N; b5c]</itype><trans> <tr>criticize</tr>; <tr>find fault</tr> with s.t. </trans>
<eg><i lang=""ceb"">Kusug siyang mutatsa (manatsa) sa búhat sa uban,</i><trans> He is fond of criticizing others’ work. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>mark</tr>, <tr>blemish</tr>. </trans>
<eg><i lang=""ceb"">Way tatsa ang íyang pagkababáyi,</i><trans> Her womanhood is unblemished. </trans></eg>
</sense></hom>
<entry><form id=""tatsadur"" lang=""ceb""><abbr expan=""tatsadur"" type=""lemma"">-dur</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> fond of criticizing or despising. </trans>
</sense></hom></entry>
<entry><form id=""tatsaduxra"" lang=""ceb""><abbr expan=""tatsadúra"" type=""lemma"">-dúra</abbr></form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#tatsadur""><sc>tatsadur</sc></xr> (female).
