INSERT INTO `wced_entry` VALUES (18561, "taub", "996", "<entry page=""996"" id=""18561""><form id=""taxub"" lang=""ceb"">táub</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>high tide</tr>. </trans>
<eg><i lang=""ceb"">Táub (taub) kaáyu ang dágat run,</i><trans> The tide is high now. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B45; b4]</itype><trans> be high tide. </trans>
<eg><i lang=""ceb"">Láwum ang pantalan kun mutáub,</i><trans> The harbor is deep when it’s high tide. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>tide</tr>. </trans>
<eg><i lang=""ceb"">Ang táub gaagad lang sa búlan,</i><trans> The tide depends on the moon. </trans></eg>
</sense></hom>
<entry><form id=""tauxbun"" lang=""ceb""><abbr expan=""taúbun"" type=""lemma"">-un</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> sea at high tide. </trans>
<eg><i lang=""ceb"">Misíbug na ang taúbun,</i><trans> The tide is going out now. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>high tide</tr>. </trans>
<eg><i lang=""ceb"">Abtun giyud nang sináug nga barútu kay milíhuk na ang taúbun,</i><trans> When the high tide rushes in it will surely reach the boat that has been beached.
</trans></eg>
</sense></hom></entry></entry>");
