INSERT INTO `wced_entry` VALUES (18562, "taud", "996", "<entry page=""996"" id=""18562""><form id=""taxud"" lang=""ceb"">táud</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c]</itype><trans> put s.t. up or on by fastening, attaching, or inserting. </trans>
<eg><i lang=""ceb"">Pagtáud ug muskitíru,</i><trans> <tr>Put up</tr> a mosquito net. </trans></eg>
<eg><i lang=""ceb"">Itáud ang singsing,</i><trans> Put the ring on. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[C2; c3]</itype><trans> have <tr>sexual intercourse</tr>. </trans>
<eg><i lang=""ceb"">Nagtáud sigúru sila kay nahílum,</i><trans> They must be having intercourse because they’re silent. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; a12]</itype><trans> make a plow. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>plow</tr>. </trans>
<eg><i lang=""ceb"">Bargas karun ang ákung táud,</i><trans> I use a Vargas plow now. </trans></eg>
</sense></hom>
<entry><form id=""taud"" lang=""ceb""><abbr expan=""taud"" type=""lemma"">(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> a trimming of lace attached to a garment as a frill.
