INSERT INTO `wced_entry` VALUES (18563, "taudtaud", "996", "<entry page=""996"" id=""18563""><form id=""taudtaud"" lang=""ceb"">taudtaud</form>
<hom>
<sense n=""1""><number>1</number><trans> <tr>after a while</tr>. </trans>
<eg><i lang=""ceb"">Mihigdà ku, unyà taudtaud nakatúlug,</i><trans> I lay down, and after a while fell asleep. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> be for some time. </trans>
<eg><i lang=""ceb"">Taudtaud ka nang wà mubisíta nákù,</i><trans> It’s been some time since you visited me. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> [do] <tr>every now and then</tr>. </trans>
<eg><i lang=""ceb"">Taudtaud lag pangíhì ning táwung gibus-aw,</i><trans> This man with a bladder <pb n=""997""/>ailment keeps having <tr>frequent</tr> urination. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B246; b]</itype><trans> done some time ago. </trans>
<eg><i lang=""ceb"">Mutaudtaud na karung wà kung kakità ug sini,</i><trans> It’s been some time now since I’ve last seen a movie. </trans></eg>
<eg><i lang=""ceb"">Pataudtauri (taudtauri) nà sa káyu únà haúna,</i><trans> Let it stay over the fire for several minutes before you take it off. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A13]</itype><trans> do s.t. every now and then. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[b8]</itype><trans> taking a rather long time. </trans>
<eg><i lang=""ceb"">Mataudtauran pa dagway úsà siya muulì,</i><trans> It will probably be some time before he comes home.
</trans></eg>
</sense></hom></entry>");
