INSERT INTO `wced_entry` VALUES (18567, "taup", "997", "<entry page=""997"" id=""18567""><form id=""taxup"" lang=""ceb"">táup</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; P]</itype><trans> pierce deep. </trans>
<eg><i lang=""ceb"">Mitáup ang udiyung sa íyang dughan,</i><trans> The arrow pierced deep into his breast. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B125]</itype><trans> for the sound of s.t. one cannot see to fade away. </trans>
<eg><i lang=""ceb"">Natáup ang tíngug sa nagkalayung ayruplánu,</i><trans> The sound of the airplane faded as it got further and further away. </trans></eg>
</sense></hom>
<entry><form id=""panaxup"" lang=""ceb""><abbr expan=""panáup"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A23]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>sink</tr>, disappear below the level of. </trans>
<eg><i lang=""ceb"">Nanáup ang barku sa pagkalúnud niíni. Bisan pálu wà makítà,</i><trans> The ship was completely hidden when it sank. Even the mast could not be seen on the surface of the water. </trans></eg>
<eg><i lang=""ceb"">Nanáup ang bátà sa daghang táwu,</i><trans> The child disappeared in the midst of the crowd. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> for a score to be at the lowest, or at the bottom. </trans>
<eg><i lang=""ceb"">Sa lima ka tím, íla rang iskur ang nanáup,</i><trans> Of the five teams, their score was the lowest.
</trans></eg>
</sense></hom></entry></entry>");
