<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>gay</tr>, easily aroused to laughter. </trans>
</sense></hom></entry>
<entry><form id=""kataw-anan"" lang=""ceb"">kataw-anan</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>funny</tr>. </trans>
</sense></hom></entry>
<entry><form id=""kalataw-an"" lang=""ceb"">kalataw-an</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>laughing stock</tr>. </trans>
</sense></hom></entry>
