INSERT INTO `wced_entry` VALUES (18577, "tawhay", "998", "<entry page=""998"" id=""18577""><form id=""tawhay"" lang=""ceb"">tawhay</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>orderly</tr>, <tr>well-arranged</tr>. </trans>
<eg><i lang=""ceb"">Tawhay ang mga butang sa lamísa,</i><trans> The things on the table are well-arranged. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>relaxed</tr>, with the mind free from trouble or worries. </trans>
</sense>
<sense n=""2a""><number>2a</number><trans> face looking fresh and relaxed, free from worry or pain. </trans>
</sense>
<sense n=""3""><number>3</number><trans> work that is light and easy to do. </trans>
<eg><i lang=""ceb"">Tawhay kaáyu ang trabáhu kay íhap lang,</i><trans> The work is very light because it’s just counting things. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B2; c1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> be, become <tr>orderly</tr>, <tr>well-arranged</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> be <tr>peaceful</tr> and free from trouble or worries. </trans>
<eg><i lang=""ceb"">Mitawhay ang íyang buut pagkatápus sa mga bátà sa ílang kursu,</i><trans> He felt relaxed and relieved after his children had finished their courses. </trans></eg>
<eg><i lang=""ceb"">Tawháya (itawhay) ang mga trabahadur,</i><trans> Calm the laborers down. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> for the face to look fresh and relaxed. </trans>
<eg><i lang=""ceb"">Mitawhay (natawhay) ang náwung sa bag-ung nanganak,</i><trans> The face of the woman that had just delivered her baby looked relieved and relaxed. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>become light</tr>. </trans>
<eg><i lang=""ceb"">Mutawhay ang trabáhu ug hingpit ta sa kasangkápan,</i><trans> The work becomes easy if one has all the tools one needs.
</trans></eg>
</sense></hom></entry>");
