INSERT INTO `wced_entry` VALUES (18585, "tawu", "998", "<entry page=""998"" id=""18585""><form id=""taxwu"" lang=""ceb"">táwu</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>man</tr>, <tr>person</tr>. </trans>
</sense>
<sense n=""1a""><number>1a</number><trans> <tr>man</tr>, <tr>fellow</tr>. </trans>
<eg><i lang=""ceb"">Naunsa mag táwu! Nanghawuk man!</i><trans> What’s gotten into the man! Kissing me like that. </trans></eg>
<eg><i lang=""ceb"">Kanà gung tawhána,</i><trans> That guy ... </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>follower</tr>. </trans>
<eg><i lang=""ceb"">Táwu nà siyang Markus,</i><trans> He is one of Marcos’ men. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>face card</tr>. </trans>
<eg><i lang=""ceb"">Nindut íyang baráha kay púlus táwu,</i><trans> He has good cards, all face cards. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> s.o. left to watch the house. </trans>
<eg><i lang=""ceb"">Kinsay táwu run sa balay,</i><trans> Who’s left to watch the house? </trans></eg>
</sense>
<sense n=""5""><number>5</number><trans> <tr>visitor</tr>. </trans>
<eg><i lang=""ceb"">Dì ku makalakaw kay náay táwu sa ámù,</i><trans> I can’t leave the house because we have visitors. </trans></eg>
</sense>
<sense n=""6""><number>6</number><trans> <ix>in phrases:</ix> </trans>
</sense></hom>
<entry><form id=""anak_sa_taxwu"" lang=""ceb"">anak sa <abbr expan=""táwu"" type=""lemma"">—</abbr></form>
<hom>
<sense n=""0""><trans> the son of man (Biblical). </trans>
</sense></hom></entry>
<entry><form id=""Taxwung_Matuxud"" lang=""ceb""><abbr expan=""Táwung"" type=""lemma"">-ng</abbr> Matúud</form>
<hom>
<sense n=""0""><trans> Jesus Christ. </trans>
</sense></hom></entry>
<entry><form id=""dakung_taxwu"" lang=""ceb"">dakung <abbr expan=""táwu"" type=""lemma"">—</abbr></form>
<hom>
<sense n=""0""><trans> <ix>see</ix> <xr lang=""ceb"" target=""#dakuq""><sc>dakù</sc></xr>. </trans>
</sense></hom></entry>
<entry><form id=""tawhaxna"" lang=""ceb"">tawhána</form>
<hom>
<sense n=""0""><trans> particular man. </trans>
<eg><i lang=""ceb"">Kanang tawhána,</i><trans> That man. </trans></eg>
<eg><i lang=""ceb"">Kinsang tawhána?</i><trans> Which man? </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b6]</itype><trans> stay and watch the house. </trans>
<eg><i lang=""ceb"">Taw-i ang báy samtang manábù ku,</i><trans> Watch the house while I go marketing. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B1256; b8]</itype><trans> be <tr>born</tr>. </trans>
<eg><i lang=""ceb"">Natáwu siya sa pasungan,</i><trans> He was born in a manger. </trans></eg>
<eg><i lang=""ceb"">Unsang pitsáha íyang natawhan?</i><trans> On what date was he born? </trans></eg>
<eg><i lang=""ceb"">Yútang natawhan,</i><trans> <tr>Native land</tr>. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[AN]</itype><trans> prepare for guests on special occasions. </trans>
<eg><i lang=""ceb"">Manáwu sila unyà sa pista sa ílang baryu,</i><trans> They will prepare for visitors when it is the feast day in their village. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A]</itype><trans> <tr>attend</tr> an affair or special occasion. </trans>
<eg><i lang=""ceb"">Mutáwu ta sa kasal níla,</i><trans> We will attend their wedding. </trans></eg>
<eg><i lang=""ceb"">Nagtáwu sila sa mísa sa kaadláwun,</i><trans> They are attending the early morning mass. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[AN; a12]</itype><trans> <tr>pay a visit</tr>. </trans>
<eg><i lang=""ceb"">Gitáwu níla ang mga prísu,</i><trans> They <tr>visited</tr> the prisoners. </trans></eg>
</sense></hom></entry>
<entry><form id=""pataxwu"" lang=""ceb""><abbr expan=""patáwu"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; ac]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> have s.o. stay in a house. </trans>
</sense>
<sense n=""2""><number>2</number><trans> give rise to a feeling. </trans>
<eg><i lang=""ceb"">Mupatáwu sa talagsaung kadásig,</i><trans> Gives rise to an unusual enthusiasm. </trans></eg>
</sense></hom></entry>
<entry><form id=""pakataxwu"" lang=""ceb""><abbr expan=""pakatáwu"" type=""lemma"">paka-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A13; a]</itype><trans> come, bring into the world. </trans>
<eg><i lang=""ceb"">Ngánung gipakatáwu pa aku?</i><trans> Why was I brought into this world? </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A13]</itype><trans> take the form of man, pretend to be man. </trans>
<eg><i lang=""ceb"">Magpakatáwu ang ingkantu kun mangulitáwu,</i><trans> The enchanted beings take the form of man when they go after women. </trans></eg>
</sense></hom></entry>
<entry><form id=""hitaxwu_hataxwu"" lang=""ceb""><abbr expan=""hitáwu"" type=""lemma"">hi-</abbr>/<abbr expan=""hatáwu"" type=""lemma"">ha-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B1256]</itype><trans> be left in a house to watch it. </trans>
<eg><i lang=""ceb"">Siya na lay nahitáwu sa balay,</i><trans> She was the only one left in the house to watch it. </trans></eg>
</sense></hom></entry>
<entry><form id=""tawutaxwu"" lang=""ceb"">tawutáwu</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>figurehead</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A1B12; c16]</itype><trans> make s.o. a figurehead, become a figurehead. </trans>
</sense></hom></entry>
<entry><form id=""taw-an"" lang=""ceb"">taw-an</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> not unoccupied. </trans>
<eg><i lang=""ceb"">Taw-an nang payága kay dúnay sugà,</i><trans> That hut is not unoccupied because there’s <pb n=""999""/>light. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> inhabited by supernatural beings. </trans>
<eg><i lang=""ceb"">Magdiwáta sila sa káhuyng taw-an,</i><trans> They’ll offer offerings to the tree that is inhabited by spirits. </trans></eg>
</sense></hom></entry>
<entry><form id=""tawhaxnun"" lang=""ceb"">tawhánun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>characteristic</tr> of humans, <tr>earthly</tr>. </trans>
<eg><i lang=""ceb"">Gibyáan sa mungha ang mga tawhánung tingúhà,</i><trans> The nun put away earthly desires. </trans></eg>
<eg><i lang=""ceb"">Masayup kita tungud kay tawhánun,</i><trans> We commit mistakes because we are human. </trans></eg>
</sense></hom></entry>
<entry><form id=""makitawhaxnun"" lang=""ceb"">makitawhánun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>humanistic</tr>, <tr>humanitarian</tr>. </trans>
<eg><i lang=""ceb"">Makitawhánun siya, dílì manaugdáug sa láin,</i><trans> He is humanitarian. He does not oppress other people. </trans></eg>
</sense></hom></entry>
<entry><form id=""tinaxwu"" lang=""ceb""><abbr expan=""tináwu"" type=""lemma"">-in-</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> done in a human way. </trans>
<eg><i lang=""ceb"">Ang ímung gibúhat dì na tináwu, linuug na,</i><trans> What you did was no longer human but beastly. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> paid by individuals, not by the whole vehicle, service, etc. </trans>
<eg><i lang=""ceb"">Tináwu ang báyad sa dyíp, dì pakyaw,</i><trans> The amount of fare depends on the number of people. It’s not for the whole car. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[c1]</itype><trans> pay for individually, not for a whole. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[c1]</itype><trans> do s.t. <tr>manually</tr>, use bare manpower on as compared to the use of machines. </trans>
<eg><i lang=""ceb"">Kun tinawhun (itináwu) nà pagbúhat madúgay giyud,</i><trans> If you do it <tr>by hand</tr> it will take time. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A13; b6]</itype><trans> <tr>give a banquet</tr>. </trans>
<eg><i lang=""ceb"">Dì ka ba magtináwu rung pyista?</i><trans> Aren’t you going to prepare a banquet this coming feast? </trans></eg>
</sense></hom></entry>
<entry><form id=""katawhan"" lang=""ceb"">katawhan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>people</tr>, <tr>masses</tr>.</trans>
<eg><i lang=""ceb""> Kabus ang átung mga katawhan,</i><trans> Our people are poor. </trans></eg>
</sense></hom></entry>
<entry><form id=""pagkataxwu"" lang=""ceb""><abbr expan=""pagkatáwu"" type=""lemma"">pagka-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>character</tr>, <tr>personality</tr>. </trans>
<eg><i lang=""ceb"">Kasalígan siyang pagkatáwu,</i><trans> He has a trustworthy character. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>birth</tr>. </trans>
</sense></hom></entry>
<entry><form id=""kinataxwu"" lang=""ceb""><abbr expan=""kinatáwu"" type=""lemma"">kina-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>nature</tr>, <tr>inborn</tr> character or <tr>inherent</tr> tendencies of a person. </trans>
<eg><i lang=""ceb"">Kinatáwu nà níla nga mga dagkù sila kaáyu,</i><trans> It runs in their family that they grow to be large people. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>genitalia</tr> (euphemism). </trans>
</sense></hom></entry>
<entry><form id=""tawutaxwu"" lang=""ceb"">tawutáwu</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> s.t. like a person, e.g. <tr>scarecrow</tr> or the like. </trans>
</sense>
<sense n=""2""><number>2</number><trans> pupil and iris of the eye. </trans>
</sense></hom></entry>
<entry><form id=""tinawutaxwu"" lang=""ceb"">tinawutáwu</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>comic strips</tr>. </trans>
<eg><i lang=""ceb"">Unáhun kug bása ang tinawutáwung sugilánun,</i><trans> I’ll read the comic strips first. </trans></eg>
</sense></hom></entry>
<entry><form id=""ulitaxwu"" lang=""ceb""><abbr expan=""ulitáwu"" type=""lemma"">uli-</abbr></form>
<hom>
<sense n=""0""><trans> <ix>see</ix> <xr lang=""ceb"" target=""#ulitaxwu""><sc>ulitáwu</sc></xr>.
</trans>
</sense></hom></entry></entry>");
