INSERT INTO `wced_entry` VALUES (18587, "tawugtawug", "999", "<entry page=""999"" id=""18587""><form id=""tawugtawug"" lang=""ceb"">tawugtawug</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> for s.t. long and thin that is standing with the base firmly attached to wave back and forth. </trans>
<eg><i lang=""ceb"">Antína sa awtu nga magtawugtawug inighúnung sa awtu,</i><trans> An automobile antenna that waves back and forth when the car stops.
</trans></eg>
</sense></hom></entry>");
