INSERT INTO `wced_entry` VALUES (18588, "tawun", "999", "<entry page=""999"" id=""18588""><form id=""tawun"" lang=""ceb"">tawun</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>move</tr> to a place to take shelter or refuge. </trans>
<eg><i lang=""ceb"">Nakatawun na mi sa simbahan pagbahà,</i><trans> We moved to the church when there was a flood. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> move to another place. </trans>
<eg><i lang=""ceb"">Nakatawun na sila sa Mindanaw,</i><trans> They have already moved to Mindanao. </trans></eg>
</sense></hom>
<entry><form id=""tawuntaxwun"" lang=""ceb"">tawuntáwun</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b5]</itype><trans> <tr>transfer</tr>, go over from place to place. </trans>
<eg><i lang=""ceb"">Nagtawuntáwun lang ang mga manaygúnay sa kabalayan,</i><trans> The carolers caroled from house to house. </trans></eg>
<eg><i lang=""ceb"">Gitawuntawúnan (gitawuntáwun) sa bátà ug paráyig ang íyang máma ug pápa,</i><trans> The child went back and forth between his mother and father asking for affection.
</trans></eg>
</sense></hom></entry></entry>");
