INSERT INTO `wced_entry` VALUES (18590, "taya1", "999", "<entry page=""999"" id=""18590""><form id=""tayaq"" lang=""ceb"">tayà<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> place a bet. </trans>
<eg><i lang=""ceb"">Adtu ku tayà sa hárì,</i><trans> I’ll bet on heads. </trans></eg>
<eg><i lang=""ceb"">Ayawg itayà ang tibuuk puhúnan,</i><trans> Don’t stake all the money you have. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> stake one’s life, honor. </trans>
<eg><i lang=""ceb"">Nagtayà ang sundálu sa íyang kinabúhì álang sa násud,</i><trans> The soldier puts his life on the line for his country. </trans></eg>
<eg><i lang=""ceb"">Ákung itayà ákung dungug paglában sa sinumbung,</i><trans> I’ll stake my name to defend the accused. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; b6(1)]</itype><trans> pay for the others in a treat (slang). </trans>
<eg><i lang=""ceb"">Akuy magtayà sa átung inúmun,</i><trans> I’ll pay for the drinks. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> bet. </trans>
</sense>
<sense n=""2""><number>2</number><trans> treat, turn to pay (slang).
</trans>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (18590, "tayà", "taya", "s", "vn");
INSERT INTO `wced_entry` VALUES (18591, "taya2", "999", "<entry page=""999"" id=""18591""><form id=""tayaq2"" lang=""ceb"">tayà<sub>2</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>rust</tr>. </trans>
</sense></hom>
<entry><form id=""way_tayaq_ang_bulsa"" lang=""ceb"">way <abbr expan=""tayà"" type=""lemma"">—</abbr> ang bulsa</form>
<hom>
<sense n=""0""><trans> be broke (slang). </trans>
<eg><i lang=""ceb"">Wà giyud bisag tayà ákung bursa,</i><trans> My pocket doesn’t have a thing (lit. not even rust [from money]). </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; b4]</itype><trans> become rusty. </trans>
<eg><i lang=""ceb"">Tay-an ang gamitung dì lanahan,</i><trans> Tools get rusty if you don’t oil them. </trans></eg>
</sense>
