INSERT INTO `wced_entry` VALUES (18601, "tayim", "1000", "<entry page=""1000"" id=""18601""><form id=""tayim"" lang=""ceb"">tayim</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> time, o’clock. </trans>
<eg><i lang=""ceb"">Unsay ímung tayim,</i><trans> What time do you have? </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> time at which s.t. is scheduled to begin or end. </trans>
<eg><i lang=""ceb"">Daliag human kay hápit na ang tayim,</i><trans> Finish it quickly because it’s almost time. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> time, chance. </trans>
<eg><i lang=""ceb"">Wà kuy tayim pagrilaks,</i><trans> I don’t have time to relax. </trans></eg>
</sense></hom>
<entry><form id=""tayim_pa"" lang=""ceb""><abbr expan=""tayim"" type=""lemma"">—</abbr> pa</form>
<hom>
<sense n=""1""><number>1</number><trans> time out, let me have some more time. </trans>
<eg><i lang=""ceb"">Tayim pa. Wà pa kung katágù,</i><trans> Time out. I haven’t hidden yet. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> just a minute. </trans>
<eg><i lang=""ceb"">Tayim pa kay tawgun ku siya,</i><trans> Just a minute. I’ll call her. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> just a second, I’ll be right back. </trans>
<eg><i lang=""ceb"">Tayim pa. Ákung kuháun,</i><trans> Just a second. I’ll get it. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> excuse me, let me interrupt or change the subject. </trans>
<eg><i lang=""ceb"">Tayim pa ra gud, kinsa tu?</i><trans> Excuse me. Who did you say it was? </trans></eg>
</sense>
<sense n=""5""><number>5</number><trans> excuse me (correcting oneself). </trans>
<eg><i lang=""ceb"">Muabut sa Lúnis. Tayim pa diay, sa Martis,</i><trans> He is arriving on Monday, I mean, on Tuesday. </trans></eg>
</sense></hom></entry>
<entry><form id=""tayim_awut"" lang=""ceb""><abbr expan=""tayim"" type=""lemma"">—</abbr> awut</form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#tayimpa""><sc>tayimpa</sc></xr>, <i lang=""ceb""><number>1</number>.</i> </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b]</itype><trans> ascertain the time, rate. </trans>
<eg><i lang=""ceb"">Taymi kung magtayip,</i><trans> Time me typewriting. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B256]</itype><trans> be time to start or end. </trans>
<eg><i lang=""ceb"">Buhíi ang klási kay hápit na mutayim (matayim),</i><trans> Dismiss the class because it’s almost time. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A2]</itype><trans> say ‘time out’, ‘wait a second’. </trans>
<eg><i lang=""ceb"">Sa ríng dì ka makatayim ug kupúgan ka na sa kuntra,</i><trans> In the ring you can’t ask for time-out when your opponent mauls you.
</trans></eg>
</sense></hom></entry></entry>");
