INSERT INTO `wced_entry` VALUES (18608, "tayming", "1000", "<entry page=""1000"" id=""18608""><form id=""tayming"" lang=""ceb"">tayming</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>timing</tr>, the way s.t. is made to coincide with s.t. else. </trans>
</sense>
<sense n=""2""><number>2</number><trans> timing in music, rate of beating. </trans>
</sense>
<sense n=""2a""><number>2a</number><trans> tempo. </trans>
<eg><i lang=""ceb"">Rumba ang tayming íni, dì tanggu,</i><trans> This is a rumba beat, not tango. </trans></eg>
</sense>
<sense n=""2b""><number>2b</number><trans> sense of rhythm. </trans>
<eg><i lang=""ceb"">Maáyug tayming nang batáa sa íyang pagkanta,</i><trans> That boy sings with very good timing. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> well, opportunely timed. </trans>
<eg><i lang=""ceb"">Tayming kaáyu ang ámung pag-abut sa íla kay nagbinignit sila,</i><trans> We timed our arrival perfectly because they were serving <ix>binignit.</ix> </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> in time, rhythmical. </trans>
<eg><i lang=""ceb"">Tayming kaáyu ang istíping sa íyang sáyaw sa ákung kanta,</i><trans> His dance steps are in time with my song. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2NC3; b2c1]</itype><trans> synchronize, do s.t. so as to make it correspond with s.t. else. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A12; b2]</itype><trans> happen on, get a chance to. </trans>
<eg><i lang=""ceb"">Nakatayming siyag baylig gwápa,</i><trans> He happened to dance with a pretty girl. </trans></eg>
</sense></hom>
<entry><form id=""panayming"" lang=""ceb""><abbr expan=""panayming"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2]</itype><trans> take a chance on. </trans>
<eg><i lang=""ceb"">Panayming lag ansir. Siliksiyun tayip bítaw,</i><trans> Take a chance on your answer. Anyway it’s a multiple-choice exam.
</trans></eg>
</sense></hom></entry></entry>");
