INSERT INTO `wced_entry` VALUES (18635, "tibas", "1002", "<entry page=""1002"" id=""18635""><form id=""tixbas"" lang=""ceb"">tíbas</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a12]</itype><trans> <tr>take the rest</tr> of s.t., <tr>finish</tr> doing the remaining portion. </trans>
<eg><i lang=""ceb"">Akuy mitíbas ug pamutul sa mga káhuy sa maisan,</i><trans> I cut the rest of the trees in the cornfield. </trans></eg>
<eg><i lang=""ceb"">Kinsay nagtíbas ug palit sa ímung mga mangga?</i><trans> Who bought the rest of your mangoes? </trans></eg>
<eg><i lang=""ceb"">Tibása nang kan-un sa ímung plátu,</i><trans> Eat the rest of the food on your plate. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B23; b6]</itype><trans> for crops or fruits to be past their season. </trans>
<eg><i lang=""ceb"">Hápit na matíbas (mutíbas) ang mga mangga,</i><trans> Mango fruits will soon be <tr>out of season</tr>. </trans></eg>
<eg><i lang=""ceb"">Nagkatibas na ang áni sa mga humay,</i><trans> The rice harvest season is starting to be over.
</trans></eg>
</sense></hom></entry>");
