INSERT INTO `wced_entry` VALUES (18637, "tibaw", "1002", "<entry page=""1002"" id=""18637""><form id=""tixbaw"" lang=""ceb"">tíbaw</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a12]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>visit</tr>, usually to see how s.t. is. </trans>
<eg><i lang=""ceb"">Aku ray mutíbaw sa ákung nangkà ug nahinug na ba,</i><trans> I’ll take a look at the jackfruit that I kept and see if it’s ripe yet. </trans></eg>
<eg><i lang=""ceb"">Tibáwun na sad níya ang íyang tinagúan,</i><trans> He will visit his mistress again. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> inspect a trap to see if there is a catch. </trans>
<eg><i lang=""ceb"">Way kuhà ang gitíbaw kung lit-ag,</i><trans> The trap I inspected had no catch.
</trans></eg>
</sense></hom></entry>");
