INSERT INTO `wced_entry` VALUES (18639, "tibhang", "1002", "<entry page=""1002"" id=""18639""><form id=""tibhang"" lang=""ceb"">tibhang</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b7]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>remove</tr> a portion of a whole. </trans>
</sense>
<sense n=""1a""><number>1a</number><trans> <tr>cut off</tr> a piece to make s.t. </trans>
<eg><i lang=""ceb"">Ákung tibhángan ang pára sa bàbà sa sag-ub,</i><trans> I will <tr>chip off</tr> a piece of the end of the bamboo to serve as a mouth. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>lessen</tr>, <tr>diminish</tr>. </trans>
<eg><i lang=""ceb"">Way makatibhang sa ákung pagbátì nímu,</i><trans> Nothing can make me love you less. </trans></eg>
<eg><i lang=""ceb"">Matibhang ákung trabáhu kun mutábang ka,</i><trans> My work will be less if you help me. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>deduction from</tr>, <tr>lack</tr>. </trans>
<eg><i lang=""ceb"">Gihátag níya ang swildu ngadtu sa íyang asáwa nga way tibhang,</i><trans> He handed his salary intact to his wife. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> space left after s.t. was removed. </trans>
<eg><i lang=""ceb"">Ang tibhang sa yútà nga giagian sa karsáda mga siyin mitrus kwadrádu,</i><trans> About 100 square meters were taken off the land for the road. </trans></eg>
</sense></hom>
<entry><form id=""tibhangtibhang"" lang=""ceb"">tibhangtibhang</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b]</itype><trans> <tr>chop</tr> the outer part of a tree trunk to leave open marks.
</trans>
</sense></hom></entry></entry>");
