INSERT INTO `wced_entry` VALUES (18646, "tibis", "1002", "<entry page=""1002"" id=""18646""><form id=""tixbis"" lang=""ceb"">tíbis</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> pour <tr>water</tr> on s.t. to <tr>rinse</tr> it off or sprinkle it. </trans>
<eg><i lang=""ceb"">Túa siya sa gardin nagtíbis sa mga tanum,</i><trans> He is in the garden watering the plants. </trans></eg>
<eg><i lang=""ceb"">Bi, tibísan nátù ug túbig arun makapanghinaw ka,</i><trans> Here, let’s pour water on your hands so you can wash them. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> pour liquid into a container. </trans>
<eg><i lang=""ceb"">Aku lay mutíbis sa tubà arun dì mayabu,</i><trans> I’ll pour the palm toddy into your glass so that it won’t spill over.
