INSERT INTO `wced_entry` VALUES (18650, "tibu", "1002", "<entry page=""1002"" id=""18650""><form id=""tibuq"" lang=""ceb"">tibù</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B126; a2]</itype><trans> do s.t. in large quantity rather than little at a time, be in a large quantity. </trans>
<eg><i lang=""ceb"">Natibù ang labhunun kay nasakit ku,</i><trans> My laundry piled up because I was sick. </trans></eg>
<eg><i lang=""ceb"">Kusgan giyud ang makatibù ínig hákut,</i><trans> Whoever can carry all of this at once must be strong. </trans></eg>
<eg><i lang=""ceb"">Tib-ag báyad ang útang. Ayawg datadatáhi,</i><trans> Pay the debts all at once, not bit by bit. </trans></eg>
</sense></hom>
<entry><form id=""tixbuq"" lang=""ceb""><abbr expan=""tíbù"" type=""lemma"">(←)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2C; c1]</itype><trans> <tr>group</tr> or <tr>join</tr> together. </trans>
<eg><i lang=""ceb"">Nagtíbù sa usa ka dápit ang mga bantúgang mamumulung,</i><trans> All the best orators grouped in one place. </trans></eg>
<eg><i lang=""ceb"">Dílì makatíbù ang mga kabus ánang kapunungána,</i><trans> The poor cannot join that organization. </trans></eg>
</sense></hom></entry>
<entry><form id=""tinib-anay_tinib-axnay"" lang=""ceb"">tinib-anay, tinib-ánay</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> putting everything one has into it at once. </trans>
<eg><i lang=""ceb"">Tinib-anay tung ílang panamílit,</i><trans> They poured all of their emotions into their <pb n=""1003""/>farewell.
</trans></eg>
</sense></hom></entry></entry>");
