<sense n=""0""><trans> (from <ix>buuk</ix>) </trans>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> beads of <tr>sweat</tr> or drops of <tr>tears</tr> formed s.w. </trans>
<eg><i lang=""ceb"">Tibug-uk nga mga lúhà,</i><trans> Drops of tears. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B46N; b6]</itype><trans> for beads of sweat to form or tears to well up. </trans>
<eg><i lang=""ceb"">Mitibug-uk (nanibug-uk) ákung singut dihang gikasab-an kung Tátay,</i><trans> I got beads of sweat on my forehead when Father scolded me. </trans></eg>
<eg><i lang=""ceb"">Hápit na mutúlù ang nagtibug-uk níyang lúhà,</i><trans> The tears that welled up in her eyes are about to come streaming down.
</trans></eg>
</sense></hom></entry>");
