INSERT INTO `wced_entry` VALUES (18662, "tibul", "1003", "<entry page=""1003"" id=""18662""><form id=""tibul"" lang=""ceb"">tibul</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> pour liquid into a vessel with a narrow opening. </trans>
<eg><i lang=""ceb"">Daghang úsik kun ikay mutibul sa lamparilya,</i><trans> You waste so much when you pour kerosene into the lamp. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> pour a liquid over another liquid. </trans>
<eg><i lang=""ceb"">Tibuli ug gás ang kanal arun mamatay ang wayawaya,</i><trans> Pour kerosene over the ditch so that the wrigglers will die. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> have <tr>intercourse</tr> (humorous). </trans>
<eg><i lang=""ceb"">Magbagulbul ang asáwa ug dílì katiblan káda gabíi,</i><trans> The wife complains if she doesn’t have bit of sex every night. </trans></eg>
</sense></hom>
<entry><form id=""tibulaxnan_tiblanan"" lang=""ceb""><abbr expan=""tibulánan"" type=""lemma"">-anan(←)</abbr>, tiblanan</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> pouring vent or hole. </trans>
</sense>
<sense n=""2""><number>2</number><trans> s.t. which needs to have liquids poured into it. </trans>
<eg><i lang=""ceb"">Ayaw sag dagkuti nang sugáa kay tibulánan (tiblanan) pa nà,</i><trans> Don’t light that lamp yet because it has not been filled with kerosene.
</trans></eg>
</sense></hom></entry></entry>");
