INSERT INTO `wced_entry` VALUES (18667, "tibuuk", "1003", "<entry page=""1003"" id=""18667""><form id=""tibuuk"" lang=""ceb"">tibuuk</form>
<hom>
<sense n=""0""><trans> (from <ix>buuk</ix>) </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>whole</tr>, <tr>all</tr> of s.t. </trans>
<eg><i lang=""ceb"">Gidúngug sa tibuuk lungsud ang ílang pagtában,</i><trans> The whole town knew about their eloping. </trans></eg>
<eg><i lang=""ceb"">Simbáhun ku ikaw sa tibuuk kung kasingkásing,</i><trans> I’ll adore you with all my heart. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> whole, <tr>unfragmented</tr>. </trans>
<eg><i lang=""ceb"">Sinsiyúi ring tibuuk písu,</i><trans> Change this whole peso bill. </trans></eg>
<eg><i lang=""ceb"">Palita nang tibuuk, ayaw nang píkas,</i><trans> Buy the whole piece, not just a half. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> <tr>whole grain</tr>, not ground. </trans>
<eg><i lang=""ceb"">Unsa man nang maísa, tibuuk u ginaling?</i><trans> What kind of corn is that, whole grain or ground? </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>solid tires</tr>, not pneumatic. </trans>
<eg><i lang=""ceb"">Sa karáang mga trák ang gúma sa ligid tibuuk,</i><trans> The old trucks had solid rubber wheels. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> resonant in timbre of voice. </trans>
<eg><i lang=""ceb"">Máayu siyang mukanta kay tibuuk kaáyu siya ug tíngug,</i><trans> He sings well because he has a very resonant voice. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a2]</itype><trans> make whole, in one piece. </trans>
<eg><i lang=""ceb"">Tibuk-a ning dyigsu pásul,</i><trans> Put the jigsaw puzzle together. </trans></eg>
<eg><i lang=""ceb"">Wà <pb n=""1004""/>siya katibuk-ig báyad,</i><trans> He hasn’t been paid <tr>in full</tr>. </trans></eg>
</sense></hom>
<entry><form id=""tibuuk_ang_hunaqhuxnaq_hukum"" lang=""ceb""><abbr expan=""tibuuk"" type=""lemma"">—</abbr> ang hunàhúnà, hukum</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B126]</itype><trans> be resolved, decided. </trans>
<eg><i lang=""ceb"">Natibuuk ang ákung hunàhúnà nga magmadri (Natibuuk sa ákung hunàhúnà ang pagmadri),</i><trans> I have decided to become a nun. </trans></eg>
</sense></hom></entry>
<entry><form id=""kinatibuk-an"" lang=""ceb"">kinatibuk-an</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> absolutely <tr>undivided</tr> <tr>whole</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>aggregate</tr>, <tr>total</tr> <tr>sum</tr>.
</trans>
</sense></hom></entry></entry>");
