INSERT INTO `wced_entry` VALUES (18670, "tibway", "1004", "<entry page=""1004"" id=""18670""><form id=""tibway"" lang=""ceb"">tibway</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a12]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>complete</tr> s.t. unfinished. </trans>
<eg><i lang=""ceb"">Kinsay mutibway sa gibyáan nímung daruhun?</i><trans> Who’ll <tr>finish</tr> plowing the rest of the field? </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> buy the remaining portion of s.t. </trans>
<eg><i lang=""ceb"">Tibwáya ring nahibilin kay ákung baratúhun,</i><trans> Buy all that’s left, and I’ll let you have it cheap. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> put to an <tr>end</tr>. </trans>
<eg><i lang=""ceb"">Kining hilu mauy mutibway ning kinabúhì,</i><trans> This poison will <tr>end</tr> my life. </trans></eg>
</sense></hom>
<entry><form id=""tibway_ug"" lang=""ceb""><abbr expan=""tibway"" type=""lemma"">—</abbr> ug</form>
<hom>
<sense n=""0""><trans> <tr>should have</tr> [done], would <tr>rather</tr> [do] than what is the case now. </trans>
<eg><i lang=""ceb"">Tibwayg mikúyug tu, malingaw untà ku,</i><trans> I should have gone with them. I would have had a good time. </trans></eg>
<eg><i lang=""ceb"">Tibwayg mamatay kay sa mag-antus,</i><trans> I’d rather die than suffer the way I am. </trans></eg>
</sense></hom></entry>
<entry><form id=""tibwanay"" lang=""ceb"">tibwanay</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[C2]</itype><trans> put an end to each other. </trans>
<eg><i lang=""ceb"">Ug wà ulánga magtibwanay ang duha,</i><trans> If they had not been separated, they would have killed each other.
</trans></eg>
</sense></hom></entry></entry>");
