INSERT INTO `wced_entry` VALUES (18674, "tidlum", "1004", "<entry page=""1004"" id=""18674""><form id=""tidlum"" lang=""ceb"">tidlum</form>
<hom>
<sense n=""0""><trans> (from <ix>lalum</ix>) </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AP; cP]</itype><trans> dive under water, <tr>sink</tr>. </trans>
<eg><i lang=""ceb"">Mitidlum ang angkla,</i><trans> The anchor sank. </trans></eg>
<eg><i lang=""ceb"">Mitidlum (mipatidlum) ang mamamánà sa lawum,</i><trans> The diver dove into the deep. </trans></eg>
<eg><i lang=""ceb"">Itidlum (ipatidlum) ang submarínu kay dúnay kaáway,</i><trans> <tr>Submerge</tr> the submarine because there’s an enemy. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b6]</itype><trans> for the sun to set. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[A]</itype><trans> sink into the mind or feelings (literary). </trans>
<eg><i lang=""ceb"">Ang sirmun wà makatidlum sa íyang pagbátì,</i><trans> The message of the sermon did not sink into his feelings. </trans></eg>
</sense></hom>
<entry><form id=""hitidlum_hatidlum"" lang=""ceb""><abbr expan=""hitidlum"" type=""lemma"">hi-</abbr>/<abbr expan=""hatidlum"" type=""lemma"">ha-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B1256]</itype><trans> sink involuntarily. </trans>
<eg><i lang=""ceb"">Nahílum si Lúlu, nahitidlum,</i><trans> Grandfather sank into silence.
</trans></eg>
</sense></hom></entry></entry>");
