INSERT INTO `wced_entry` VALUES (18680, "tig-a", "1004", "<entry page=""1004"" id=""18680""><form id=""tig-a"" lang=""ceb"">tig-a</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>hard</tr>, not soft. </trans>
<eg><i lang=""ceb"">Tig-a daw puthaw,</i><trans> Hard as steel. </trans></eg>
<eg><i lang=""ceb"">Tig-a giyug balatían ang dì malúuy kaníya,</i><trans> You have to be <tr>heartless</tr> not to pity her. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B24; b6]</itype><trans> become hard, not soft. </trans>
<eg><i lang=""ceb"">Mitig-a ang karning gibulad,</i><trans> The meat which was dried under the sun got <tr>hardened</tr>. </trans></eg>
</sense></hom>
<entry><form id=""matig-a"" lang=""ceb""><abbr expan=""matig-a"" type=""lemma"">ma-</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> very <tr>hard</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> be hard. </trans>
<eg><i lang=""ceb"">Nagmatig-ang kasingkásing,</i><trans> A hard heart. </trans></eg>
</sense></hom></entry>
<entry><form id=""patig-atig-a"" lang=""ceb"">patig-atig-a</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> pretend to be unyielding. </trans>
<eg><i lang=""ceb"">Nagpatig-atig-a siya kay magpalúgit,</i><trans> She pretended to be unyielding to give him a hard time.
</trans></eg>
</sense></hom></entry></entry>");
