INSERT INTO `wced_entry` VALUES (18684, "tigaman", "1004", "<entry page=""1004"" id=""18684""><form id=""tigaxman"" lang=""ceb"">tigáman</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b(1)]</itype><trans> <tr>remember</tr>, keep s.t. in one’s mind thinking about it. </trans>
<eg><i lang=""ceb"">Nagtigáman kug singsing nga ákung palitun inigswildu,</i><trans> I had my eye on a ring which I wanted to buy on payday. </trans></eg>
<eg><i lang=""ceb"">Nakatigáman ka kung unsang adláwa ang kasal ni Bíbi?</i><trans> Can you <tr>recall</tr> the date of Baby’s marriage? </trans></eg>
<eg><i lang=""ceb"">Tigamni ang ákung pahimangnu nímu,</i><trans> Always <tr>bear in mind</tr> the precautions I gave you. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> sign to help recall s.t. </trans>
<eg><i lang=""ceb"">Dúna kuy tigáman nga gikúlit sa mga káhuy arun dì ta mawā̂ sa lasang,</i><trans> I carved some signs on the trees so we won’t get lost in the jungle.
</trans></eg>
</sense></hom></entry>");
