INSERT INTO `wced_entry` VALUES (18685, "tigas", "1004", "<entry page=""1004"" id=""18685""><form id=""tigas"" lang=""ceb"">tigas</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>tough</tr>, <tr>fearless</tr>. </trans>
<eg><i lang=""ceb"">Tigas nà siya, dì madág hulgà,</i><trans> He’s tough and cannot be threatened. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> exceptionally good in s.t. </trans>
<eg><i lang=""ceb"">Tigas kaáyu nà siya mubaskitbul,</i><trans> He’s very good in playing basketball. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B126; b6]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> become tough or a <tr>toughie</tr>. </trans>
<eg><i lang=""ceb"">Matigas ba ang baklà?</i><trans> Can a sissy become a <tr>tough guy</tr>? </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> be exceptionally good in s.t. </trans>
<eg><i lang=""ceb"">Ang kaáyu níyang mulantúgì mauy nakatigas (nakapatigas) níyang abugádu,</i><trans> His skill in debate made him a very good lawyer. </trans></eg>
</sense></hom>
<entry><form id=""pakatigas"" lang=""ceb""><abbr expan=""pakatigas"" type=""lemma"">paka-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13; a12]</itype><trans> act like a tough, treat like a tough. </trans>
<eg><i lang=""ceb"">Ang tigas magpakatigas,</i><trans> A toughie will act like one. </trans></eg>
</sense></hom></entry>
<entry><form id=""patigastixgas"" lang=""ceb"">patigastígas</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> pretend to be tough. </trans>
<eg><i lang=""ceb"">Nagpatigastígas uruy ang báyut,</i><trans> There goes the sissy pretending to be tough.
</trans></eg>
</sense></hom></entry></entry>");
