INSERT INTO `wced_entry` VALUES (18687, "tigaw1", "1005", "<entry page=""1005"" id=""18687""><form id=""tixgaw"" lang=""ceb"">tígaw<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a1]</itype><trans> <tr>disturb</tr>, break up the quiet, serenity, or stillness of. </trans>
<eg><i lang=""ceb"">Ang butu mauy mitígaw sa kamíngaw sa kagabhíun,</i><trans> The explosion disturbed the stillness of the night. </trans></eg>
<eg><i lang=""ceb"">Ayawg tigáwa ang duut sa isdà,</i><trans> Don’t disturb the school of fish. </trans></eg>
</sense></hom>
