INSERT INTO `wced_entry` VALUES (18700, "tigi1", "1005", "<entry page=""1005"" id=""18700""><form id=""tixgiq"" lang=""ceb"">tígì<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AC; a1c3]</itype><trans> pit persons against each other to determine who is the best in s.t. </trans>
<eg><i lang=""ceb"">Ang prinsísay mutígì sa buut mangasáwa níya,</i><trans> The princess will have the people that want to marry her vie with each other. </trans></eg>
<eg><i lang=""ceb"">Magtígì (magtigiay) ta kun kinsay taas ug utung,</i><trans> Let’s have a contest to see who can hold his breath longest. </trans></eg>
<eg><i lang=""ceb"">Palaínum sad tung gikatígì nákug ínum,</i><trans> The one I had a drinking bout with was also a drunkard. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a12]</itype><trans> diagnose an illness by a marble placed at the edge of a glass. A yes-no question is put by the sorcerer, and if the marble falls, the answer is ‘no’. </trans>
<eg><i lang=""ceb"">Tigíun nátù ang sakit,</i><trans> We will divine the sickness. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>contest</tr> between two people or teams. </trans>
</sense></hom>
<entry><form id=""tigiay"" lang=""ceb""><abbr expan=""tigiay"" type=""lemma"">-ay(→)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[C]</itype><trans> <tr>vie</tr> with one another. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>contest</tr>. </trans>
</sense></hom></entry>
<entry><form id=""panagtixgiq"" lang=""ceb""><abbr expan=""panagtígì"" type=""lemma"">panag-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> a <tr>vying</tr> with one another. </trans>
<eg><i lang=""ceb"">Ang kulilísi panagtígì sa mga birsu,</i><trans> The <ix>kulilísi</ix> is a contest in making verses.
</trans></eg>
</sense></hom></entry></entry>");
