<sense n=""1""><number>1</number> <itype>[B26]</itype><trans> turn deaf ears to an order or to pleadings. </trans>
<eg><i lang=""ceb"">Mitigkul lang si Huwan nga gipakabù ug túbig,</i><trans> Juan just turned deaf ears when he was told to fetch water. </trans></eg>
