<sense n=""2""><number>2</number> <itype>[B2]</itype><trans> be, become <tr>stubborn</tr>. </trans>
<eg><i lang=""ceb"">Mutigkul hinúun siyag buyagun,</i><trans> He’ll become more stubborn if he’ll be reprimanded. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
