<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> interest payable in kind (usually farm products) for money borrowed. The interest is paid continuously until the principal in cash is repaid. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
