INSERT INTO `wced_entry` VALUES (18738, "tiil", "1007", "<entry page=""1007"" id=""18738""><form id=""tiil"" lang=""ceb"">tiil</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>foot</tr>. </trans>
