<sense n=""0""> <itype>[A2; c]</itype><trans> fight with the legs. </trans>
<eg><i lang=""ceb"">Nakabunù ang ugis kay maáyung maniil,</i><trans> The white cock won because it fought well with its legs. </trans></eg>
