INSERT INTO `wced_entry` VALUES (18812, "tikup", "1010", "<entry page=""1010"" id=""18812""><form id=""tixkup"" lang=""ceb"">tíkup</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> closed tight, without holes or spaces in between. </trans>
<eg><i lang=""ceb"">Tíkup pagkalála ning baníga,</i><trans> This mat was tightly woven. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c1]</itype><trans> make s.t. <tr>tight</tr>. </trans>
<eg><i lang=""ceb"">Kadaug kang mutíkup ug siklat ánà,</i><trans> Are you strong enough to weave the bamboo slats tight? </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a1]</itype><trans> close up the opening of a hollow area or a hole in s.t. that wraps around s.t. else. </trans>
<eg><i lang=""ceb"">Akuy mutíkup sa púyù,</i><trans> I’ll sew up the pouch. </trans></eg>
<eg><i lang=""ceb"">Tikúpa na ang kural líbut sa balay,</i><trans> Make the ends of the fence around the house meet.
</trans></eg>
</sense></hom></entry>");
