INSERT INTO `wced_entry` VALUES (18813, "tik-up", "1010", "<entry page=""1010"" id=""18813""><form id=""tik-up"" lang=""ceb"">tik-up</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AB46; b2c1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> cover over an opening with s.t. that moves over it and fits it. </trans>
<eg><i lang=""ceb"">Gidalì níyag tik-up ang bintánà,</i><trans> She <tr>shut</tr> the windows at once. </trans></eg>
<eg><i lang=""ceb"">Mutik-up ang kurtína human sa káda isína,</i><trans> The curtain will <tr>close</tr> after each scene. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>close up</tr>, be folded, cause s.t. to do so. </trans>
<eg><i lang=""ceb"">Ganíha ra nà siyang tábì wà pa giyud mutik-up ang bàbà,</i><trans> She has been chattering for quite some time now. Her mouth never seems to shut. </trans></eg>
<eg><i lang=""ceb"">Nagtik-up pa ang biyúus,</i><trans> The bud is still unopened. </trans></eg>
<eg><i lang=""ceb"">Dì siya makatik-up sa páyung kay gáhì,</i><trans> She can’t fold the umbrella because it is stuck. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A2]</itype><trans> for the sun to set. </trans>
<eg><i lang=""ceb"">Mingitngit ang kalibútan dihang nakatik-up na ang adlaw,</i><trans> The earth became dark after the sun had set.
</trans></eg>
</sense></hom></entry>");
