INSERT INTO `wced_entry` VALUES (18822, "tikwi1", "1011", "<entry page=""1011"" id=""18822""><form id=""tikwiq"" lang=""ceb"">tikwì<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> sound made by a hawk. </trans>
</sense>
<sense n=""2""><number>2</number><trans> name given to hawks or buzzards which sound <ix>tikwì</ix>: the <ix>ananangkil</ix> and the <ix>banug</ix>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> produce such a sound. </trans>
<eg><i lang=""ceb"">Mutikwì ang banug inigkakitag madágit,</i><trans> The hawk goes <ix>tikwì</ix> when he spies a prey. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> fondle a baby by imitating a hawk’s sound raising the hand and letting it fall in some part of the body to tickle it in imitation of a preying hawk.†
</trans>
</sense></hom></entry>");
