<sense n=""2""><number>2</number> <itype>[a3]</itype><trans> get s.t. out of s.o. or s.t. </trans>
<eg><i lang=""ceb"">Daghan kag amígu kun dúna pa silay matílà nímu,</i><trans> You’ll have lots of friends if there is s.t. they can get out of you. </trans></eg>
