INSERT INTO `wced_entry` VALUES (18877, "timaan", "1013", "<entry page=""1013"" id=""18877""><form id=""timaxan"" lang=""ceb"">timáan</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A3S; b(1)]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>remember</tr>, <tr>take note</tr>. </trans>
<eg><i lang=""ceb"">Maáyu siyang mutimáan ug ngálan,</i><trans> He’s good in remembering names. </trans></eg>
<eg><i lang=""ceb"">Nakatimaan ka ba sa átung giagían niadtu?</i><trans> Do you remember the road we took before? </trans></eg>
<eg><i lang=""ceb"">Timan-i unsáun pagbúhat íni,</i><trans> Take note how this is done. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> keep, <tr>bear in mind</tr>. </trans>
<eg><i lang=""ceb"">Magtimáan ka sa íyang panambágun,</i><trans> Keep his advice in your mind. </trans></eg>
<eg><i lang=""ceb"">Timan-i nga sinagup ka lang,</i><trans> Bear in mind that you are just a foster child. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; c]</itype><trans> <tr>mark</tr>, <tr>indicate</tr>. </trans>
<eg><i lang=""ceb"">Way kurus nga nagtimáan sa íyang lubung,</i><trans> No cross marks his grave. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A13]</itype><trans> <tr>mean</tr>, be an <tr>indication</tr> of. </trans>
<eg><i lang=""ceb"">Ang pagpasákit nagtimáan sa gugma,</i><trans> Sacrifice is an indication of love. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[A; b]</itype><trans> affix a signature or thumbmark. </trans>
<eg><i lang=""ceb"">Ubligádu ka pagtúman kun mutimáan kag kuntrátu,</i><trans> When you <tr>sign</tr> a contract, you are obliged to abide by it. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>sign</tr>, <tr>mark</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>indication</tr>. </trans>
</sense>
<sense n=""3""><number>3</number><trans> <tr>signature</tr> or <tr>thumbmark</tr>. </trans>
</sense></hom>
<entry><form id=""timaan"" lang=""ceb""><abbr expan=""timaan"" type=""lemma"">(→)</abbr></form>
<hom>
<sense n=""0""> <form id=""timaan_ug_buut"" lang=""ceb""><abbr expan=""timaan"" type=""lemma"">—</abbr> ug buut</form><trans> </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A12]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> regain consciousness. </trans>
<eg><i lang=""ceb"">Nagkatimaan nag buut ang nautas,</i><trans> The person who fainted has regained consciousness. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> reach the stage in life where one is aware. </trans>
<eg><i lang=""ceb"">Ílu na kung dáan pagkatimaan nákug buut,</i><trans> From the time of my earliest consciousness I have been an orphan. </trans></eg>
</sense></hom></entry>
<entry><form id=""timan-anay"" lang=""ceb"">timan-anay</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[C2]</itype><trans> for two or more parties to sign papers agreeing to s.t. </trans>
<eg><i lang=""ceb"">Nagtiman-anay sila sa kasabútan,</i><trans> They signed the agreement.†
</trans></eg>
</sense></hom></entry></entry>");
