INSERT INTO `wced_entry` VALUES (18885, "timayud, timayud", "1014", "<entry page=""1014"" id=""18885""><form id=""timayud_timaxyud"" lang=""ceb"">timayud, timáyud</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A1; a12]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>recognize</tr>, be aware of the importance of s.t. </trans>
<eg><i lang=""ceb"">Mutimayud lang ka nákù kun dúna kay kinahanglan,</i><trans> You bother about me when you want s.t. from me. </trans></eg>
<eg><i lang=""ceb"">Nagtimáyud ku níla ísip ákung mga ginikánan,</i><trans> I recognize them as my parents. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>notice</tr>, be <tr>aware</tr> of s.t. </trans>
<eg><i lang=""ceb"">Nakatimáyud kung may misaka sa balay,</i><trans> I noticed s.o. entering the house. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>pay attention</tr> to, <tr>watch</tr> s.t. </trans>
<eg><i lang=""ceb"">Timayúra ang ímung manghud kun túa ba sa iskuylahan,</i><trans> <tr>See</tr> if your brother is in school. </trans></eg>
<eg><i lang=""ceb"">Itimáyud ku sa balay kun wà mi dihà,</i><trans> Please watch the house for us while we are away. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> do s.t. well putting one’s full attention to it. </trans>
<eg><i lang=""ceb"">Mitimáyud na siyag trabáhu,</i><trans> He now works consistently well. </trans></eg>
<eg><i lang=""ceb"">Timayúra ug bása ang libru,</i><trans> Read the book carefully.
</trans></eg>
</sense></hom></entry>");
