INSERT INTO `wced_entry` VALUES (18899, "timbuy", "1015", "<entry page=""1015"" id=""18899""><form id=""timbuy"" lang=""ceb"">timbuy</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> </trans>
</sense>
<sense n=""1, 2""><number>1, 2</number><trans> = <xr lang=""ceb"" target=""#tibul""><sc>tibul</sc></xr>, <i lang=""ceb"">3.</i> </trans>
</sense>
<sense n=""3""><number>3</number><trans> add a little amount of s.t. to s.t.; contribute a little. </trans>
<eg><i lang=""ceb"">Mitimbuy (nagtimbuy) siyag písus sa ílang kapunúngan,</i><trans> He contributed one peso to their organization. </trans></eg>
<eg><i lang=""ceb"">Nakatimbuy ning librúha pagkúhà ku sa iksámin,</i><trans> This book helped a little when I took the examination. </trans></eg>
<eg><i lang=""ceb"">Gitimbúyan níyag asin ang sabaw,</i><trans> He added salt to the soup. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A; b]</itype><trans> have sexual relations with a married woman. </trans>
<eg><i lang=""ceb"">Nakatimbuy ka ánang batáa?</i><trans> Have you contributed s.t. to the making of that child?
</trans></eg>
</sense></hom></entry>");
