INSERT INTO `wced_entry` VALUES (18900, "timgas", "1015", "<entry page=""1015"" id=""18900""><form id=""timgas"" lang=""ceb"">timgas</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> neat, clean and white with a clear and fine texture. </trans>
<eg><i lang=""ceb"">Timgas kang tan-áwun gíkang nalígù,</i><trans> You look clean-complexioned after bathing. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> enunciated with clarity and determination. </trans>
<eg><i lang=""ceb"">‘Ipanimalus ku ang ákung asáwa,’ timgas ug maisúgung pamúlung ni Sultan Saranggáni,</i><trans> ‘I will avenge my wife,’ Sultan Saranggani averred firmly. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[BN]</itype><trans> be clear, white and smooth in texture. </trans>
<eg><i lang=""ceb"">Magtimgas ang lugas sa humay nga maáyung pagkauga,</i><trans> The grains of well-dried rice are smooth and clear. </trans></eg>
</sense></hom>
<entry><form id=""timgasun"" lang=""ceb""><abbr expan=""timgasun"" type=""lemma"">-un</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> of a fair and clean sort.
</trans>
</sense></hom></entry></entry>");
