INSERT INTO `wced_entry` VALUES (18906, "timpasaw", "1015", "<entry page=""1015"" id=""18906""><form id=""timpasaw"" lang=""ceb"">timpasaw</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> splash heavily and resoundingly into the water. </trans>
<eg><i lang=""ceb"">Mitimpasaw ngadtus túbig pagkahúlug níya gíkan sa pantalan,</i><trans> He fell off the wharf and landed in the water with a splash. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> be hit by the aptness of what s.o. might say about one. </trans>
<eg><i lang=""ceb"">Ug átung buhátun mutimpasaw ta niadtung pagyà nga nag-ingun nga maáyus tayáda, way ági,</i><trans> If that is what we do, they’ll be able to apply that old saying to us—that we’re all talk and no action.
