INSERT INTO `wced_entry` VALUES (18913, "timpranu", "1016", "<entry page=""1016"" id=""18913""><form id=""timpraxnu"" lang=""ceb"">timpránu</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>early</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>just in time</tr> for s.t. </trans>
<eg><i lang=""ceb"">Timpránu giyud pag-abúta nímu, talilákaw ku,</i><trans> You got here just in time, because I was about to go. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; a2]</itype><trans> do s.t. <tr>early</tr> or ahead of schedule. </trans>
<eg><i lang=""ceb"">Timpranúhag human pagdáru arun timpránu tang makapugas,</i><trans> Finish the plowing early so we can plant early.
