INSERT INTO `wced_entry` VALUES (18914, "timpu", "1016", "<entry page=""1016"" id=""18914""><form id=""timpu"" lang=""ceb"">timpu</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>time</tr>, <tr>chance</tr>. </trans>
<eg><i lang=""ceb"">Wà kuy timpu ihalayhálay,</i><trans> I have no time for relaxation. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>time</tr>, <tr>schedule</tr>. </trans>
<eg><i lang=""ceb"">Timpu sa tingkaun ra mi magkitaay,</i><trans> We meet only at mealtime. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>weather</tr>. </trans>
<eg><i lang=""ceb"">Mubyáhi ka bísag dautag timpu?</i><trans> Are you travelling even in bad weather? </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> <tr>season</tr>. </trans>
<eg><i lang=""ceb"">Timpu sa pagpangáni karun,</i><trans> It’s harvest season now. </trans></eg>
</sense>
<sense n=""4a""><number>4a</number><trans> propitious time to do s.t. </trans>
<eg><i lang=""ceb"">Timpu na run sa íyang himbis,</i><trans> According to the scale configuration on its legs, now is the time to fight it. </trans></eg>
</sense>
<sense n=""5""><number>5</number><trans> <tr>era</tr>, <tr>period</tr>. </trans>
<eg><i lang=""ceb"">Timpu sa Katsílà pa nang ímung purul,</i><trans> Your shorts go back to the Spanish times. </trans></eg>
</sense>
<sense n=""6""><number>6</number><trans> <tr>tempo</tr>. </trans>
<eg><i lang=""ceb"">Swít ang timpu íning sunatáha,</i><trans> This dance is in a slow tempo. </trans></eg>
</sense></hom>
<entry><form id=""panimpu"" lang=""ceb""><abbr expan=""panimpu"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; b6]</itype><trans> do s.t. at the best time. </trans>
<eg><i lang=""ceb"">Manimpu siyag súgal, kanà lang dibuynasun,</i><trans> He gambles only when the time is right, when it’s his lucky day. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> doing s.t. at the best time. </trans>
</sense></hom></entry>
<entry><form id=""timputimpu"" lang=""ceb"">timputimpu</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[c16]</itype><trans> do s.t. at the right season. </trans>
<eg><i lang=""ceb"">Itimputimpu (timputimpúhun) ang pagtanum kun way patubig,</i><trans> Planting is done in the right season if there’s no irrigation. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>from time to time</tr>. </trans>
<eg><i lang=""ceb"">Timputimpu nga musáka us-us ang prisyu,</i><trans> Prices fluctuate from time to time.
</trans></eg>
</sense></hom></entry></entry>");
