INSERT INTO `wced_entry` VALUES (18923, "timun", "1016", "<entry page=""1016"" id=""18923""><form id=""timun"" lang=""ceb"">timun</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>rudder</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>clitoris</tr> (humorous euphemism). </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AN2; b]</itype><trans> steer a boat with a rudder, or with a paddle used like a rudder. </trans>
<eg><i lang=""ceb"">Lihíru siyang mutimun (manimun) kúmu mananagat,</i><trans> He steers the rudder well since he is a fisherman. </trans></eg>
<eg><i lang=""ceb"">Timuni ang sakayan,</i><trans> Steer the boat. </trans></eg>
</sense></hom>
<entry><form id=""panimun"" lang=""ceb""><abbr expan=""panimun"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
