INSERT INTO `wced_entry` VALUES (18951, "ting-", "1018", "<entry page=""1018"" id=""18951""><form id=""ting-"" lang=""ceb"">ting-</form>
<hom>
<sense n=""0""><trans> prefix added to roots which refer to s.t. which happens seasonally to form nouns which mean ‘season or time of the day that [so-and-so] takes place’. Most forms with <ix>ting-</ix> have short penults. </trans>
<eg><i lang=""ceb"">Sayung buntag nga mauy tinglusad sa manuk,</i><trans> The early morning hours when the chickens come down from their perches. </trans></eg>
<eg><i lang=""ceb"">Tingbunga (tingpamunga) sa mangga,</i><trans> The mango season. </trans></eg>
<eg><i lang=""ceb"">Tingadlaw (ting-adlaw),</i><trans> The hot season. </trans></eg>
<eg><i lang=""ceb"">Tingbálud,</i><trans> The wavy season.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (18951, "ting-", "ting-", "m", "");
INSERT INTO `wced_entry` VALUES (18952, "tinga", "1018", "<entry page=""1018"" id=""18952""><form id=""tinga"" lang=""ceb"">tinga</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> food particle lodged between the teeth. </trans>
</sense>
<sense n=""2""><number>2</number><trans> k.o. reddish breast tumor believed to be caused by eating any k.o. shellfish with nipple-like growths, and treated with steam from those k.o. shellfish. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A123P]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> have food particles lodged in the teeth. </trans>
<eg><i lang=""ceb"">Makatinga (makapatinga) ang karni sa ngípun,</i><trans> Meat sticks in the teeth. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> get this k.o. tumor.
</trans>
</sense></hom></entry>");
