INSERT INTO `wced_entry` VALUES (18953, "*tinga", "1018", "<entry page=""1018"" id=""18953""><form id=""xxtixnga"" lang=""ceb"">*tínga</form>
<entry><form id=""patixnga"" lang=""ceb""><abbr expan=""patínga"" type=""lemma"">pa-</abbr></form>
