INSERT INTO `wced_entry` VALUES (18956, "tingabngab", "1018", "<entry page=""1018"" id=""18956""><form id=""tingabngab"" lang=""ceb"">tingabngab</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B; c1]</itype><trans> be gaping with a huge opening or hole. </trans>
<eg><i lang=""ceb"">Mitingabngab ang bakilid nga gidinamíta,</i><trans> The hill had a big gape in it after it was dynamited. </trans></eg>
<eg><i lang=""ceb"">Ayawg tingabngába (itingabngab) ang ímung bàbà kay sudlag lamuk,</i><trans> If you open your mouth wide mosquitoes are going to come in.
</trans></eg>
</sense></hom></entry>");
