INSERT INTO `wced_entry` VALUES (18957, "tingag", "1018", "<entry page=""1018"" id=""18957""><form id=""tingag"" lang=""ceb"">tingag</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B36; c]</itype><trans> catch, <tr>snag</tr> or hold by piercing. </trans>
<eg><i lang=""ceb"">Mitingag (natingag) sa íyang tutunlan ang bukug sa isdà,</i><trans> The fish bone got snagged in his throat. </trans></eg>
<eg><i lang=""ceb"">Nagtingag pa sa íyang bukubuku ang báraw,</i><trans> The knife was still sticking <corr sic=""on"">in</corr> his back. </trans></eg>
<eg><i lang=""ceb"">Gitingag níya sa kalindaryu ang dágum,</i><trans> He ran a needle through the calendar. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A12; a]</itype><trans> knock a piece of the circle in the game of <ix>taksì<sub>1</sub></ix>. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[B126]</itype><trans> suffer the relapse called <ix>tingag</ix>. </trans>
<eg><i lang=""ceb"">Ang kalísang mauy nakatingag (nakapatingag) sa bag-ung nanganak,</i><trans> The intense fright caused the woman who had just given birth to have a fatal relapse. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> fatal relapse suffered by a woman who has recently had a baby, caused by overstrain or emotional disturbance. </trans>
</sense></hom>
<entry><form id=""bughat_tingag"" lang=""ceb"">bughat <abbr expan=""tingag"" type=""lemma"">—</abbr></form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#tingag""><sc>tingag</sc></xr>, <i lang=""ceb"">n</i>.
</trans>
</sense></hom></entry></entry>");
