INSERT INTO `wced_entry` VALUES (18958, "tingal", "1018", "<entry page=""1018"" id=""18958""><form id=""tixngal"" lang=""ceb"">tíngal</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a1c]</itype><trans> force s.t. into s.o.’s mouth. </trans>
<eg><i lang=""ceb"">Tingálun ang bátang purgahun,</i><trans> If you give a child a purgative, you have to force it down his throat. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> force a pig’s mouth open by sticking s.t. into it. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c]</itype><trans> <tr>bribe</tr>. </trans>
<eg><i lang=""ceb"">Mamakak ang saksi ug dúnay mutíngal níya,</i><trans> The witness will lie if s.o. bribes him. </trans></eg>
<eg><i lang=""ceb"">Itíngal ni sa gwardiya,</i><trans> Give this as a bribe to the guard. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; c]</itype><trans> for s.t. to be brought onto one (literary). </trans>
<eg><i lang=""ceb"">Dílì ku na hápit maantus ang kapaítan nga gitíngal kanákù sa kapaláran,</i><trans> I can hardly bear the bitter experiences which fate has bestowed on me.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (18958, "tíngal", "tingal", "m", "v");
INSERT INTO `wced_translation` (entryid, translation) VALUES (18958, "bribe");
INSERT INTO `wced_entry` VALUES (18959, "tingala", "1018", "<entry page=""1018"" id=""18959""><form id=""tingaxla"" lang=""ceb"">tingála</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B1256; b3(1)c5]</itype><trans> be <tr>surprised</tr>, <tr>mystified</tr> at s.t. unexpected. </trans>
<eg><i lang=""ceb"">Natingála ku sa íyang pagkausab,</i><trans> It surprised me at how he had changed. </trans></eg>
<eg><i lang=""ceb"">Gikatingad-an ang butu sa laburaturyu,</i><trans> People were mystified by the explosion in the lab. </trans></eg>
<eg><i lang=""ceb"">Dì ikatingála ang íyang pagdaug,</i><trans> It’s not amazing that he won. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B26N]</itype><trans> for one’s body processes or health to be upset from being subjected to s.t. to which one is not accustomed. </trans>
<eg><i lang=""ceb"">Naningála ang ákung tiyan sa pagkáun ug nangkà,</i><trans> The jackfruit upset my stomach. </trans></eg>
<eg><i lang=""ceb"">Natingála ang íyang láwas sa kabugnaw sa irkundisyunir,</i><trans> His body can’t seem to adjust to the air conditioner. </trans></eg>
</sense></hom>
<entry><form id=""paningala_paningaxla"" lang=""ceb""><abbr expan=""paningala"" type=""lemma"">paN-(→)</abbr>, <abbr expan=""paningála"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A23]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> = <xr lang=""ceb"" target=""#tingaxla""><sc>tingála</sc></xr>, <i lang=""ceb"">2.</i> </trans>
</sense>
<sense n=""2""><number>2</number><trans> be ill at ease from being new to s.t. </trans>
<eg><i lang=""ceb"">Naningala ku áning bag-ung kambiyu,</i><trans> I find it hard to adjust to this new gearshift. </trans></eg>
</sense></hom></entry>
<entry><form id=""katingaxla"" lang=""ceb""><abbr expan=""katingála"" type=""lemma"">ka-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> state of being surprised. </trans>
</sense></hom></entry>
<entry><form id=""katingalaxhan"" lang=""ceb"">katingaláhan</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> s.t. <tr>mysterious</tr>, <tr>wondrous</tr>. </trans>
<eg><i lang=""ceb"">Katingaláhan ang búhat sa Diyus,</i><trans> God’s ways are wondrous. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>enchanted</tr>, with <tr>magical</tr> power. </trans>
<eg><i lang=""ceb"">Pangáyù bisan unsa sa katingaláhang singsing,</i><trans> Wish for anything at all from the <tr>magic</tr> ring.
</trans></eg>
</sense></hom></entry></entry>");
