INSERT INTO `wced_entry` VALUES (18993, "tingub", "1020", "<entry page=""1020"" id=""18993""><form id=""tingub"" lang=""ceb"">tingub</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c1]</itype><trans> do s.t. <tr>all at once</tr>. </trans>
<eg><i lang=""ceb"">Tinguba (tingba, itingub) paglaba ang bulingun,</i><trans> Wash all of the clothes at once. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B126C23]</itype><trans> be <tr>combined</tr> in one, be entirely devoted to s.t. </trans>
<eg><i lang=""ceb"">Magtingub tag pangadyì,</i><trans> Let’s all pray <tr>together</tr>. </trans></eg>
<eg><i lang=""ceb"">Kining mga híyas natingub sa íyang pagkatáwu,</i><trans> All these qualities were combined in his person. </trans></eg>
<eg><i lang=""ceb"">Natingub ang tanang pagpanggà sa bugtung nílang anak,</i><trans> They devoted <tr>all</tr> of their love and affection to their only child. </trans></eg>
<eg><i lang=""ceb"">Ang nasakpan mauy natingban sa tanang pasángil,</i><trans> The one who was caught got all of the blame. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. complete in one. </trans>
<eg><i lang=""ceb"">Ang tingub ánang idiyáha maúmul sa usa ka púlung,</i><trans> The <tr>entirety</tr> of that idea can be expressed in one word. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>complete</tr>, covering everything. </trans>
<eg><i lang=""ceb"">Usa ka mubù apan tingub nga pangutána,</i><trans> A short but <tr>all-embracing</tr> question. </trans></eg>
</sense></hom>
<entry><form id=""tingbanan"" lang=""ceb"">tingbanan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>storage</tr>, <tr>reservoir</tr>. </trans>
</sense></hom></entry>
<entry><form id=""katilingban"" lang=""ceb"">katilingban</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>society</tr>, <tr>community</tr>. </trans>
</sense></hom></entry>
<entry><form id=""katilingbaxnun"" lang=""ceb"">katilingbánun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> having to do with society, community. </trans>
</sense></hom></entry>
<entry><form id=""tiningub"" lang=""ceb""><abbr expan=""tiningub"" type=""lemma"">-in-</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> done all at <corr sic=""one"">once</corr>. </trans>
</sense></hom></entry>
<entry><form id=""tingbanay"" lang=""ceb"">tingbanay</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> = <xr lang=""ceb"" target=""#tiningub""><sc><abbr expan=""tiningub"" type=""lemma"">-in-</abbr></sc></xr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> done to the fullest extent possible. </trans>
<eg><i lang=""ceb"">Tingbanay giyud ning átung pag-ínum,</i><trans> Let’s not just drink. Let’s get completely soused.
</trans></eg>
</sense></hom></entry></entry>");
