INSERT INTO `wced_entry` VALUES (18995, "tingug", "1020", "<entry page=""1020"" id=""18995""><form id=""tixngug"" lang=""ceb"">tíngug</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2S]</itype><trans> produce a <tr>sound</tr>. </trans>
<eg><i lang=""ceb"">Ayúha nang tiklang dì mutíngug,</i><trans> Fix the piano keys that don’t sound. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2S; b3c]</itype><trans> <tr>speak</tr>, <tr>speak up</tr>. </trans>
<eg><i lang=""ceb"">Unsa pay tinggan nákù nga dì ka man mamínaw?</i><trans> What should I <tr>talk</tr> for, since you won’t listen? </trans></eg>
<eg><i lang=""ceb"">Tíngug sa míting ug dúna kay ikatíngug,</i><trans> Speak up in the meeting if you have s.t. to say. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[C; b6]</itype><trans> be on <tr>speaking terms</tr>. </trans>
<eg><i lang=""ceb"">Walà mi magtíngug (magtingganay),</i><trans> We aren’t on speaking terms. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>sound</tr>, <tr>voice</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> one’s say or word in the proceedings of. </trans>
<eg><i lang=""ceb"">Ang ákung tíngug mauy matúman,</i><trans> They will do whatever I say. </trans></eg>
</sense></hom>
<entry><form id=""patixngug"" lang=""ceb""><abbr expan=""patíngug"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c1]</itype><trans> turn on radio, <asc>TV</asc>, make s.t. sound. </trans>
<eg><i lang=""ceb"">Patingúga (ipatíngug) ang radiyu,</i><trans> Turn the radio on. </trans></eg>
</sense></hom></entry>
<entry><form id=""tingganay"" lang=""ceb"">tingganay</form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#tixngug""><sc>tíngug</sc></xr>, <i lang=""ceb"">v3.</i> </trans>
</sense></hom></entry>
<entry><form id=""panixngug"" lang=""ceb""><abbr expan=""paníngug"" type=""lemma"">paN-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> the way the voice sounds, the manner of speaking. </trans>
<eg><i lang=""ceb"">Subù ang paníngug sa namatyan,</i><trans> The bereaved person spoke in a sad <tr>tone of voice</tr>.
</trans></eg>
</sense></hom></entry></entry>");
