INSERT INTO `wced_entry` VALUES (18996, "tinguha", "1020", "<entry page=""1020"" id=""18996""><form id=""tinguxhaq"" lang=""ceb"">tingúhà</form>
<hom>
<sense n=""0""><trans> (from <ix>kúhà</ix>) </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13; a12]</itype><trans> <tr>aim for</tr>, seek to possess. </trans>
<eg><i lang=""ceb"">Matag baksir nagtingúhà sa kampiyunátu,</i><trans> Every boxer aims at the championship. </trans></eg>
<eg><i lang=""ceb"">Gitingúhà níyang magbúlag sila,</i><trans> It was her <tr>intention</tr> to separate them. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. one intends, aspires to do. </trans>
<eg><i lang=""ceb"">Wà kuy tingúhang dautan nímu,</i><trans> I do not have wicked <tr>intentions</tr> against you. </trans></eg>
<eg><i lang=""ceb"">Ang mga tingúhà sa bayánì álang sa násud,</i><trans> The hero’s <tr>aspirations</tr> for the country. </trans></eg>
</sense></hom>
<entry><form id=""paninguxhaq"" lang=""ceb""><abbr expan=""paningúhà"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; a12]</itype><trans> give one’s utmost in doing s.t. </trans>
<eg><i lang=""ceb"">Muasinsu ang táwung maningúhà,</i><trans> He who strives hard will succeed. </trans></eg>
<eg><i lang=""ceb"">Paninguháa nga mutáp ka sa tís,</i><trans> Try hard to top the exam. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2]</itype><trans> <tr>court</tr> a woman. </trans>
<eg><i lang=""ceb"">Naningúhà ku níya piru gibastid ku,</i><trans> I courted her for all I was worth, but I was turned down. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> striving, trying hard. </trans>
<eg><i lang=""ceb"">Káwang ang paningúhà nga dì nuntan ug kaabtik,</i><trans> It is futile to try hard if you don’t couple it with shrewdness.
</trans></eg>
</sense></hom></entry></entry>");
