INSERT INTO `wced_entry` VALUES (19028, "tipak", "1021", "<entry page=""1021"" id=""19028""><form id=""tipak"" lang=""ceb"">tipak</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; ab7]</itype><trans> break, chip a piece from. </trans>
<eg><i lang=""ceb"">Natipak ang bàbà sa kupíta,</i><trans> The rim of the goblet is <tr>chipped</tr>. </trans></eg>
<eg><i lang=""ceb"">Ayawg tipki ni kay gamay na lang,</i><trans> Don’t break anything off of this piece. It’s already small as it is. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b7]</itype><trans> <tr>take away from</tr> one’s money, time, etc. </trans>
<eg><i lang=""ceb"">Mutipak kug tirsiyu sa swildu pára sa buhis,</i><trans> I <tr>chip in</tr> one-third of my salary for taxes. </trans></eg>
<eg><i lang=""ceb"">Tipki kug diyútay sa ímung panahun,</i><trans> <tr>Spare</tr> me a little of your time. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[AB12; a1]</itype><trans> <tr>crack</tr>. </trans>
<eg><i lang=""ceb"">Kinsay nakatipak sa tibud?</i><trans> Who cracked the jar? </trans></eg>
<eg><i lang=""ceb"">Nagkatipak ang sag-ub nga pirming nabulad,</i><trans> The bamboo bucket is getting cracked because it is constantly left in the sun. </trans></eg>
<eg><i lang=""ceb"">Ayawg tipka nang básu,</i><trans> Don’t crack the glass. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A; a3]</itype><trans> get a <tr>profit</tr> from s.t. </trans>
<eg><i lang=""ceb"">Dakù kug natipak sa gúmang ákung gibaligyà,</i><trans> I made a lot from the tires I resold. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> piece broken from s.t. </trans>
</sense>
<sense n=""2""><number>2</number><trans> s.t. taken, deducted from.
</trans>
</sense></hom></entry>");
