INSERT INTO `wced_entry` VALUES (19041, "tipik", "1022", "<entry page=""1022"" id=""19041""><form id=""tipik"" lang=""ceb"">tipik</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b]</itype><trans> take a bit off s.t. </trans>
<eg><i lang=""ceb"">Dì giyud ka makatipik ánang kík pára nákù?</i><trans> Can’t you break a bit of that cake off for me? </trans></eg>
<eg><i lang=""ceb"">Tipki sad ku sa ímung pagtagad,</i><trans> Let me have a moment of your attention. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>small portion</tr>, a <tr>fraction</tr> of s.t. </trans>
<eg><i lang=""ceb"">Ang íyang hinábang tipik lang sa íyang bahandì,</i><trans> His donation is only a fraction of what he has. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>integral part</tr>. </trans>
<eg><i lang=""ceb"">Tipik ka na sa ákung kaugalíngun,</i><trans> You’re already a part of my being. </trans></eg>
</sense></hom>
<entry><form id=""katipik"" lang=""ceb""><abbr expan=""katipik"" type=""lemma"">ka-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. that forms a whole together with s.t. else. </trans>
<eg><i lang=""ceb"">Ang yútà nga ákung gipalit katipik niadtu sa asyinda,</i><trans> The land I bought was formerly <tr>part and parcel</tr> of the hacienda.
</trans></eg>
</sense></hom></entry></entry>");
