INSERT INTO `wced_entry` VALUES (19047, "tiptip", "1022", "<entry page=""1022"" id=""19047""><form id=""tiptip"" lang=""ceb"">tiptip</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b]</itype><trans> <tr>cut</tr> the tip of s.t. with scissors or shears. </trans>
<eg><i lang=""ceb"">Ang mutiptip sa balíli gantíhan,</i><trans> Whoever clips the grass will get s.t. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[AP; c1]</itype><trans> cut close to the surface or ground. </trans>
<eg><i lang=""ceb"">Ákung gitiptípan (gipatiptípan) ang íyang buhuk kay gikutu,</i><trans> I cut his hair very short because he has lots of lice. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a1]</itype><trans> break s.t. with the teeth. </trans>
<eg><i lang=""ceb"">Kalabaw níla ang nagtiptip sa ámung mais,</i><trans> Their carabao chewed up our corn. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>cut close</tr> to the surface. </trans>
<eg><i lang=""ceb"">Tiptip kaáyung pagkaputul ang mga tuud sa nataran,</i><trans> The stumps in the yard were cut close to the ground.
</trans></eg>
</sense></hom></entry>");
