INSERT INTO `wced_entry` VALUES (19056, "tipuku", "1023", "<entry page=""1023"" id=""19056""><form id=""tipukuq"" lang=""ceb"">tipukù</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b(1)]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> get on top of s.o. or s.t., hugging and bending it down. </trans>
<eg><i lang=""ceb"">Gitipuk-an níya ang bábuy,</i><trans> He jumped on the pig and pinned it down. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> have a woman for intercourse (euphemism). </trans>
</sense>
<sense n=""1b""><number>1b</number><trans> use s.t. one sets oneself on. </trans>
<eg><i lang=""ceb"">Maay ka lang mutipukù ánang bisiklíta apan dì ka muáyu ug madáut,</i><trans> You are good at using the bicycle, but are you good at fixing it if it breaks? </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>crowd around</tr> s.o. or s.t. </trans>
<eg><i lang=""ceb"">Mitipukù ang mga táwu sa labasíru,</i><trans> The people crowded around the fish peddler. </trans></eg>
<eg><i lang=""ceb"">Gitipuk-an sila sa mga lángaw,</i><trans> A swarm of flies set on them.
</trans></eg>
</sense></hom></entry>");
