INSERT INTO `wced_entry` VALUES (19060, "tipun", "1023", "<entry page=""1023"" id=""19060""><form id=""tixpun"" lang=""ceb"">típun</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; ac]</itype><trans> put, be <tr>together</tr>, <tr>join</tr> in a group. </trans>
<eg><i lang=""ceb"">Dì siya mutípun sa mga pundukpunduk,</i><trans> He doesn’t mingle with groups. </trans></eg>
<eg><i lang=""ceb"">Iniglaba ayawg tipúna ang putì ug dikulur,</i><trans> In doing the laundry don’t put the white and colored clothes together. </trans></eg>
<eg><i lang=""ceb"">Malatà nang prutása ug itípun sa lataun,</i><trans> That fruit will get rotten if you put it together with rotten ones. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2C; c5]</itype><trans> <tr>live together</tr>. </trans>
<eg><i lang=""ceb"">Pait ikatípun ning kusug muháguk,</i><trans> It’s terrible to <tr>live with</tr> s.o. who snores. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[C; c3]</itype><trans> live as a <tr>common-law</tr> couple. </trans>
<eg><i lang=""ceb"">Magtípun lang ta, way kasalkásal,</i><trans> Let’s just live together without getting married. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> being together. </trans>
<eg><i lang=""ceb"">Típun mi niadtug kwartu,</i><trans> We were roommates formerly. </trans></eg>
</sense></hom>
<entry><form id=""tipuntipun"" lang=""ceb"">tipuntipun</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> k.o. edible cerith <tr>shells</tr>, <measure reg=""1.3–2.6 cm"">½″–1″</measure> long, mud-colored or black, found on rocks or mangrove trees. </trans>
</sense></hom></entry>
<entry><form id=""tinixpun"" lang=""ceb""><abbr expan=""tinípun"" type=""lemma"">-in-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. that has been put together. </trans>
<eg><i lang=""ceb"">Tinípung Bansa,</i><trans> <tr>United States</tr>. </trans></eg>
<eg><i lang=""ceb"">Tinípung Kanasúran,</i><trans> <tr>United Nations</tr>. </trans></eg>
</sense></hom></entry>
<entry><form id=""katixpun"" lang=""ceb""><abbr expan=""katípun"" type=""lemma"">ka-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>housemate</tr>. </trans>
</sense></hom></entry>
<entry><form id=""katipuxnan"" lang=""ceb""><abbr expan=""katipúnan"" type=""lemma"">ka-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> the <ix>Katipúnan,</ix> a secret revolutionary society which aimed at independence from Spain. </trans>
</sense></hom></entry>
<entry><form id=""katipunixru"" lang=""ceb"">katipuníru</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> a member of the <ix>Katipúnan</ix>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B156]</itype><trans> become a <ix>katipuníru</ix>. </trans>
</sense></hom></entry>
<entry><form id=""panagtixpun"" lang=""ceb""><abbr expan=""panagtípun"" type=""lemma"">panag-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>living together</tr>, esp. as a couple. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>gathering</tr>, <tr>coming together</tr>.
</trans>
</sense></hom></entry></entry>");
