INSERT INTO `wced_entry` VALUES (19066, "tira", "1023", "<entry page=""1023"" id=""19066""><form id=""tixra"" lang=""ceb"">tíra</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>shoot</tr>. </trans>
<eg><i lang=""ceb"">Tiráhi dáyug langgam inigbátug,</i><trans> Shoot the bird as soon as it lands on the branch. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> dynamite fish. </trans>
<eg><i lang=""ceb"">Tiráhi bísag duut sa gagmayng isdà,</i><trans> Blast it even if it’s a school of small fish. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> go after a girl (slang). </trans>
<eg><i lang=""ceb"">Mutíra siya bísag kinsa basta manimáhung babáyi,</i><trans> He courts anybody as long as it smells like a woman. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> have a woman for sexual purposes. </trans>
<eg><i lang=""ceb"">Mutíra nà bísag kúkuk,</i><trans> He will have sexual intercourse even with prostitutes. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[A; c]</itype><trans> <tr>publish</tr>, <tr>appear in print</tr>. </trans>
<eg><i lang=""ceb"">Itíra nang balitáa sa pamantaláan ugmà,</i><trans> That news will be published in the papers tomorrow. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>shooting</tr>. </trans>
</sense></hom>
<entry><form id=""tixra_pula"" lang=""ceb""><abbr expan=""tíra"" type=""lemma"">—</abbr> pula</form>
<hom>
<sense n=""0""><trans> in a variety of billiards where only three balls are used, the condition that the player must hit the red ball first whenever he tries to make a carom. </trans>
</sense></hom></entry>
<entry><form id=""tixra_pasaxgad"" lang=""ceb""><abbr expan=""tíra"" type=""lemma"">—</abbr> paságad</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>hit-and-miss</tr>, <tr>at random</tr>. </trans>
<eg><i lang=""ceb"">Diplánu ang ámung panúlis, dì tíra paságad,</i><trans> Our robberies are planned, not merely hit-and-miss. </trans></eg>
<eg><i lang=""ceb"">Dì siya makaigù kay tíra pasàgad siyang manumbag,</i><trans> He can’t hit the mark because he shoots at random. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A3P]</itype><trans> do s.t. thoughtlessly or indiscriminately. </trans>
<eg><i lang=""ceb"">Ayawg tíra paságad. Pilía ang laláking buútan,</i><trans> Don’t pick just anybody. Choose a good man to marry. </trans></eg>
</sense></hom></entry>
<entry><form id=""tiraxda"" lang=""ceb""><abbr expan=""tiráda"" type=""lemma"">-da</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> a single photographic <tr>exposure</tr>, <tr>shot</tr>. </trans>
<eg><i lang=""ceb"">Kining tiradáha didtu makúhà duul sa taytáyan,</i><trans> This shot was taken near the bridge. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>shot</tr> in a billiard game. </trans>
</sense></hom></entry>
<entry><form id=""biyin_tiraxda"" lang=""ceb"">biyin <abbr expan=""tiráda"" type=""lemma"">—</abbr></form>
<hom>
<sense n=""0""><trans> good shot. </trans>
</sense>
<sense n=""3""><number>3</number><trans> <tr>attack</tr>, verbal or physical. </trans>
<eg><i lang=""ceb"">Kusug nga tirádang nakapalukápa níya,</i><trans> A hard <tr>blow</tr> that sent him reeling. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> the <pb n=""1024""/>way one tries to persuade or <tr>approach</tr> s.o. (slang). </trans>
<eg><i lang=""ceb"">Sayup ímung tiráda hay imbis musugut, nasukù na hinúun,</i><trans> Your <tr>approach</tr> was wrong because instead of consenting he became angry. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b(1)]</itype><trans> <tr>attack</tr> s.o. verbally or physically. </trans>
<eg><i lang=""ceb"">Mutiráda ku bísag kinsa,</i><trans> I’ll sock anyone. </trans></eg>
<eg><i lang=""ceb"">Gitiradáhan sa pastǔr ang mga maut,</i><trans> The minister <tr>lashed out</tr> at the hypocrites. </trans></eg>
</sense></hom></entry>
<entry><form id=""tiradur"" lang=""ceb""><abbr expan=""tiradur"" type=""lemma"">-dur(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>slingshot</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> one who lures victims into some sort of swindling operation. </trans>
<eg><i lang=""ceb"">Tiradur kanang nagpatúung giáyu sa tambálan,</i><trans> The man who is pretending the doctor cured him is just there to lure victims. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> one who engages in dynamite fishing. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a12]</itype><trans> shoot with a slingshot. </trans>
<eg><i lang=""ceb"">Tiradura ang manuk nga nanuktuk sa binlad,</i><trans> Shoot the chicken that is pecking at the rice with a slingshot. </trans></eg>
</sense></hom></entry>
<entry><form id=""panixra"" lang=""ceb""><abbr expan=""paníra"" type=""lemma"">paN-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> dynamite fishing.
</trans>
</sense></hom></entry></entry>");
