INSERT INTO `wced_entry` VALUES (19151, "tits1", "1026", "<entry page=""1026"" id=""19151""><form id=""tits"" lang=""ceb"">tits<sub>1</sub></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> humorous, impolite term of address to a man, usually used when negating s.t. he says: <tr>buster</tr>, <tr>buddy roe</tr>. </trans>
<eg><i lang=""ceb"">Ilára tits. Úna pa ku nímu sa dúyan,</i><trans> Don’t try to fool me, buster! I wasn’t born yesterday. </trans></eg>
<eg><i lang=""ceb"">Hadlúka tits,</i><trans> You can’t scare me, buddy roe. </trans></eg>
</sense></hom>
