INSERT INTO `wced_entry` VALUES (19162, "tiunay", "1027", "<entry page=""1027"" id=""19162""><form id=""tiuxnay"" lang=""ceb"">tiúnay</form>
<hom>
<sense n=""0""><trans> (from <ix>unay</ix>) </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> s.t. deeply imbedded in the flesh such that one must dig to get it out. </trans>
<eg><i lang=""ceb"">Gikúhà sa duktur ang tiúnay sa ákung dughan,</i><trans> The doctor removed the arrowhead from my chest. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>true</tr>, <tr>sincere</tr>. </trans>
<eg><i lang=""ceb"">Salígi king gugmang tiúnay,</i><trans> Trust this sincere love (of mine). </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <corr sic=""interest"">inherent</corr>, natural property of. </trans>
<eg><i lang=""ceb"">Ang kabangis tiúnay sa tawhánung kinaíya,</i><trans> Pugnaciousness is inherent in human nature. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> = <xr lang=""ceb"" target=""#kasya""><sc>kasya<sub>1</sub></sc></xr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B]</itype><trans> be deeply <tr>imbedded</tr>. </trans>
<eg><i lang=""ceb"">Gugmang nagtiúnay sa dughan,</i><trans> A love that has penetrated deep into my breast.
</trans></eg>
</sense></hom></entry>");
