INSERT INTO `wced_entry` VALUES (19167, "tiwas", "1027", "<entry page=""1027"" id=""19167""><form id=""tiwas"" lang=""ceb"">tiwas</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a12]</itype><trans> <tr>finish</tr>, <tr>complete</tr>. </trans>
<eg><i lang=""ceb"">Wà ku makatiwas ug káun kay nabukug ku,</i><trans> I didn’t finish eating because a bone got stuck in my throat. </trans></eg>
<eg><i lang=""ceb"">Tiwasa úsà ang iskuyla únà ka magminyù,</i><trans> Finish your studies first before you get married. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A3P; b]</itype><trans> give a <tr>finishing blow</tr>, kill in the end. </trans>
<eg><i lang=""ceb"">Ang kaguul mauy nakatiwas (nakapatiwas) sa masakitun,</i><trans> Grief finished off the sick man. </trans></eg>
<eg><i lang=""ceb"">Ug mulíhuk pa gánì tiwasi (tiwsi),</i><trans> If he still moves, deliver him the coup-de-grace. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[C2]</itype><trans> conclude a conflict by fighting it out to the death. </trans>
<eg><i lang=""ceb"">Huy animal! Kanáug diri arun magtíwas ta,</i><trans> Hey you! Come on down here so we can fight it out to the death. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>finished</tr>. </trans>
<eg><i lang=""ceb"">Tiwas na ang ákung pípar,</i><trans> My paper is all done. </trans></eg>
</sense></hom>
<entry><form id=""patiwas"" lang=""ceb""><abbr expan=""patiwas"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; ac]</itype><trans> have s.o. bring s.t. to an end. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[c]</itype><trans> have s.o. get married. </trans>
<eg><i lang=""ceb"">Ipatiwas na sila si Tabúra ug si Tunyu,</i><trans> Have Tonio and Tabora get married.
</trans></eg>
</sense></hom></entry></entry>");
