INSERT INTO `wced_entry` VALUES (19176, "trabahu", "1028", "<entry page=""1028"" id=""19176""><form id=""trabaxhu"" lang=""ceb"">trabáhu</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b6(1)]</itype><trans> <tr>work</tr>, <tr>go to work</tr>. </trans>
<eg><i lang=""ceb"">Nagtrabáhu siya sa kapitul,</i><trans> He is working at the Capitol. </trans></eg>
<eg><i lang=""ceb"">Ámung tindáhan ang íyang gitrabahúan,</i><trans> She is working in our store. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A123S]</itype><trans> obtain employment. </trans>
<eg><i lang=""ceb"">Lisud makatrabahu ang ikskanbik,</i><trans> An ex-convict has a hard time finding employment. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> <tr>work on</tr> s.t. </trans>
<eg><i lang=""ceb"">Trabahúa ang íyang sinínà,</i><trans> Work on her dress. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; a2]</itype><trans> have <tr>sexual intercourse</tr> (euphemism). </trans>
<eg><i lang=""ceb"">Ayawg trabahúa ímung asáwa ug nagrigla,</i><trans> Don’t have intercourse with your wife when she menstruates. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> piece of work. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>job</tr>. </trans>
</sense></hom>
<entry><form id=""trabahadur"" lang=""ceb"">trabahadur</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>manual laborer</tr>. </trans>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> one who works hard on manual labor. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B156]</itype><trans> be a <tr>laborer</tr>. </trans>
<eg><i lang=""ceb"">Natrabahadur siya sa gihímung karsáda,</i><trans> He was a laborer on a road-building project. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B126; b6]</itype><trans> be a hard worker (usually said of manual work). </trans>
<eg><i lang=""ceb"">Ang tingúhang muuswag mauy nakapatrabahadur (nakatrabahadur) níya,</i><trans> He was a hard worker because of his desire to prosper. </trans></eg>
</sense></hom></entry>
<entry><form id=""trabahaduxra"" lang=""ceb""><abbr expan=""trabahadúra"" type=""lemma"">-a(←)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#trabahadur""><sc>trabahadur</sc></xr> (female). </trans>
</sense></hom></entry>
<entry><form id=""trabahanti"" lang=""ceb"">trabahanti</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>laborer</tr>, <tr>employee</tr>. </trans>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> hard worker. </trans>
<eg><i lang=""ceb"">Ang táwung trabahanti dì gustung mupahúway,</i><trans> A hard worker does not want to rest. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B156]</itype><trans> be a laborer, employee. </trans>
<eg><i lang=""ceb"">Natrabahanti siya sa ákung upisína,</i><trans> He was an employee at my office.
</trans></eg>
</sense></hom></entry></entry>");
