INSERT INTO `wced_entry` VALUES (19179, "trabisiya", "1028", "<entry page=""1028"" id=""19179""><form id=""trabisixya"" lang=""ceb"">trabisíya</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c]</itype><trans> go around s.t., go the long way around instead of directly to one’s destination. </trans>
<eg><i lang=""ceb"">Nakatrabisíya na ang gwardiya sa prisuhan,</i><trans> The guard has made the rounds of the prison. </trans></eg>
<eg><i lang=""ceb"">Itrabisíya ang sakayan kun sungsungun ang hángin,</i><trans> Let the boat go round about if you have to go against the wind. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AN; c]</itype><trans> place a private bet against a member of the crowd in the cockpit. </trans>
<eg><i lang=""ceb"">Itrabisíya únà ang kwarta arun mutúbù,</i><trans> First bet the money around among the onlookers so it will grow. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A13; c1]</itype><trans> lie diagonally across s.t. </trans>
<eg><i lang=""ceb"">Kun magtrabisíya kita paghigdà masulud kitang tanan niíning katri,</i><trans> If we lie diagonally across the bed, we can all get in it. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> place for onlookers, crowd, etc. around a cockpit. </trans>
<eg><i lang=""ceb"">Anhà siya sa trabisíya,</i><trans> He stays in the place for the onlookers. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> cockpit audience or crowd. </trans>
<eg><i lang=""ceb"">Ang trabisíya nanghugyaw,</i><trans> The crowd in the cockpit yelled.
</trans></eg>
</sense></hom></entry>");
