INSERT INTO `wced_entry` VALUES (19207, "trapik", "1029", "<entry page=""1029"" id=""19207""><form id=""traxpik"" lang=""ceb"">trápik</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>traffic</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> street intersection with a traffic light in it. </trans>
</sense>
<sense n=""3""><number>3</number><trans> policeman directing traffic. </trans>
</sense>
<sense n=""4""><number>4</number> <form id=""way_traxpik"" lang=""ceb"">way <abbr expan=""trápik"" type=""lemma"">—</abbr></form><trans> lacking manners. </trans>
<eg><i lang=""ceb"">Wà kay trápik. Mulatas ka man sa taliwálà sa mga táwung nagsultihánay,</i><trans> You have no manners. You pass between people talking. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> heavy traffic. </trans>
<eg><i lang=""ceb"">Trápik kaáyu ug alas dúsi,</i><trans> The traffic is heavy at twelve o’clock. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b(1)]</itype><trans> <tr>direct traffic</tr>. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[B156]</itype><trans> be a traffic policeman. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[B6]</itype><trans> for traffic to be heavy, congested. </trans>
<eg><i lang=""ceb"">Magtrápik ang karsáda ug dúnay parid,</i><trans> Traffic is congested if there’s a parade. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[a12]</itype><trans> be caught in a traffic jam. </trans>
<eg><i lang=""ceb"">Natrápik ku sa Kulun,</i><trans> I was caught in a traffic jam on Colon Street.
</trans></eg>
</sense></hom></entry>");
