INSERT INTO `wced_entry` VALUES (19209, "trapu", "1029", "<entry page=""1029"" id=""19209""><form id=""traxpu"" lang=""ceb"">trápu</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b1]</itype><trans> <tr>wipe</tr> a large area. </trans>
<eg><i lang=""ceb"">Nagtrápu siya sa singut sa bátà,</i><trans> She’s wiping off the child’s sweat. </trans></eg>
<eg><i lang=""ceb"">Trapúhi ang lamísa únà basyúhi,</i><trans> Wipe the table before setting it. </trans></eg>
<eg><i lang=""ceb"">Trapúhi ring lipstik sa ákung ngábil,</i><trans> Wipe the lipstick off my lips. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b]</itype><trans> clean s.o. by rubbing with a wet cloth. </trans>
<eg><i lang=""ceb"">Trapúhi lang ang bátà kay kahilanatun,</i><trans> Just <tr>wash</tr> the child off with a wet cloth because he’s feverish. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[c6]</itype><trans> in games: be badly beaten. </trans>
<eg><i lang=""ceb"">Sa baskit gitrápu mi sa San Karlus,</i><trans> We were badly beaten by San Carlos in basketball. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[B1256; c1]</itype><trans> make old garments into rags for wiping. </trans>
<eg><i lang=""ceb"">Trapuha (itrapu) na lang ning gisiun nga bláwus,</i><trans> Make this old, worn-out blouse into rags. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[A1; c16]</itype><trans> finish a big quantity of food. </trans>
<eg><i lang=""ceb"">Duha ra ka táwu ang nagtrápu sa usa ka kū́ng linúgaw,</i><trans> Two people finished off the whole potful of porridge. </trans></eg>
</sense></hom>
<entry><form id=""trapu"" lang=""ceb""><abbr expan=""trapu"" type=""lemma"">(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>rag</tr> or anything for wiping. </trans>
</sense></hom></entry>
<entry><form id=""panraxpu"" lang=""ceb""><abbr expan=""panrápu"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; c6]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> wipe oneself dry. </trans>
<eg><i lang=""ceb"">Nanarápu (nanrápu) siya human kalígù,</i><trans> He dried himself after he took a bath. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> clean oneself with a washcloth. </trans>
<eg><i lang=""ceb"">Dì ku malígù. Manarápu lang ku,</i><trans> I won’t take a bath, I’ll just wash myself with a washcloth.
</trans></eg>
</sense></hom></entry></entry>");
