INSERT INTO `wced_entry` VALUES (19262, "trukis", "1031", "<entry page=""1031"" id=""19262""><form id=""truxkis"" lang=""ceb"">trúkis</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AC]</itype><trans> for two things to cross each other’s path but not meet; be facing each other but not squarely. </trans>
<eg><i lang=""ceb"">Magtrúkis sila sa ílang ispáda,</i><trans> They will <tr>cross</tr> swords. </trans></eg>
<eg><i lang=""ceb"">Magtrúkis ang duha ka trín,</i><trans> The two trains will <tr>pass</tr> each other. </trans></eg>
<eg><i lang=""ceb"">Upat ka lamísa nga gatrúkis pagkabutang,</i><trans> Four tables placed facing each other in a disorderly way. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AC; a2c3]</itype><trans> trade two things for each other that are exactly in opposing functions or positions. </trans>
<eg><i lang=""ceb"">Makigtrúkis aku nímu. Pusta ka sa ákung manuk, aku sa ímu,</i><trans> <asc>OK</asc>, I’ll trade with you. I bet on your cock and you bet on mine. </trans></eg>
<eg><i lang=""ceb"">Trukísun ang ílang gúl sa haptayim,</i><trans> They traded goals at half-time. </trans></eg>
<eg><i lang=""ceb"">Itrúkis ímung rákit sa iyáha,</i><trans> Trade your racket for his. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[C; c3]</itype><trans> have a clash of ideas or exchange of words. </trans>
<eg><i lang=""ceb"">Nagtrúkis mi si Sír báhin sa ákung swildu,</i><trans> I had a <tr>quarrel</tr> with the boss regarding my salary. </trans></eg>
<eg><i lang=""ceb"">Amígu gihápun ta bísag nagkatrúkis átung idíya,</i><trans> We will remain friends even if our ideas clash. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[C3]</itype><trans> for ideas to contradict each other. </trans>
<eg><i lang=""ceb"">Namakak ka kay nagkatrúkis ang ímung katarúngan,</i><trans> You are lying because your reasoning is self-contradictory. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> being in a <tr>crossed</tr> position. <pb n=""1032""/></trans>
<eg><i lang=""ceb"">Trúkis kanang duha ka lubi,</i><trans> Those two coconut trees are growing so that they form an X relative to each other. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>argument</tr>. </trans>
<eg><i lang=""ceb"">Walay kahusayun ang inyung trúkis,</i><trans> There’s no solving of your argument.
</trans></eg>
</sense></hom></entry>");
