INSERT INTO `wced_entry` VALUES (19381, "tuay", "1035", "<entry page=""1035"" id=""19381""><form id=""tuay"" lang=""ceb"">tuay</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B456; c6]</itype><trans> for s.t. attached to hang <tr>limp</tr> from its base. </trans>
<eg><i lang=""ceb"">Nabálì sigúrug íyang buktun kay nagtuay man,</i><trans> His arm must be broken because it is hanging limp. </trans></eg>
<eg><i lang=""ceb"">Ituay ímung úlu ingun sa patay ka,</i><trans> Let your head hang limp as if you were dead. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B123(1)]</itype><trans> become bent over in maturity. </trans>
<eg><i lang=""ceb"">Ug matuay na ang mga mais, aníhun na nátù,</i><trans> If the corn is quite bent over, we can harvest it. </trans></eg>
</sense></hom>
