INSERT INTO `wced_entry` VALUES (19384, "tuba2", "1035", "<entry page=""1035"" id=""19384""><form id=""tubaq2"" lang=""ceb"">tubà<sub>2</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a1]</itype><trans> cut down a banana stalk for the fruit. </trans>
