INSERT INTO `wced_entry` VALUES (19385, "tubag", "1035", "<entry page=""1035"" id=""19385""><form id=""tubag"" lang=""ceb"">tubag</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a1c6]</itype><trans> <tr>answer</tr>. </trans>
<eg><i lang=""ceb"">Akuy mutubag sa pangutána,</i><trans> I’ll answer the question. </trans></eg>
<eg><i lang=""ceb"">Tubaga ang nangutána,</i><trans> Answer the person who asked a question. </trans></eg>
<eg><i lang=""ceb"">Pahiyum lay íyang itubag sa ákung hangyù,</i><trans> The only answer she gives to my plea is a smile. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A; b5]</itype><trans> answer correspondence. </trans>
<eg><i lang=""ceb"">Wà ku makatubag dáyun sa ímung sulat,</i><trans> I couldn’t answer your letter right away. </trans></eg>
</sense>
<sense n=""1b""><number>1b</number> <itype>[A2; a12]</itype><trans> <tr>talk back</tr>, <tr>retort</tr>. </trans>
<eg><i lang=""ceb"">Hisagpaan siya kay mitubag sa inahan,</i><trans> She got a slap in the face because she talked back to her mother. </trans></eg>
</sense>
<sense n=""1c""><number>1c</number> <itype>[C3; c36]</itype><trans> exchange heated words. </trans>
<eg><i lang=""ceb"">Nagkatúbag mi dihang giinsultuhan ku níya,</i><trans> We exchanged heated words when he insulted me. </trans></eg>
</sense>
<sense n=""1d""><number>1d</number> <itype>[A23; b5]</itype><trans> for an uncommon event to recur or be followed by s.t. similar (in folk belief, a not-so-common event is followed by s.t. similar). </trans>
<eg><i lang=""ceb"">Tubagun (tubagan) pa nang ímung swirti sa láing táwu,</i><trans> S.o. else will have good luck in response to your good luck. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2N; a12]</itype><trans> <tr>answer for</tr>, <tr>take responsibility</tr>. </trans>
<eg><i lang=""ceb"">Ángayng tubagun nimu ang dadangátan sa ímung kirída,</i><trans> You ought to take responsibility to whatever happens to your mistress. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[A2; a1]</itype><trans> bear s.o.’s expenses. </trans>
<eg><i lang=""ceb"">Tubagun sa sigúru ang bayranan nímu sa uspital,</i><trans> The insurance will <tr>cover</tr> your hospital bills. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> answer. </trans>
</sense>
<sense n=""2""><number>2</number><trans> s.t. which happens after s.t. in response to it. </trans>
</sense></hom>
<entry><form id=""tubag_pangutaxna_uxyun_etc."" lang=""ceb""><abbr expan=""tubag"" type=""lemma"">—</abbr> pangutána, úyun, etc.</form>
<hom>
<sense n=""0""><trans> question, agreement, etc. given in answer. </trans>
<eg><i lang=""ceb"">‘Náa ka na diay?’ tubag tuksù ni Kulasing,</i><trans> ‘Are you really there now?’ asked Kulasing in answer. </trans></eg>
</sense></hom></entry>
<entry><form id=""panubag"" lang=""ceb""><abbr expan=""panubag"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; c6]</itype><trans> <tr>answer</tr> questions. </trans>
<eg><i lang=""ceb"">Pasar siya sa intirbiyu kay maáyu siyang <pb n=""1036""/>manubag,</i><trans> She passed the interview because she answered the questions well. </trans></eg>
<eg><i lang=""ceb"">Unsay ákung ipanubag ug imbistigarun ku?</i><trans> What shall I answer if I am investigated? </trans></eg>
</sense></hom></entry>
<entry><form id=""tubagtubag"" lang=""ceb"">tubagtubag</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a12]</itype><trans> <tr>talk back</tr> insolently. </trans>
<eg><i lang=""ceb"">Ayawg tubagtubaga ang ímung magulang kay gabáan ka,</i><trans> Don’t talk back insolently to your elder brother or you will get divine retribution visited on you. </trans></eg>
</sense></hom></entry>
<entry><form id=""matubagtubagun"" lang=""ceb"">matubagtubagun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> inclined to talk back insolently. </trans>
</sense></hom></entry>
<entry><form id=""tubagtuxbag"" lang=""ceb"">tubagtúbag</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a1c]</itype><trans> sing, read s.t. alternatingly or with a responsive reading. </trans>
<eg><i lang=""ceb"">Tubagtubágan ta pagbása ang kasulátan,</i><trans> Let us read the scriptures responsively. </trans></eg>
</sense></hom></entry>
<entry><form id=""tinubaxgay"" lang=""ceb""><abbr expan=""tinubágay"" type=""lemma"">-in-ay(←)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number><trans> = <xr lang=""ceb"" target=""#tubag""><sc>tubag</sc></xr>, <i lang=""ceb"">v1c.</i> </trans>
</sense>
<sense n=""2""><number>2</number><trans> = <xr lang=""ceb"" target=""#tubagtubag""><sc>tubagtubag</sc></xr>. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> heated exchange of words. </trans>
</sense>
<sense n=""2""><number>2</number><trans> responsive or alternate making of sound. </trans>
<eg><i lang=""ceb"">Ang tinubágay sa mga langgam mabuntag,</i><trans> The alternating sounds of birds in the morning. </trans></eg>
</sense></hom></entry>
<entry><form id=""tinubagan"" lang=""ceb""><abbr expan=""tinubagan"" type=""lemma"">-in-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> manner of answering. </trans>
</sense></hom></entry>
<entry><form id=""tulubaxgun"" lang=""ceb""><abbr expan=""tulubágun"" type=""lemma"">-l-un(←)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>responsibility</tr> that one has to answer for. </trans>
<eg><i lang=""ceb"">Tulubágun sa tsapirun ug unsay mahitabù níla,</i><trans> It is the chaperon who has to answer if s.t. happens to them. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> material from which a responsive reading or singing is read.
</trans>
</sense></hom></entry></entry>");
