INSERT INTO `wced_entry` VALUES (19386, "tubas", "1036", "<entry page=""1036"" id=""19386""><form id=""tubas"" lang=""ceb"">tubas</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> off-season for fruit-bearing trees. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B23]</itype><trans> for trees to stop bearing fruit. </trans>
<eg><i lang=""ceb"">Nagkatubas na ang pamúnga sa kaimítu,</i><trans> The fruit-bearing season for star apples is coming to a close. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B2]</itype><trans> stop raining. </trans>
<eg><i lang=""ceb"">Ug mutubas na ang ulan, dì na ta magpáyung,</i><trans> If the rains stop, we won’t need an umbrella any more. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[b4]</itype><trans> get, be <tr>rain-soaked</tr> (lit. be in the rain till it stops). </trans>
<eg><i lang=""ceb"">Gitubasan (hingtubasan) ku sa ulan,</i><trans> I got soaked by the rain.
</trans></eg>
</sense></hom></entry>");
