<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B12; a]</itype><trans> for the husks to come off of pounded grains. </trans>
<eg><i lang=""ceb"">Gáhì matúbaw ang humay nga pínug lugas,</i><trans> It is difficult to get the husk off fine-grained rice.
</trans></eg>
</sense></hom></entry>");
