INSERT INTO `wced_entry` VALUES (19393, "tublag", "1036", "<entry page=""1036"" id=""19393""><form id=""tublag"" lang=""ceb"">tublag</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b6]</itype><trans> <tr>dilute</tr> s.t. </trans>
<eg><i lang=""ceb"">Ákung gitublágag túbig ang súkà,</i><trans> I diluted vinegar with water. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A12]</itype><trans> for a food ingredient added as a seasoning or sweetening to be well diffused. </trans>
<eg><i lang=""ceb"">Dílì makatublag ang diyútayng asúkar <pb n=""1037""/>sa usa ka tásang kapi,</i><trans> A little sugar cannot sweeten a cup of coffee. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B126; c5]</itype><trans> for everybody to get some of s.t., usually food. </trans>
<eg><i lang=""ceb"">Dílì makatublag sa tanan ug maglútù lang kug gamay,</i><trans> If I don’t prepare but a little, not everyone will get s.t. to eat. </trans></eg>
<eg><i lang=""ceb"">Natublag ang tanan sa ákung gilútù,</i><trans> I prepared enough to take care of everybody.
</trans></eg>
</sense></hom></entry>");
