INSERT INTO `wced_entry` VALUES (19394, "tubli", "1037", "<entry page=""1037"" id=""19394""><form id=""tubli"" lang=""ceb"">tubli</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> k.o. shrub growing along streams and in secondary forests, the leaves and branches of which are used as fish poison: <bio>Derris elliptica</bio>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a2]</itype><trans> poison fish with <ix>tubli</ix>. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A2; a12]</itype><trans> give off a terrible odor, enough to make one groggy. </trans>
<eg><i lang=""ceb"">Ang báhù sa íyang utut makatublig búnug,</i><trans> When he breaks wind it could kill a goby. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B126]</itype><trans> be tired of the same old thing: hearing the same story, music, etc. </trans>
<eg><i lang=""ceb"">Natubli na ku ánang ímung isturyang balikbálik,</i><trans> I’m tired hearing the same story over and over again. </trans></eg>
</sense></hom>
<entry><form id=""panubli"" lang=""ceb""><abbr expan=""panubli"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A1; c6]</itype><trans> catch fish with <ix>tubli</ix>. </trans>
</sense></hom></entry>
<entry><form id=""tinublixhan"" lang=""ceb"">tinublíhan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> fish caught with <ix>tubli</ix>.
</trans>
</sense></hom></entry></entry>");
