INSERT INTO `wced_entry` VALUES (19396, "tubtub1", "1037", "<entry page=""1037"" id=""19396""><form id=""tubtub"" lang=""ceb"">tubtub<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a1b7]</itype><trans> <tr>cut</tr> s.t. at its base, very close to the surface. </trans>
<eg><i lang=""ceb"">Tubtúba pagputul ang ságing arun sayun ang pagpanáhà,</i><trans> Cut the banana stalk close to the ground so it will readily grow suckers. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b5]</itype><trans> cut around s.t. cylindrical, usually bamboo poles, little by little with short hacks, resulting in a clean finish. </trans>
<eg><i lang=""ceb"">Tubtúbi (tubtúba) ang tumuy sa kawáyan arun malimpiyu,</i><trans> Cut around the tip of the bamboo pole so it will be clean. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; a]</itype><trans> make a toddy container out of a length of bamboo. </trans>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> being cut close to the surface. </trans>
<eg><i lang=""ceb"">Tubtub rang pagkaputúla ang íyang buhuk,</i><trans> Her hair was cut too close to the roots. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> section cut from a long piece. </trans>
<eg><i lang=""ceb"">Usa ka tubtub nga láwas sa lubi,</i><trans> A section of a coconut tree trunk. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> one node length of bamboo, usually used as a container, esp. for palm toddy.
</trans>
</sense></hom></entry>");
