INSERT INTO `wced_entry` VALUES (19400, "tubu1", "1037", "<entry page=""1037"" id=""19400""><form id=""tuxbuq"" lang=""ceb"">túbù<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2S; b17]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>grow</tr>, <tr>become larger</tr>. </trans>
<eg><i lang=""ceb"">Mutaas pa siya kay nagtubù pa,</i><trans> She will <tr>grow</tr> taller because she is still growing. </trans></eg>
<eg><i lang=""ceb"">Dus pulgádas ang ákung gitubúan,</i><trans> I grew two inches taller. </trans></eg>
<eg><i lang=""ceb"">Gitubúan na ang sinínà,</i><trans> She has <tr>outgrown</tr> her dress. </trans></eg>
<eg><i lang=""ceb"">Ang gitubúan sa dákit,</i><trans> Where the banyan tree was <tr>growing</tr>. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>earn interest</tr>. </trans>
<eg><i lang=""ceb"">Mutúbù ang kwartang ibangku,</i><trans> Money put in the bank earns <tr>interest</tr>. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[b(1)]</itype><trans> <tr>develop feelings</tr>. </trans>
<eg><i lang=""ceb"">Gitubúan kug kasína sa íyang paglampus,</i><trans> I grew envious over his success. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A2S]</itype><trans> for water, dough, land to <tr>rise</tr>. </trans>
<eg><i lang=""ceb"">Hurnúha ang harínang gimása ug mutúbù na,</i><trans> Put the dough in the oven when it rises. </trans></eg>
<eg><i lang=""ceb"">Síging magtubù ang dágat ug dì pa makalantung,</i><trans> The sea continues to rise until it reaches its highest point at high tide. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>growth</tr>. </trans>
<eg><i lang=""ceb"">Kusug ang túbù sa tanum,</i><trans> The plant grows fast. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>interest</tr> on loan. </trans>
</sense></hom>
<entry><form id=""bag-ung_tuxbuq"" lang=""ceb"">bag-ung <abbr expan=""túbù"" type=""lemma"">—</abbr></form>
<hom>
<sense n=""0""><trans> <ix>see</ix> <xr lang=""ceb"" target=""#bag-u""><sc>bag-u</sc></xr>. </trans>
</sense></hom></entry>
<entry><form id=""patuxbuq"" lang=""ceb""><abbr expan=""patúbù"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b]</itype><trans> lend money with interest. </trans>
<eg><i lang=""ceb"">Patubúan diay nímu tung ákung gibaylu?</i><trans> Are you going to charge interest on the money I borrowed? </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>leavening</tr> agent. </trans>
</sense>
<sense n=""2""><number>2</number><trans> wall stud of bamboo. </trans>
</sense></hom></entry>
<entry><form id=""pinatuxbuq"" lang=""ceb""><abbr expan=""pinatúbù"" type=""lemma"">pina-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>grown</tr>, <tr>raised</tr>. </trans>
<eg><i lang=""ceb"">Sankis nga pinatúbù sa Kalipurníya,</i><trans> California-grown sunkist. </trans></eg>
</sense></hom></entry>
<entry><form id=""tinubuxan_tinubuan"" lang=""ceb""><abbr expan=""tinubúan"" type=""lemma"">-in-an</abbr>, <abbr expan=""tinubuan"" type=""lemma"">-in-an(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> outgrown outfit. </trans>
</sense></hom></entry>
<entry><form id=""tubuqtuxbuq"" lang=""ceb"">tubùtúbù</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> growth on the skin. </trans>
<eg><i lang=""ceb"">Mu rag áwum nang íyang tubùtúbù piru nagkadakù,</i><trans> Your growth looks like a mole, but it is getting bigger. </trans></eg>
</sense></hom></entry>
<entry><form id=""halinub-un"" lang=""ceb"">halinub-un</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> having a tendency to grow fast even with no care. </trans>
<eg><i lang=""ceb"">Halinub-un ning sagbúta, pirmi lang hagbásan,</i><trans> This k.o. grass grows fast. It has to be trimmed frequently.†
</trans></eg>
</sense></hom></entry></entry>");
