INSERT INTO `wced_entry` VALUES (19402, "tubud", "1037", "<entry page=""1037"" id=""19402""><form id=""tubud"" lang=""ceb"">tubud</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b6]</itype><trans> <tr>flow</tr> in a steady stream. </trans>
<eg><i lang=""ceb"">Mitubud ang dugù sa dakung samad,</i><trans> Blood flowed from the big wound. </trans></eg>
<eg><i lang=""ceb"">Sandayung ang tuburan sa ulan,</i><trans> The rain flowed out of the gutter. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B46]</itype><trans> for liquid to <tr>leak</tr> out of a container or boat. </trans>
<eg><i lang=""ceb"">Nagtubud ang sakayan maung sígi kung gahinúbig,</i><trans> The boat sprung a leak so I kept bailing out water. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> water <tr>spring</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>leak</tr>. </trans>
</sense></hom>
<entry><form id=""patubud_patuxbud_sa_uxhung"" lang=""ceb""><abbr expan=""patubud"" type=""lemma"">pa-</abbr>, <abbr expan=""patúbud"" type=""lemma"">pa-(←)</abbr> sa úhung</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A]</itype><trans> make people believe s.t. about oneself which is impossible (lit. make a water flow from a mushroom). </trans>
<eg><i lang=""ceb"">Nagpatúbud na sad sa úhung ang hambugíru,</i><trans> The boaster is bragging again. </trans></eg>
<eg><i lang=""ceb"">Ayaw pagpatúbud dinhi kay suhítu mi sa ímung kaláki,</i><trans> Don’t try to <tr>talk big</tr> around here because we know what you are. </trans></eg>
</sense></hom></entry>
<entry><form id=""tuburan"" lang=""ceb"">tuburan</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>spring</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> source of s.t. that gushes in abundance. </trans>
<eg><i lang=""ceb"">Diyus nga tuburan sa kalúuy,</i><trans> All-merciful (lit. giver of all mercy) God. </trans></eg>
</sense></hom></entry>
<entry><form id=""tinubdan"" lang=""ceb"">tinubdan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>source</tr>, <tr>origin</tr>. </trans>
<eg><i lang=""ceb"">Tinubdan sa sapà,</i><trans> The brook’s source. </trans></eg>
<eg><i lang=""ceb"">Tinubdan sa balità,</i><trans> Source of news.
<pb n=""1038""/>
</trans></eg>
</sense></hom></entry></entry>");
