INSERT INTO `wced_entry` VALUES (19408, "tubus", "1038", "<entry page=""1038"" id=""19408""><form id=""tubus"" lang=""ceb"">tubus</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a1]</itype><trans> <tr>redeem</tr>, <tr>save from</tr>. </trans>
<eg><i lang=""ceb"">Ang ímung bahandì dì makatubus sa mahúgaw mung ngalan,</i><trans> Your wealth cannot redeem your filthy name. </trans></eg>
<eg><i lang=""ceb"">Gitubus sila ni Muysis gíkan sa kaulipnan,</i><trans> They were saved from slavery by Moses. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a2b2]</itype><trans> in games where several people play in turns, take a player’s turn for him to keep him from losing his turn (e.g. when a player is in a difficult position, for s.o. better to play for him for that one move). </trans>
</sense>
<sense n=""2a""><number>2a</number><trans> take s.o. else’s place in his absence or in the event of his inability. </trans>
<eg><i lang=""ceb"">Akuy mutubus ug káun sa ímung báhin kay dì ka man muadtu,</i><trans> I’ll eat your share because you aren’t going. </trans></eg>
<eg><i lang=""ceb"">Dì ku makatubus sa ímung trabáhu kay mulakaw man ku,</i><trans> I can’t take your work over for you because I’m going out. </trans></eg>
</sense></hom>
<entry><form id=""katubsaxnan"" lang=""ceb"">katubsánan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>redemption</tr>. </trans>
</sense></hom></entry>
<entry><form id=""manunubus"" lang=""ceb""><abbr expan=""manunubus"" type=""lemma"">maN-r-(←)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>redeemer</tr>; <tr>Christ the Redeemer</tr>.
</trans>
</sense></hom></entry></entry>");
