INSERT INTO `wced_entry` VALUES (19410, "tubuy", "1038", "<entry page=""1038"" id=""19410""><form id=""tuxbuy"" lang=""ceb"">túbuy</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c16]</itype><trans> hold, put upward and above the rest. </trans>
<eg><i lang=""ceb"">Makatúbuy ku ánang barbil,</i><trans> I can raise that barbell above my head. </trans></eg>
<eg><i lang=""ceb"">Daw tubúyun (itúbuy) siya sa lángit kun pahiyuman siya ni Adilayda,</i><trans> It was as though he was being raised to the heavens when Adelaida smiled at him. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[C; c6]</itype><trans> <tr>put up for election</tr>. </trans>
<eg><i lang=""ceb"">Itúbuy nátù siya pagkakunsihal,</i><trans> We will put him up as councilor.
