INSERT INTO `wced_entry` VALUES (19411, "tuda", "1038", "<entry page=""1038"" id=""19411""><form id=""tuxda"" lang=""ceb"">túda</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>fast</tr>, <tr>rapid</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>hard</tr>, with much force. </trans>
</sense>
<sense n=""3""><number>3</number><trans> doing to a high degree or in excess. </trans>
<eg><i lang=""ceb"">Túda siyang mukáun,</i><trans> He eats ravenously. </trans></eg>
<eg><i lang=""ceb"">Túda siyang matúlug,</i><trans> He sleeps soundly. </trans></eg>
<eg><i lang=""ceb"">Túda siyang mangasábà,</i><trans> He scolds very severely. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; b(1)]</itype><trans> do s.t. <tr>fast</tr>, <tr>rapidly</tr>. </trans>
<eg><i lang=""ceb"">Ayaw tudáhig lakaw,</i><trans> Don’t walk too fast. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b5]</itype><trans> do s.t. with much force. </trans>
<eg><i lang=""ceb"">Tudáhag (tudáhig) lísù ang takub,</i><trans> Turn the cap with a good deal of force. </trans></eg>
</sense></hom>
<entry><form id=""patuxda"" lang=""ceb""><abbr expan=""patúda"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b(1)]</itype><trans> <tr>drive fast</tr>. </trans>
<eg><i lang=""ceb"">Gipatudáhan sa kapitan ang dágan sa yáti,</i><trans> The captain made the yacht go fast.
</trans></eg>
</sense></hom></entry></entry>");
