INSERT INTO `wced_entry` VALUES (19413, "tudas", "1038", "<entry page=""1038"" id=""19413""><form id=""tuxdas"" lang=""ceb"">túdas</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AB; a]</itype><trans> be totally <tr>lost</tr> or <tr>used up</tr>, cause s.t. to be so. </trans>
<eg><i lang=""ceb"">Akuy mutúdas ánang ímung baligyà basta barátu,</i><trans> I’ll take all of your wares if you let me have them cheap. </trans></eg>
<eg><i lang=""ceb"">Ang ákung mga anak nga kiat mauy nagtúdas sa ákung mga básung tarungtarung,</i><trans> The children played around and broke all my decent glasses. </trans></eg>
<eg><i lang=""ceb"">Natúdas ang ákung singsing nga mihiplus sa ákung tudlù,</i><trans> The ring slipped off my finger and is lost. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2; a2]</itype><trans> draw the card that makes the hand complete. </trans>
<eg><i lang=""ceb"">Búnut na kay tudásun ku na ni,</i><trans> Draw a card because I am going to go out now. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[AB126; a1]</itype><trans> murder (slang). </trans>
<eg><i lang=""ceb"">Tudásun nátù nang hambugírung dakù,</i><trans> We will kill that bigmouth. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> completely used up, lost, killed<corr sic="","">.</corr> </trans>
<eg><i lang=""ceb"">Hansákan ku bítaw sa tris kantus, túdas lagi,</i><trans> I stabbed him with a three-bladed knife. That was the end of him. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> the card in a game of <ix>tudasay</ix> that completes the last pair. </trans>
</sense></hom>
<entry><form id=""panuxdas"" lang=""ceb""><abbr expan=""panúdas"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; c]</itype><trans> for s.o. who is desperate, and sure to die anyway to kill s.o. to die along with him. </trans>
<eg><i lang=""ceb"">Manúdas na lang ku kay wà na man kuy mahímù,</i><trans> I’ll just kill s.o. to die along with me because I am at the end of my rope. </trans></eg>
</sense></hom></entry>
<entry><form id=""tudastuxdas"" lang=""ceb"">tudastúdas</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> k.o. coin-tossing game where three coins are tossed up and the bettors win only if it is three heads or three tails. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AC2; b6(1)]</itype><trans> play <ix>tudastúdas</ix>. </trans>
</sense></hom></entry>
<entry><form id=""tudasan"" lang=""ceb""><abbr expan=""tudasan"" type=""lemma"">-an(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> card that allows one to go out in <ix>tudasay</ix>. </trans>
</sense></hom></entry>
<entry><form id=""walay_tudasan"" lang=""ceb"">walay <abbr expan=""tudasan"" type=""lemma"">-an(→)</abbr></form>
<hom>
<sense n=""0""><trans> be no match for s.o. </trans>
<eg><i lang=""ceb"">Haníti kaáyu nà. Wà kay tudasan ug musúkul ka,</i><trans> He is very skillful. You won’t have a chance if you play against him. </trans></eg>
</sense></hom></entry>
<entry><form id=""tudasay"" lang=""ceb""><abbr expan=""tudasay"" type=""lemma"">-ay(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> card game with drawing and discarding in which the object is to compete to get three pairs from a hand of five cards. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; c]</itype><trans> play <ix>tudasay</ix>.
</trans>
</sense></hom></entry></entry>");
