INSERT INTO `wced_entry` VALUES (19416, "tudlis", "1038", "<entry page=""1038"" id=""19416""><form id=""tudlis"" lang=""ceb"">tudlis</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a1]</itype><trans> <tr>prick</tr> with a needle to get s.t. out. </trans>
<eg><i lang=""ceb"">Akuy mutudlis sa ímung tunuk sa tiil,</i><trans> I will prick your foot to get the thorn out. </trans></eg>
<eg><i lang=""ceb"">Tudlísa ang hubag arun mugulà ang nánà,</i><trans> Prick the boil so the pus can come out. </trans></eg>
