INSERT INTO `wced_entry` VALUES (19417, "tudlu", "1038", "<entry page=""1038"" id=""19417""><form id=""tudluq"" lang=""ceb"">tudlù</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a1]</itype><trans> point at, out. </trans>
<eg><i lang=""ceb"">Kun mutudlù si Sír nímu sulayi lag tubag,</i><trans> If the teacher <pb n=""1039""/>calls on you just try to answer. </trans></eg>
<eg><i lang=""ceb"">Tudlúa ang sinumbung,</i><trans> <tr>Point out</tr> the one who did it. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c6]</itype><trans> <tr>point</tr>, give <tr>directions</tr>. </trans>
<eg><i lang=""ceb"">Kinsay gatudlù nímung nía ku magpuyù?</i><trans> Who told you that I live here? </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>teach</tr>. </trans>
<eg><i lang=""ceb"">Nagtudlù siya sa pablik,</i><trans> She is teaching in the public schools. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A; c16]</itype><trans> <tr>appoint</tr>. </trans>
