<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> for God or nature to bestow, endow. </trans>
<eg><i lang=""ceb"">Gitugáhan siyag diyútay nga kaísug,</i><trans> He has been endowed with a little courage. </trans></eg>
<eg><i lang=""ceb"">Ang kaálam itúga sa Diyus niadtung nagtáhud kaníya,</i><trans> God bestows wisdom on whoever shows Him reverence. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. esp. given, directly from God. </trans>
<eg><i lang=""ceb"">Túga sa lángit nang ímung anak,</i><trans> Your child is a gift from heaven. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[b6]</itype><trans> be given s.t. exclusively by a supernatural being. </trans>
<eg><i lang=""ceb"">Si Hárì Artur gitugáhan ug usa ka ispáda,</i><trans> King Arthur was given a sword by a supernatural being. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. presented exclusively to s.o. by a supernatural being.
