</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B1; b]</itype><trans> get torn wide open. </trans>
<eg><i lang=""ceb"">Nagkatugalhab ang gisì kay wà dáyun sursíhi,</i><trans> The tear became a gaping hole because she didn’t darn it at once. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B126]</itype><trans> lose one’s virginity.
</trans>
</sense></hom></entry>");
