INSERT INTO `wced_entry` VALUES (19448, "tugbang", "1040", "<entry page=""1040"" id=""19448""><form id=""tugbang"" lang=""ceb"">tugbang</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; c]</itype><trans> give s.t. as <tr>counterpart</tr>; <tr>match</tr>. </trans>
<eg><i lang=""ceb"">Ug muámut ka ug kanding sa kumbira mutugbang ku ug ámut ug bábuy,</i><trans> If you give a goat for the feast, I will give a pig to match it. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[C; b6]</itype><trans> sit across or in front of each other. </trans>
<eg><i lang=""ceb"">Nagkatugbang mi ug lingkud sa dyip,</i><trans> We happened to sit across from each other in the jeep. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> in activities where people are paired off: be s.o.’s opposite. </trans>
<eg><i lang=""ceb"">Dílì ku makigtugbang nímu sa kuntis kay maáyu ka,</i><trans> I don’t want to be matched against you in the contest because you’re good. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> thing given as <tr>counterpart</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> one’s opposite in a contest. </trans>
</sense>
<sense n=""3""><number>3</number><trans> s.t. which happens which makes up for s.t. else. </trans>
<eg><i lang=""ceb"">Kining átung mga pag-antus run tugbang sa átung kalípay niadtu,</i><trans> Our sufferings now are exact payment of our happiness formerly. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> s.t. <tr>commensurate</tr> in degree or weight. </trans>
<eg><i lang=""ceb"">Ang tugbang sílut sa pagpatay mau ang pagbítay,</i><trans> Hanging is the punishment <tr>appropriate</tr> for murder. </trans></eg>
</sense>
<sense n=""5""><number>5</number><trans> = <xr lang=""ceb"" target=""#ka-""><sc>ka-</sc></xr>. </trans>
</sense></hom>
<entry><form id=""tugbang_puxlung"" lang=""ceb""><abbr expan=""tugbang"" type=""lemma"">—</abbr> púlung</form>
<hom>
<sense n=""0""><trans> <tr>antonym</tr>. </trans>
<eg><i lang=""ceb"">Ang tugbang púlung sa ‘layù’, ‘duul’,</i><trans> The antonym of ‘far’ is ‘near’. </trans></eg>
</sense></hom></entry>
<entry><form id=""katugbang"" lang=""ceb""><abbr expan=""katugbang"" type=""lemma"">ka-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>analogous</tr>, <tr>counterpart</tr>. </trans>
<eg><i lang=""ceb"">Ang inbiay tugbang sa ipbiay sa istíts,</i><trans> The <asc>NBI</asc> is the counterpart of the <asc>FBI</asc> in the States.
</trans></eg>
</sense></hom></entry></entry>");
