INSERT INTO `wced_entry` VALUES (19449, "tugbaw", "1040", "<entry page=""1040"" id=""19449""><form id=""tugbaw"" lang=""ceb"">tugbaw</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>lofty</tr>, <tr>high</tr> up. </trans>
<eg><i lang=""ceb"">Tugbaw kaáyung miuntul ang búla,</i><trans> The ball bounces high. </trans></eg>
<eg><i lang=""ceb"">Hilabihang katugbaw sa garbu!</i><trans> What a great pride! </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B246; a3]</itype><trans> <tr>rise</tr> to a considerable height. </trans>
<eg><i lang=""ceb"">Mitugbaw ang tíngug ni Níning sa kasukù,</i><trans> Nening’s voice rose in anger. </trans></eg>
<eg><i lang=""ceb"">Natugbaw sa íyang hunàhúnà ang mga hudlat ni Maks,</i><trans> Max’s threats came to his thoughts. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[c1]</itype><trans> put s.t. high up or way up. </trans>
<eg><i lang=""ceb"">Itugbaw (tugbáwa) pagdala nang isdà arun dílì maabut sa irù,</i><trans> Lift the fish you are carrying high so the dogs can’t reach it. </trans></eg>
</sense></hom>
<entry><form id=""matugbaxwun"" lang=""ceb""><abbr expan=""matugbáwun"" type=""lemma"">ma-un</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>lofty</tr> (literary). </trans>
<eg><i lang=""ceb"">Matugbáwung damgu,</i><trans> Lofty dreams. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A12C1; a2]</itype><trans> match in height, popularity, or ability. </trans>
<eg><i lang=""ceb"">Walay makatugbaw sa kataas ni Pidru,</i><trans> No one is as tall as Pedro. </trans></eg>
<eg><i lang=""ceb"">Tugbáwun ku ang kaálam níya sa makina,</i><trans> I’ll try to learn as much about machine as he knows.
</trans></eg>
</sense></hom></entry></entry>");
