<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AB23(1); c1]</itype><trans> <tr>sink</tr> to the bottom of water, cause s.t. to do so. </trans>
<eg><i lang=""ceb"">Mitugdang na ang lawug, ug tin-aw na ang túbig,</i><trans> The mud in the water has <tr>settled</tr>, and it is clear now. </trans></eg>
<eg><i lang=""ceb"">Natugdang na ang bapur digíra,</i><trans> The battleship has sunk. </trans></eg>
<eg><i lang=""ceb"">Nakatugdang na ka sa taliwálà ánang línaw?</i><trans> Have you gone to the bottom in the middle of that lake? </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2; b6]</itype><trans> land hard after being projected or dropped. </trans>
