INSERT INTO `wced_entry` VALUES (19464, "tugkad", "1041", "<entry page=""1041"" id=""19464""><form id=""tugkad"" lang=""ceb"">tugkad</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a12]</itype><trans> touch the bottom standing in water. </trans>
<eg><i lang=""ceb"">Makatugkad ka ba dihà?</i><trans> Can you stand there? </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B456]</itype><trans> for the feet or s.t. dangling to reach the ground. </trans>
<eg><i lang=""ceb"">Dílì makatugkad ang íyang tiil sa salug ug kanang siyáhay lingkúran,</i><trans> His feet don’t touch the ground if he sits in that chair. </trans></eg>
<eg><i lang=""ceb"">Nagtikwangtikwang ang lamísa kay wà magtugkad ang usa ka tiil,</i><trans> The table is jiggling because one of the legs isn’t touching the ground. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; a12]</itype><trans> <tr>fathom</tr>, <tr>comprehend</tr> s.t. mysterious. </trans>
<eg><i lang=""ceb"">Way makatugkad sa ákung hunàhúnà,</i><trans> Nobody can read my mind. </trans></eg>
<eg><i lang=""ceb"">Lisud tugkárun ang sumbíngay sa páras,</i><trans> It is hard to <tr>understand</tr> the meaning of the Parable of the Vine. </trans></eg>
</sense></hom>
<entry><form id=""tugkaran"" lang=""ceb"">tugkaran</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>yard</tr> of a house. </trans>
</sense>
<sense n=""2""><number>2</number><trans> foot of a hill. </trans>
</sense></hom></entry>
<entry><form id=""tulugkaxrun"" lang=""ceb"">tulugkárun</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. that takes deep understanding.
</trans>
</sense></hom></entry></entry>");
