INSERT INTO `wced_entry` VALUES (19469, "tugnaw", "1041", "<entry page=""1041"" id=""19469""><form id=""tugnaw"" lang=""ceb"">tugnaw</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>cold</tr> to the touch, feel. </trans>
<eg><i lang=""ceb"">Tugnaw kaáyu sa Bagyu,</i><trans> It’s very cold in Baguio. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B]</itype><trans> become cold weather. </trans>
<eg><i lang=""ceb"">Mutugnaw (matugnaw) ang panahun inigka Disimbri,</i><trans> The weather gets cold in December. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[a4]</itype><trans> <tr>feel cold</tr>. </trans>
<eg><i lang=""ceb"">Gamítag hítir kun tugnawun ka,</i><trans> Use the heater if you feel cold. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[b8]</itype><trans> be exposed to the cold. </trans>
<eg><i lang=""ceb"">Gisip-un siya kay hitugnawan,</i><trans> He caught cold because he was exposed to the cold. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>cold</tr>. </trans>
<eg><i lang=""ceb"">Dì kung kaagwanta sa tugnaw,</i><trans> I can’t take the cold. </trans></eg>
</sense></hom>
<entry><form id=""katugnaw"" lang=""ceb""><abbr expan=""katugnaw"" type=""lemma"">ka-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> state of being cold. </trans>
<eg><i lang=""ceb"">Nagkuray siya sa katugnaw,</i><trans> She is shivering with cold. </trans></eg>
</sense></hom></entry>
<entry><form id=""panugnaw"" lang=""ceb""><abbr expan=""panugnaw"" type=""lemma"">paN-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>chills</tr>. </trans>
<eg><i lang=""ceb"">Ang panugnaw mubálus sa hilánat,</i><trans> Chills come right after fever. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[a4]</itype><trans> get the chills. </trans>
</sense></hom></entry>
<entry><form id=""tingtugnaw"" lang=""ceb""><abbr expan=""tingtugnaw"" type=""lemma"">ting-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>cold season</tr>.
</trans>
</sense></hom></entry></entry>");
