INSERT INTO `wced_entry` VALUES (19473, "tugpu1", "1041", "<entry page=""1041"" id=""19473""><form id=""tugpuq"" lang=""ceb"">tugpù<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c6]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>toss</tr> s.t. up in the air. </trans>
<eg><i lang=""ceb"">Itugpù ang búla kay akuy mubumba,</i><trans> Toss the volleyball and I will spike it. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> put up s.o. as candidate. </trans>
<eg><i lang=""ceb"">Siyay átung itugpù pagkamayur,</i><trans> We will put him up as candidate for mayor. </trans></eg>
</sense></hom>
