INSERT INTO `wced_entry` VALUES (19475, "tugsad", "1042", "<entry page=""1042"" id=""19475""><form id=""tugsad"" lang=""ceb"">tugsad</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; b6]</itype><trans> hit, reach the ground from an elevated position. </trans>
<eg><i lang=""ceb"">Milayat siya ug didtu mutugsad sa píkas tampi,</i><trans> He jumped and landed on the opposite bank. </trans></eg>
<eg><i lang=""ceb"">Gibukhárag panaptun ang gitugsáran sa rayna gíkan sa hagdanan,</i><trans> A cloth was laid over the area the queen stepped on when she came down from the stairs.
