<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a3b]</itype><trans> <tr>plunge</tr> into water, <tr>dunk</tr> s.t. straight into a liquid. </trans>
<eg><i lang=""ceb"">Nagtugsaw ang íyang tiil sa dágat samtang nagdagan ang pambut,</i><trans> His feet were <tr>immersed</tr> in the water while the boat was moving. </trans></eg>
