INSERT INTO `wced_entry` VALUES (19477, "tugsuk", "1042", "<entry page=""1042"" id=""19477""><form id=""tugsuk"" lang=""ceb"">tugsuk</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; ab2]</itype><trans> strike s.t. pointed into s.t. </trans>
<eg><i lang=""ceb"">Nagtugsuk siyag káhuy silbing timáan,</i><trans> He planted a stake as a marker. </trans></eg>
<eg><i lang=""ceb"">Tugsukun níya ang linung-ag ságing sa tinidur,</i><trans> He will <tr>stick</tr> a fork into the boiled banana. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b6(1)]</itype><trans> stick one’s finger into liquid and immediately remove it. </trans>
<eg><i lang=""ceb"">Ang binditahan nga ákung gitugsúkan sa ákung tudlù,</i><trans> The font of the holy water into which I <tr>dipped</tr> my finger. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>skewer</tr>, s.t. to stick into s.t. </trans>
<eg><i lang=""ceb"">Ambi ra ang tugsuk kay átung isuway sa amúti,</i><trans> Let me have a stick so I can see if the sweet potatoes are done.
</trans></eg>
</sense></hom></entry>");
