INSERT INTO `wced_entry` VALUES (19478, "tugsuy", "1042", "<entry page=""1042"" id=""19478""><form id=""tugsuy"" lang=""ceb"">tugsuy</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B46; b6]</itype><trans> for s.t. to appear as an elongated shape. </trans>
<eg><i lang=""ceb"">Unsa nang mitugsuy sa ímung bursa, ságing?</i><trans> What is that thing protruding in your pocket, a banana? </trans></eg>
<eg><i lang=""ceb"">Nagtugsuy lang nang níwang mu rag kawáyan,</i><trans> That skinny person looks tall and thin like a bamboo pole. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> thin and <tr>elongated</tr>. </trans>
<eg><i lang=""ceb"">Tugsuy ug simud,</i><trans> Long-snouted.
</trans></eg>
