INSERT INTO `wced_entry` VALUES (19482, "tugun", "1042", "<entry page=""1042"" id=""19482""><form id=""tuxgun"" lang=""ceb"">túgun</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a1c6]</itype><trans> leave or send s.o. with instructions to do s.t. </trans>
<eg><i lang=""ceb"">Tugna siya pagpalit ug asin inigtugbung níya,</i><trans> Give him the message to buy some salt when he goes to town. </trans></eg>
<eg><i lang=""ceb"">Unsay ímung itúgun inig-adtu nákù sa Manílà?</i><trans> What do you want me to do for you when I go to Manila? </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> word of instruction to do or get s.t. </trans>
</sense>
<sense n=""2""><number>2</number><trans> final message of a dying man. </trans>
</sense></hom>
<entry><form id=""Bag-ung_Tuxgun"" lang=""ceb"">Bag-ung <abbr expan=""Túgun"" type=""lemma"">—</abbr></form>
<hom>
<sense n=""0""><trans> <tr>New Testament</tr>. </trans>
</sense></hom></entry>
<entry><form id=""Daxang_Tuxgun"" lang=""ceb"">Dáang <abbr expan=""Túgun"" type=""lemma"">—</abbr></form>
<hom>
<sense n=""0""><trans> <tr>Old Testament</tr>. </trans>
</sense></hom></entry>
<entry><form id=""panuxgun"" lang=""ceb""><abbr expan=""panúgun"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2S; b6]</itype><trans> ask s.o. to get and bring s.t. back. </trans>
<eg><i lang=""ceb"">Nagpanugun tus Búbuy sa íyang duláan,</i><trans> Boboy keeps asking you to bring him a toy. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2; c]</itype><trans> give final instructions, will at deathbed. </trans>
<eg><i lang=""ceb"">Nanúgun na ang himatyun,</i><trans> The dying man is giving his final instructions.
</trans></eg>
</sense></hom></entry></entry>");
