INSERT INTO `wced_entry` VALUES (19483, "tugut", "1042", "<entry page=""1042"" id=""19483""><form id=""tuxgut"" lang=""ceb"">túgut</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b]</itype><trans> pay out line. </trans>
<eg><i lang=""ceb"">Tugúti ang lambu hangtud malúya ang isdà,</i><trans> Pay out the line until the fish gets weak. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c]</itype><trans> <tr>permit</tr>, <tr>allow</tr>. </trans>
<eg><i lang=""ceb"">Mulangyaw untà ku kun mutúgut ka,</i><trans> I would like to go abroad if you permit me. </trans></eg>
<eg><i lang=""ceb"">Dílì itúgut ang paghulam íning librúha,</i><trans> No one is permitted to borrow this book. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; c6]</itype><trans> sell s.t. at a price lower than that quoted. </trans>
<eg><i lang=""ceb"">Ákù ning palitun ug itúgut nímug písus,</i><trans> I’ll buy it if you give it to me for one peso. </trans></eg>
</sense></hom>
<entry><form id=""tugut"" lang=""ceb""><abbr expan=""tugut"" type=""lemma"">(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> line which one pays out, esp. a kite string.
</trans>
</sense></hom></entry></entry>");
