INSERT INTO `wced_entry` VALUES (19485, "tugway", "1042", "<entry page=""1042"" id=""19485""><form id=""tugway"" lang=""ceb"">tugway</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b]</itype><trans> lengthen a tether. </trans>
<eg><i lang=""ceb"">Tas-ig tugway ang kábaw,</i><trans> Give the carabao more rope. </trans></eg>
<eg><i lang=""ceb"">Tugwáyi ang kanding arun makapanabsab,</i><trans> Give the goat more rope so it can graze. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AN; c]</itype><trans> pasture an animal by lengthening or untying the tether. </trans>
<eg><i lang=""ceb"">Manugway kug kábaw mahápun,</i><trans> I pasture the carabao each afternoon. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> rope used to <tr>tether</tr> animals. </trans>
</sense>
<sense n=""2""><number>2</number><trans> length of tether allowed. </trans>
</sense></hom>
<entry><form id=""tugwayanan"" lang=""ceb""><abbr expan=""tugwayanan"" type=""lemma"">-anan</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> place where animals are tethered. </trans>
</sense></hom></entry>
