INSERT INTO `wced_entry` VALUES (19487, "tuhab", "1042", "<entry page=""1042"" id=""19487""><form id=""tuxhab"" lang=""ceb"">túhab</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a]</itype><trans> <tr>peck</tr> a piece of s.t. </trans>
<eg><i lang=""ceb"">Dílì makatúhab ang langgam sa búnga nga giputus,</i><trans> The bird could not peck at the fruit that was wrapped. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b6]</itype><trans> cut a large opening or swath. </trans>
<eg><i lang=""ceb"">Kinsay maistráhang nagtúhab sa úlus ákung anak?</i><trans> Which teacher was it that cut a wide swath into my son’s hair? </trans></eg>
<eg><i lang=""ceb"">Bistídu nga mu rag sáku nga gituhában pára agiánas buktun,</i><trans> A dress like a sack with pieces snipped off for armholes. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A23; a12]</itype><trans> affect s.t. as though diminishing it. </trans>
<eg><i lang=""ceb"">Sígas plaslayit nga mitúhab sa kangitngit,</i><trans> A flashlight <pb n=""1043""/>beam that pierced the darkness. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> large hole left, large portion removed. </trans>
</sense>
<sense n=""2""><number>2</number><trans> large opening in a dress. </trans>
</sense></hom>
<entry><form id=""tuhab"" lang=""ceb""><abbr expan=""tuhab"" type=""lemma"">(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> a woman who is no longer a virgin (humorous). </trans>
</sense></hom></entry>
<entry><form id=""tinuhaxban"" lang=""ceb""><abbr expan=""tinuhában"" type=""lemma"">-in-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> place s.t. was pecked off. </trans>
<eg><i lang=""ceb"">Makáun pa ning kapayása. Abisa lang nang tinuhában,</i><trans> You can still eat the papaya. Just cut out the holes. </trans></eg>
</sense></hom></entry>
<entry><form id=""tinuhaban"" lang=""ceb""><abbr expan=""tinuhaban"" type=""lemma"">-in-an(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> fruits that have peck marks.
</trans>
</sense></hom></entry></entry>");
