INSERT INTO `wced_entry` VALUES (19489, "tuhaw", "1043", "<entry page=""1043"" id=""19489""><form id=""tuhaw"" lang=""ceb"">tuhaw</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B23(1)6]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> spring forth unexpectedly, appear suddenly, <tr>pop up</tr>. </trans>
<eg><i lang=""ceb"">Mituhaw lang pagkalit ang anak hung nawálà,</i><trans> My lost son suddenly appeared in our house. </trans></eg>
<eg><i lang=""ceb"">Mituhaw sa íyang hunàhúnà ang usa ka maanindut nga láraw,</i><trans> A beautiful plan popped into his mind. </trans></eg>
