<sense n=""2""><number>2</number><trans> do s.t. suddenly and without cause. </trans>
<eg><i lang=""ceb"">Nabúang kang mituhaw ka man lag kasukù,</i><trans> Have you gone crazy, flaring up like that? </trans></eg>
</sense></hom>
