INSERT INTO `wced_entry` VALUES (19493, "tuhik, tuhik", "1043", "<entry page=""1043"" id=""19493""><form id=""tuhik_tuxhik"" lang=""ceb"">tuhik, túhik</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; ab]</itype><trans> <tr>peck</tr> with a sharp, pointed beak to eat or inflect a wound. </trans>
