INSERT INTO `wced_entry` VALUES (19494, "tuhil", "1043", "<entry page=""1043"" id=""19494""><form id=""tuhil"" lang=""ceb"">tuhil</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a1]</itype><trans> poke or tap s.t. small or a tiny portion of s.t. so as to move it. </trans>
<eg><i lang=""ceb"">Ayaw punáyig tuhil ang itlug sa irù kay mapaakan ka,</i><trans> Don’t keep poking the dog’s testicles. He might bite you. </trans></eg>
<eg><i lang=""ceb"">Mataktak ang búwak bísag ígù lang tuhilun,</i><trans> The flowers will fall off even if you just touch them lightly. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. used to poke.
</trans>
</sense></hom></entry>");
