INSERT INTO `wced_entry` VALUES (19495, "tuhu, tuhu", "1043", "<entry page=""1043"" id=""19495""><form id=""tuhu_tuhuq"" lang=""ceb"">tuhu, tuhù</form>
<hom>
<sense n=""0""><trans> particle following the first word of the predicate, used in negating s.o.’s statement and stressing the contrary. </trans>
<eg><i lang=""ceb"">Namutbut siya. Mutan-aw tuhù nà siyag sini,</i><trans> She is lying. She is so going to the movies. </trans></eg>
<eg><i lang=""ceb"">Dílì tuhù nà siya indyinir,</i><trans> No, he’s not. He is not an engineer.
</trans></eg>
</sense></hom></entry>");
