INSERT INTO `wced_entry` VALUES (19499, "tuhuktuhuk", "1043", "<entry page=""1043"" id=""19499""><form id=""tuhuktuhuk"" lang=""ceb"">tuhuktuhuk</form>
<hom role=""v""><pos>v</pos>
