INSERT INTO `wced_entry` VALUES (19500, "tuhup", "1044", "<entry page=""1044"" id=""19500""><form id=""tuhup"" lang=""ceb"">tuhup</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; b5]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>permeate</tr>. </trans>
<eg><i lang=""ceb"">Mituhup ang katugnaw sa sinínà,</i><trans> The cold <tr>seeped</tr> through the dress. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> for s.t. wet to <tr>seep through</tr>, permeate. </trans>
<eg><i lang=""ceb"">Gituphan sa kabasà ang yútà,</i><trans> Moisture permeated the earth. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> be affected with a feeling or emotion. </trans>
<eg><i lang=""ceb"">Tuphun kug kahingáwa matag byáhi níya,</i><trans> I get anxious whenever he goes on a trip. </trans></eg>
</sense></hom>
<entry><form id=""matuhuxpun"" lang=""ceb""><abbr expan=""matuhúpun"" type=""lemma"">ma-un(←)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>penetrating</tr>.
