INSERT INTO `wced_entry` VALUES (19502, "tuhuy", "1044", "<entry page=""1044"" id=""19502""><form id=""tuhuy"" lang=""ceb"">tuhuy</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2]</itype><trans> get out of s.w. suddenly and with haste. </trans>
<eg><i lang=""ceb"">Dì pa gánì mahuman kug súgù, mutuhuy dáyug lakaw,</i><trans> I can’t even finish giving my orders before he rushes up to get going. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B; b3cP]</itype><trans> be sticking out straight. </trans>
<eg><i lang=""ceb"">Mituhuy ang túbig sa hús,</i><trans> The water from the hose is spurting out far. </trans></eg>
<eg><i lang=""ceb"">Nagtuhuy ang tintin sa báta. Básig kaihiun,</i><trans> The child has an erection. He probably has to urinate. </trans></eg>
<eg><i lang=""ceb"">Ayawg ituhuy (ipatuhuy) nang ímung buhuk dapit sa agtang. Mu ra kag tin-idyir,</i><trans> Don’t let your hair stick out over your forehead. You look like a teen-ager. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> carrying oneself in a straight but artless way. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>sticking out</tr>.
</trans>
</sense></hom></entry>");
