</sense>
<sense n=""2""><number>2</number> <itype>[A123P; b4(1)]</itype><trans> choke on s.t. ingested. </trans>
<eg><i lang=""ceb"">Makatukà nang tag-as nga bíhun,</i><trans> You can choke on long noodles. </trans></eg>
