INSERT INTO `wced_entry` VALUES (19514, "tukag, tukag", "1045", "<entry page=""1045"" id=""19514""><form id=""tukag_tuxkag"" lang=""ceb"">tukag, túkag</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AB2S6; cP]</itype><trans> place s.t. long in a position <tr>vertical</tr> or <tr>crosswise</tr> relative to s.t. else; cause it to be so. </trans>
<eg><i lang=""ceb"">Ayúhag butang ang gabas kay mutúkag sa kahun,</i><trans> Lay the saw down carefully crosswise in the toolbox. </trans></eg>
<eg><i lang=""ceb"">Nagtukag ang bukug sa íyang tunlan,</i><trans> A bone is lodged cross-ways in his throat. </trans></eg>
<eg><i lang=""ceb"">Itúkag (ipatúkag) ang lipak sa takup arun dílì mutak-up,</i><trans> Prop the shutter open with a stick of bamboo. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B2S6]</itype><trans> for s.t. slender to be jutting out. </trans>
<eg><i lang=""ceb"">Ang mga tiil sa dakung bátà mutukag kun kugúsun,</i><trans> The legs of a big child dangle if he is carried. </trans></eg>
</sense></hom>
<entry><form id=""tukag"" lang=""ceb""><abbr expan=""tukag"" type=""lemma"">(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> s.t. placed athwart s.o. </trans>
</sense>
<sense n=""2""><number>2</number><trans> sticking out. </trans>
<eg><i lang=""ceb"">Tukag siyag dawunggan,</i><trans> He has ears that stick out.
</trans></eg>
</sense></hom></entry></entry>");
