INSERT INTO `wced_entry` VALUES (19518, "tukar", "1045", "<entry page=""1045"" id=""19518""><form id=""tukar"" lang=""ceb"">tukar</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a2]</itype><trans> <tr>play</tr> a musical instrument, piece. </trans>
<eg><i lang=""ceb"">Hanas siyang mutukar sa marimba,</i><trans> He plays the marimba well. </trans></eg>
<eg><i lang=""ceb"">Tanggu tukara,</i><trans> Play a tango. </trans></eg>
