<sense n=""1a""><number>1a</number> <itype>[A; b(1)]</itype><trans> for a musical group to <tr>perform</tr>. </trans>
<eg><i lang=""ceb"">Dúna silay tukaran nga parti karung gabíi,</i><trans> They will perform at a party tonight. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2]</itype><trans> have an attack of a recurring illness or undesirable behavior. </trans>
<eg><i lang=""ceb"">Mutukar ang riyuma kun ting-ulan,</i><trans> Rheumatism flares up on rainy days. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> music played. </trans>
<eg><i lang=""ceb"">Magsáyaw ta inigsúgud sa tukar,</i><trans> Let’s dance when the music starts. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>performance</tr> by a musical group. </trans>
