INSERT INTO `wced_entry` VALUES (19539, "tuklang", "1046", "<entry page=""1046"" id=""19539""><form id=""tuklang"" lang=""ceb"">tuklang</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b5]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> put a piece of wood s.w. to inhibit motion, either by propping s.t. under it and keeping it from falling or by laying it in the way and stopping it from proceeding. </trans>
<eg><i lang=""ceb"">Tuklángun (tuklángan) ang takup sa dúlung arun dílì musira,</i><trans> <tr>Prop up</tr> the hood so it won’t slam shut. </trans></eg>
<eg><i lang=""ceb"">Ituklang nis bintánà arun dílì matúkab,</i><trans> <tr>Wedge</tr> the window shut with this so it can’t come open. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> <tr>prop</tr> s.t. up. </trans>
<eg><i lang=""ceb"">Taas nga káhuy ang ituklang sa hayhayan arun dì masagyad ang hinayhay,</i><trans> Use a long bamboo pole to hold the clothesline to keep the wash from touching the ground. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AN3; b6]</itype><trans> put up the hands to keep s.o. at arms’ distance, as if bracing oneself. </trans>
<eg><i lang=""ceb"">Nanuklang siya kay gipiit siya sa ílang pagbayli,</i><trans> She kept her hand up because her partner danced too close to her. </trans></eg>
</sense></hom>
<entry><form id=""panuklang"" lang=""ceb""><abbr expan=""panuklang"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A1]</itype><trans> brace oneself or keep s.o. away from one’s body. </trans>
<eg><i lang=""ceb"">Kun wà pa siya makapanuklang mahaplà untà siya,</i><trans> Had she not braced herself she would have fallen flat. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> stick used to prevent motion.
</trans>
</sense></hom></entry></entry>");
