INSERT INTO `wced_entry` VALUES (19540, "tuklas", "1046", "<entry page=""1046"" id=""19540""><form id=""tuklas"" lang=""ceb"">tuklas</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AB; a1]</itype><trans> <tr>open</tr> a shutter, curtain or s.t. that covers, be opened. </trans>
<eg><i lang=""ceb"">Natukas ang atup pagbagyu,</i><trans> The roof was blown off in the storm. </trans></eg>
<eg><i lang=""ceb"">Natukas ang íyang sayal paghángin,</i><trans> Her skirt was lifted up by the wind. </trans></eg>
<eg><i lang=""ceb"">Inánayng nagkatukas ang tilun,</i><trans> The curtain slowly opens. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> be <tr>open</tr>. </trans>
<eg><i lang=""ceb"">May nangáwat kay tukas nag paradur,</i><trans> There has been a robbery because the cabinet is open.
</trans></eg>
</sense></hom></entry>");
