<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c6]</itype><trans> give s.o. a sudden <tr>push</tr>. </trans>
<eg><i lang=""ceb"">Kinsay nagtuklid nímung nahayang ka man?</i><trans> Why did you fall? Who pushed you? </trans></eg>
