INSERT INTO `wced_entry` VALUES (19544, "tuklu", "1046", "<entry page=""1046"" id=""19544""><form id=""tukluq"" lang=""ceb"">tuklù</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a2]</itype><trans> steal by catching s.t. at the neck, esp. chicken. </trans>
<eg><i lang=""ceb"">Gituklù ang manuk sa nangharána,</i><trans> The chicken was swiped by the serenaders. </trans></eg>
<eg><i lang=""ceb"">Gituklù sa naglágut nga bána ang líug sa asáwa,</i><trans> The husband was so angry he grabbed his wife’s neck and squeezed it. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2; a1]</itype><trans> dart or <tr>strike</tr> instantly with the head. </trans>
<eg><i lang=""ceb"">Pagbantay kay ang bitin mutuklù lag kalit,</i><trans> Watch out for a snake might just strike out suddenly. </trans></eg>
<eg><i lang=""ceb"">Ang manuk nakatuklù ug duha ka bakì,</i><trans> The chicken has caught two frogs pecking at them.
</trans></eg>
</sense></hom></entry>");
