INSERT INTO `wced_entry` VALUES (19546, "tuklung", "1046", "<entry page=""1046"" id=""19546""><form id=""tuklung"" lang=""ceb"">tuklung</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> for rice or corn to have overripe grains. </trans>
<eg><i lang=""ceb"">Tukung na kaáyu ang humay nga wà maáni dáyun,</i><trans> The rice in the fields is bent over now because it was not harvested right away. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B12; b6]</itype><trans> get grains that are overripe.
<pb n=""1047""/>
</trans>
</sense></hom></entry>");
