INSERT INTO `wced_entry` VALUES (19547, "tuklus", "1047", "<entry page=""1047"" id=""19547""><form id=""tuklus"" lang=""ceb"">tuklus</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c]</itype><trans> hand s.t. to s.o. </trans>
<eg><i lang=""ceb"">Ituklus ang suwat,</i><trans> <tr>Hand over</tr> the letter. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[b5]</itype><trans> = <xr lang=""ceb"" target=""#pan-""><sc>paN-</sc></xr>. </trans>
</sense></hom>
<entry><form id=""panuklus"" lang=""ceb""><abbr expan=""panuklus"" type=""lemma"">paN-</abbr></form>
<hom>
<sense n=""0""> <itype>[A; b]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> go to a banquet with the primary purpose of eating. </trans>
<eg><i lang=""ceb"">Manuklus ta sa íla kay dakù silag híkay,</i><trans> Let’s go to their house for a free meal, because they have prepared quite extensively. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> attend any k.o. entertainment without invitation. </trans>
<eg><i lang=""ceb"">Manuklus tag bayli sa ílang iskuyláhan,</i><trans> Let’s go attend the dance in their school.
</trans></eg>
</sense></hom></entry></entry>");
