INSERT INTO `wced_entry` VALUES (19548, "tukma", "1047", "<entry page=""1047"" id=""19548""><form id=""tukmaq"" lang=""ceb"">tukmà</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>exact</tr>, <tr>exactly</tr>. </trans>
<eg><i lang=""ceb"">Náa sa libru ang tukmà nga tubag,</i><trans> The exact answer is in the book. </trans></eg>
<eg><i lang=""ceb"">Tukmà nga alas syíti ang pagsúgud sa prugráma,</i><trans> The program starts at exactly seven o’clock. </trans></eg>
<eg><i lang=""ceb"">Tukmà sa gikasabútan,</i><trans> Exactly as agreed. </trans></eg>
<eg><i lang=""ceb"">Tukmang usa ka búlan ugmà sukad sa íyang paggíkan,</i><trans> It will be exactly one month tomorrow since the day he left. </trans></eg>
<eg><i lang=""ceb"">Kining ruskáha tukmà kaáyu ánang pirnúha,</i><trans> This nut fits that bolt very nicely. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>suitable</tr>, <tr>appropriate</tr>. </trans>
<eg><i lang=""ceb"">Tukmà ang tíma sa ukasiyun,</i><trans> The theme <tr>fits</tr> the occasion exactly. </trans></eg>
<eg><i lang=""ceb"">Kining tanúma tukmà giyud sa bugnawng klíma,</i><trans> This plant is perfectly <tr>adapted</tr> for a cold climate. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B26C; c]</itype><trans> <tr>coincide</tr>, <tr>correspond</tr> with. </trans>
<eg><i lang=""ceb"">Mitukmà ang ákung pangagpas sa nahitabù,</i><trans> My guess coincided with what actually happened. </trans></eg>
<eg><i lang=""ceb"">Nagkatukmà ang pista ug ang ákung adlaw,</i><trans> The fiesta and my birthday fall on the same date. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[C3; c6]</itype><trans> for edges to fit, abut perfectly. </trans>
<eg><i lang=""ceb"">Itukmag maáyu ang mga ngilit,</i><trans> Make the edges abut perfectly. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> be, make <tr>suitable</tr>, <tr>appropriate</tr>. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[b8]</itype><trans> <tr>come upon</tr> s.o. quite unexpectedly. </trans>
<eg><i lang=""ceb"">Hitukmaan níya ang bátà nga mikúut sa kúkis,</i><trans> She came upon the child getting some cookies. </trans></eg>
</sense></hom>
<entry><form id=""hitukmaq_hatukmaq"" lang=""ceb""><abbr expan=""hitukmà"" type=""lemma"">hi-</abbr>/<abbr expan=""hatukmà"" type=""lemma"">ha-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B1256; b8]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> come out to be the same as or appropriate. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>come upon</tr> s.t. in a place. </trans>
<eg><i lang=""ceb"">Sa íyang paglatagaw nahitukmà siya sa usa ka payag,</i><trans> In his wandering he came upon a hut. </trans></eg>
</sense></hom></entry>
<entry><form id=""pahitukmaq"" lang=""ceb""><abbr expan=""pahitukmà"" type=""lemma"">pahi-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> make s.t. coincide. </trans>
<eg><i lang=""ceb"">Kinahanglang ipahitukmà ang prugráma sa gubyirnu sa kinahanglanun sa násud,</i><trans> The government’s program must be made to correspond with the country’s needs. </trans></eg>
</sense></hom></entry>
<entry><form id=""tinukmaan"" lang=""ceb""><abbr expan=""tinukmaan"" type=""lemma"">-in-an(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>joint</tr>. </trans>
<eg><i lang=""ceb"">Ang tinukmaan sa túbu tulù,</i><trans> The pipe joint is leaky.
</trans></eg>
</sense></hom></entry></entry>");
