INSERT INTO `wced_entry` VALUES (19552, "tukpaw", "1047", "<entry page=""1047"" id=""19552""><form id=""tukpaw"" lang=""ceb"">tukpaw</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> push s.t. upward. </trans>
<eg><i lang=""ceb"">Akuy mutukpaw nímu ngadtus atup arun ka makasaka ngadtu,</i><trans> I’ll give you a <tr>boost</tr> onto the roof so that you can climb up there. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> induce s.o. to do s.t. bad for him. </trans>
<eg><i lang=""ceb"">Ang íyang mga amígu nakatukpaw níya sa mga bisyu,</i><trans> His friends induced him into a life of sin. </trans></eg>
<eg><i lang=""ceb"">Ayaw siya itukpaw ngadtu ni Satanas,</i><trans> Do not lure him into the ways of the devil. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> jump from one point to another. </trans>
<eg><i lang=""ceb"">Ang ági sa makina mutukpaw,</i><trans> The sewing machine <tr>skips</tr>. </trans></eg>
<eg><i lang=""ceb"">Gitukpaw níya ang isturyag láin,</i><trans> He <tr>skipped over</tr> to s.t. else to change the subject. </trans></eg>
<eg><i lang=""ceb"">Ingun ug magatukpaw ang átung sulti, wà diay makapasar si Tunyu sa búrd,</i><trans> To <tr>change the subject</tr>, so Tony didn’t pass the board examination. </trans></eg>
</sense></hom>
<entry><form id=""tukpawtukpaw"" lang=""ceb"">tukpawtukpaw</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c1]</itype><trans> work skipping about, not systematically. </trans>
<eg><i lang=""ceb"">Gitukpawtukpaw níya pagpintal, man nga nagkábang ang ági,</i><trans> He did not paint it square at a time and so it came out splotched. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B; b6]</itype><trans> move with a jerky up and down motion. </trans>
<eg><i lang=""ceb"">Nagtukpawtukpaw ang sakayan sa bawud,</i><trans> The boat <tr>bounced</tr> up and down in the waves.
</trans></eg>
</sense></hom></entry></entry>");
