<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> <tr>query</tr> in a pressing way. </trans>
<eg><i lang=""ceb"">Akuy mutuksù níya kun tinúud tung ímung gisulti,</i><trans> I will <tr>ask</tr> him if what you said was true. </trans></eg>
