INSERT INTO `wced_entry` VALUES (19555, "tuktugauk", "1047", "<entry page=""1047"" id=""19555""><form id=""tuktugaxuk"" lang=""ceb"">tuktugáuk</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A]</itype><trans> for cocks to <tr>crow</tr>. </trans>
<eg><i lang=""ceb"">Mutuktugáuk na gánì ang mga manuk, sa átù pa duul na ang kabuntágun,</i><trans> When the cock crows, we know morning is near. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c]</itype><trans> vomit due to excessive drinking of alcoholic beverages (slang). </trans>
<eg><i lang=""ceb"">Kanang ímung kan-un ímu ra sang ituktugáuk ug magpalabi kag ínum,</i><trans> You will vomit out what you are eating if you drink too much. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> cock’s <tr>crow</tr> or noise of a similar sort.
</trans>
</sense></hom></entry>");
