INSERT INTO `wced_entry` VALUES (19556, "tuktuk1", "1047", "<entry page=""1047"" id=""19556""><form id=""tuktuk"" lang=""ceb"">tuktuk<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>knock on</tr>. </trans>
<eg><i lang=""ceb"">Tuktúka ang pultahan únà musúd,</i><trans> <tr>Knock</tr> on the door before you go in. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>peck at</tr> repeatedly. </trans>
<eg><i lang=""ceb"">Gituktuk sa sunuy ang íyang higut,</i><trans> The cock <tr>pecked</tr> at its tether. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>knocking</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> feed for chickens. </trans>
