INSERT INTO `wced_entry` VALUES (19563, "tukud1", "1048", "<entry page=""1048"" id=""19563""><form id=""tuxkud"" lang=""ceb"">túkud<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; ac]</itype><trans> <tr>brace</tr>, <tr>prop</tr>. </trans>
<eg><i lang=""ceb"">Tukúra ang kapáyas kay malúad unyà inigbagyu,</i><trans> Brace the papaya. It might fall when the storm comes. </trans></eg>
<eg><i lang=""ceb"">Itúkud ímung kamut sa bungbung unyà barug sa usang tiil,</i><trans> Prop your hand against the wall. Then stand on one leg. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c1]</itype><trans> <tr>erect</tr> a house, building. </trans>
<eg><i lang=""ceb"">Anhi tukúra (itúkud) ang munisipyu,</i><trans> The municipal hall will be erected here. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; a]</itype><trans> form, <tr>found</tr> an organization, establishment. </trans>
<eg><i lang=""ceb"">Kinsay nagtúkud sa Siliman?</i><trans> Who founded Silliman University? </trans></eg>
<eg><i lang=""ceb"">Gitúkud ang buluntaryu panahun sa Hapun,</i><trans> Volunteer troops were <tr>organized</tr> during the Japanese occupation. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> put up a business. </trans>
<eg><i lang=""ceb"">Ang nigusyung tukúrun kanang gikinahanglan sa lungsud,</i><trans> The business you <tr>put up</tr> should be one which the town needs. </trans></eg>
</sense></hom>
<entry><form id=""tukud"" lang=""ceb""><abbr expan=""tukud"" type=""lemma"">(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. used to prop or brace s.t. </trans>
</sense></hom></entry>
<entry><form id=""tagtukud"" lang=""ceb""><abbr expan=""tagtukud"" type=""lemma"">tag-(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>founder</tr>, <tr>organizer</tr>. </trans>
</sense></hom></entry>
<entry><form id=""katukuxran"" lang=""ceb"">katukúran</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>founding</tr>, <tr>establishment</tr>. </trans>
<eg><i lang=""ceb"">Nagsaúlug sila sa katukúran sa syudad,</i><trans> They are celebrating the founding of the city. </trans></eg>
</sense></hom></entry>
<entry><form id=""magtutuxkud"" lang=""ceb""><abbr expan=""magtutúkud"" type=""lemma"">mag-r-</abbr></form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#tagtukud""><sc>tagtukud</sc></xr>. </trans>
</sense></hom></entry>
<entry><form id=""patukuraxnan"" lang=""ceb"">patukuránan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>foundation</tr>, <tr>basis</tr>. </trans>
<eg><i lang=""ceb"">Way patukuránan ang ímung pasángil,</i><trans> Your charges are without foundation. </trans></eg>
</sense></hom></entry>
<entry><form id=""tukudtuxkud"" lang=""ceb"">tukudtúkud</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b(1)]</itype><trans> fabricate a story, esp. one with a dubious motive. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>fabrication</tr>, <tr>concoction</tr>. </trans>
<eg><i lang=""ceb"">Pulus tu tinukudtúkud (tukudtúkud) ang ílang isturyang naglaki ang ímung asáwa,</i><trans> Those stories about your wife’s carrying on with other men are all fabrication anyway. </trans></eg>
</sense></hom></entry>
<entry><form id=""tinukudtuxkud"" lang=""ceb"">tinukudtúkud</form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#tukudtuxkud""><sc>tukudtúkud</sc></xr>, <i lang=""ceb"">n</i>. </trans>
</sense></hom></entry>
<entry><form id=""panuxkud"" lang=""ceb""><abbr expan=""panúkud"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; b(1)]</itype><trans> hold oneself at arm’s length when dancing.
</trans>
</sense></hom></entry></entry>");
