INSERT INTO `wced_entry` VALUES (19574, "tukuy", "1049", "<entry page=""1049"" id=""19574""><form id=""tuxkuy"" lang=""ceb"">túkuy</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> word used to call dogs. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a12]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> call a dog, saying <ix>‘túkuy’.</ix> </trans>
<eg><i lang=""ceb"">Tukúya ang irù arun pakan-un,</i><trans> Call the dog so it can eat. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> draw irresistibly toward s.t. </trans>
<eg><i lang=""ceb"">Ang kadalù mauy mutúkuy sa táwu pagpaníkas,</i><trans> Greed leads a person to cheat. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> in folk belief, induce a person to walk in his sleep by tying a string to a finger and pulling it rhythmically. </trans>
<eg><i lang=""ceb"">Kamau siyang mutúkuy ug táwung natúlug,</i><trans> He knows how to make a person walk in his sleep. </trans></eg>
</sense></hom>
<entry><form id=""tukuy"" lang=""ceb""><abbr expan=""tukuy"" type=""lemma"">(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>puppy</tr>.
