INSERT INTO `wced_entry` VALUES (19587, "tulak", "1049", "<entry page=""1049"" id=""19587""><form id=""tuxlak"" lang=""ceb"">túlak</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>push</tr> or move s.t. with the arm. </trans>
<eg><i lang=""ceb"">Kami mauy mitúlak sa awtu nga nalubung,</i><trans> We were the ones who pushed the car that got stuck in the mud. </trans></eg>
<eg><i lang=""ceb"">Íya kung gitúlak ngadtus swíming pul,</i><trans> He pushed me into the swimming pool. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> lift s.t. up to one’s head or higher and throw to an elevated place. </trans>
<eg><i lang=""ceb"">Kami mutúlak sa sáku ngadtu sa tinumpì,</i><trans> We will throw the sack up onto the pile. </trans></eg>
<eg><i lang=""ceb"">Itúlak ang kahun sa istanti,</i><trans> Throw the box up onto the top of the shelf. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B126; b8]</itype><trans> <tr>fall</tr> from a height accidentally when one loses his hold, slips, support is taken away, and the like. </trans>
<eg><i lang=""ceb"">Ayawg padaplin kay matúlak ka unyà,</i><trans> Don’t sit too close to the edge or you might fall. </trans></eg>
</sense></hom>
<entry><form id=""tigtulak"" lang=""ceb""><abbr expan=""tigtulak"" type=""lemma"">tig-(→)</abbr></form>
<hom role=""n""><pos>n</pos>
