INSERT INTO `wced_entry` VALUES (19604, "tul-id", "1050", "<entry page=""1050"" id=""19604""><form id=""tul-id"" lang=""ceb"">tul-id</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>straight</tr>. </trans>
<eg><i lang=""ceb"">Tul-id nga linya,</i><trans> A straight line. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>straight towards</tr>. </trans>
<eg><i lang=""ceb"">Lakaw lag tul-id ánang dálan ug musangkù ka sa simbahan,</i><trans> Just walk straight on that street and you will reach the church. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[APB; a]</itype><trans> <tr>straighten</tr>. </trans>
<eg><i lang=""ceb"">Akuy mutul-id (mupatul-id) sa balikug nga alambri,</i><trans> I’ll straighten the crooked wire. </trans></eg>
<eg><i lang=""ceb"">Mitul-id siya sa íyang pagyukù,</i><trans> He <tr>straightened up</tr> after he had bent over. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AB; a2]</itype><trans> <tr>reform</tr>, <tr>correct</tr>. </trans>
<eg><i lang=""ceb"">Dì na matul-id ang dautan níyang pagkatáwu,</i><trans> His bad ways cannot be reformed. </trans></eg>
</sense></hom>
<entry><form id=""katul-ixran"" lang=""ceb"">katul-íran</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>reform</tr>, <tr>amendment</tr>.
