INSERT INTO `wced_entry` VALUES (19607, "tulin", "1050", "<entry page=""1050"" id=""19607""><form id=""tuxlin"" lang=""ceb"">túlin</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; b6]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>move forward</tr>. </trans>
<eg><i lang=""ceb"">Pagbulhut sa hángin mitúlin ang sakayan,</i><trans> When the wind blew, the boat moved <tr>forward</tr>. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> cover a certain distance. </trans>
<eg><i lang=""ceb"">Mutúlin ang dálan ug kilumitru úsà mulikù sa tuu,</i><trans> The road will <tr>go on</tr> for a kilometer before it turns to the right. </trans></eg>
<eg><i lang=""ceb"">Pila may tulínan sa usa ka baril nga aspaltu?</i><trans> How far can a barrel of asphalt go? </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> <tr>accomplish</tr> a certain amount. </trans>
<eg><i lang=""ceb"">Dí ta mutúlin ug kanúnay kag sámuk,</i><trans> I won’t accomplish anything if you keep making a nuisance of yourself. </trans></eg>
</sense>
<sense n=""2b""><number>2b</number> <itype>[A2]</itype><trans> <tr>expand</tr>, take space in the direction of. </trans>
<eg><i lang=""ceb"">Ámù nang yútà ang gitulínan sa gihímung karsáda,</i><trans> The road they made has <tr>encroached</tr> on our land. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B2; b6]</itype><trans> become <tr>fast</tr>, <tr>swift</tr>. </trans>
<eg><i lang=""ceb"">Mutúlin (matúlin) ang pambut kun habwáag karga,</i><trans> The motorboat will move fast if we take the cargo off. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>accomplishment</tr>, distance covered. </trans>
<eg><i lang=""ceb"">Gamay ra siyag túlin kay naglangaylángay man,</i><trans> He made little <tr>progress</tr> because he was just loafing. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>speed</tr>, <tr>forward motion</tr>. </trans>
<eg><i lang=""ceb"">Hínay ang túlin sa bangkà kun way hángin,</i><trans> The sailboat’s speed is slow if there is no wind. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>fast</tr> and <tr>swift</tr>. </trans>
<eg><i lang=""ceb"">Túlin nga nanglábay ang katuígan,</i><trans> The years passed <tr>swiftly</tr>. </trans></eg>
</sense></hom>
<entry><form id=""patuxlin"" lang=""ceb""><abbr expan=""patúlin"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b(1)]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> extend measurements in constructing s.t. </trans>
<eg><i lang=""ceb"">Ug padak-an ang balay, adtu patulíni sa luyu,</i><trans> If you enlarge the house, extend the construction to the rear. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> increase the speed of s.t. moving forward. </trans>
<eg><i lang=""ceb"">Magpatúlin ta arun sayu tang maabut,</i><trans> Let’s increase our speed, so we arrive early.
</trans></eg>
</sense></hom></entry></entry>");
