INSERT INTO `wced_entry` VALUES (19618, "tulpuk", "1051", "<entry page=""1051"" id=""19618""><form id=""tulpuk"" lang=""ceb"">tulpuk</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>prick</tr> or <tr>poke</tr> at with s.t. pointed. </trans>
<eg><i lang=""ceb"">Dágum nga mitulpuk sa ákung buktun,</i><trans> A needle that pricked my arm. </trans></eg>
<eg><i lang=""ceb"">Tulpúka ang timbri,</i><trans> <tr>Push</tr> the doorbell button. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> make, put a dot on s.t. </trans>
<eg><i lang=""ceb"">Tulpúkan nátug itum ári pára mata,</i><trans> We’ll put dots here for the eyes. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> press the keys of a piano, typewriter, and the like. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>pricking</tr>, <tr>poking</tr>, <tr>injection</tr> with a hypodermic needle. </trans>
<eg><i lang=""ceb"">Dús ang ipabáyad sa duktǔr káda tulpuk,</i><trans> The doctor charges two pesos for each <tr>shot</tr>. </trans></eg>
</sense></hom>
<entry><form id=""tulpuktulpuk"" lang=""ceb"">tulpuktulpuk</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> dots in cloth design. </trans>
<eg><i lang=""ceb"">Bistídung may tulpuktulpuk nga pula,</i><trans> Dress with red dots.
</trans></eg>
</sense></hom></entry></entry>");
