INSERT INTO `wced_entry` VALUES (19619, "tultug", "1051", "<entry page=""1051"" id=""19619""><form id=""tultug"" lang=""ceb"">tultug</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6(1)7]</itype><trans> knock off the ashes or embers. </trans>
<eg><i lang=""ceb"">Nakatultug siyag bága sa agipu didtu sa mga papil,</i><trans> He accidentally knocked an ember off from the firebrand onto the pieces of paper.
</trans></eg>
</sense></hom></entry>");
