INSERT INTO `wced_entry` VALUES (19623, "tulud", "1051", "<entry page=""1051"" id=""19623""><form id=""tulud"" lang=""ceb"">tulud</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c6]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>push</tr>. </trans>
<eg><i lang=""ceb"">Itulud ang kutsi kay dì muandǎr,</i><trans> Push the car because it won’t start. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>goad</tr>, <tr>incite</tr>. </trans>
<eg><i lang=""ceb"">Daw sa may mutulud nákù sa pagpaúlì,</i><trans> As if s.t. were <tr>urging</tr> me to come home. </trans></eg>
</sense></hom>
<entry><form id=""tuludtuxlud"" lang=""ceb"">tuludtúlud</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c6]</itype><trans> pass work, blame onto one another. </trans>
<eg><i lang=""ceb"">Nagtuludtúlud lang sila dihang gipangutána kinsay nakasalà,</i><trans> They just kept passing the blame onto each other when I asked them who the culprit was. </trans></eg>
<eg><i lang=""ceb"">Ayawg ituludtúlud ang trabáhu,</i><trans> <pb n=""1052""/>Don’t keep trying to pawn off the work on each other. </trans></eg>
</sense></hom></entry>
<entry><form id=""tulud_baxtang"" lang=""ceb""><abbr expan=""tulud"" type=""lemma"">—</abbr> bátang</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> the period from August to October when the wind direction is not fixed (the time when a log [<ix>bátang</ix>] is pushed in one direction and then another).
</trans>
</sense></hom></entry></entry>");
