INSERT INTO `wced_entry` VALUES (19642, "tumaw", "1053", "<entry page=""1053"" id=""19642""><form id=""tumaw"" lang=""ceb"">tumaw</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B23(1)6]</itype><trans> <tr>pop up</tr>, <tr>come out</tr>, <tr>surface</tr>, esp. s.t. unexpected, secret, or little known. </trans>
<eg><i lang=""ceb"">Mutumaw giyud ang matúud,</i><trans> The truth always comes out. </trans></eg>
<eg><i lang=""ceb"">Ug dì ka makatumaw sa inyung kásu, prisúhun ka giyud,</i><trans> If you do not <tr>appear</tr> in court, you will surely be imprisoned. </trans></eg>
<eg><i lang=""ceb"">Kanang ímung pagrilaks mau nay makatumaw (makapatumaw) sa sulbad sa prublíma,</i><trans> Relaxation can make the solution to your problem pop up. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>mutant</tr>. </trans>
<eg><i lang=""ceb"">Tumaw nang batáa kay nigru man untà ang mga ginikánan ug ngánung putì man nà siya,</i><trans> That child is a mutant, because the parents are black, but he is white.
</trans></eg>
</sense></hom></entry>");
