INSERT INTO `wced_entry` VALUES (19643, "tumba1", "1053", "<entry page=""1053"" id=""19643""><form id=""tumba"" lang=""ceb"">tumba<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AB12; a]</itype><trans> for s.t. upright to <tr>fall over</tr>, cause it to do so. </trans>
<eg><i lang=""ceb"">Kinsay nagtumba sa bisiklíta?</i><trans> Who made the bicycle fall over? </trans></eg>
<eg><i lang=""ceb"">Natumba ang bátà,</i><trans> The child fell. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> slaughter an animal for an occasion. </trans>
<eg><i lang=""ceb"">Magtumba tag báka sa ímung kasal,</i><trans> We will slaughter a cow on your wedding. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number>
<eg><i lang=""ceb"">— ug kandílà</i> <itype>[A; b]</itype><trans> light a candle as an offering. </trans></eg>
<eg><i lang=""ceb"">Nakatumba na siyag kandílà pára sa kalag sa mga minatay,</i><trans> He has already lighted a candle for the departed souls. </trans></eg>
</sense>
<sense n=""2b""><number>2b</number> <itype>[A; a12]</itype><trans> consume a liquor container full of drink. </trans>
<eg><i lang=""ceb"">Kanang grupúha mutumba ug usa ka tárung tubà,</i><trans> That group will consume one kerosene can of palm toddy. </trans></eg>
</sense></hom>
<entry><form id=""tumba_luxbu"" lang=""ceb""><abbr expan=""tumba"" type=""lemma"">—</abbr> lúbu</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>unbalanced</tr>: </trans>
</sense>
<sense n=""1""><number>1</number><trans> for a vehicle to have its load unevenly distributed. </trans>
</sense>
<sense n=""2""><number>2</number><trans> for a building or ship to have a top floor that is too high in proportion to its bottom floor. </trans>
<eg><i lang=""ceb"">Kusug kaáyung mukíling ang barku nga tumba lúbu,</i><trans> A ship which has an unproportionately large upper deck easily lists. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B1256]</itype><trans> develop a lack of balance. </trans>
</sense></hom></entry>
<entry><form id=""tumbatumba"" lang=""ceb"">tumbatumba</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A13]</itype><trans> offer various reasons for doing or not doing s.t., keep changing one’s mind. </trans>
<eg><i lang=""ceb"">Nagtumbatumba ka ánang pangatarúngan nímu. Ug buhátun nímu, buhata na,</i><trans> You keep changing your reasons. If you want to do it, do it already. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A]</itype><trans> play ball with the politicians, not stick to one or the other but going along with whoever is in power. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[A; c1]</itype><trans> for capital in a business to be so small that it is entirely invested in merchandise and new goods are bought with proceeds. </trans>
<eg><i lang=""ceb"">Dì paútang ang tindáhan ug magtumbatumba ang puhúnan,</i><trans> A store that has all its capital invested in goods cannot afford to give credit. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> having flexible politics. </trans>
<eg><i lang=""ceb"">Kinahanglan tumbatumba ang nigusiyanti,</i><trans> A businessman has to be flexible when it comes to politics. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#liyalixya""><sc>liyalíya</sc></xr>.
</trans>
</sense></hom></entry></entry>");
