INSERT INTO `wced_entry` VALUES (19649, "tumbas", "1054", "<entry page=""1054"" id=""19649""><form id=""tumbas"" lang=""ceb"">tumbas</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2C; b6]</itype><trans> <tr>equal</tr> in comparison. </trans>
<eg><i lang=""ceb"">Way makatumbas sa íyang kaanyag,</i><trans> Nothing can equal her beauty. </trans></eg>
<eg><i lang=""ceb"">Magtumbas giyud ang inyung pagkadawù,</i><trans> You both are <tr>equally</tr> greedy. </trans></eg>
<eg><i lang=""ceb"">Ang íyang kamaksut gitumbásan sa íyang kadautan,</i><trans> He is as ugly as he is mean. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>equivalent</tr>, <tr>worth</tr>. </trans>
<eg><i lang=""ceb"">Tumbas sa napúlù ka bútus ang maung balúta,</i><trans> The ballot is worth ten votes. </trans></eg>
</sense></hom>
<entry><form id=""katumbas"" lang=""ceb""><abbr expan=""katumbas"" type=""lemma"">ka-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. <tr>equivalent</tr> to. </trans>
<eg><i lang=""ceb"">Mau ni ang katumbas sa ganti nga Uskar sa Amirika,</i><trans> This is the equivalent of the Oscar in America.
</trans></eg>
</sense></hom></entry></entry>");
