INSERT INTO `wced_entry` VALUES (19650, "tumbaya", "1054", "<entry page=""1054"" id=""19650""><form id=""tumbayaq"" lang=""ceb"">tumbayà</form>
<hom>
<sense n=""0""><trans> (from <ix>bayà</ix>) </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AP; cP]</itype><trans> leave s.t. to the care of s.o. </trans>
<eg><i lang=""ceb"">Ayaw itumbayà sa sulugúun ang mga bátà,</i><trans> Don’t leave the children to the care of the maids. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AP; b(1)P]</itype><trans> fail to care for. </trans>
<eg><i lang=""ceb"">Kanang inahána nagpatumbayà lang sa íyang mga anak,</i><trans> That mother is <tr>neglecting</tr> her children. </trans></eg>
<eg><i lang=""ceb"">Nagkagubà ang karáang balay nga gipatumbayáan (gitumbayáan) lang,</i><trans> The old <tr>neglected</tr> house is getting dilapidated.
</trans></eg>
</sense></hom></entry>");
