INSERT INTO `wced_entry` VALUES (19651, "tumbuk1", "1054", "<entry page=""1054"" id=""19651""><form id=""tumbuk"" lang=""ceb"">tumbuk<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a]</itype><trans> poke a finger or s.t. pointed at s.t. </trans>
<eg><i lang=""ceb"">Mitumbuk siya sa makinilya arun pagtisting niíni,</i><trans> She poked a finger at the typewriter keys to try them out. </trans></eg>
<eg><i lang=""ceb"">Aku na say tumbuk sa bilyar,</i><trans> It is my turn to strike the billiard ball. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c1]</itype><trans> <tr>point out</tr>, <tr>pinpoint</tr>. </trans>
<eg><i lang=""ceb"">Dì ku katumbuk sa iksaktung hinungdan,</i><trans> I cannot <tr>point to</tr> the exact reason. </trans></eg>
<eg><i lang=""ceb"">Tumbúka ang utlánan sa mápa,</i><trans> Point out the boundaries on the map. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; b]</itype><trans> put a dot s.w.
