INSERT INTO `wced_entry` VALUES (19665, "tumung, tumung", "1054", "<entry page=""1054"" id=""19665""><form id=""tumung_tuxmung"" lang=""ceb"">tumung, túmung</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c6]</itype><trans> <tr>aim</tr> s.t. at s.t. </trans>
<eg><i lang=""ceb"">Ayawg itumung nákù nang pistúla,</i><trans> Don’t <tr>point</tr> that gun at me. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; acP]</itype><trans> go to the direction of s.t. straight. </trans>
<eg><i lang=""ceb"">Tumúnga nang baláya,</i><trans> Go in the direction of that house. </trans></eg>
<eg><i lang=""ceb"">Itumung (ipatumung) ang dáru ánang káhuy arun tul-id ímung ági,</i><trans> Aim your furrow at that tree, so it will be straight. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[a1]</itype><trans> direct a statement, joke, etc. </trans>
<eg><i lang=""ceb"">Aku bay gitumung sa ímung insultu?</i><trans> Was your insult directed at me? </trans></eg>
<eg><i lang=""ceb"">Wà nákù itumung ang insultu nímu,</i><trans> I didn’t aim the insult at you. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A12; a2]</itype><trans> get s.t. (good or bad) as one’s lot. </trans>
<eg><i lang=""ceb"">Nakatumung siyag asáwang bagìbian,</i><trans> He ended up with a nagging wife. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>direction</tr>. </trans>
<eg><i lang=""ceb"">Way tumung sa átung lákaw run,</i><trans> We are not going any particular place. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>purpose</tr> for which s.t. is done. </trans>
<eg><i lang=""ceb"">Unsa may tumung sa íyang pagsukitsukit?</i><trans> What was the purpose of his asking around? </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>straight toward</tr>. </trans>
<eg><i lang=""ceb"">Miatubang <pb n=""1055""/>siya tumung sa bandíra,</i><trans> He faced <tr>toward</tr> the flag.
</trans></eg>
</sense></hom></entry>");
