INSERT INTO `wced_entry` VALUES (19675, "tuna2", "1055", "<entry page=""1055"" id=""19675""><form id=""tuxnaq2"" lang=""ceb"">túnà<sub>2</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A23; c6]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> use a <tr>thumbmark</tr> for signature. </trans>
<eg><i lang=""ceb"">Itúnà ang kumagkù sa mga táwung dì makamaung mupirma,</i><trans> People who don’t know how to write use a thumbmark for their signatures. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> have <tr>coitus</tr> (humorous euphemism). </trans>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>illiterate</tr>. </trans>
<eg><i lang=""ceb"">Ispúting kaáyu apan túnà diay,</i><trans> He is well-dressed but he’s illiterate (he uses thumbmark for his signature).
</trans></eg>
</sense></hom></entry>");
