INSERT INTO `wced_entry` VALUES (19676, "tunada", "1055", "<entry page=""1055"" id=""19676""><form id=""tunaxda"" lang=""ceb"">tunáda</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>tune</tr> of a musical piece. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>tone</tr>, <tr>tenor</tr> of voice or statement. </trans>
<eg><i lang=""ceb"">Nagdalag kasukù ang tunáda sa íyang tíngug,</i><trans> The tone of his voice is tinged with anger. </trans></eg>
<eg><i lang=""ceb"">Kláru ang íyang túyù sa tunáda lang sa suwat,</i><trans> Her object is obvious just by the tenor of the letter.
</trans></eg>
</sense></hom></entry>");
