INSERT INTO `wced_entry` VALUES (19677, "tun-as", "1055", "<entry page=""1055"" id=""19677""><form id=""tun-as"" lang=""ceb"">tun-as</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[APB12]</itype><trans> decompose entirely, cause s.t. to do so. </trans>
<eg><i lang=""ceb"">Way báhù ang patayng láwas nga matun-as,</i><trans> A dead body that is totally decomposed is odorless. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B12]</itype><trans> fall into complete ruin. </trans>
<eg><i lang=""ceb"">Natun-as na ang karáang báy nga wà puy-i,</i><trans> The old, uninhabited house has fallen into ruin. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> destroy dreams, hopes, etc. </trans>
<eg><i lang=""ceb"">Nagkatun-as na ang ákung mga damgu,</i><trans> My dreams are gradually crumbling down. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> totally decomposed.
</trans>
</sense></hom></entry>");
