INSERT INTO `wced_entry` VALUES (19679, "tunay", "1055", "<entry page=""1055"" id=""19679""><form id=""tuxnay"" lang=""ceb"">túnay</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>real</tr>, <tr>genuine</tr> (slang). </trans>
<eg><i lang=""ceb"">Dì ni imitisyun uy. Túnay ni,</i><trans> This is not imitation. This is genuine. </trans></eg>
<eg><i lang=""ceb"">Maáyu siyang mudá mu rag túnay giyud,</i><trans> He acts well, as though it were actually real. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>true</tr>; <tr>faithful</tr> to one’s sweetheart (slang). </trans>
<eg><i lang=""ceb"">Ayaw siyag binuángi kay túnay nà siya nímu,</i><trans> Don’t deceive her because she is true to you.
</trans></eg>
</sense></hom></entry>");
