INSERT INTO `wced_entry` VALUES (19685, "tunduk", "1056", "<entry page=""1056"" id=""19685""><form id=""tunduk"" lang=""ceb"">tunduk</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> <tr>poke</tr>, hit or strike s.t. with the end or tip of s.t. </trans>
<eg><i lang=""ceb"">Ang hálas nga nakatunduk níya,</i><trans> The snake that struck him. </trans></eg>
<eg><i lang=""ceb"">Gitunduk níya sa lamísa ang ayis pik,</i><trans> He stuck the icepick in the table. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> thrust with the end of s.t. </trans>
<eg><i lang=""ceb"">Ang hínay nga tunduk sa bára,</i><trans> The gentle thrust of an iron bar. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> a spot on an animal’s body or head. </trans>
<eg><i lang=""ceb"">May tunduk nga itum ang awman,</i><trans> The spotted snapper has a black spot. </trans></eg>
</sense></hom>
<entry><form id=""tunduxkan"" lang=""ceb""><abbr expan=""tundúkan"" type=""lemma"">-an(←)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> animal having a spot.
</trans>
</sense></hom></entry></entry>");
