INSERT INTO `wced_entry` VALUES (19686, "tung", "1056", "<entry page=""1056"" id=""19686""><form id=""tuxng"" lang=""ceb"">túng</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> rake-off given by gamblers to the owner of the gambling paraphernalia used. </trans>
</sense>
<sense n=""2""><number>2</number><trans> bribe given to a policeman to avoid arrest. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6(1)]</itype><trans> pay the <ix>tung</ix>. </trans>
<eg><i lang=""ceb"">Ngánung dì ka man mutúng nga ikaw may nakadaug?</i><trans> Why <corr sic=""don’t"">didn’t</corr> you pay the rake-off when you won the game? </trans></eg>
<eg><i lang=""ceb"">Ug túngan nímu ang pulis, papamaligyáun ka nas asíras,</i><trans> If you pay the cops off, you’ll be allowed to hawk on the sidewalk. </trans></eg>
</sense></hom>
<entry><form id=""tuxngir"" lang=""ceb""><abbr expan=""túngir"" type=""lemma"">-ir</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> the one who collects the rake-off in a gambling den.
</trans>
</sense></hom></entry></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (19686, "túng", "tung", "m", "nv");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (19686, "túngir", "tungir", "s", "n");
INSERT INTO `wced_entry` VALUES (19687, "tunga", "1056", "<entry page=""1056"" id=""19687""><form id=""tunga"" lang=""ceb"">tunga</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b6]</itype><trans> come out from under water. </trans>
<eg><i lang=""ceb"">Layù siyag gitungahan gíkan sa íyang gisawman,</i><trans> The place he came up was far from where he dived. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[c6]</itype><trans> pause to breathe while drinking a whole container of spirits. </trans>
<eg><i lang=""ceb"">Dílì nákù itunga ang usa ka búl nga tubà,</i><trans> I’ll drink a jar of coconut palm toddy without pausing to breathe. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2; a12]</itype><trans> show up or see s.o. as per appointment or agreement. </trans>
<eg><i lang=""ceb"">Wà na mutunga ang nakautang nákù,</i><trans> The person who owed me money didn’t show up.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (19687, "tunga", "tunga", "m", "v");
INSERT INTO `wced_entry` VALUES (19688, "tunga", "1056", "<entry page=""1056"" id=""19688""><form id=""tungaq"" lang=""ceb"">tungà</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>half</tr>. </trans>
<eg><i lang=""ceb"">Tungà sa taknà,</i><trans> Half an hour. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>middle</tr>, <tr>center</tr>. </trans>
<eg><i lang=""ceb"">Tungà sa karsáda,</i><trans> Middle of the road. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>vagina</tr> (euphemism). </trans>
</sense>
<sense n=""4""><number>4</number><trans> <tr>stomach</tr> (coarse). </trans>
<eg><i lang=""ceb"">Bísag napunù na ang tungà, gabagulbul nga walay lamì ang pagkáun,</i><trans> He filled his <tr>gullet</tr>, but he grumbles that the food was no good. </trans></eg>
</sense></hom>
<entry><form id=""so-and-so_sa_ixmung_ixyang_tungaq"" lang=""ceb""><r>[<ix>so-and-so</ix>]</r> sa ímung (íyang) <abbr expan=""tungà"" type=""lemma"">—</abbr></form>
<hom>
<sense n=""0""><trans> [so-and-so] is not true (said in denying s.t. vigorously and with resentment). </trans>
<eg><i lang=""ceb"">Dátù sa íyang tungà. Wà man gánì kuy ikapalit ug bugas,</i><trans> Rich my foot! Here I don’t even have money for food! </trans></eg>
</sense></hom></entry>
<entry><form id=""tungang_gabixi"" lang=""ceb"">tungang gabíi</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>midnight</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B256; c16]</itype><trans> be at about half of s.t. </trans>
<eg><i lang=""ceb"">Mutungà sa kilumitru ang ákung gibaktas,</i><trans> I walked for about half a kilometer. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[c16]</itype><trans> hit at the middle or center. </trans>
<eg><i lang=""ceb"">Itungà (tung-a) giyud pag-igù arun buls-ay,</i><trans> Hit the center to get a bull’s-eye. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B126; a12]</itype><trans> consume, reduce to half. </trans>
<eg><i lang=""ceb"">Tung-un ku nang usa ka galun nga tubà,</i><trans> I’ll consume half of that gallon of palm toddy. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[b(1)]</itype><trans> place between two or more others. </trans>
<eg><i lang=""ceb"">Gitung-an siyag higdà sa íyang Nánay ug Tátay,</i><trans> She was laid between her mother and father. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[AC; abc3]</itype><trans> divide, share into halves. </trans>
<eg><i lang=""ceb"">Akuy mutungà arun way áway,</i><trans> I’ll divide it so there will be no quarrel. </trans></eg>
<eg><i lang=""ceb"">Magtúngà ta sa ganansiya,</i><trans> We will split the profit equally. </trans></eg>
<eg><i lang=""ceb"">Tungáa (tung-a) nà ninyung duha,</i><trans> Divide it equally between the two of you. </trans></eg>
</sense></hom></entry>
<entry><form id=""tungaqtuxngaq"" lang=""ceb"">tungàtúngà</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> the halfway or mid-point. </trans>
<eg><i lang=""ceb"">Tungàtúngà sa átung lákaw,</i><trans> Mid-point of our trip. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> divide equally among. </trans>
<eg><i lang=""ceb"">Tungàtungáa ninyu nang usa ka buuk kík,</i><trans> Divide that one cake equally among yourselves. </trans></eg>
</sense></hom></entry>
<entry><form id=""hinungaqtungaq"" lang=""ceb"">hinungàtungà</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B1356]</itype><trans> be about halfway through. </trans>
<eg><i lang=""ceb"">Nahinungàtúngà (nanungàtungà) na ang mísa pag-abut námù,</i><trans> The mass was about halfway through when we arrived. </trans></eg>
</sense></hom></entry>
<entry><form id=""panungaqtuxngaq"" lang=""ceb"">panungàtúngà</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> = <xr lang=""ceb"" target=""#hinungaqtuxngaq""><sc>hinungàtúngà</sc></xr>. </trans>
</sense></hom></entry>
<entry><form id=""hinungaq"" lang=""ceb""><abbr expan=""hinungà"" type=""lemma"">hiN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B156]</itype><trans> be halfway done. </trans>
<eg><i lang=""ceb"">Walà pa gánì mahinungà ang kan-un niíni, mitindug na kini,</i><trans> She got up before the rice was even halfway consumed. </trans></eg>
</sense></hom></entry>
<entry><form id=""tinungaq"" lang=""ceb""><abbr expan=""tinungà"" type=""lemma"">-in-</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> by half. </trans>
<eg><i lang=""ceb"">Tinungà ka manghangyù,</i><trans> You bargain things down to half-price. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> do by halves or two to one. </trans>
<eg><i lang=""ceb"">Way musúkul nímu bísag itinungà ang pusta,</i><trans> No one will challenge you even if the bet is two to one. </trans></eg>
</sense></hom></entry>
<entry><form id=""kinatung-an"" lang=""ceb"">kinatung-an</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>centermost</tr>, <tr>middlemost</tr>. </trans>
</sense></hom></entry>
<entry><form id=""kinatung-an_silangan"" lang=""ceb""><abbr expan=""kinatung-an"" type=""lemma"">—</abbr> silangan</form>
<hom>
<sense n=""0""><trans> <tr>Middle East</tr>. </trans>
</sense></hom></entry>
<entry><form id=""katungaq"" lang=""ceb""><abbr expan=""katungà"" type=""lemma"">ka-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>one-half</tr> of s.t. </trans>
<eg><i lang=""ceb"">Ibangku ang katungà sa ímung swildu,</i><trans> Deposit half of your salary in the bank. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B236]</itype><trans> be at about halfway. </trans>
<eg><i lang=""ceb"">Nakatungà na ku sa libru,</i><trans> I’m halfway through the book. </trans></eg>
<eg><i lang=""ceb"">Wà pa ku makakatungà sa tísis,</i><trans> I have not reached the halfway point in my thesis. </trans></eg>
</sense></hom></entry>
<entry><form id=""tulung-an"" lang=""ceb"">tulung-an</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> palm toddy measure, a bamboo tube container which holds one-half a <ix>típu<sub>1</sub></ix>, <ix>1</ix>. </trans>
</sense></hom></entry>
<entry><form id=""tulung-un"" lang=""ceb"">tulung-un</form>
<hom>
<sense n=""0""><trans> the Wednesday of the Holy Week where work is done half day.
</trans>
</sense></hom></entry></entry>");
