INSERT INTO `wced_entry` VALUES (19689, "tungab", "1056", "<entry page=""1056"" id=""19689""><form id=""tuxngab"" lang=""ceb"">túngab</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2S; c]</itype><trans> put the mouth to the edge of a vessel, as in drinking. </trans>
<eg><i lang=""ceb"">Mitúngab siya sa pawpaw arun pag-inum,</i><trans> He brought the half coconut shell to his mouth to drink. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[c6]</itype><trans> put the mouth near s.t. as in drinking. </trans>
<eg><i lang=""ceb"">Ayawg itúngab ímung bàbà sa ákung <pb n=""1057""/>dunggan ug musulti ka,</i><trans> Don’t put your mouth right on top of my ear when you talk.
</trans></eg>
</sense></hom></entry>");
