<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#tulungan""><sc>tulungan</sc></xr>. <ix>see</ix> <xr lang=""ceb"" target=""#tuxlung""><sc>túlung</sc></xr>.
</trans>
</sense></hom></entry>");
