INSERT INTO `wced_entry` VALUES (19691, "tungas", "1057", "<entry page=""1057"" id=""19691""><form id=""tuxngas"" lang=""ceb"">túngas</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> go up a mountain, <tr>uphill</tr>. </trans>
<eg><i lang=""ceb"">Mutúngas ta ánang bakilid,</i><trans> We are going up that slope. </trans></eg>
<eg><i lang=""ceb"">Tungásun ku ang kabukíran pagpangítà nímu,</i><trans> I will <tr>climb mountains</tr> to look for you. </trans></eg>
</sense></hom>
<entry><form id=""tungasun"" lang=""ceb""><abbr expan=""tungasun"" type=""lemma"">-un(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>uphill</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>uphill fight</tr>. </trans>
<eg><i lang=""ceb"">Tungasun ang íyang kahimtang sa iliksiyun,</i><trans> He has an uphill fight in the election. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B125]</itype><trans> be <tr>uphill</tr> or <tr>steep</tr>. </trans>
<eg><i lang=""ceb"">Pahináyi ang awtu kay nagkatungasun ang karsáda,</i><trans> Slow the car down because the road is becoming steep.
</trans></eg>
</sense></hom></entry></entry>");
