INSERT INTO `wced_entry` VALUES (19692, "tungaw", "1057", "<entry page=""1057"" id=""19692""><form id=""tungaw"" lang=""ceb"">tungaw</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> k.o. very minute, red <tr>mite</tr> that abounds in bushes, producing an itchy bite and hiding in skin pores. </trans>
<eg><i lang=""ceb"">Madakup pay tungaw nga dílì gayud kini musayup paghapit kanámù,</i><trans> It’s more likely that you could catch a mite (i.e. highly unlikely) than that he would fail to stop in our place. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[b4]</itype><trans> be infested with such fleas.
</trans>
</sense></hom></entry>");
