INSERT INTO `wced_entry` VALUES (19693, "tungay", "1057", "<entry page=""1057"" id=""19693""><form id=""tungay"" lang=""ceb"">tungay</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B]</itype><trans> hang down on a weak or loose attachment. </trans>
<eg><i lang=""ceb"">Nagtungay ang sanga sa káhuy nga wà malahus ug kaputul,</i><trans> The branch of the tree is hanging because it was not completely cut through.
</trans></eg>
</sense></hom></entry>");
