<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[C; c]</itype><trans> have a <tr>drinking spree</tr> (slang). </trans>
<eg><i lang=""ceb"">Makigtunggà sila nákù karung ákung adlaw,</i><trans> They want to have a drinking spree with me on my birthday.
</trans></eg>
</sense></hom></entry>");
