INSERT INTO `wced_entry` VALUES (19697, "tunggal", "1057", "<entry page=""1057"" id=""19697""><form id=""tunggal"" lang=""ceb"">tunggal</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> prod s.t. with a stick to drive or push it out of a small place. </trans>
<eg><i lang=""ceb"">Gitunggal níya ang sagbut sa túbu,</i><trans> He pushed the dirt out of the pipe with a stick. </trans></eg>
<eg><i lang=""ceb"">Tunggála ang ilagà sa kisami,</i><trans> Poke at the mice in the ceiling to drive them out.
</trans></eg>
</sense></hom></entry>");
