INSERT INTO `wced_entry` VALUES (19698, "tunggul", "1057", "<entry page=""1057"" id=""19698""><form id=""tunggul"" lang=""ceb"">tunggul</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>stupid</tr>, having no common sense. </trans>
<eg><i lang=""ceb"">Tunggul kaáyu nímu uy nga dì ka man makasabut ug sugúun,</i><trans> How stupid you are! You don’t understand when you are told to do s.t.!
</trans></eg>
</sense></hom></entry>");
