INSERT INTO `wced_entry` VALUES (19699, "tungguy", "1057", "<entry page=""1057"" id=""19699""><form id=""tungguy"" lang=""ceb"">tungguy</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> any growth that protrudes from the body. </trans>
</sense>
<sense n=""2""><number>2</number><trans> a swelling or <corr sic=""protruberance"">protuberance</corr> on a tree. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B46]</itype><trans> <tr>protrude</tr>. </trans>
<eg><i lang=""ceb"">Mutungguy ang sábà úsà mugulà,</i><trans> The sucker protrudes first before coming out. </trans></eg>
</sense></hom>
<entry><form id=""tungguytungguy"" lang=""ceb"">tungguytungguy</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> a knoblike <tr>protrusion</tr>, e.g. a <tr>pommel</tr>. </trans>
<eg><i lang=""ceb"">Isab-it lang ang rinda sa tungguytungguy ánang muntúra,</i><trans> Just loop the reins around the pommel of the saddle. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13; a2]</itype><trans> make, attach a knoblike protrusion.
</trans>
</sense></hom></entry></entry>");
