INSERT INTO `wced_entry` VALUES (19700, "tungha", "1057", "<entry page=""1057"" id=""19700""><form id=""tunghaq"" lang=""ceb"">tunghà</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; b6]</itype><trans> <tr>appear</tr>. </trans>
<eg><i lang=""ceb"">May kumíta nga mitunghà sa lángit,</i><trans> A comet appeared in the sky. </trans></eg>
<eg><i lang=""ceb"">Gitungháan siyag ingkantu,</i><trans> A supernatural being appeared to him. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A2; a12]</itype><trans> show up for a date. </trans>
<eg><i lang=""ceb"">Nagsábut mi nga magkítà sa alas dus apan wà ku níya tungháa,</i><trans> We agreed to meet at two o’clock but he didn’t appear. </trans></eg>
</sense>
<sense n=""1b""><number>1b</number> <itype>[b8]</itype><trans> <tr>come upon</tr> s.t. </trans>
<eg><i lang=""ceb"">Sa pagtúngas námù sa búkid ámung hingtunghaan ang usa ka talagsáung talan-áwun,</i><trans> When we climbed up the mountain we came upon a spectacular view. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>report to work</tr>. </trans>
<eg><i lang=""ceb"">Mutunghà kug sayu,</i><trans> I’ll <tr>go to work</tr> early. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; b6]</itype><trans> <tr>attend school</tr>, classes. </trans>
<eg><i lang=""ceb"">Nagtunghà siya sa kulihiyu,</i><trans> She is attending college. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A23; b1]</itype><trans> for s.t. to occur periodically. </trans>
<eg><i lang=""ceb"">Sakitan giyud siya sa tiyan basta mutunghà na kaníya ang íyang sakit,</i><trans> She gets a stomachache when she has her period. </trans></eg>
</sense></hom>
<entry><form id=""tunghaq_ang_bisixta"" lang=""ceb""><abbr expan=""tunghà"" type=""lemma"">—</abbr> ang bisíta</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; b5]</itype><trans> <tr>menstruate</tr> (euphemism). </trans>
</sense></hom></entry>
<entry><form id=""patunghaq"" lang=""ceb""><abbr expan=""patunghà"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a1]</itype><trans> send to school. </trans>
<eg><i lang=""ceb"">Magwurking gud ku ug dì mu makapatunghà nákù,</i><trans> I will work my way through if you can’t support my studies. </trans></eg>
</sense></hom></entry>
<entry><form id=""tulunghaan"" lang=""ceb""><abbr expan=""tulunghaan"" type=""lemma"">-l-an(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>school</tr>.
</trans>
</sense></hom></entry></entry>");
