INSERT INTO `wced_entry` VALUES (19701, "tunghak", "1057", "<entry page=""1057"" id=""19701""><form id=""tunghak"" lang=""ceb"">tunghak</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A23; c6]</itype><trans> stop drinking to catch one’s breath. </trans>
</sense></hom>
<entry><form id=""tunghaktunghak"" lang=""ceb"">tunghaktunghak</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> stop every now and then while drinking to catch one’s breath. </trans>
<eg><i lang=""ceb"">Ísug kaáyung ilimnúna. Magtunghaktunghak kang muinum,</i><trans> The drink is too strong. You have to stop every now and then to catch a breath when you drink it.
</trans></eg>
</sense></hom></entry></entry>");
