INSERT INTO `wced_entry` VALUES (19702, "tungina1", "1057", "<entry page=""1057"" id=""19702""><form id=""tungixna"" lang=""ceb"">tungína<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> misfortune or suffering inflicted on s.o. by a supernatural being in retribution for some infraction or at the behest of a sorcerer. </trans>
<eg><i lang=""ceb"">Kini ang tungína sa ákung pagkamakasasálà,</i><trans> This is my retribution for being a sinner. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6(1)]</itype><trans> send <ix>tungína</ix> to s.o. </trans>
<eg><i lang=""ceb"">Tungináhan ka,</i><trans> I’ll send divine punishment on you. </trans></eg>
</sense></hom>
<entry><form id=""tunginahan"" lang=""ceb"">tunginahan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> sorcerer who can have divine retribution sent.
</trans>
</sense></hom></entry></entry>");
