INSERT INTO `wced_entry` VALUES (19703, "tungina2", "1057", "<entry page=""1057"" id=""19703""><form id=""tungixna2"" lang=""ceb"">tungína<sub>2</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> needlessly deprive s.o. of s.t. </trans>
<eg><i lang=""ceb"">Dì mutungína ang inahan sa kinahanglanun sa anak,</i><trans> A mother does not deprive a child of its needs. </trans></eg>
<eg><i lang=""ceb"">Ang kagawásan nga itungína nátù sa Kumunismu,</i><trans> The liberty that Communism will deprive us of.
</trans></eg>
</sense></hom></entry>");
