INSERT INTO `wced_entry` VALUES (19704, "tungka", "1057", "<entry page=""1057"" id=""19704""><form id=""tungkaq"" lang=""ceb"">tungkà</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2C3; c1]</itype><trans> <tr>meet</tr>, <tr>join</tr>, <tr>come together</tr>. </trans>
<eg><i lang=""ceb"">Kining karsadáha mutungkà adtung karsadáha,</i><trans> This road will meet that road. </trans></eg>
<eg><i lang=""ceb"">Nagtungkà ang duha ka tumuy sa alambri,</i><trans> <pb n=""1058""/>The two ends of the wire meet. </trans></eg>
<eg><i lang=""ceb"">Tungkáa (itungkà) ang duha ka pidásung panaptun,</i><trans> Join the two pieces of cloth. </trans></eg>
<eg><i lang=""ceb"">Dúgay nang wà mi magkatungkà,</i><trans> We haven’t <tr>gotten together</tr> for a long time. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AC; a2]</itype><trans> hold a drinking spree, <tr>drink</tr> alcoholic beverages. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>drinking spree</tr> (slang). </trans>
</sense></hom>
<entry><form id=""tungkaan"" lang=""ceb""><abbr expan=""tungkaan"" type=""lemma"">-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> place for drinking alcoholic beverages. </trans>
</sense></hom></entry>
<entry><form id=""tinungkaan"" lang=""ceb""><abbr expan=""tinungkaan"" type=""lemma"">-in-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>joint</tr>, <tr>connection</tr>, <tr>seam</tr>.
</trans>
</sense></hom></entry></entry>");
