INSERT INTO `wced_entry` VALUES (19708, "tungku1", "1058", "<entry page=""1058"" id=""19708""><form id=""tungkuq"" lang=""ceb"">tungkù<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; ac]</itype><trans> step, set on top of s.t. </trans>
<eg><i lang=""ceb"">Tungkúa ang binítay arun ka kaabut,</i><trans> <tr>Step on</tr> s.t. to reach the thing we had hung up. </trans></eg>
<eg><i lang=""ceb"">Itungkù ang básu sa láin,</i><trans> Put the glass on top of another.
