INSERT INTO `wced_entry` VALUES (19712, "tunglu", "1058", "<entry page=""1058"" id=""19712""><form id=""tunglu"" lang=""ceb"">tunglu</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a12]</itype><trans> <tr>curse</tr> bringing evil effect. </trans>
<eg><i lang=""ceb"">Ang Ginuu nagtunglu nga magkamang ang hálas,</i><trans> The Lord condemned the serpent to crawl on the ground. </trans></eg>
<eg><i lang=""ceb"">Ayawg tunglúha siya kay matinúud unyà,</i><trans> Don’t curse him, for it might come true. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>curse</tr> that brings evil effect. </trans>
<eg><i lang=""ceb"">‘Malatà pa untà ímung tinái!’ tunglu níya,</i><trans> ‘May your intestines rot!’ he cursed. </trans></eg>
</sense></hom>
<entry><form id=""panunglu"" lang=""ceb""><abbr expan=""panunglu"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c]</itype><trans> utter curses. </trans>
<eg><i lang=""ceb"">Daw makítà ku siya nga nagpanunglù kanátù,</i><trans> It was as if I could see her cursing us. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2]</itype><trans> do s.t. not serious which will bring a curse on one. </trans>
<eg><i lang=""ceb"">Ngánung nanilhig kag gabíi? Nanunglu ka?</i><trans> Why are you sweeping after dark? You want to bring a curse on yourself? </trans></eg>
</sense></hom></entry>
<entry><form id=""matungluxhun"" lang=""ceb"">matunglúhun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>cursing</tr>.
</trans>
</sense></hom></entry></entry>");
