INSERT INTO `wced_entry` VALUES (19713, "tungtung", "1058", "<entry page=""1058"" id=""19713""><form id=""tungtung"" lang=""ceb"">tungtung</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c]</itype><trans> step, put on top. </trans>
<eg><i lang=""ceb"">Mitungtung siya sa tabládu arun pagdiskursu,</i><trans> He stepped on the stage to speak. </trans></eg>
<eg><i lang=""ceb"">Itungtung ang silya sa lamísa,</i><trans> Put the chair on top of the table. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b6]</itype><trans> reach an age, grade in school. </trans>
<eg><i lang=""ceb"">Karun hinúun nga mitungtung na aku ning ákung panuígun,</i><trans> Now that I have reached this age. </trans></eg>
<eg><i lang=""ceb"">Primarya ra ang íyang hitungtungan,</i><trans> He didn’t get any further than the primary grades. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; c]</itype><trans> put interest on a loan. </trans>
<eg><i lang=""ceb"">Grábi sad kang makatungtung ug túbù,</i><trans> You sure charge a high interest. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>interest</tr> on a loan.
</trans>
</sense></hom></entry>");
