INSERT INTO `wced_entry` VALUES (19715, "tungud", "1058", "<entry page=""1058"" id=""19715""><form id=""tungud"" lang=""ceb"">tungud</form>
<hom>
<sense n=""1""><number>1</number><trans> <tr>because</tr>, <tr>due to</tr>. </trans>
<eg><i lang=""ceb"">Napúkan si Samsun tungud ni Dilayla,</i><trans> Samson fell because of Delilah. </trans></eg>
<eg><i lang=""ceb"">Tungud kay nalísang ku,</i><trans> Because I was afraid. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> <ix>in set usage in prayers:</ix> ‘in the name of’. </trans>
<eg><i lang=""ceb"">Tungud sa timáan sa Santa Krus, sa ámung mga áway bawíun mu kami, Ginúung Diyus námù...<corr>,</corr></i><trans> By the sign of the Holy Cross deliver us from our enemies, our Lord God ... </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>by</tr>, <tr>at</tr> a place. </trans>
<eg><i lang=""ceb"">Ihúnung ang dyíp tungud ánang balay,</i><trans> Stop the jeep by that house. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>directly beneath</tr>. </trans>
<eg><i lang=""ceb"">Dúnay subwi tungud ning átung gitindúgan,</i><trans> There is a subway directly beneath where we are standing. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AP; cP]</itype><trans> put directly beneath. </trans>
<eg><i lang=""ceb"">Kinsay nagtungud (nagpatungud) ánà sa bintánà? Hilud-an hinúun,</i><trans> Who put that beneath the window? S.o. spat on it. </trans></eg>
<eg><i lang=""ceb"">Itungud (ipatungud) ang baldi sa grípu,</i><trans> Put the pail directly under the faucet. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AN; a12]</itype><trans> go under the house to peep. </trans>
<eg><i lang=""ceb"">Kinsa guy gustung mutungud ug tigúlang,</i><trans> Who likes to peep at an old woman? </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B1256]</itype><trans> be at, near, or directly beneath s.t. </trans>
<eg><i lang=""ceb"">Sirbátu kun matungud na ta sa taw-ang dákit,</i><trans> Blow your horn when we get near the enchanted banyan tree. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[b4]</itype><trans> be <tr>concerned</tr>, <tr>referred to</tr>. </trans>
<eg><i lang=""ceb"">Álang niadtung hitungdan,</i><trans> To whom it may <tr>concern</tr>. </trans></eg>
<eg><i lang=""ceb"">Kadtung hitungdan sa ákung sulti,</i><trans> Those referred to by my words. </trans></eg>
</sense>
<sense n=""4a""><number>4a</number> <itype>[a12]</itype><trans> <tr>aim at</tr> s.t. or s.o. </trans>
<eg><i lang=""ceb"">Ngánung mau man puy inyung tungdun ug insultu ang hilumun?</i><trans> Why do you <tr>aim</tr> your insults to one who does not even talk? </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> the place directly below, directly across. </trans>
</sense>
<sense n=""2""><number>2</number> <form id=""niadtung_tunguxra"" lang=""ceb"">niadtung tungúra</form><trans> at that particular juncture, moment. </trans>
<eg><i lang=""ceb"">Niadtung tungúra pagkadisgrasya níya gipangulbaan ku,</i><trans> That instant when he met his accident I was terrified. </trans></eg>
</sense></hom>
<entry><form id=""tuxngud"" lang=""ceb""><abbr expan=""túngud"" type=""lemma"">(←)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AC; ac3]</itype><trans> put, arrange one exactly beneath or opposite the other. </trans>
<eg><i lang=""ceb"">Akuy mutúngud sa naghiwì nga dubul dik,</i><trans> I will put the double-deck beds exactly beneath each other. </trans></eg>
<eg><i lang=""ceb"">Wà magtúngud ang butúnis ug uhális,</i><trans> The buttons and the buttonholes are not exactly opposite each other. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A1; a12]</itype><trans> look down searchingly into the sea for fish. </trans>
<eg><i lang=""ceb"">Nagtúngud ang mananagat ug maáyung panaun,</i><trans> The fisherman is looking into the sea for a good fish to spear. </trans></eg>
</sense></hom></entry>
<entry><form id=""tungudtuxngud"" lang=""ceb"">tungudtúngud</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AP; b6P]</itype><trans> <tr>make a pass</tr> at a girl or boy. </trans>
<eg><i lang=""ceb"">Dúsi pa siya piru daghan nang nagtungudtúngud <pb n=""1059""/>(nagpatungudtúngud) níya,</i><trans> She is only twelve but lots of boys are making passes at her. </trans></eg>
</sense></hom></entry>
<entry><form id=""patungud"" lang=""ceb""><abbr expan=""patungud"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A]</itype><trans> go beneath, near. </trans>
<eg><i lang=""ceb"">Mipatungud siya sa ákung lawak,</i><trans> He went directly under my room. </trans></eg>
</sense></hom></entry>
<entry><form id=""pahinungud"" lang=""ceb""><abbr expan=""pahinungud"" type=""lemma"">pahiN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> give s.o. s.t. by way of thanks. </trans>
<eg><i lang=""ceb"">Kay mitábang man ka mupahinungud ku nímu ug diyis písus,</i><trans> Because you helped I will give you ten pesos as thanks. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> dedicate, do s.t. in honor of s.o. </trans>
<eg><i lang=""ceb"">Nagpahinungud ang lungsud ug mísa álang sa minatay,</i><trans> The town offered a mass in honor of the dead. </trans></eg>
<eg><i lang=""ceb"">Kining kantáha ákung ipahinungud nímu,</i><trans> This song I dedicate to you. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. offered as thanks or as a dedication. </trans>
</sense></hom></entry>
<entry><form id=""katungud_katuxngud"" lang=""ceb""><abbr expan=""katungud"" type=""lemma"">ka-</abbr>, <abbr expan=""katúngud"" type=""lemma"">ka-(←)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>right</tr>, <tr>privilege</tr>. </trans>
<eg><i lang=""ceb"">May katungud (katúngud) kang mahibalu kúmu asáwa,</i><trans> You have the right to know, being the wife. </trans></eg>
</sense></hom></entry>
<entry><form id=""katungdaxnan"" lang=""ceb"">katungdánan</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>duty</tr>. </trans>
<eg><i lang=""ceb"">Katungdánan sa anak ang pagsirbi sa ginikánan,</i><trans> It is a child’s duty to serve his parents. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>office</tr>, <tr>position</tr>. </trans>
<eg><i lang=""ceb"">Taas siyag katungdánan sa gubirnu,</i><trans> He holds a high office in the government. </trans></eg>
</sense></hom></entry>
<entry><form id=""pangatungdaxnan"" lang=""ceb"">pangatungdánan</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A]</itype><trans> <tr>hold a position</tr>. </trans>
</sense></hom></entry>
<entry><form id=""tagtungud_tagtuxngud"" lang=""ceb""><abbr expan=""tagtungud"" type=""lemma"">tag-</abbr>, <abbr expan=""tagtúngud"" type=""lemma"">tag-(←)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.o. who owns, has responsibility over s.t. </trans>
<eg><i lang=""ceb"">Gustung ipalubung dáyun sa tagtungud (tagtúngud) ang minatay,</i><trans> The family (lit. concerned party) wants to have the body buried at once. </trans></eg>
</sense></hom></entry>
<entry><form id=""hinungdan"" lang=""ceb"">hinungdan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>cause</tr> of, <tr>reason for</tr>. </trans>
<eg><i lang=""ceb"">Unsay hinungdan nga miundang ka?</i><trans> What is the <tr>reason</tr> you quit? </trans></eg>
</sense></hom></entry>
<entry><form id=""way_hinungdan"" lang=""ceb"">way <abbr expan=""hinungdan"" type=""lemma"">—</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>good-for-nothing</tr>, <tr>useless</tr>. </trans>
<eg><i lang=""ceb"">Way hinungdan tawhána gipabantay, natū́g na hinúun,</i><trans> He is useless! He is supposed to stand guard but he is sleeping. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A12P]</itype><trans> <tr>cause</tr>. </trans>
<eg><i lang=""ceb"">Ang mga pabrika mauy nakapahinungdan sa pag-uswag sa dápit,</i><trans> The factories <tr>brought about</tr> progress in the place. </trans></eg>
</sense></hom></entry>
<entry><form id=""pakahinungdan"" lang=""ceb"">pakahinungdan</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13; a12]</itype><trans> consider s.t. important. </trans>
<eg><i lang=""ceb"">Dì nátù pakahinungdánun ang milabay na,</i><trans> Let’s not give importance to what has already passed. </trans></eg>
</sense></hom></entry>
<entry><form id=""hinungdaxnun_mahinungdaxnun"" lang=""ceb"">hinungdánun, mahinungdánun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>important</tr>. </trans>
<eg><i lang=""ceb"">Hinungdánun nga túyù,</i><trans> Important business. </trans></eg>
</sense></hom></entry>
<entry><form id=""mahitungud_mahatungud"" lang=""ceb""><abbr expan=""mahitungud"" type=""lemma"">mahi-</abbr>/<abbr expan=""mahatungud"" type=""lemma"">maha-</abbr></form>
<hom>
<sense n=""0""><trans> <tr>about</tr>. </trans>
<eg><i lang=""ceb"">Magsulti ta mahitungud sa Biyitnam,</i><trans> Let us talk about Vietnam. </trans></eg>
</sense></hom></entry>
<entry><form id=""nahinunghud"" lang=""ceb""><abbr expan=""nahinunghud"" type=""lemma"">nahiN-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> thing pertaining to. </trans>
<eg><i lang=""ceb"">Mau ray ílang gihisgutan ang nahinungud sa nigusyu,</i><trans> All they talked about was matters of business. </trans></eg>
</sense></hom></entry>
<entry><form id=""tungdunun"" lang=""ceb"">tungdunun</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> stars, constellations, or landmarks used by fishermen, navigators, as a guide.
</trans>
</sense></hom></entry></entry>");
