INSERT INTO `wced_entry` VALUES (19733, "tuntu", "1060", "<entry page=""1060"" id=""19733""><form id=""tuntu"" lang=""ceb"">tuntu</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>stupid</tr>, <tr>silly</tr>. </trans>
<eg><i lang=""ceb"">Tuntu! Ngánung kining klasíha ímung gipalit,</i><trans> Stupid! Why did you buy this kind? </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B12; b6]</itype><trans> become stupid, silly, consider s.o. as such. </trans>
<eg><i lang=""ceb"">Sa nagkadugay ka ning trabahúa nagkatuntu ka sab,</i><trans> The longer you are on this job, the dumber you get. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AN; a12]</itype><trans> <tr>deceive</tr>, make a fool of. </trans>
<eg><i lang=""ceb"">Way kalúuy ang laláking nagtuntu nímu,</i><trans> The man who deceived you was heartless. </trans></eg>
<eg><i lang=""ceb"">Manuntu ka man nákung mas wayis man ku nímu,</i><trans> Don’t try to make a fool of me. I’m a bit smarter than you are. </trans></eg>
<eg><i lang=""ceb"">Gituntu ka lang ánang mananag-an,</i><trans> That fortuneteller just <tr>hoaxed</tr> you. </trans></eg>
</sense></hom>
<entry><form id=""tinuntu"" lang=""ceb""><abbr expan=""tinuntu"" type=""lemma"">-in-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b(1)]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>abuse</tr>, do s.t. mean or bad to s.t. </trans>
<eg><i lang=""ceb"">Ug dúnay mutinuntu nímung buguy, tawga lang ku,</i><trans> If some ruffian is mean to you, just call me. </trans></eg>
<eg><i lang=""ceb"">Kinsay nagtinuntu ring ákung tigib nga nagíbang man,</i><trans> Who abused my chisel? Somebody nicked it. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> <tr>abuse sexually</tr>. </trans>
<eg><i lang=""ceb"">Ayaw siyag tinuntuhi samtang dì pa mu minyù,</i><trans> Don’t abuse her so long as you are not married. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> do s.t. in a careless way, somewhat playfully. </trans>
<eg><i lang=""ceb"">Ayawg tinantug dúwà kay mapildi ta,</i><trans> Don’t <tr>fool around</tr> in this game. We might lose. </trans></eg>
<eg><i lang=""ceb"">Gitinuntuhan níyag drúwing ang ákung tsárt,</i><trans> He was just fooling around with the chart that I had him draw. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> fool around with women. </trans>
<eg><i lang=""ceb"">Nagtinuntu ang íyang bána,</i><trans> Her husband is fooling around. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> fooling, <tr>horsing around</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> bad, <tr>illicit practices</tr>. </trans>
<eg><i lang=""ceb"">Daghan kaáyung tinuntu sa gubirnu,</i><trans> There is a great deal of <tr>corruption</tr> in the government.
</trans></eg>
</sense></hom></entry></entry>");
