INSERT INTO `wced_entry` VALUES (19734, "tuntun", "1060", "<entry page=""1060"" id=""19734""><form id=""tuntun"" lang=""ceb"">tuntun</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c]</itype><trans> <tr>lower</tr> s.t. </trans>
<eg><i lang=""ceb"">Mitábang kug tuntun sa lungun sa buhù,</i><trans> I helped lower the coffin into the hole. </trans></eg>
<eg><i lang=""ceb"">Ituntun ang baldi sa atábay,</i><trans> Lower the pail <corr sic=""to"">into</corr> the well. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[B6]</itype><trans> <tr>sag</tr> loosely. </trans>
<eg><i lang=""ceb"">Mituntun íyang súsu nga wà bráhi,</i><trans> Her breasts sagged without a bra. </trans></eg>
<eg><i lang=""ceb"">Nagtuntun ang luag níyang karsúnis,</i><trans> His pants are sagging because they are loose. </trans></eg>
</sense>
<sense n=""1b""><number>1b</number> <itype>[A; b(1)]</itype><trans> pay out a fishline. </trans>
<eg><i lang=""ceb"">Tuntúni ug mga lima ka dupa ang pasul,</i><trans> Pay out five fathoms of line. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AB2; b6(1)]</itype><trans> for s.t. weighted down to sink; cause it to do so. </trans>
<eg><i lang=""ceb"">Magtuntun siya sa iring nga ilábu sa dágat,</i><trans> He’ll weight the cat down to throw it into the sea. </trans></eg>
<eg><i lang=""ceb"">Mutuntun (matuntun) ug dalì ang pasul ug lagdúngan,</i><trans> The fishing line will sink easily if you attach a sinker. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[A13; b6]</itype><trans> use a <tr>plumb</tr> to test whether things are vertical. </trans>
<eg><i lang=""ceb"">Magtuntun kus halígi arun dílì maghirig,</i><trans> I am using the plumb line on this post so it won’t lean. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> string or rope used to lower s.t. </trans>
</sense>
<sense n=""2""><number>2</number><trans> heavy object attached to s.t. to make it sink. </trans>
</sense>
<sense n=""3""><number>3</number><trans> <tr>plumb line</tr>. </trans>
</sense></hom>
<entry><form id=""panuntun"" lang=""ceb""><abbr expan=""panuntun"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; b6(1)]</itype><trans> fish in deep waters with a hook, line, and sinker. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> fishing with a hook, line, and sinker in deep waters.
</trans>
</sense></hom></entry></entry>");
