INSERT INTO `wced_entry` VALUES (19738, "tunub", "1060", "<entry page=""1060"" id=""19738""><form id=""tunub"" lang=""ceb"">tunub</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b]</itype><trans> <tr>step on</tr>. </trans>
<eg><i lang=""ceb"">Nagtunub ka sa ákung prupyidad,</i><trans> You are stepping on my property. </trans></eg>
<eg><i lang=""ceb"">Ayawg tumbi ang sáwug kay basà pa,</i><trans> Don’t step on the floor. It’s still wet. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2; b2]</itype><trans> <tr>set foot on</tr>, in. </trans>
<eg><i lang=""ceb"">Dì na ku mutunub ning inyung báy,</i><trans> I will never <tr>set foot in</tr> your house again. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A12]</itype><trans> have attended some school. </trans>
<eg><i lang=""ceb"">Amin na lang kay nakatunub nà siyag unibirsidad,</i><trans> Just give in. He has gone to college, you know. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A; b6]</itype><trans> <tr>dishonor</tr>, <pb n=""1061""/><tr>desecrate</tr> s.o.’s name or honor. </trans>
<eg><i lang=""ceb"">Ayawg tumbi ang dungug sa átung pamilya,</i><trans> Don’t dishonor our family’s name. </trans></eg>
</sense></hom>
<entry><form id=""tuxnub"" lang=""ceb""><abbr expan=""túnub"" type=""lemma"">(←)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>footprint</tr>. </trans>
</sense>
<sense n=""1a""><number>1a</number><trans> the k.o. life one led. </trans>
<eg><i lang=""ceb"">Sunda ang túnub sa ímung amahan,</i><trans> Follow in your father’s footsteps. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>footfalls</tr>. </trans>
<eg><i lang=""ceb"">Kinsa nang dagkug túnub sa táas,</i><trans> Who made that loud noise upstairs? </trans></eg>
</sense></hom></entry>
<entry><form id=""tuxnub_ug_kasixkas"" lang=""ceb""><abbr expan=""túnub"" type=""lemma"">—</abbr> ug kasíkas</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>sound effects</tr> in a radio play (lit. footfalls and noise). </trans>
<eg><i lang=""ceb"">Ang mga túnub ug kasíkas kinahanglang itayming giyud sa lakaw sa dúlà,</i><trans> The sound effects should be coordinated with the progress of the play. </trans></eg>
</sense></hom></entry>
<entry><form id=""tumbanan"" lang=""ceb"">tumbanan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> place one puts the feet when sitting.
</trans>
</sense></hom></entry></entry>");
