INSERT INTO `wced_entry` VALUES (19739, "tunud", "1061", "<entry page=""1061"" id=""19739""><form id=""tuxnud"" lang=""ceb"">túnud</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c]</itype><trans> convey below the surface of the water or into a pit. </trans>
<eg><i lang=""ceb"">Nagtúnud kug patayng irù sa lawud,</i><trans> I threw the dead dog into the deep part of the ocean. </trans></eg>
<eg><i lang=""ceb"">Itúnud na ang lungun sa lungag,</i><trans> Lower the casket into the hole now. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B245; b6]</itype><trans> for the sun to set. </trans>
<eg><i lang=""ceb"">Nagkatúnud (nagkatunud) na ang adlaw sa kasadpan,</i><trans> The sun is sinking in the west.
</trans></eg>
</sense></hom></entry>");
