INSERT INTO `wced_entry` VALUES (19740, "tunug", "1061", "<entry page=""1061"" id=""19740""><form id=""tunug"" lang=""ceb"">tunug</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> sound of a musical instrument. </trans>
<eg><i lang=""ceb"">Manánuy ang tunug sa mga tulunggun,</i><trans> The musical instruments make a sweet sound. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>resonant</tr>, producing a distantly loud sound. </trans>
<eg><i lang=""ceb"">Tunug ning sistáha dà, dì bungul,</i><trans> This guitar is sure resonant. It is not dull. </trans></eg>
<eg><i lang=""ceb"">Tunug kaáyu dinhi ang sinultihánay sa píkas kwartu,</i><trans> You can clearly hear the conversation in the next room. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>widely known</tr>. </trans>
<eg><i lang=""ceb"">Tunug na nga mupaúlì ka,</i><trans> Everybody knows that you’re going home. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B2; b6]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> become resonant, consider s.t. so. </trans>
<eg><i lang=""ceb"">Sa magkadaan ang byulin, magkatunug sab,</i><trans> The older a violin gets, the more resonant it becomes. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> be distinctly <tr>audible</tr>. </trans>
<eg><i lang=""ceb"">Mutunug ímung tíngug kun pabur mi sa hángin,</i><trans> Your voice is very audible if the wind comes towards us. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B12]</itype><trans> be widely known. </trans>
<eg><i lang=""ceb"">Natunug na sa lungsud ang inyung kasal,</i><trans> Everybody knows that you’re getting married. </trans></eg>
</sense></hom>
<entry><form id=""tulunggun"" lang=""ceb"">tulunggun</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>musical instrument</tr>.
</trans>
</sense></hom></entry></entry>");
