INSERT INTO `wced_entry` VALUES (19744, "tunung", "1061", "<entry page=""1061"" id=""19744""><form id=""tunung"" lang=""ceb"">tunung</form>
<hom>
<sense n=""0""><trans> directly at a point. </trans>
<eg><i lang=""ceb"">Naigù ang langgam tunung giyud sa kasingkásing,</i><trans> He hit the bird <tr>right</tr> in the heart. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AC3; ac6]</itype><trans> <tr>zero in</tr> on a mark, go directly to s.t. </trans>
<eg><i lang=""ceb"">Dihà mutunung sa íyang úlu ang napúwak nga lubi,</i><trans> The coconut fell right on his head. </trans></eg>
<eg><i lang=""ceb"">Dì kung katunung sa buhù sa dágum kay kurug ku,</i><trans> I cannot get the thread into the eye of the needle because I’m shaking. </trans></eg>
<eg><i lang=""ceb"">Wà magtúnung ang mga batúnis ug uhális,</i><trans> The buttons and buttonholes don’t exactly align. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B1256; c16]</itype><trans> happen at a particular time, <tr>coincide</tr> with a certain other event. </trans>
<eg><i lang=""ceb"">Natunung nga bakasiyun ang pagkasakit nákù,</i><trans> I got sick just when it was vacation time. </trans></eg>
<eg><i lang=""ceb"">Itunung (tungna) sa Anyu Nuybu ang inugurasiyun,</i><trans> The inauguration is set for New Year’s day. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A12; a2]</itype><trans> get s.t. (good or bad) as one’s lot. </trans>
<eg><i lang=""ceb"">Nakatunung kug silyang tughuun sa sinihan,</i><trans> Of all the seats in the theater I had to pick one that was infested with bugs. </trans></eg>
<eg><i lang=""ceb"">Tungna nang asáwang paraygun,</i><trans> Pick a wife that asks for affection. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A12]</itype><trans> have the presence of mind to do s.t. </trans>
<eg><i lang=""ceb"">Hastang kulbáa nákù. Wà ku katunung ug dágan,</i><trans> How shaken I was! I didn’t have the presence of mind to run. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. aimed at. </trans>
<eg><i lang=""ceb"">Milakaw siyang way tunung,</i><trans> He walked out without going anywhere in particular. </trans></eg>
<eg><i lang=""ceb"">Láin siyag tunung,</i><trans> He has an evil purpose.
</trans></eg>
</sense></hom></entry>");
