INSERT INTO `wced_entry` VALUES (19762, "tupung", "1062", "<entry page=""1062"" id=""19762""><form id=""tuxpung"" lang=""ceb"">túpung</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> of the same height, <tr>even</tr> along the top or bottom. </trans>
<eg><i lang=""ceb"">Túpung ang íyang mga ngípun,</i><trans> Her teeth are all of the same height. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> reaching an equally high state of excellence. </trans>
<eg><i lang=""ceb"">Si Magsaysay walay túpung,</i><trans> No one is as great as Magsaysay. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A23S; a2b2]</itype><trans> <tr>reach</tr> to a certain height or level. </trans>
<eg><i lang=""ceb"">Ang ákung kalágut mitúpung na sa lángit,</i><trans> My anger reaches the heavens. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> make things even. </trans>
<eg><i lang=""ceb"">Tupúnga ang tiil sa silya arun dì magkindangkindang,</i><trans> <tr>Even up</tr> the chair legs so it won’t wobble back and forth. </trans></eg>
<eg><i lang=""ceb"">Dílì na siya hitupngan sa pagkapalikíru,</i><trans> No one is as great a philanderer as he is. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[C; a]</itype><trans> be of the same height. </trans>
<eg><i lang=""ceb"">Nagtúpung sila,</i><trans> They are of the same height. </trans></eg>
<eg><i lang=""ceb"">Tupúngun nátù ang mga tanum,</i><trans> Let’s cut the plants even along the top. </trans></eg>
</sense></hom>
<entry><form id=""tuxpung_ang_tiil"" lang=""ceb""><abbr expan=""túpung"" type=""lemma"">—</abbr> ang tiil</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[C3]</itype><trans> be <tr>dead</tr> (humorous). </trans>
</sense>
<sense n=""4""><number>4</number> <itype>[C; c]</itype><trans> compare height, ability. </trans>
<eg><i lang=""ceb"">Dílì ikatúpung ang íyang abilidad,</i><trans> There is nothing that can compare to his ability. <ix>see also</ix> <xr lang=""ceb"" target=""#alinupung""><sc>alinupung</sc></xr>.
</trans></eg>
</sense></hom></entry></entry>");
