INSERT INTO `wced_entry` VALUES (19763, "tupus1", "1062", "<entry page=""1062"" id=""19763""><form id=""tupus"" lang=""ceb"">tupus<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b(1)]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>suck</tr> on s.t. in the mouth to eat it or get the juice out. </trans>
<eg><i lang=""ceb"">Nagtupus kug biksdrap kay árat ákung tunlan,</i><trans> I am sucking on a cough drop because I have a sore throat. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> toy or play with s.t. with the mouth. </trans>
<eg><i lang=""ceb"">Madaníhung ngábil nga íyang gitupsan sa pagháluk níla,</i><trans> The attractive lips he played with as they kissed. </trans></eg>
</sense></hom>
<entry><form id=""tinupsan"" lang=""ceb"">tinupsan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>pulp</tr> or juiceless flesh after eating. </trans>
<eg><i lang=""ceb"">Silhíga ang mga tinupsan human mug pangus ug tubu,</i><trans> Sweep away the pulp after you’re through eating your sugar cane. </trans></eg>
</sense></hom></entry>
<entry><form id=""talinupsan"" lang=""ceb"">talinupsan</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> for clothes to <corr>be </corr>moist, almost dry after having been wet. </trans>
<eg><i lang=""ceb"">Mabulkas na ang hinalay kay talinupsan na,</i><trans> You can take in the clothes now because they are <tr>almost dry</tr>. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B125]</itype><trans> be, become almost dry.
</trans>
</sense></hom></entry></entry>");
