INSERT INTO `wced_entry` VALUES (19764, "tupus2", "1062", "<entry page=""1062"" id=""19764""><form id=""tupus2"" lang=""ceb"">tupus<sub>2</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a12]</itype><trans> <tr>take over</tr> the task of s.o. incapable or unavailable. </trans>
<eg><i lang=""ceb"">Kinsa may mutupus <pb n=""1063""/>sa ímung trabáhu ug mulakaw ka,</i><trans> Who takes over your chores when you go out? </trans></eg>
<eg><i lang=""ceb"">Tupsa ring ákung buhatun kay kahilanatun ku,</i><trans> Take over my work because I feel feverish. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b]</itype><trans> make up for the time lost or missed. </trans>
<eg><i lang=""ceb"">Buhían mu run kun tupsan ninyu ang klási sa Sabadu,</i><trans> I will dismiss you now if you make the class up on Saturday. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; a12]</itype><trans> <tr>make up for</tr> s.t. lacking by s.t. very good. </trans>
<eg><i lang=""ceb"">Púlus sila burung piru gitupus sa ílang anak nga utukan,</i><trans> They are mostly imbeciles, but their one brainy child made up for it. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> time used for make-up. </trans>
<eg><i lang=""ceb"">Ang trabáhu run tupus sa pista upisiyal gahápun,</i><trans> Today’s work is to make up for yesterday’s holiday. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> s.t. just as much so in exactly the opposite way. </trans>
<eg><i lang=""ceb"">Dátù mi niadtu, tupus pud run nga kakha tukà,</i><trans> We used to be just as rich as we are poor now. </trans></eg>
<eg><i lang=""ceb"">Pagkagarbúsang bayhána, tupus sa íyang bánang labihan kamapaubsánun,</i><trans> She is just as stuck up as her husband is modest.
</trans></eg>
</sense></hom></entry>");
