<sense n=""3""><number>3</number><trans> fraudulent coin-tossing game where the coins have two heads. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> </trans>
</sense>
