INSERT INTO `wced_entry` VALUES (19800, "turuk", "1064", "<entry page=""1064"" id=""19800""><form id=""turuk"" lang=""ceb"">turuk</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B23(1)46; b(1)]</itype><trans> <tr>sprout</tr>, grow from the surface. </trans>
<eg><i lang=""ceb"">Wà makaturuk ang similya tungud sa húlaw,</i><trans> The seeds did not sprout because of the drought. </trans></eg>
<eg><i lang=""ceb"">Uy gitugkan ug buhuk si Upaw,</i><trans> My, old Baldy has grown hair. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B246; b(1)]</itype><trans> for a feeling to develop. </trans>
<eg><i lang=""ceb"">Makapaturuk (makaturuk) sa katáhap ang íyang linihukan,</i><trans> His behavior arouses suspicion. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>sprout</tr>. </trans>
<eg><i lang=""ceb"">Pandúngi ang mga bag-ung turuk arun dì maláyà,</i><trans> Cover the new sprouts so they don’t wither. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> sprout on coconut fruit. </trans>
<eg><i lang=""ceb"">Tul-id giyud ang turuk sa binhiun nga lubi,</i><trans> The sprouts of the coconuts for planting are really straight. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>penis</tr> (humorous euphemism). </trans>
</sense></hom>
<entry><form id=""turuk_banwa"" lang=""ceb""><abbr expan=""turuk"" type=""lemma"">—</abbr> banwa</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> s.t. growing without being planted and taking space, like a weed. </trans>
</sense>
<sense n=""2""><number>2</number><trans> a person who is useless and occupies space. </trans>
<eg><i lang=""ceb"">Turuk banwa nà siya sa pamilya; dílì mutábang sa buluhatun,</i><trans> That person just occupies space in the house. He does not help with the chores. </trans></eg>
</sense></hom></entry>
<entry><form id=""tugkan"" lang=""ceb"">tugkan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> coconut having a sprout. </trans>
</sense></hom></entry>
<entry><form id=""turukturuk"" lang=""ceb"">turukturuk</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> tiny <tr>growths</tr> which emerge. </trans>
<eg><i lang=""ceb"">Unsa nang mga turukturuk sa ímung náwung, bugas?</i><trans> What are those growths on your face, pimples?
</trans></eg>
</sense></hom></entry></entry>");
