INSERT INTO `wced_entry` VALUES (19850, "tutuy", "1067", "<entry page=""1067"" id=""19850""><form id=""tuxtuy"" lang=""ceb"">tútuy</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2S; b]</itype><trans> suck the breast. </trans>
<eg><i lang=""ceb"">Nagtutuy pa siya pagkamatay sa íyang inahan,</i><trans> He was still sucking his mother’s breast when she died. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A13]</itype><trans> be at the sucking stage. </trans>
<eg><i lang=""ceb"">Dì pa mabulag ang ituy sa inahan kay nagtutuy pa,</i><trans> You can’t take the puppy away from its mother because it is still suckling. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A23]</itype><trans> lick s.o.’s boots. </trans>
<eg><i lang=""ceb"">Kusug kaáyu ang íyang pag-usbaw sa katungdánan kay maáyu mang mutútuy,</i><trans> He easily got to the top because he never hesitates to lick his superiors’ boots. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>breast</tr>. </trans>
</sense></hom>
