INSERT INTO `wced_entry` VALUES (19852, "tuu2", "1067", "<entry page=""1067"" id=""19852""><form id=""tuxu2"" lang=""ceb"">túu<sub>2</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b(1)]</itype><trans> <tr>believe</tr>. </trans>
<eg><i lang=""ceb"">Mutúu ka bag anting-anting?</i><trans> Do you believe in amulets? </trans></eg>
<eg><i lang=""ceb"">Tuhúan (tuúhan) ba gud nang pulitiku?</i><trans> Should you believe that politician? </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AP; b(1)]</itype><trans> <tr>heed</tr>. </trans>
<eg><i lang=""ceb"">Dì ka man gud mupatúu (mutúu) ug tambágan,</i><trans> It’s because you don’t <tr>listen</tr> when you’re given advice. </trans></eg>
<eg><i lang=""ceb"">Sultíhi siya kay ikaw ray íyang tuhúan,</i><trans> Tell him because you’re the only one he listens to. </trans></eg>
</sense></hom>
<entry><form id=""Mituxu_Aku"" lang=""ceb"">Mitúu Aku</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> The <tr>Apostles Creed</tr>. <ix>short form:</ix> <bx>mituáku</bx>. </trans>
<eg><i lang=""ceb"">Mangadyì kitag Mitúu Aku,</i><trans> Let us pray the Apostles’ Creed. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A13]</itype><trans> return, come back to a place after having supposedly left it for good (from the portion of the Apostles’ Creed that reads, ‘And He will come back ...’). </trans>
<eg><i lang=""ceb"">Anía mibálik na sab ku mu ra ug nagmitúu aku,</i><trans> Here I am back again, like it said in the Apostles’ Creed. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A13P]</itype><trans> keep going back and forth. </trans>
<eg><i lang=""ceb"">Magmituáku ang kalag pagtúman sa pinitinsiya,</i><trans> A soul keeps coming back on earth to do penance. </trans></eg>
<eg><i lang=""ceb"">Ang pagkalimtánun mauy makamituáku (makapamituáku) nákù sa balay,</i><trans> I’m so forgetful I keep going back and forth to the house. </trans></eg>
</sense></hom></entry>
<entry><form id=""tuutuxu"" lang=""ceb"">tuutúu</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>superstitious belief</tr>. </trans>
<eg><i lang=""ceb"">Tuutúu lang nga taw-an nang dakíta,</i><trans> It’s nothing more than <tr>superstition</tr> that that banyan is inhabited by spirits. </trans></eg>
</sense></hom></entry>
<entry><form id=""patuutuxu"" lang=""ceb"">patuutúu</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> deceive by pretending to be s.o. or teaching s.t. false. </trans>
<eg><i lang=""ceb"">Nagpatuutúu siyang asindíru apan diay musimus nga dakù,</i><trans> He pretends to be a big landowner when he’s nothing more than a beggar. </trans></eg>
<eg><i lang=""ceb"">Unsa na say íyang gipatuutúu?</i><trans> What k.o. foolishness is he trying to make you believe now? </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> false ideas which s.o. is disseminating. </trans>
<eg><i lang=""ceb"">Patuutúu lang nà sa mga panatiku,</i><trans> That’s nothing but <tr>baloney</tr> that the fanatics try to make you believe. </trans></eg>
</sense></hom></entry>
<entry><form id=""matuutuuhun_matuhuqtuhuun"" lang=""ceb"">matuutuuhun, matuhùtuhuun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>superstitious</tr>, given to false beliefs. </trans>
</sense></hom></entry>
<entry><form id=""tinuhuxan_tinuuxhan"" lang=""ceb"">tinuhúan, tinuúhan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>beliefs</tr>, religious or otherwise. </trans>
</sense></hom></entry>
<entry><form id=""tuluhuxan"" lang=""ceb"">tuluhúan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>article of belief</tr>. </trans>
</sense></hom></entry>
<entry><form id=""pagtuxu"" lang=""ceb""><abbr expan=""pagtúu"" type=""lemma"">pag-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>belief</tr>, feeling of certainty that s.t. is a certain way. </trans>
</sense></hom></entry>
<entry><form id=""matuuxhun"" lang=""ceb"">matuúhun</form>
<hom>
<sense n=""0""><trans> <tr>a</tr> having faith.
</trans>
</sense></hom></entry></entry>");
