INSERT INTO `wced_entry` VALUES (19853, "tuub, tuub1", "1067", "<entry page=""1067"" id=""19853""><form id=""tuub_tuxub"" lang=""ceb"">tuub, túub<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> k.o. treatment by steam whereby the patient is set before a pot of boiling water with herbs or a representative of whatever caused his illness, and a blanket is put over him so that he can breathe in the steam; or if it is just a part of his body that is ailing, the ailing part is exposed to the steam. </trans>
</sense>
<sense n=""1a""><number>1a</number><trans> a similar treatment with tobacco smoke instead of steam for stomach ailments. </trans>
</sense>
<sense n=""2""><number>2</number><trans> the material which is thought to have caused the illness, used in the <ix>tuub</ix> treatment. </trans>
</sense></hom>
<entry><form id=""tuxub"" lang=""ceb""><abbr expan=""túub"" type=""lemma"">(←)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b5]</itype><trans> treat with <ix>tuub</ix>. </trans>
<eg><i lang=""ceb"">Gitúub (gituúban) ku ang katul sa ákung tiil,</i><trans> I treated the rash on my foot with steam.
</trans></eg>
</sense></hom></entry></entry>");
