INSERT INTO `wced_entry` VALUES (19860, "tuun1", "1068", "<entry page=""1068"" id=""19860""><form id=""tuun"" lang=""ceb"">tuun<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b(1)]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>teach</tr>. </trans>
<eg><i lang=""ceb"">Si Mánuy nagtuun nákug bisiklíta,</i><trans> My brother taught me how to ride a bicycle. </trans></eg>
<eg><i lang=""ceb"">Tun-i siyag languy,</i><trans> Teach her how to swim. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>study</tr>. </trans>
<eg><i lang=""ceb"">Dì na nà tun-an kay sayun da,</i><trans> You don’t have to study that because it’s easy. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[A; b(1)]</itype><trans> <tr>study</tr>, put s.t. under consideration. </trans>
<eg><i lang=""ceb"">Tun-an pa nákù tung ímung tanyag,</i><trans> I will still put your offer under consideration. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>attend school</tr>. </trans>
<eg><i lang=""ceb"">Ayawg intra sa ínum kay nagtuun ka pa,</i><trans> Don’t take up drinking because you are still studying. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A12; b8]</itype><trans> <tr>learn from</tr>. </trans>
<eg><i lang=""ceb"">Didtu siya makatuun ug panúlis sa munti,</i><trans> He learned about robbery in prison. </trans></eg>
</sense></hom>
<entry><form id=""tuunanan"" lang=""ceb""><abbr expan=""tuunanan"" type=""lemma"">-anan</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. to be studied. </trans>
</sense></hom></entry>
<entry><form id=""hinuxun"" lang=""ceb""><abbr expan=""hinúun"" type=""lemma"">hiN-(←)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>studious</tr>. </trans>
<eg><i lang=""ceb"">Hinúun siya, buguk lang,</i><trans> He studies hard, only he is stupid. </trans></eg>
</sense></hom></entry>
<entry><form id=""matulun-axnun"" lang=""ceb"">matulun-ánun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>educational</tr>, giving lessons. </trans>
<eg><i lang=""ceb"">Matulun-ánun nga lílas,</i><trans> An <tr>instructive</tr> movie. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B146]</itype><trans> be instructive, educational. </trans>
</sense></hom></entry>
<entry><form id=""pagtuun"" lang=""ceb""><abbr expan=""pagtuun"" type=""lemma"">pag-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>studies</tr>, <tr>schooling</tr>. </trans>
<eg><i lang=""ceb"">Nahúnung ang íyang pagtuun paggíra,</i><trans> His studies were interrupted by the war. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> action of putting s.t. under analytic consideration or advisement. </trans>
</sense></hom></entry>
<entry><form id=""pagtulun-an"" lang=""ceb"">pagtulun-an</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>teachings</tr>, <tr>moral lesson</tr>. </trans>
<eg><i lang=""ceb"">Pagtulun-an sa sugilánun,</i><trans> The moral lesson of the story. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>lesson</tr> in school. <ix>see also</ix> <xr lang=""ceb"" target=""#kat-un""><sc>kat-un</sc></xr>.
</trans>
</sense></hom></entry></entry>");
