INSERT INTO `wced_entry` VALUES (19861, "tuun", "1068", "<entry page=""1068"" id=""19861""><form id=""tuxun"" lang=""ceb"">túun</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B3]</itype><trans> be directed towards a <tr>focus</tr>. </trans>
<eg><i lang=""ceb"">Wà ku makakità nímu kay didtu magtúun ang ákung mata sa ladlad,</i><trans> I didn’t see you because my eyes were <tr>focused</tr> on the wares that were on display. </trans></eg>
<eg><i lang=""ceb"">Dì matúun ang gás sa bàbà sa butilya ug way imbúdu,</i><trans> Kerosene will not get directly into the mouth of the bottle if there is no funnel. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c]</itype><trans> put a child on the patty. </trans>
</sense></hom>
<entry><form id=""tuun2"" lang=""ceb""><abbr expan=""tuun"" type=""lemma"">(→)</abbr><sub>2</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[c6]</itype><trans> happen <tr>coincidentally</tr> with s.t. else. </trans>
<eg><i lang=""ceb"">Wà mi magsábut kay natuun lang sa pag-abut,</i><trans> We had no agreement. We just arrived at the same time by coincidence. </trans></eg>
