INSERT INTO `wced_entry` VALUES (19865, "tuwad", "1069", "<entry page=""1069"" id=""19865""><form id=""tuwad"" lang=""ceb"">tuwad</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b6]</itype><trans> be in position with the rump stuck out and the body downward. </trans>
<eg><i lang=""ceb"">Ilúhi nang bátà kay nagtuwad na,</i><trans> Wipe the child now that he is thrusting out his rump. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A3P]</itype><trans> for s.t. horizontal to be lower at the tail end. </trans>
<eg><i lang=""ceb"">Nagtuwad ang sakayan kay bug-at sa prúwa,</i><trans> The boat is low at the bow because too much weight was put in front. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c1]</itype><trans> <tr>overturn</tr> s.t. bottoms up. </trans>
<eg><i lang=""ceb"">Tuwara (ituwad) ang bisiklíta kay átung ilísag ligid,</i><trans> Turn the bicycle <tr>upside down</tr> because I will change the tire. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; a12]</itype><trans> scrutinize s.t. carefully to find a mistake or falsity. </trans>
<eg><i lang=""ceb"">Bísan pag tuwarun ninyu siya, mudukut giyud siya sa íyang diklarasiyun,</i><trans> No matter how well you cross-examine him he will stick to his declaration. </trans></eg>
</sense></hom>
<entry><form id=""tuxwad"" lang=""ceb""><abbr expan=""túwad"" type=""lemma"">(←)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> (colloquial—somewhat coarse) </trans>
</sense>
<sense n=""1""><number>1</number><trans> fruit or product of one’s effort or endeavor. </trans>
<eg><i lang=""ceb"">Nabúhì siya sa dílì íyang túwad,</i><trans> He lives on the fruit of others’ efforts. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>children</tr>. </trans>
<eg><i lang=""ceb"">Akuy musúgù sa ákung mga anak kay ákung túwad,</i><trans> I’ll tell my children what to do because they are my own. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>work</tr>. </trans>
<eg><i lang=""ceb"">Ákù ang tanang túwad sa balay,</i><trans> I do all the work in the house. </trans></eg>
</sense></hom></entry>
<entry><form id=""tuxwad_tuaxli"" lang=""ceb""><abbr expan=""túwad"" type=""lemma"">(←)</abbr> tuáli</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B; a12]</itype><trans> be in complete <tr>disorder</tr>, <tr>disrupted</tr>. </trans>
<eg><i lang=""ceb"">Usba nang trabahúa kay nagtúwad tuáli,</i><trans> Redo that work because it’s all a <tr>mess</tr>. </trans></eg>
<eg><i lang=""ceb"">Dì ku mangilábut ninyu bísag túwad tualíhun ninyu ang inyung kinabúhì,</i><trans> I won’t interfere. You may make a mess of your life if you like. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> = <xr lang=""ceb"" target=""#tuwad""><sc>tuwad</sc></xr>, <i lang=""ceb"">v3.</i> </trans>
</sense></hom></entry>
<entry><form id=""katuxwad_tuaxli"" lang=""ceb""><abbr expan=""katúwad"" type=""lemma"">ka-(←)</abbr> tuáli</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> be in complete disorder. </trans>
</sense></hom></entry>
<entry><form id=""tuwadtuxwad"" lang=""ceb"">tuwadtúwad</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number><trans> = <xr lang=""ceb"" target=""#tuwad""><sc>tuwad</sc></xr>, <i lang=""ceb"">v3.</i> </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A1]</itype><trans> expend a great deal of effort in s.t. </trans>
<eg><i lang=""ceb"">Nagtuwadtúwad ug hílak,</i><trans> Crying for all he was worth.
</trans></eg>
</sense></hom></entry></entry>");
