INSERT INTO `wced_entry` VALUES (19868, "tuwang1, tuwang1", "1069", "<entry page=""1069"" id=""19868""><form id=""tuwang_tuxwang"" lang=""ceb"">tuwang<sub>1</sub>, túwang<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AB; c1]</itype><trans> <tr>tilt</tr> s.t. over on its side, for s.t. to tilt. </trans>
<eg><i lang=""ceb"">Hináyag tuwang ang táru ug maghuwad kag túbig,</i><trans> Tilt the can slowly when you pour water out. </trans></eg>
<eg><i lang=""ceb"">Twangun (ituwang) ku ning lamísa kun manihúun nímug baráha,</i><trans> I’ll turn the table over if you manipulate the cards. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>tilted</tr>. </trans>
<eg><i lang=""ceb"">Tuwang kaáyu ang tartanilyang gisakyag tambuk,</i><trans> The cart was tilted very much to one side when a fat man got on it. </trans></eg>
</sense></hom>
<entry><form id=""tuwangtuxwang"" lang=""ceb"">tuwangtúwang</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AB1456; a12]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>rock</tr>, make s.t. rock from side to side. </trans>
<eg><i lang=""ceb"">Nagtuwangtúwang ang barku sa kadagkù sa balud,</i><trans> The boat was rocking from side to side in the big waves. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c16]</itype><trans> carry water using the <ix>tuwangtúwang</ix>. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> strong strip of bamboo for carrying cans of water which are suspended from it. </trans>
</sense></hom></entry>
<entry><form id=""tuwangtuxwang_nga_silya"" lang=""ceb""><abbr expan=""tuwangtúwang"" type=""lemma"">—</abbr> nga silya</form>
