INSERT INTO `wced_entry` VALUES (19889, "tuyhad", "1070", "<entry page=""1070"" id=""19889""><form id=""tuyhad"" lang=""ceb"">tuyhad</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c1]</itype><trans> straighten up the body, stay erect. </trans>
<eg><i lang=""ceb"">Tuyhad ug panagsa kun maglingkud kag dúgay,</i><trans> Stretch out once in a while when you sit for some time. </trans></eg>
<eg><i lang=""ceb"">Ituyhad (tuyhára) ímung láwas kanang mu rag kadíti,</i><trans> Carry your body straight like a cadet. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A1]</itype><trans> arrive from s.w. empty-handed (lit. not bent under a load). </trans>
<eg><i lang=""ceb"">Miabut gíkan sa byáhi walà giyuy dala. Nagtuyhad lang,</i><trans> He arrived from his trip empty-handed. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> straight, erect of the body.
</trans>
</sense></hom></entry>");
