<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>wound</tr> esp. one which is inflicted in <pb n=""1071""/>a contest. </trans>
<eg><i lang=""ceb"">Ang sunuy nakadaug sa tárì nga walay tuyù,</i><trans> The rooster won in the cockfight without a wound. </trans></eg>
